(149, 57, 1, 'mp3 للسيارة', '(حزمة) mp3 للسيارة', 120, 190, 850, 5, 1, 'available', 'مادة ABS\r\nشاشة LED مصفوفة نقطية\r\nإصدار بلوتوث V5.0\r\nنطاق بلوتوث 2.4 جيجا هرتز-2.48 جيجا هرتز\r\nمسافة نقل بلوتوث 5 متر\r\nتردد FM 87.5-108 ميجا هرتز\r\nمسافة نقل FM 2 متر\r\nجهد الإدخال 12-24 فولت\r\nالإخراج 5 فولت/3.1', 'm6', NULL, NULL, '2023-12-10 12:20:16', '2023-12-12 14:32:10', '2023-12-12 14:32:10'),
(150, 83, 1, 'قدر كهربائي', '(حزمة) قدر كهربائي', 900, 1450, NULL, NULL, 1, 'available', 'قدمت Guangdong Bester Household Products Ltd. طنجرة طبخ أرز فاخرة بسعة تتراوح بين 1.0 لتر و 2.8 لتر. تتميز هذه الطنجرة بتصميمها الجديد الذي يسهل عملية التنظيف، وتحتوي على غطاء زجاجي شفاف. مصنوعة من مواد عالية الجودة، توفر هذه الطنجرة تجربة طهي أرز فاخرة في المطاعم والوحدات الفردية والوك طباخ الغاز.\r\n\r\nتأتي الطنجرة مع ملحقات مثل كوب القياس وملعقة وكوب الري. يمكن استخدامها لطهي الأرز والوجبات الأخرى بسهولة وسرعة. تتوفر خيارات متعددة للواجهة والسعة لتناسب احتياجاتك. تعتبر هذه الطنجرة مثالية للمطاعم والفنادق والمنازل حيث يمكن تحضير الأطباق الشهية بسهولة ويسر.\r\n\r\nاحصل على طنجرة طبخ أرز فاخرة وعالية الجودة الآن واستمتع بتجربة طهي متميزة!', 'x5d-16', NULL, 'uploads/supplier/supplier-150-2023-12-22.pdf', '2023-12-10 12:37:58', '2023-12-26 17:14:46', NULL),
(151, 57, 1, 'mp3 للسيارة نوع (carg7)', '(حزمة) mp3 للسيارة نوع (carg7)', 75, 150, NULL, NULL, 1, 'available', 'سماعات mp3 للسيارة', 'cg7', NULL, NULL, '2023-12-10 12:47:45', '2023-12-12 14:32:10', '2023-12-12 14:32:10'),
(152, 58, 1, 'باور بانك 10000 ملي أمبير', '(حزمة) باور بانك 10000 ملي أمبير', 450, 650, NULL, NULL, 1, 'available', 'سريع شحن, مع التوصيل, عالية السعة, مع كابل, محمول, الطاقة Staion, تأجير قوة البنك, أدى عرض, 2 في 1 شاحن سريع قوة البنك, ل في الهواء الطلق, المحمولة محطة الطاقة', 'nj-29', NULL, NULL, '2023-12-10 12:57:44', '2023-12-12 14:32:04', '2023-12-12 14:32:04'),
(153, 58, 1, 'سماعات galaxy buds الاسلكية', '(حزمة) سماعات galaxy buds الاسلكية', 400, 620, NULL, NULL, 1, 'available', 'سماعات بجودة عالية', 'kww36', NULL, NULL, '2023-12-10 14:17:58', '2023-12-12 14:32:04', '2023-12-12 14:32:04'),
(154, 83, 1, 'مسخن كهربائي', '(حزمة) مسخن كهربائي', 600, 840, NULL, NULL, 1, 'available', 'طباخ الأرز الكهربائي المحمول الذكي الوصول الجديد يعد حلاً مثاليًا لتحضير الأرز اللذيذ في أي مكان وفي أي وقت. يتميز هذا الطباخ الصغير بالتحكم الذكي في درجة الحرارة والتسخين الكهربائي الفعال، مما يضمن طهي الأرز بشكل مثالي وبنتائج متساوية في كل مرة. بفضل سعته الكبيرة والمناسبة، يمكنك استخدامه لطهي الأرز للعائلة أو أثناء السفر والتنقل. يأتي مع طبق داخلي مطلي بالسيراميك للحفاظ على طعم الأرز الطازج واللذيذ. بفضل لوحة التحكم الرقمية، يمكنك ضبط وقت الطهي ودرجة الحرارة بكل سهولة. بالإضافة إلى ذلك، يتميز بتصميمه المحمول والمريح، مما يجعله مثاليًا للسفر والرحلات. تجربة طهي الأرز السهلة واللذيذة لم تكن بهذه البساطة من قبل!', 'xjd81', NULL, NULL, '2023-12-12 15:50:18', '2023-12-13 17:53:24', NULL),
(155, 106, 1, 'ساعة منبه المرآة الرقمية LED', '(حزمة) ساعة منبه المرآة الرقمية LED', 300, 500, NULL, NULL, 1, 'available', 'ساعة المنبه بمرآة رقمية LED هي ساعة منضدية عصرية وعملية، مصممة خصيصًا لتناسب غرف النوم والطلاب وغرف المعيشة الحديثة. تتميز بشاشة LED رقمية ومرآة مدمجة، وتعديل تلقائي لدرجة السطوع لإضاءة الغرفة بشكل مناسب. تحتوي الساعة على العديد من الميزات المتعددة، بما في ذلك الإنذارات ووظيفة الغفوة وعرض الوقت والتاريخ ودرجة الحرارة. كما تأتي الساعة بتصميم جميل وأنيق يضفي لمسة فريدة على المكتب أو الطاولة. تعمل الساعة بواسطة كابل USB، ويمكن استخدامها كشاحن للهواتف اللاسلكية. بالإضافة إلى ذلك، تعمل بالبطارية، مما يجعلها مناسبة للسفر والاستخدام في أماكن بدون مصدر طاقة.', 'jsj-17', NULL, NULL, '2023-12-12 16:55:56', '2023-12-26 17:16:10', NULL),
(156, 69, 1, 'مغلف حراري يدوي', '(حزمة) مغلف حراري يدوي', 700, 1000, NULL, NULL, 1, 'available', 'صواميل معدنية يدوية وسدادة حرارية للتعبئة، معتمدة من CE FCC (ABS). هذا المنتج هو مغلق حراري يعمل باليد يستخدم لإحكام إغلاق الأكياس والأغلفة البلاستيكية. يتميز بتصميم مدمج وسهل الاستخدام، مما يجعله مناسبًا للاستخدام المنزلي والتجاري. يمكن استخدامه في الفنادق، مصانع الأغذية، المطاعم، والمتاجر الغذائية. يوفر هذا المنتج ختماً قوياً وموثوقاً، ويساعد في الحفاظ على جودة وطازجة المنتجات المعبأة. يعمل بسرعة عالية، حيث يمكنه ختم حتى 60 قطعة في الدقيقة. يتميز بوزن خفيف وأبعاد مدمجة، مما يجعله محمولًا وسهل الاستخدام في أي مكان.', 'TB0', NULL, NULL, '2023-12-12 16:56:32', '2023-12-27 01:20:41', NULL),
(157, 68, 1, 'خلاط العصائر المحمول USB', '(حزمة) خلاط العصائر المحمول USB', 150, 300, NULL, NULL, 1, 'available', 'احصل على هذا الخلاط العصارة الشخصي الصغير والمحمول المزود بواجهة USB، والذي يعد رفيقًا مثاليًا للسفر. يتميز هذا الخلاط بتصميمه المدمج والعملي، حيث يمكنك استخدامه بسهولة في أي مكان تذهب إليه. يمكنك استخدامه لعصر الفواكه والخضروات وتحضير العصائر الطازجة بسرعة وسهولة.\r\n\r\nيأتي هذا الخلاط بشفرات حادة وقوية تعمل بسرعة تصل إلى 21000 دورة في الدقيقة، مما يسمح بالحصول على نتائج مثالية في وقت قصير. كما يتميز بتصميم صامت يقلل من الضوضاء أثناء الاستخدام.\r\n\r\nبفضل ميزة الشحن عبر USB، يمكنك شحن الخلاط بسهولة باستخدام مصدر طاقة USB مثل الكمبيوتر أو الشاحن المحمول. احصل على هذا الخلاط المحمول واستمتع بالعصائر اللذيذة أينما كنت.', 'xpdp04', NULL, NULL, '2023-12-12 17:05:25', '2023-12-27 01:22:10', NULL),
(158, 68, 1, 'جهاز العصارة الشخصية المحمولة USB', '(حزمة) جهاز العصارة الشخصية المحمولة USB', 200, 380, NULL, NULL, 1, 'available', 'جهاز العصارة الشخصية المحمولة USB هو جهاز عملي ومريح يمكنك استخدامه في المنزل أو أثناء التنقل. يتميز بتصميمه الصغير والمحمول الذي يسمح لك بتحضير العصائر الطازجة في أي وقت وأي مكان. يعمل هذا الجهاز بواسطة الشحن عبر منفذ USB، مما يجعله متوافقًا مع معظم أجهزة الكمبيوتر والشواحن المحمولة. يحتوي على كوب سعة 500 مللي لتر وشفرات من الفولاذ المقاوم للصدأ لتوفير أداء قوي وسريع. يمكنك استخدامه لاستخراج العصائر من الفواكه والخضروات والمكونات الأخرى بسهولة. بفضل خاصية الشحن المدمجة، يمكنك الاستمتاع بعصائر طازجة ومغذية في أي وقت تشاء. قم بترقية نمط حياتك الصحي مع جهاز العصارة الشخصية المحمولة USB.', 'jf46', NULL, NULL, '2023-12-12 17:13:43', '2023-12-27 01:22:53', NULL),
(159, 69, 1, 'سدادة حرارية مصغرة للغلق الذكي', '(حزمة) سدادة حرارية مصغرة للغلق الذكي', 40, 150, NULL, NULL, 1, 'available', 'المحمولة اليد الصحافة سدادة حرارية مصغرة المنزلية مشبك للغلق بإحكام الذكية السداده حقائب بلاستيكية\r\n\r\nتعتبر المحمولة اليد الصحافة سدادة حرارية مصغرة المنزلية مشبكًا ذكيًا للغلق الآمن لحقائب البلاستيك. تصميمها المدمج والصغير يجعلها سهلة الاستخدام ومحمولة بشكل مريح. تعمل بتقنية الحرارة لختم الحقائب البلاستيكية بإحكام، مما يساعد على الحفاظ على الطعام طازجًا لفترة أطول وحمايته من الرطوبة والهواء الخارجي. بفضل سهولة الاستخدام، يمكن استخدام هذه السدادة الحرارية في المنزل، أو أثناء السفر، أو في النزهات. إنها أداة مثالية للحفاظ على الأطعمة المعبأة بشكل صحي وآمن، وتوفير الوقت والجهد في عملية التعبئة والتغليف.', 'tv73', NULL, NULL, '2023-12-12 17:25:07', '2023-12-24 00:06:27', NULL),
(160, 84, 1, 'منشة البعوض المحمولة', '(حزمة) منشة البعوض المحمولة', 350, 550, NULL, NULL, 1, 'available', 'منشة البعوض المحمولة/المنشة العمودية ذات الشحن USB 2 في 1 هي أداة فعالة للتخلص من البعوض والحشرات الطائرة. تمتاز هذه المنشة بتصميمها المحمول والعملي، حيث يمكنك استخدامها في أي مكان داخل المنزل أو خارجه. يمكن شحنها بسهولة باستخدام كابل USB، مما يجعلها مريحة للاستخدام المستمر. تأتي المنشة مع إضاءة بنفسجية بلون بنفسجي، مما يساهم في جذب البعوض والحشرات وإلقائها على الفور. تعد هذه المنشة خيارًا مثاليًا لتوفير حماية فعالة ضد البعوض والحشرات الطائرة بطريقة آمنة وصديقة للبيئة.', 'jf18', NULL, NULL, '2023-12-12 18:01:03', '2023-12-13 18:05:36', NULL),
(161, 85, 1, 'مجفف الشعر cronier', '(حزمة) مجفف الشعر cronier', 350, 550, NULL, NULL, 1, 'available', 'مجفف الشعر هذا هو منتج ممتاز للعناية بالشعر يعمل بموتور تيار مباشر قوي بقوة 2000 واط، مصمم خصيصًا للاستخدام في صالونات التجميل وللاستخدام المهني. يتميز بوزن خفيف وحجم مدمج مما يجعله مثاليًا للاستخدام أثناء السفر. يتميز بقابس طاقة طويل لضمان سهولة الاستخدام والحركة. يحتوي على إعدادات للسرعة والحرارة المختلفة لتلبية احتياجاتك المحددة. يوفر هذا المجفف القوة الكافية لتجفيف الشعر بسرعة وفعالية مع الحفاظ على صحة ولمعان الشعر. منتج عالي الجودة يقدم أداءً متميزًا ونتائج مذهلة لتصفيف الشعر.', 'yw-103', NULL, NULL, '2023-12-12 18:07:18', '2023-12-13 18:11:08', NULL),
(162, 85, 1, 'مجفف شعر hair deyer', '(حزمة) مجفف شعر hair deyer', 200, 350, NULL, NULL, 1, 'available', 'مجفف الشعر المنزلي ذو القوة الكبيرة والمهنية، يعد هذا المنتج المصنوع بتقنية OEM AC صالون منزلي بميزة الأيونات أداة مثالية للعناية بشعرك. يتميز بقوة تصل إلى 2500 واط، مما يوفر لك تجفيفًا سريعًا وفعالًا. يوفر لك إعدادات سرعة متعددة لتلبية احتياجاتك المختلفة. يحتوي على مكثف لتوفير توزيع متساوٍ للحرارة والهواء، مما يساعد على تجفيف الشعر بشكل سلس ومنتظم. يأتي هذا المجفف بتصميم مريح وسهل الاستخدام، وهو مناسب للاستخدام الشخصي في المنزل أو في صالون الشعر. احصل على شعر جميل ومظهر مهني في منزلك مع هذا المجفف القوي والمحترف.', '600s', NULL, NULL, '2023-12-12 18:18:48', '2023-12-13 18:12:08', NULL),
(163, 85, 1, 'مجفف الشعر vitec', '(حزمة) مجفف الشعر vitec', 150, 270, NULL, NULL, 1, 'available', 'مجفف الشعر بالأشعة فوق البنفسجية هو منتج عصري وعالي الأداء يتميز بتصميمه الكلاسيكي. يوفر هذا المجفف الشعر تجربة صالون متميزة في راحة منزلك. بقوة 2800 واط، يوفر المجفف نتائج فعالة وسريعة لتجفيف الشعر بلمسة واحدة. يتميز بوظيفة الأشعة فوق البنفسجية التي تعزز صحة الشعر وتقلل من التجعد والتطاير. يتميز بسرعتين للتحكم في درجة الحرارة والسرعة لتلبية احتياجاتك المحددة. كما يحتوي على مكثف لتوفير تصفيف شعر ممتاز. مع تصميمه الأنيق والعملي، يعد مجفف الشعر هذا خيارًا مثاليًا للاستخدام في الفنادق وصالونات التجميل أو في المنزل.', '6001', NULL, NULL, '2023-12-12 18:24:32', '2023-12-13 18:12:49', NULL),
(164, 86, 1, 'صندوق بينو العصري للأطفال', '(حزمة) صندوق بينو العصري للأطفال', 450, 680, NULL, NULL, 1, 'available', 'صندوق بينو للأطفال البالغين مع حقيبة الغداء المعزولة هو منتج عالي الجودة ومتعدد الاستخدامات. يتميز بتصميمه الأنيق والعصري، وهو مثالي للأطفال الذين يحتاجون إلى وجبات غداء صحية ومغذية أثناء التنقل. يتكون الصندوق من الفولاذ المقاوم للصدأ 304/201، مما يجعله متينًا وآمنًا للاستخدام. يأتي الصندوق مع حاويات داخلية توفر مساحة كافية لتخزين الطعام، وتحافظ على حفظ الحرارة لفترة أطول. كما يأتي مع حقيبة غداء معزولة تحتفظ ببرودة الطعام وتمنع تسربه. يعد صندوق بينو للأطفال البالغين مع حقيبة الغداء المعزولة اختيارًا رائعًا للأهل الذين يهتمون بتوفير وجبات غداء صحية ومريحة لأطفالهم.', 'BW05', NULL, NULL, '2023-12-12 18:29:11', '2023-12-13 18:15:31', NULL),
(165, 74, 1, 'مرطب الهواء العطري بالموجات فوق الصوتية', '(حزمة) مرطب الهواء العطري بالموجات فوق الصوتية', 700, 1000, NULL, NULL, 1, 'available', 'مع مرطب الهواء بالموجات فوق الصوتية ديفوزور دي رائحة بسعة 500 مللي، ستستمتع بتجربة رائحة منعشة ومريحة في منزلك أو مكتبك. يعمل المرطب بتقنية الصوت لتكون الرائحة متساوية ومنتشرة في الهواء بشكل مثالي. يعمل بالكهرباء ويمكن استخدامه كمرطب هواء أو مجرد فاحة عطور. يوفر ميزة التوقيت لتعيين فترة زمنية للتشغيل المناسبة لك، ويحتوي على إضاءة LED تتغير الألوان لإضفاء جو مريح واسترخاء. يمتاز بتصميم أنيق ومتين وسعة كبيرة للمياه، وهو مثالي للاستخدام في السيارة أو في الهواء الطلق أو في المكاتب أو الفنادق. احصل على هذا المرطب العطري الفريد واستمتع بأجواء منعشة ومريحة في كل مكان.', 'x5d-34', NULL, NULL, '2023-12-12 18:32:17', '2023-12-13 18:16:37', NULL),
(166, 87, 1, 'فرشاة أسنان كهربائية متطورة', '(حزمة) فرشاة أسنان كهربائية متطورة', 180, 350, NULL, NULL, 1, 'available', 'فرشاة أسنان كهربائية دوارة للبالغين مزودة ببطارية معتمدة من Brc Bsci فائقة الجودة ومضادة للماء. تعتبر هذه الفرشاة الكهربائية المدورة خيارًا مثاليًا للأشخاص البالغين الذين يهتمون بصحة أسنانهم. تأتي الفرشاة بتصميم عصري ومريح يسهل الاستخدام. تعمل بتقنية الدوران لإزالة البلاك والرواسب بفعالية وتحسين صحة اللثة. تم تجهيز الفرشاة ببطارية عالية الجودة توفر أداءً قويًا وتعمل لفترة طويلة بعد كل شحنة. كما أنها مضادة للماء، مما يسمح باستخدامها بأمان في الحمام. احصل على هذه الفرشاة الكهربائية الدوارة ذات الجودة العالية واستمتع بابتسامة صحية ومشرقة.', 'tv93', NULL, NULL, '2023-12-12 18:41:00', '2023-12-13 18:21:50', NULL),
(167, 88, 1, 'حلق السيلفي المضيء بتحكم عن بعد', '(حزمة) حلق السيلفي المضيء بتحكم عن بعد', 600, 900, NULL, NULL, 1, 'available', 'صورة سيلفي مع تحكم عن بعد بالألوان RGB مع إضاءة مؤتمرات فيديو مباشرة Led RGB - اجعل صور سيلفيك أكثر إشراقًا وأناقة مع هذا الحلق الذكي المزود بتقنية الإضاءة الديناميكية. يتميز بتصميم دائري بقطر 10 بوصات (26 سم) ومصابيح LED RGB متعددة الألوان التي يمكن التحكم فيها عن بعد. يوفر هذا الحلق الإضاءة المثالية للتصوير الفوتوغرافي ومقاطع الفيديو ومؤتمرات الفيديو المباشرة. يأتي مع حامل ثلاثي وجهاز تحكم عن بعد لسهولة الاستخدام والتحكم في الإضاءة والألوان. يعتبر هذا المنتج مثاليًا للمصورين ومحبي السيلفي الذين يرغبون في إضاءة مثالية ومتعددة الألوان لصورهم ومقاطع الفيديو.', '14', NULL, NULL, '2023-12-12 18:47:32', '2023-12-27 01:31:24', NULL),
(168, 85, 1, 'مجفف الشعر المهني بليز هير (Bliss Hair)', '(حزمة) مجفف الشعر المهني بليز هير (Bliss Hair)', 400, 670, NULL, NULL, 1, 'available', 'مجفف الشعر المهني بقوة 4000 واط هو أداة قوية ومبتكرة لتجفيف وتصفيف الشعر. يتميز هذا المجفف بتصميمه الناشر الكهربائي الدوار والذي يوفر تجربة تجفيف فعالة وفعّالة. يأتي مع فوهة إضافية لتوجيه تدفق الهواء وتصفيف الشعر بدقة وسهولة. يعتبر هذا المجفف الشعر أداة مثالية للاستخدام في صالونات التجميل وأيضًا أثناء السفر بفضل تصميمه المدمج والخفيف الوزن. يتميز بجودة عالية ومتانة للاستخدام الطويل الأمد. احصل على مجفف الشعر المهني هذا لتحصل على تجربة تصفيف الشعر الممتازة والنتائج المذهلة.', '6004', NULL, NULL, '2023-12-12 18:49:27', '2023-12-18 18:12:54', NULL),
(169, 88, 1, 'اضائة رينج لايت', '(حزمة) اضائة رينج لايت', 400, 650, NULL, NULL, 1, 'available', 'وصف المنتج:\r\n\r\nمصباح حلقة السيلفي المضيء بحجم 12 بوصة (30 سنتيمتر) هو منتج مبتكر يعزز جودة الإضاءة ويحسن تجربة التصوير والتصوير الذاتي. يأتي هذا المصباح بتصميم حلقة مصممة بشكل جميل ومجهزة بمصابيح LED لتوفير إضاءة موحدة وناعمة وطبيعية. يتميز بدرجة حرارة لون قابلة للتعديل تتراوح بين 3000 إلى 6000 كيلوفولت لتناسب احتياجات التصوير المختلفة. يمكن التحكم في الإضاءة بواسطة وضع التحكم عن بعد، مما يوفر راحة وسهولة في الاستخدام. هذا المصباح خفيف الوزن ومحمول، مما يجعله مثاليًا للاستخدام في استوديوهات التجميل، وجلسات الماكياج المنزلية، والتصوير الاحترافي، وتطبيقات Tiktok وغيرها. يعد هذا المصباح حلاً مثاليًا للحصول على إضاءة مثالية ونتائج مذهلة في كل مرة.', '129', NULL, NULL, '2023-12-12 18:59:46', '2023-12-13 18:27:41', NULL),
(170, 85, 1, 'مجفف شعر قابل ل الطي', '(حزمة) مجفف شعر قابل ل الطي', 400, 600, NULL, NULL, 1, 'available', 'ها هو مجفف الشعر Kemey Km-6838، الذي يتميز بدرجة حرارة ثابتة وتصميم طوي مصغر. يوفر هذا المجفف قوة رياح عالية لجفاف الشعر بسرعة وفعالية. يعد هذا الموديل الجديد مثاليًا للعناية بالشعر وتصفيفه في أي مكان تذهب إليه. يتميز المجفف باللون الأصفر/الأخضر الجذاب ويتوفر بقوة 1200 واط. كما يأتي بميزة القابلية للطي، مما يجعله محمولًا ومناسبًا للسفر والاستخدام في الهواء الطلق. يأتي المجفف مع فوهة تركيز لتوجيه الهواء وتحسين نتائج التصفيف. احصل على مجفف الشعر Kemey Km-6838 الآن واستمتع بشعر جاف ومصفف بشكل رائع في أي وقت وأي مكان.', 'yn104', NULL, NULL, '2023-12-12 19:02:10', '2023-12-13 18:28:36', NULL),
(171, 90, 1, 'مرآة ماكياج القط الجميلة', '(حزمة) مرآة ماكياج القط الجميلة', 60, 140, NULL, NULL, 1, 'available', 'مرآة ماكياج القط المميزة والجميلة مثالية للفتيات العصريات وعشاق المكياج. تصميمها الدائري يضفي عليها لمسة جمالية فريدة، وتتميز بجودتها العالية وأدائها المتميز. تتميز بقاعدة محمولة تسمح لك بحملها بسهولة أثناء السفر أو في أي مكان آخر. تدور بزاوية 360 درجة لتوفير رؤية كاملة ومريحة أثناء وضع المكياج. تتوفر بعدة ألوان جذابة تناسب أذواق مختلفة. إنها مرآة مثالية للمستحضرات التجميلية وصالونات التجميل وتستخدم في تطبيقات المكياج الاحترافية. قم بشراء هذه المرآة الجميلة اليوم واستمتع بتجربة ماكياج مريحة ومميزة.', 'zh-10', NULL, NULL, '2023-12-12 19:07:45', '2023-12-13 18:30:27', NULL),
(172, 86, 1, 'صندوق الغداء الكهربائي الساخن', '(حزمة) صندوق الغداء الكهربائي الساخن', 280, 480, NULL, NULL, 1, 'available', 'صندوق الغداء الكهربائي الخالي من التسرب هو منتج عالي الجودة وعملي للغاية. يتميز بتصميم متين وعصري يجمع بين الفولاذ المقاوم للصدأ والبلاستيك المحمول. يعمل هذا الصندوق الكهربائي على تسخين الطعام والحفاظ على درجة حرارته، مما يتيح لك الاستمتاع بوجبة دافئة ولذيذة في أي وقت وفي أي مكان. يعد هذا المنتج مثاليًا للاستخدام أثناء السفر أو في السيارة، كما أنه يناسب الاحتياجات اليومية في المدرسة أو العمل. مع وظائف متعددة مثل التحكم في الموقت الرقمي ووظيفة البخار الفورية، وهو أداة مثالية لتسهيل تجربة تناول الطعام الخاصة بك بطريقة مريحة وآمنة.', 'XJD36', NULL, NULL, '2023-12-12 19:15:01', '2023-12-13 18:31:28', NULL),
(173, 87, 1, 'حامل معجون الأسنان يُثبت على الحائط', '(حزمة) حامل معجون الأسنان يُثبت على الحائط', 120, 300, NULL, NULL, 1, 'available', 'حامل معجون الأسنان المستخدم في الحمام يُثبت على الحائط\r\n\r\nاستمتع بتجربة فريدة لتنظيم حمامك مع حامل معجون الأسنان المستخدم في الحمام والذي يُثبت على الحائط. يتميز هذا الحامل بتصميم أنيق وعصري يناسب أي ديكور حمام. يتميز بوجود مكان مخصص لوضع معجون الأسنان وفرشاة الأسنان، مما يساعد على الحفاظ على نظافة وترتيب المقاومة. بالإضافة إلى ذلك، يحتوي الحامل على ميزة فريدة وهي وجود فتحة تسمح بتهوية معجون الأسنان وتجفيفه بفعالية. كما يأتي الحامل مزودًا بنظام فوق بنفسجي يعمل على تطهير وتعقيم الفرشاة ومعجون الأسنان باستخدام التقنية المبتكرة للأشعة فوق البنفسجية. احصل على حمام منظم ونظيف مع حامل معجون الأسنان المستخدم في الحمام المثبت على الحائط.', 'tv08', NULL, NULL, '2023-12-12 19:29:06', '2023-12-13 18:32:12', NULL),
(174, 77, 1, 'مثبت الغسالة مضاد الإنزلاق', '(حزمة) مثبت الغسالة مضاد الإنزلاق', 50, 90, NULL, NULL, 1, 'available', 'وسادة مضادة للاهتزاز وتقليل الضوضاء للغسالة - احصل على وسادة مضادة للاهتزاز عالية الجودة للغسالة تساعد في تقليل الاهتزازات والضوضاء أثناء استخدام الغسالة. تم تصميمها خصيصًا لتوفير استقرار أفضل للغسالة وتقليل الاهتزازات الناتجة عن دوران الحوض. تساعد في منع انتقال الاهتزازات إلى الأرضية والمجاورين، مما يقلل من الضوضاء والاهتزازات غير المرغوب فيها. بفضل تصميمها المضاد للانزلاق، فإنها تثبت الغسالة بشكل آمن وتمنع انزلاقها أثناء الاستخدام. الوسادة مصنوعة من مواد عالية الجودة ومتينة، وتتميز بحجم ملائم يناسب معظم أنواع الغسالات. احصل على وسادة مضادة للاهتزاز وتمتع بتجربة هادئة وسلسة أثناء استخدام الغسالة.', 'tv40', NULL, NULL, '2023-12-12 19:36:15', '2023-12-16 00:04:29', NULL),
(175, 86, 1, 'صندوق الحرارة الذكي', '(حزمة) صندوق الحرارة الذكي', 450, 680, NULL, NULL, 1, 'available', 'صندوق بنتو الحرارة الكهربائية القابل للإزالة، مصنوع من الفولاذ المقاوم للصدأ عالي الجودة، يعد حلاً مثاليًا لحمل الطعام بشكل آمن والاستمتاع بوجبة ساخنة في أي مكان. يتميز بتصميم معاصر وقابلية للفصل، مما يسهل تنظيفه وتخزينه. يمكن استخدامه في السيارة أو العمل أو السفر، ويوفر وظيفة التدفئة للحفاظ على الطعام ساخنًا وشهيًا. يأتي بحجم مريح وخفيف الوزن، مما يجعله سهل الحمل والاستخدام. يعد هذا الصندوق الكهربائي العملي والعصري خيارًا مثاليًا للأفراد الذين يحتاجون إلى وجبات ساخنة وصحية أثناء التنقل.', 'XJD80', NULL, NULL, '2023-12-12 19:41:05', '2023-12-13 18:34:03', NULL),
(176, 82, 1, 'طقم تدليك الوجه المتعدد الوظائف باليشم', '(حزمة) طقم تدليك الوجه المتعدد الوظائف باليشم', 80, 170, NULL, NULL, 1, 'available', 'فرشاة اليشم للوجه 3 في 1 Gua Sha سيليكون الأسطوانة سماع Gua Sha طقم تدليك الأسطوانة اليشم للوجه تقدم لك تجربة تدليك متعددة الوظائف لتعزيز صحة وجمال بشرتك. تتألف الفرشاة من أسطوانة يشم للتدليك بالإضافة إلى سماع Gua Sha وفرشاة سيليكون. تستخدم الأسطوانة اليشم لتدليك الوجه وتحسين مرونة البشرة وتحفيز الدورة الدموية. بينما تستخدم سماع Gua Sha لتحسين مظهر البشرة وتقليل التجاعيد والهالات السوداء. وتستخدم الفرشاة السيليكونية لتطهير البشرة وتنظيف المسام. هذا الطقم مثالي للاستخدام المنزلي ويقدم تجربة تدليك فاخرة للوجه. احصل على بشرة صحية ومشرقة مع هذا الطقم المتعدد الوظائف لتدليك الوجه.', 'jf-75', NULL, NULL, '2023-12-12 19:43:39', '2023-12-13 18:34:44', NULL),
(177, 90, 1, 'مرآة الجمال الذكية', '(حزمة) مرآة الجمال الذكية', 250, 470, NULL, NULL, 1, 'available', 'مرآة التجميل قابلة للشحن، مزودة بأضواء LED ومرآة مكبرة بتكبير 10x، تعد رفيقًا مثاليًا لجلسات المكياج والعناية بالبشرة. تتميز هذه المرآة بتصميمها المميز والعصري، وتوفر إضاءة مثالية لتسهيل عملية المكياج وتطبيق المستحضرات. يمكن شحنها بسهولة، مما يجعلها محمولة ومريحة للاستخدام في أي مكان. تأتي مع حامل هاتف لتسهيل استخدام الهاتف أثناء الجلسات التجميلية. بفضل المرآة المكبرة بتكبير 10x، يمكنك الحصول على تفاصيل دقيقة للغاية لتطبيق المكياج أو العناية بالبشرة. احصل على مرآة التجميل هذه اليوم وتمتع بتجربة مكياج مريحة واحترافية.', '00000', NULL, NULL, '2023-12-12 19:52:26', '2023-12-13 18:35:30', NULL),
(178, 91, 1, 'فرشاة الوجه  للتنظيف الشامل', '(حزمة) فرشاة الوجه  للتنظيف الشامل', 90, 140, NULL, NULL, 1, 'available', 'فرشاة الوجه للعناية بالبشرة العميقة هي أداة فائقة لتنظيف الوجه بعمق وفعالية. تعمل هذه الفرشاة على إزالة الشوائب والزيوت الزائدة وخلايا الجلد الميتة، مما يساعد على تحسين مظهر البشرة وتركها نظيفة ومشرقة. تتميز بتصميم محمول ومريح يسهل حملها واستخدامها في أي مكان. تأتي مع مقبض مريح وشعيرات ناعمة ولطيفة على البشرة. كما أنها مقاومة للماء، مما يسمح باستخدامها أثناء الاستحمام. تعمل بتقنية الاهتزاز الناعمة لتوفير تدليك لطيف وتحفيز الدورة الدموية. اجعلي فرشاة الوجه هذه جزءًا أساسيًا من روتين العناية بالبشرة اليومي للحصول على بشرة صحية ومشرقة.', '00000', NULL, NULL, '2023-12-12 20:01:32', '2023-12-13 18:38:17', NULL),
(179, 91, 1, 'قناع الفحم  لإزالة الرؤوس السوداء', '(حزمة) قناع الفحم  لإزالة الرؤوس السوداء', 80, 150, NULL, NULL, 1, 'available', 'قناع مزيل الرؤوس السوداء للوجه هو منتج فعال لتنقية البشرة وتنظيف المسامات بعمق. يحتوي هذا القناع على فحم الخيزران وقشر الأنف ومكونات أخرى مثل الكولاجين وحمض الهيالورونيك، التي تعمل على إزالة الشوائب والزيوت الزائدة من البشرة وتقليل ظهور الرؤوس السوداء والمسام المتسعة. يترك القناع البشرة نظيفة ومشرقة ومنتعشة. يمكن استخدامه على الوجه والأنف، ويناسب جميع أنواع البشرة. استخدمي هذا القناع بانتظام للحصول على بشرة صحية وخالية من العيوب. قناع مزيل الرؤوس السوداء للوجه هو اختيارك المثالي للحصول على بشرة نقية ومشرقة.', 'tv-05', NULL, NULL, '2023-12-12 20:20:08', '2023-12-13 18:39:32', NULL),
(180, 104, 1, 'جهاز تسخين الطعام من الفولاذ المقاوم للصدأ', '(حزمة) جهاز تسخين الطعام من الفولاذ المقاوم للصدأ', 350, 550, NULL, NULL, 1, 'available', 'جهاز تسخين الطعام الحراري عالي الجودة، مصنوع من الفولاذ المقاوم للصدأ، يعد حلاً مثاليًا للحفاظ على الطعام ساخنًا وشهيًا. يتميز بالقدرة على تسخين الطعام بشكل سريع وفعال، مما يساعد على الاستمتاع بوجبات لذيذة في أي وقت وفي أي مكان. تصميمه الصغير والمحمول يجعله مثاليًا للاستخدام في السفر، العمل، أو النزهات. يتميز بوعاء صغير للطعام يمكن تخزينه بشكل مريح وسهل الحمل. يعد هذا الجهاز الحراري الفولاذي المقاوم للصدأ خيارًا مثاليًا للأفراد الذين يحبون الاستمتاع بوجبات ساخنة ولذيذة أثناء التنقل.', 'BW03', NULL, NULL, '2023-12-12 20:26:54', '2023-12-27 02:34:10', NULL),
(181, 89, 1, 'فرشاة التنظيف الكهربائية المتعددة الاستخدامات', '(حزمة) فرشاة التنظيف الكهربائية المتعددة الاستخدامات', 200, 350, NULL, NULL, 1, 'available', '\"قابل لإعادة الشحن لاسلكي أرضية السيارة الكهربائية تدور الغسيل حوض البلاط السلطة الغسيل المطبخ المنزل دش فرشاة التنظيف\"\r\n\r\nهل تبحث عن طريقة فعالة ومريحة لتنظيف منزلك؟ إليك هذه الفرشاة الكهربائية المبتكرة والمتعددة الاستخدامات. تتميز بتصميم لاسلكي يمنحك حرية التنقل وقابلية لإعادة الشحن، حيث يمكنك استخدامها في تنظيف الأرضيات، حمامات السباحة، البلاط، المطابخ، وأكثر من ذلك. تأتي الفرشاة برأس قابل للدوران لتسهيل وصولها إلى الأماكن الضيقة والصعبة. بفضل القوة العالية لهذه الفرشاة، يمكنك إزالة الأوساخ والبقع بسهولة وفعالية. اجعل عملية التنظيف أسهل وأكثر متعة مع هذه الفرشاة الكهربائية المذهلة.', 'tv-28', NULL, NULL, '2023-12-12 20:37:06', '2023-12-13 18:41:30', NULL),
(182, 125, 1, 'ابريق يحافظ علي الحرارة', '(حزمة) ابريق يحافظ علي الحرارة', 350, 590, NULL, NULL, 1, 'available', 'إبريق يحافظ على الحرارة من مادة الزجاج Jeko & Jeko مع غطاء يعمل بالبطارية\r\n\r\nاستمتع بالمشروبات الساخنة لفترة أطول مع إبريق الزجاج الحراري من Jeko & Jeko. يتميز هذا الإبريق بتصميمه الأنيق والعصري مع غطاء يعمل بالبطارية، مما يساعد في الحفاظ على درجة حرارة المشروبات لفترة طويلة. يتم تصنيعه من مادة الزجاج عالية الجودة مع قبضة مريحة لليد.\r\n\r\nيتميز هذا الإبريق بسعة كبيرة تبلغ 1.6 لتر، مما يجعله مثاليًا للاستخدام في المنزل أو في الأماكن العامة. يمكن استخدامه للمشروبات الساخنة مثل الشاي والقهوة والحساء. بفضل أداءه العزل الحراري الفائق، سوف تستمتع بمشروبك الساخن لمدة تصل إلى 24 ساعة.\r\n\r\nلا تدع مشروبك يبرد بعد الآن، احصل على إبريق الزجاج الحراري Jeko & Jeko واستمتع بتجربة شرب ساخنة ومريحة في أي وقت.', 'BW06', NULL, NULL, '2023-12-12 20:39:05', '2023-12-27 01:19:01', NULL),
(183, 89, 1, 'منظفة الأرضيات البلاستيكية اللينة', '(حزمة) منظفة الأرضيات البلاستيكية اللينة', 50, 100, NULL, NULL, 1, 'available', 'المقشة البلاستيكية لتنظيف الأرضيات هي منتج ساخن للغاية في عام 2022. تستخدم هذه المقشة البلاستيكية الناعمة رأسًا لتنظيف الأرضيات الداخلية والخارجية بكفاءة وسهولة. تتميز بجودة عالية ومتانة لتحمل الاستخدام المتكرر. تتكون المقشة من رأس مكون من مادة البلاستيك، وعصا مصنوعة من الخشب، ومجرود من البلاستيك. تأتي بأطوال ألياف متعددة لتناسب احتياجات التنظيف المختلفة. تعتبر هذه المقشة خيارًا مثاليًا للمنازل والمكاتب والمحلات التجارية والمساحات العامة الأخرى. احصل على المقشة البلاستيكية لتنظيف الأرضيات واستمتع بنظافة مثالية وسهولة في التنظيف.', '262', NULL, NULL, '2023-12-12 20:46:15', '2023-12-13 18:43:23', NULL),
(184, 102, 1, 'مكنسة السيارة اللاسلكية المحمولة', '(حزمة) مكنسة السيارة اللاسلكية المحمولة', 300, 500, NULL, NULL, 1, 'available', 'مكنسة السيارة اللاسلكية المحمولة هي جهاز قوي وفعال لتنظيف سيارتك بسهولة ويسر. تعمل هذه المكنسة بواسطة بطارية ليثيوم أيون قابلة للشحن، مما يوفر لك حرية التنقل دون الحاجة إلى توصيلها بمصدر طاقة خارجي. تتميز بقوة شفط عالية تصل إلى 9000 باسكال، مما يسمح لها بامتصاص الأوساخ والغبار بسهولة. تحتوي على خزان غبار سعة 120 مليلتر لتخزين الأوساخ ويسهل تفريغه وتنظيفه. تأتي هذه المكنسة مع مجموعة متنوعة من الفوهات لتنظيف الزوايا والفراغات الصعبة الوصول. بفضل تصميمها المحمول واللاسلكي، يمكنك استخدامها في السيارة والمنزل والهواء الطلق بكل سهولة وراحة.', 'tv-29', NULL, NULL, '2023-12-12 20:46:18', '2023-12-27 01:25:26', NULL),
(185, 92, 1, 'مجموعة استحمام', '(حزمة) مجموعة استحمام', 200, 350, NULL, NULL, 1, 'available', 'طقم هدايا كرات الاستحمام الفوارة الجديد والمبتكر يحتوي على 5 قطع، مثالي للنساء. يمكنك الاستمتاع بتجربة الاستحمام الفاخرة في راحة منزلك. تأتي الكرات بألوان مبهجة ورائحة منعشة، تضفي لمسة من المرح والاسترخاء على وقت استحمامك. يمكن استخدامها في المناسبات المختلفة مثل العيد، الزفاف، وعيد الميلاد، أو يمكن تقديمها كهدية لشخص عزيز. تأتي في عبوة فاخرة وجميلة، مما يجعلها خيارًا رائعًا للهدايا. اجعل تجربة الاستحمام الخاصة بك أكثر متعة واستمتع بلحظات من الاسترخاء مع طقم هدايا كرات الاستحمام الفوارة هذا.', 'hx19', NULL, NULL, '2023-12-12 20:52:15', '2023-12-13 18:45:56', NULL),
(186, 88, 1, 'مصباح المحمول للتصوير الاحترافى', '(حزمة) مصباح المحمول للتصوير الاحترافى', 300, 550, NULL, 10, 1, 'available', 'مصباح مصمم على شكل حلقة مع حامل ثلاثي القوائم داخلي المحمول بث مباشر ماكياج التصوير ملء ضوء الليل مصباح LED Selfie مصباح مصمم على شكل حلقة - احصل على إضاءة مثالية لجلسات التصوير والمكياج الخاصة بك مع مصباح الحلقة ذو الشكل الجذاب. يتميز هذا المصباح بتصميمه الفريد على شكل حلقة وحامل ثلاثي القوائم القابل للتعديل، مما يتيح لك ضبط الإضاءة والزاوية بسهولة لتحقيق أفضل نتائج التصوير. يوفر هذا المصباح إضاءة مشرقة ومتوازنة تعكس الألوان بدقة، مما يساعدك على إنشاء صور وفيديوهات احترافية عالية الجودة. مع وظيفة البث المباشر، يمكنك استخدامه للتواصل مع جمهورك عبر وسائل التواصل الاجتماعي وتحسين إضاءة مقاطع الفيديو الخاصة بك. هذا المصباح محمول وسهل الاستخدام، مما يجعله الخيار المثالي للمصورين، خبراء التجميل، ومحبي السيلفي.', '11', NULL, NULL, '2023-12-12 20:55:10', '2023-12-13 18:47:42', NULL),
(188, 82, 1, 'مسدس الاهتزاز العضلي المحمول', '(حزمة) مسدس الاهتزاز العضلي المحمول', 750, 1200, NULL, NULL, 1, 'available', 'مسدس عضلات صغير يعمل بالاهتزاز كهربائي للاسترخاء المنزلي - استمتع بلحظات الاسترخاء والتدليك في راحة منزلك مع مسدس العضلات الصغير الذي يعمل بالاهتزاز الكهربائي. يوفر هذا المسدس المحمول تجربة تدليك عميقة للأنسجة اللينة والعضلات، مما يساعد على تخفيف التوتر وتجديد الحيوية. يتميز بأربع رؤوس تدليك مختلفة لتلبية احتياجاتك المختلفة، ويعمل ببطارية ليثيوم عالية القدرة توفر وقت تشغيل يصل إلى 2-4 ساعات. يأتي بتصميم مريح وخفيف الوزن، مما يسهل حمله واستخدامه في أي مكان. احصل على هذا المسدس الصغير للاسترخاء المنزلي واستمتع بجلسات التدليك الاسترخائية في أي وقت تشاء.', 'yn98', NULL, NULL, '2023-12-13 14:16:09', '2023-12-13 18:49:57', NULL),
(189, 65, 1, 'قطاعة الخضروات والفواكه المتعددة الاستخدام', '(حزمة) قطاعة الخضروات والفواكه المتعددة الاستخدام', 250, 450, NULL, NULL, 1, 'available', 'قطاعة الخضروات والفواكه متعددة الاستخدام هي أداة مطبخ عملية وفعالة. تتيح لك هذه القطاعة تقطيع وتقسيم الخضروات والفواكه بسهولة وسرعة. تأتي القطاعة مع شفرات حادة مصممة للتعامل مع مختلف أنواع الخضروات والفواكه بسلاسة ودقة. يمكن استخدامها لتقطيع البطاطس والجزر والخيار والفلفل والطماطم والبصل والتفاح وغيرها الكثير. تساعدك هذه القطاعة على توفير الوقت والجهد في عملية التحضير وتجهيز الطعام. بفضل تصميمها المريح والمتين، يمكنك استخدامها بسهولة وتنظيفها بسرعة. احصل على قطاعة الخضروات والفواكه متعددة الاستخدام اليوم واستمتع بتجربة طهي سهلة ومريحة.', 'JF.77', NULL, NULL, '2023-12-13 14:19:38', '2023-12-13 17:18:47', NULL),
(190, 82, 1, 'مسدس الاهتزاز العضلي', '(حزمة) مسدس الاهتزاز العضلي', 500, 800, NULL, NULL, 1, 'available', 'مسدس العضلات الاهتزازي المحمول والقابل للحمل باليد هو جهاز مصمم خصيصًا للاسترخاء وتدليك العضلات. يعمل بتقنية الاهتزاز لتوفير تدليك عميق ومريح لجميع أنحاء الجسم. يساعد في تقليل التوتر والتعب العضلي وتحسين الدورة الدموية. يتميز بتصميم محمول باليد يسهل حمله واستخدامه في أي مكان وزمان، سواء في المنزل أو في النزهات أو في الصالة الرياضية. يتضمن مسدس التدليك مجموعة من الرؤوس القابلة للتبديل لاستهداف مختلف مناطق الجسم. هذا المسدس المحمول هو الرفيق المثالي للحصول على تجربة تدليك مريحة وفعالة في أي وقت وأي مكان.', 'tn58', NULL, NULL, '2023-12-13 14:21:20', '2023-12-26 17:15:42', NULL),
(191, 63, 1, 'مقلب شريحة اللحم', '(حزمة) مقلب شريحة اللحم', 20, 60, NULL, NULL, 1, 'available', 'مقلاة الشريحة لحم من الفولاذ المقاوم للصدأ مع طقم إكسسوارات المطبخ هي منتج عالي الجودة والتصنيع. تتميز بشفرة حادة مصنوعة من الفولاذ المقاوم للصدأ، مما يوفر قوة ومتانة استثنائية. تصميمها غير لاصق يضمن عدم التصاق الطعام ويسهل التنظيف. تتضمن الحزمة أيضًا طقم إكسسوارات المطبخ الذي يشمل مجموعة متنوعة من الأدوات المتعددة الاستخدامات لتلبية احتياجاتك في المطبخ. يأتي مقبضها بتصميم مريح يوفر قبضة آمنة ومريحة أثناء الاستخدام. تعد مقلاة الشريحة لحم هذه الخيار المثالي للطهاة المحترفين والهواة على حد سواء. استمتع بتجربة الطهي الممتعة والنتائج المذهلة مع هذا المنتج ذو الجودة العالية.', '211', NULL, NULL, '2023-12-13 14:57:30', '2023-12-27 01:16:55', NULL),
(192, 63, 1, 'مقص المطبخ المتعدد الوظائف الديلوكس', '(حزمة) مقص المطبخ المتعدد الوظائف الديلوكس', 60, 90, NULL, NULL, 1, 'available', 'مقص مطبخ ديلوكس متعدد الوظائف هو منتج عالي الجودة ومتعدد الاستخدامات. يتميز بمقبض بلون من البلاستيك وشفرات من الفولاذ المقاوم للصدأ الأبيض، مما يجعله قويًا ومتينًا. يعتبر هذا المقص مثاليًا للاستخدام في المطبخ، حيث يمكن استخدامه في قطع اللحم والخضروات والفواكه والأعشاب، وحتى في فتح العلب وقص المواد الأخرى. بفضل تصميمه المتعدد الوظائف، يمكنك الاعتماد على هذا المقص لتلبية مختلف احتياجاتك في المطبخ. إنه منتج عملي وسهل الاستخدام ويعد إضافة مثالية لأدوات المطبخ الخاصة بك.', 'JA,160', NULL, NULL, '2023-12-13 15:44:34', '2023-12-13 15:44:34', NULL),
(193, 73, 1, 'مقص التشذيب المتميز', '(حزمة) مقص التشذيب المتميز', 70, 160, NULL, NULL, 1, 'available', 'مقصات تشذيب الأشجار من الفولاذ المقاوم للصدأ الاحترافية بالجملة هي أداة مثالية لتقليم وتشذيب الأشجار والنباتات في الحدائق والمزارع. تتميز هذه المقصات بشفراتها المصنوعة من الفولاذ المقاوم للصدأ، مما يضمن قوة وصلابة عالية ومقاومة للتآكل. تصميمها الاحترافي يوفر قبضة مريحة وثباتًا قويًا أثناء الاستخدام. بفضل قدرتها على تقطيع الأغصان السميكة والفروع الكبيرة، تعد هذه المقصات مثالية لتشذيب الأشجار المثمرة والأشجار الديكورية. بالإضافة إلى ذلك، فإنها مزودة بمقابض قابلة للطي وآلية تيليسكوبية، مما يسهل حملها وتخزينها. استمتع بأداة تشذيب عالية الجودة للحصول على حديقة جميلة ومحاطة بالأشجار المنتجة.', '00', NULL, NULL, '2023-12-13 16:54:32', '2023-12-13 18:53:00', NULL),
(194, 65, 1, 'سكين قطع الفواكه والخضروات', '(حزمة) سكين قطع الفواكه والخضروات', 20, 40, NULL, NULL, 1, 'available', 'سكاكين مطبخ منزلية رخيصة ملونة بمقبض PP لقطع الفواكه والخضروات\r\n\r\nاحصل على مجموعة سكاكين مطبخ منزلية فعالة وعالية الجودة لتلبية احتياجات قطع الفواكه والخضروات اليومية. تتميز هذه السكاكين بشفراتها المصنوعة من الفولاذ المقاوم للصدأ، مما يوفر قوة وصلابة استثنائية لقطع الأطعمة بدقة وسهولة. تأتي السكاكين بمقابض مريحة مصنوعة من البولي بروبيلين (PP) غير القابل للانزلاق والملونة بتصاميم ممتعة. تتوفر بأحجام مختلفة لتناسب احتياجاتك المحددة. اطلب هذه السكاكين الرائعة اليوم واستمتع بتجربة قطع الفواكه والخضروات المريحة والممتعة في مطبخك. احصل على الأداة المثالية لإعداد وجبات صحية وشهية.', '88', NULL, NULL, '2023-12-13 17:07:20', '2023-12-27 01:15:16', NULL),
(195, 63, 1, 'مجموعة ادوات اللمطبخ', '(حزمة) مجموعة ادوات اللمطبخ', 500, 800, NULL, NULL, 1, 'available', 'هذا المنتج هو طقم أدوات المطبخ الأكثر مبيعًا والذي يتضمن 7 قطع من الأدوات والإكسسوارات المصنوعة من الفولاذ المقاوم للصدأ عالي الجودة. يتميز هذا الطقم بتصميمه الحديث والعملي، ويعتبر خيارًا مثاليًا لمطبخك. تتضمن الأدوات الموجودة في الطقم ما يلي: ملاعق وشوكات ومغارف وأواني طهي. تعد هذه الأدوات مناسبة للاستخدام في المنزل وفي المطاعم والفنادق والمقاهي، وتتميز بالمتانة وسهولة التنظيف. بفضل جودتها العالية والتصميم الأنيق، ستتمكن من الاستمتاع بتجربة طهي ممتعة وفعالة. قم بشراء هذا الطقم الآن وجرب الأدوات المطبخية ذات الأداء الفائق والجودة العالية.', '153', NULL, NULL, '2023-12-13 17:14:15', '2023-12-13 17:14:15', NULL),
(196, 82, 1, 'مسدس الاهتزاز العضلي', '(حزمة) مسدس الاهتزاز العضلي', 500, 800, NULL, NULL, 1, 'available', 'مسدس العضلات الاهتزازي المحمول والقابل للحمل باليد هو جهاز مصمم خصيصًا للاسترخاء وتدليك العضلات. يعمل بتقنية الاهتزاز لتوفير تدليك عميق ومريح لجميع أنحاء الجسم. يساعد في تقليل التوتر والتعب العضلي وتحسين الدورة الدموية. يتميز بتصميم محمول باليد يسهل حمله واستخدامه في أي مكان وزمان، سواء في المنزل أو في النزهات أو في الصالة الرياضية. يتضمن مسدس التدليك مجموعة من الرؤوس القابلة للتبديل لاستهداف مختلف مناطق الجسم. هذا المسدس المحمول هو الرفيق المثالي للحصول على تجربة تدليك مريحة وفعالة في أي وقت وأي مكان.', 'yn58', NULL, NULL, '2023-12-13 17:19:19', '2023-12-13 17:19:19', NULL),
(197, 66, 1, 'قارورة المشروبات الفولاذية', '(حزمة) قارورة المشروبات الفولاذية', 500, 900, NULL, NULL, 1, 'available', 'القدرة العالية والأداء الممتاز يجتمعان في قارورة العزل الفراغي هذه. تتميز بتصميم فولاذي مقاوم للصدأ عالي الجودة وقدرة تخزين تبلغ 2.0/3.2 لتر، مما يجعلها مثالية لحفظ المشروبات الساخنة أو الباردة لفترة تصل إلى 24 ساعة. تتميز بمقبض يسهل حملها وتصميم معاصر يناسب جميع الأذواق. كما تتوفر بألوان متعددة لتضفي لمسة من الأناقة والتميز. مثالية للاستخدام في المدرسة أو أثناء التخييم أو السفر، وهي تعد هدية مثالية للأصدقاء والعائلة. استمتع بالمشروبات اللذيذة في أي وقت وفي أي مكان مع هذه القارورة المتينة وذات الأداء العالي.', 'BW08', NULL, NULL, '2023-12-13 17:37:47', '2023-12-13 18:52:18', NULL),
(198, 125, 1, 'قارورة القهوة الحرارية', '(حزمة) قارورة القهوة الحرارية', 400, 600, NULL, NULL, 1, 'available', 'تقدم قارورة القهوة الحرارية من الفولاذ المقاوم للصدأ هذه تجربة تحتفظ بالحرارة لقهوتك المفضلة لفترة طويلة. بتصميمها الأوروبي ذو الجدران المزدوجة والنمط الأمريكي، توفر هذه القارورة العزل الفراغي المتفوق للحفاظ على درجة حرارة القهوة لمدة تصل إلى 12-24 ساعة. يتميز المنتج بمادة الفولاذ المقاوم للصدأ عالية الجودة التي تحافظ على الحرارة وتضمن المتانة والمتانة الطويلة. بسعة 600 مل و 900 مل، تناسب هذه القارورة احتياجاتك المنزلية والمكتبية وتستحق أن تصبح رفيقًا للسفر. استمتع بقهوتك الساخنة في أي وقت وأي مكان مع هذه القارورة الفاخرة والعملية', 'A,07', NULL, NULL, '2023-12-13 17:50:25', '2023-12-27 01:12:50', NULL),
(199, 63, 1, 'ولاعة الريح القوية', '(حزمة) ولاعة الريح القوية', 50, 90, NULL, NULL, 1, 'available', 'نقدم لكم ولاعة مقاومة للرياح عالية الجودة وعملية للاستخدام في الهواء الطلق. تم تصميم هذه الولاعة خصيصًا لتوفير أداء موثوق به ومقاومة للرياح القوية أثناء استخدامها في الشواء أو التخييم أو النشاطات الخارجية الأخرى. تتميز بتقنية النفخ والإشعال الفوري، حيث يمكنك تشغيلها بسهولة دون الحاجة إلى وقود إضافي. تعمل بالشحن عبر USB، مما يجعلها اقتصادية وصديقة للبيئة. تتميز بتصميمها العصري ومصنوعة من مواد عالية الجودة للتحمل والاستدامة. استمتع بتجربة استخدام مريحة وموثوقة مع هذه الولاعة المقاومة للرياح، واستمتع بأوقاتك في الهواء الطلق بدون قلق من الرياح المزعجة.', 'DMQ01', NULL, NULL, '2023-12-13 18:22:22', '2023-12-16 16:39:20', NULL),
(200, 63, 1, 'مقشرة متعددة الوظائف الحادة', '(حزمة) مقشرة متعددة الوظائف الحادة', 30, 60, NULL, NULL, 1, 'available', 'مقشرة سكين متعددة الوظائف أداة مطبخ مقشرة من الفولاذ المقاوم للصدأ Zester القطاعة القشارة هي أداة مطبخ عالية الجودة ومتعددة الاستخدامات. تتميز بتصميمها المتين والحاد الذي يسمح لك بتقشير وتقطيع الخضروات والفواكه بسهولة ودقة. تعد هذه القطاعة مثالية لتقشير الجزر والبطاطس والكوسا والتفاح والبرتقال والحمضيات الأخرى. مصنوعة من الفولاذ المقاوم للصدأ عالي الجودة، مما يجعلها متينة ومقاومة للصدأ. بفضل تصميمها المريح والقبضة القوية، ستشعر بالراحة أثناء استخدامها. إنها أداة مثالية لإضافتها إلى مجموعة أدوات المطبخ الخاصة بك، وستساعدك في تحضير الطعام بسهولة وفعالية.', '01', NULL, NULL, '2023-12-13 18:29:59', '2023-12-13 18:29:59', NULL),
(201, 63, 1, 'قطاعة الخضروات متعددة الوظائف.', '(حزمة) قطاعة الخضروات متعددة الوظائف.', 280, 450, NULL, NULL, 1, 'available', 'قطاعة الخضروات متعددة الوظائف المبشرة ومقشِّرة البطاطس هي أداة مطبخ عملية ومفيدة. تتميز بتصميمها اليدوي السهل الاستخدام، حيث يمكنك تقطيع وتقشير الخضروات والبطاطس بسهولة وسرعة. تأتي هذه القطاعة بشفرات حادة متعددة الوظائف تسمح بتقطيع الخضروات بأشكال مختلفة، مثل الشرائح والمكعبات والشرائح الرقيقة. تعد هذه الأداة مثالية لتوفير الوقت والجهد في المطبخ، حيث يمكنك تحضير وتجهيز الخضروات بسرعة للوجبات اليومية. بفضل جودتها العالية وموادها المتينة، فإن قطاعة الخضروات متعددة الوظائف تدوم طويلًا وتوفر أداءً موثوقًا. احصل على هذه الأداة العملية اليوم وجرب سهولة وفعالية قطع الخضروات في المطبخ', '02', NULL, NULL, '2023-12-13 18:38:49', '2023-12-13 18:38:49', NULL),
(202, 63, 1, 'ولاعة مضادة للرياح', '(حزمة) ولاعة مضادة للرياح', 60, 85, NULL, NULL, 1, 'available', 'ولاعة مصممة وصغيرة الحجم للهب، ولاعة عصرية مضادة للرياح تستخدم للشيشة. تتميز هذه الولاعة بتصميمها الأنيق والمبتكر، وتعد خيارًا مثاليًا لعشاق التدخين ومحبي الشيشة. تأتي الولاعة بشكل مصغر يتيح لك حملها بسهولة في جيبك أو حقيبتك. توفر وظيفة اللافتة المضادة للرياح تجربة تدخين مريحة وسلسة، حتى في الأماكن ذات التيارات الهوائية القوية. تعمل بتقنية الاشتعال بالبيزو، مما يجعلها قابلة لإعادة الملء بالغاز. بفضل تصميمها العصري والأداء الموثوق بها، تعتبر هذه الولاعة خيارًا رائعًا للأشخاص الذين يبحثون عن منتج عالي الجودة وعملي لتلبية احتياجاتهم في التدخين والشيشة.', 'DHQ05', NULL, NULL, '2023-12-13 18:47:11', '2023-12-16 16:38:57', NULL),
(203, 111, 1, 'ولاعة نار', '(حزمة) ولاعة نار', 600, 100, NULL, NULL, 1, 'available', 'ولاعة غاز قابلة لإعادة الملء ولاعة باربيكيو ولاعة شواء هي منتج عالي الجودة يتميز بتصميمه الجميل ووظائفه المتعددة. تعد هذه الولاعة مثالية للاستخدام في المطابخ وأثناء التخييم والشواء. تأتي الولاعة بحجم طويل يوفر مسافة آمنة بين اللهب ويديك. تستخدم مواد عالية الجودة وتتميز بإمكانية إعادة الملء، مما يجعلها اختيارًا مستدامًا واقتصاديًا. توفر هذه الولاعة إشعال سريع وسهل للشعلة، مما يجعلها مثالية لإضاءة الشموع والشواء والأجهزة الأخرى التي تحتاج إلى لهب قوي. احصل على ولاعة غاز قابلة لإعادة الملء ولاعة باربيكيو ولاعة شواء اليوم واستمتع بسهولة الاستخدام والأداء الموثوق به.', 'DHQ02', NULL, NULL, '2023-12-13 18:55:47', '2023-12-16 16:37:08', NULL),
(204, 93, 1, 'مقصين للشعر', '(حزمة) مقصين للشعر', 75, 120, NULL, NULL, 1, 'available', 'تقدم لك مجموعة تصفيف الشعر المكونة من 3 قطع، مظهرًا جديدًا ومتميزًا لتسريحة شعرك. تتضمن المجموعة مقص الشعر المصنوع من الفولاذ المقاوم للصدأ، والذي يوفر قوة ومتانة عالية مع نصل مستقيم ونصيحة ثلم. بالإضافة إلى ذلك، يتميز المقص بمقبض من البلاستيك لسهولة الاستخدام والراحة. المجموعة تشمل أيضًا مشط حلاّق يساعد في تصفيف وتسريح الشعر بسهولة ودقة. بفضل جودة موادها وتصميمها المتين، فإن هذه المجموعة مثالية للاستخدام الشخصي أو في صالونات التجميل. احصل على شعر جذاب ومتألق مع مجموعة تصفيف الشعر هذه.', 'jh131', NULL, NULL, '2023-12-13 18:57:24', '2023-12-13 18:57:24', NULL),
(205, 63, 1, 'قطاعة الفواكه المتعددة', '(حزمة) قطاعة الفواكه المتعددة', 50, 90, NULL, NULL, 1, 'available', 'قطاعة من الفولاذ المقاوم للصدأ بـ 8 شفرات، آلة قطّارة كبيرة بمقبض بلاستيكي، تعتبر هذه القطاعة أداة مثالية لتحضير الفواكه بسرعة وسهولة. تأتي القطاعة مع 8 شفرات حادة مصنوعة من الفولاذ المقاوم للصدأ، مما يضمن قطع دقيق وفعال للفواكه دون تشوهها. يتميز المقبض البلاستيكي بتصميم مريح يسهل الاستخدام ويضمن الثبات أثناء القطع. تُستخدم هذه القطاعة لتقطيع وتجويف الفواكه بسرعة، مثل تقطيع التفاح واستخراج نواة الفاكهة. إنها أداة عملية وعالية الجودة تضيف الكثير من الراحة والكفاءة لتحضير الفواكه في المطبخ.', 'CL73', NULL, NULL, '2023-12-13 19:02:53', '2023-12-13 19:02:53', NULL),
(206, 93, 1, 'مجموعة مقص الشعر المتعددة الاستخدامات', '(حزمة) مجموعة مقص الشعر المتعددة الاستخدامات', 30, 70, NULL, NULL, 1, 'available', 'نقدم لك مجموعة مقص عر مجموعة شفرة حلاقة قطع، وهي منتج عالي الجودة ومتعدد الاستخدامات. تتضمن المجموعة مقصًا عرًا مصممًا خصيصًا لقص الشعر بدقة وسهولة. تتميز الشفرة بالحدة والمتانة، مما يوفر تجربة قص مريحة وفعالة. تم تصميم المقص بمقابض مريحة لتوفير قبضة قوية وثابتة أثناء الاستخدام. بالإضافة إلى ذلك، يتميز المنتج بتصميم أنيق ومتين يضمن متانته لفترة طويلة من الاستخدام. سواء كنت محترفًا في مجال الحلاقة أو ترغب في استخدامه في المنزل، فإن مجموعة مقص عر مجموعة شفرة حلاقة قطع هي الخيار المثالي لتحقيق تسريحات شعر رائعة ومذهلة.', 'jh111', NULL, NULL, '2023-12-13 19:09:36', '2023-12-13 20:11:26', NULL),
(207, 111, 1, 'موقد النار فايرجيت', '(حزمة) موقد النار فايرجيت', 25, 45, NULL, NULL, 1, 'available', 'هذا المنتج هو موقد مطبخ متعدد الأغراض ولاعة شعلة طيار لموقد المطبخ وموقد الشواء. يتميز بتصميمه العصري والعملي، حيث يوفر طريقة سهلة ومريحة لإشعال النار في المطبخ وأثناء شواء الطعام. يتمتع بخاصية مقاومة الرياح، مما يجعله مثاليًا للاستخدام في الهواء الطلق.\r\n\r\nتم تصنيعه من مواد عالية الجودة مثل البلاستيك المتين، مما يجعله متينًا ومتينًا للاستخدام الطويل الأمد. يأتي مع ميزات إضافية مثل الديكور والجمع، مما يجعله أكثر من مجرد ولاعة. كما يمكن تخصيصه بشعار مخصص حسب الطلب.\r\n\r\nإن موقد المطبخ متعدد الأغراض ولاعة شعلة طيار هو اختيار مثالي للأفراد الذين يبحثون عن وسيلة سهلة وفعالة لإشعال النار في المطبخ وخلال الشواء. سيضيف هذا المنتج العملي والعصري لمسة من الراحة والجودة إلى تجربتك في المطبخ وفي الهواء الطلق.', 'DHQ04', NULL, NULL, '2023-12-13 19:11:34', '2023-12-16 16:38:26', NULL),
(208, 63, 1, 'مجموعة قطع لتقشير الخضراوات', '(حزمة) مجموعة قطع لتقشير الخضراوات', 25, 50, NULL, NULL, 1, 'available', 'تعرض هذه العروض ألواح تقطيع محمولة مكونة من 2 قطع من ألواح التقطيع المصنوعة من مادة المطاط عالية الجودة، مما يضمن المتانة والمتانة العالية. تأتي هذه الألواح بقشرة ذات جودة عالية، مما يعزز مقاومتها للخدوش والتآكل. تتميز بتصميم محمول يجعلها سهلة الاستخدام والتنقل. تأتي معها مجموعة شفرات من الفولاذ المقاوم للصدأ تحتوي على سكين مطبخ وسكين تقشير فواكه ومقشرة. مناسبة للمطابخ المنزلية والاستخدام اليومي. هذه المجموعة توفر مجموعة كاملة من أدوات المطبخ اللازمة لتحضير الطعام بكفاءة عالية. تصميمها العصري والجودة العالية يجعلها خيارًا مثاليًا للمنزل أو كهدية.', '2H78', NULL, NULL, '2023-12-13 19:16:48', '2023-12-13 19:16:48', NULL),
(209, 94, 1, 'مزيل بشرة ميت صغير بابيكير', '(حزمة) مزيل بشرة ميت صغير بابيكير', 180, 300, NULL, NULL, 1, 'available', 'مزيل بشرة ميت صغير للعناية بالبشرة بابيكير مزيل للعناية بالأقدام ملفات طحن البشرة هو أداة مثالية للعناية بالأقدام والبشرة. يتميز هذا المزيل بتصميمه الصغير والمحمول، مما يسهل حمله في حقيبتك أثناء السفر. يعمل على إزالة الجلد الميت والخشن والكالس، مما يترك بشرتك ناعمة ونضرة. يعمل الجهاز بتقنية الطحن الكهربائية، وهو آمن وفعال في إزالة الجلد الميت بدقة ودون إحداث أي آلام. بفضل هذا المزيل المتعدد الاستخدامات، يمكن استخدامه أيضًا لإزالة الزوائد الجلدية والزوائد اللحمية الصغيرة. احصل على بشرة ناعمة وجميلة مع مزيل بشرة ميت صغير للعناية بالبشرة بابيكير.', 'yn39', NULL, NULL, '2023-12-13 19:20:14', '2023-12-13 19:20:14', NULL),
(210, 94, 1, 'مزيل بشرة قدم كهربائي', '(حزمة) مزيل بشرة قدم كهربائي', 120, 300, NULL, NULL, 1, 'available', 'جهاز إزالة الجلد الكهربائي بتقنية التفريغ الكهروستاتيكي الجديد هو أداة فعالة لتنعيم وتنظيف القدمين. يعمل هذا الجهاز على طحن وإزالة الجلد الجاف والصلب والميت من القدمين بسهولة وفعالية. يتميز بتصميم قابل لإعادة الشحن، مما يجعله مريحًا للاستخدام دون الحاجة إلى تغيير البطاريات. يضمن الجهاز نتائج مثالية وبشرة ناعمة بفضل رؤوسه الدوارة عالية الجودة. كما يتميز بوظيفة الشفط لجمع الجلد الميت والزائد، مما يحافظ على نظافة المكان ويسهل التنظيف. هذا الجهاز هو الخيار المثالي للعناية بالقدمين والحصول على مظهر صحي وجميل.', 'yn-38', NULL, NULL, '2023-12-13 19:31:01', '2023-12-13 19:31:01', NULL),
(211, 63, 1, 'مسدس الكعك البسكويت المذهل.', '(حزمة) مسدس الكعك البسكويت المذهل', 180, 280, NULL, NULL, 1, 'available', 'مسدس كعك البسكويت بضغط من صنع البسكويت هو أداة مثالية لصنع الكعك والبسكويت بسهولة وسرعة. يأتي هذا المسدس مع مجموعة متنوعة من القوالب والأشكال المختلفة التي تسمح لك بإنشاء تشكيلات مميزة ومبتكرة. يتميز المسدس بتصميم قوي ومتين مصنوع من المعادن ذات الجودة العالية، مما يضمن استخدامه لفترة طويلة دون تلف. بفضل آلية الضغط المريحة، يمكنك ضغط العجينة بسهولة من خلال المسدس للحصول على كعك وبسكويت متجانس وجميل المظهر. سواء كنت تحب صنع الحلويات في المنزل أو ترغب في تقديم هدية مميزة، فإن مسدس كعك البسكويت بضغط سيكون اختيارًا مثاليًا لك.', '03', NULL, NULL, '2023-12-13 19:35:36', '2023-12-13 19:37:09', NULL),
(212, 63, 1, 'مغرض اللحوم', '(حزمة) مغرض اللحوم', 80, 150, NULL, NULL, 1, 'available', 'منتج الجملة اللحوم إبرة 21 شفرات من الحديد الصلب هو أداة مطبخية فعالة وعملية لمحبي الطهي. يأتي هذا المغرض اللحوم بشفرات حديدية صلبة تبلغ 21 شفرة، مما يساعد في تحسين نعومة وليونة اللحم. يعمل المطرقة على تخفيض الألياف العضلية وتحطيم الأنسجة الصلبة، مما يجعل اللحم أكثر ليونة وسهلة الهضم. صُممت الأداة بشكل مريح لتسهيل الاستخدام وتوفير قوة وثبات أثناء الاستخدام. يمكن استخدامها لتحضير مجموعة متنوعة من اللحوم والدواجن، مما يجعلها خيارًا مثاليًا للطهاة المحترفين والهواة على حد سواء. احصل على هذه الأداة العملية والعالية الجودة لتحسين تجربة الطهي الخاصة بك.', 'CF26', NULL, NULL, '2023-12-13 19:46:33', '2023-12-13 19:46:33', NULL),
(213, 73, 1, 'مضخة المياه البلاستيكية القابلة للإزالة', '(حزمة) مضخة المياه البلاستيكية القابلة للإزالة', 70, 150, NULL, NULL, 1, 'available', 'مضخة المياه البلاستيكية القابلة للإزالة هي حلا مبتكرا وعمليا لتوفير المياه في المنازل والمكاتب. تأتي هذه المضخة بتصميم يدوي يسهل استخدامه وضغطها لشفط المياه من زجاجات المياه بسعة 5 جالون. تتميز بتصميم بلاستيكي خفيف الوزن ومحمول يجعلها مثالية للاستخدام في الهواء الطلق أو في السفر. يتميز السطح البارد الأخضر بمظهر جذاب ومنعش. تعد هذه المضخة المحمولة حلاً مثاليًا لتوفير المياه النقية والعملية في أي مكان وفي أي وقت. قياساتها 3*3*9 سم تجعلها مريحة للتخزين والاستخدام. احصل على هذه المضخة البلاستيكية عالية الجودة والموثوقة الآن واستمتع بسهولة وراحة في استخدام المياه.', 'JH20', NULL, NULL, '2023-12-13 19:53:59', '2023-12-13 19:53:59', NULL),
(214, 95, 1, 'فرشاة هواء الساخن', '(حزمة) فرشاة هواء الساخن', 30, 55, NULL, NULL, 1, 'available', 'فرشاة هواء ساخنة خطوة واحدة ومشط مثبت على الحائط احترافيّة، هي أداة تصفيف الشعر المبتكرة والعملية. تقدم هذه الفرشاة الهوائية الساخنة تجربة شاملة لتجفيف وتصفيف الشعر بخطوة واحدة فقط. تتميز بتصميمها المريح والمحمول، وتعد الخيار المثالي للسفر والاستخدام في المنزل والفنادق أو الصالونات. تمتاز بقدرتها على تجفيف الشعر بسرعة وإضفاء حجم وتمليس الشعر بسلاسة، مما يوفر لك تسريحة شعر مثالية في وقت قصير. بفضل مشطها المثبت على الحائط، يمكن تثبيتها بسهولة وسهولة الوصول إليها في أي وقت. احصل على شعر أنيق ومصفف بطريقة احترافية مع فرشاة الهواء الساخنة خطوة واحدة ومشط المثبت على الحائط.', 'yn62', NULL, NULL, '2023-12-13 19:56:14', '2023-12-13 19:56:14', NULL),
(215, 63, 1, 'خلاط يدوي', '(حزمة) خلاط يدوي', 50, 90, NULL, NULL, 1, 'available', 'يُعتبر خلاط البيض شبه الآلي أداة ممتازة لصنع الكعك وخلط الزبدة والويسكي بكل سهولة وفعالية. مصنوع من الفولاذ المقاوم للصدأ عالي الجودة، مما يضمن متانة ومتانة المنتج. يتميز بتصميم يدوي يوفر سهولة الاستخدام والتحكم المثلى في السرعة. يتميز بوظيفة الدوران الذاتي، مما يضمن توزيعًا متساويًا للمكونات ونتائج مثالية. يتميز بحجم مناسب ووزن خفيف للغاية، مما يجعله محمولًا وسهل الاستخدام في أي مطبخ. يعد خلاط البيض شبه الآلي هذا خيارًا ممتازًا للمحترفين وهواة الطهي على حد سواء. استمتع بالكعك اللذيذ والوصفات الرائعة مع هذه الأداة ذات الجودة العالية.', 'CF19', NULL, NULL, '2023-12-13 20:01:46', '2023-12-13 20:01:46', NULL),
(216, 95, 1, 'فرشاة الشعر المستديرة الفاخرة', '(حزمة) فرشاة الشعر المستديرة الفاخرة', 25, 65, NULL, NULL, 1, 'available', 'تقدم لك مجموعة أفضل فرشاة شعر مستديرة، تصميمها سهل الاستخدام وفعال من حيث التكلفة. تعتبر هذه الفرشاة المستديرة خيارًا مثاليًا للعناية بشعرك. تتميز بمقبض من البلاستيك عالي الجودة وشعيرات نايلون ناعمة تعمل على تسهيل التمشيط والتصفيف دون تشابك. تناسب هذه الفرشاة جميع أنواع الشعر وتوفر تجربة خالية من الألم وتدليكًا لفروة الرأس. كما تحتوي على إضافات مميزة مثل تقنية مضادة للبكتيريا والجوجوبا وفيتامين E، مما يساعد على الحفاظ على صحة وجمال شعرك. احصل على هذه المجموعة الرائعة الآن واستمتع بشعر صحي ومصقول دون عناء.', 'y607', NULL, NULL, '2023-12-13 20:06:15', '2023-12-13 20:06:15', NULL),
(217, 63, 1, 'مبشرة متعددة الاستخدامات فائقة الأداء', '(حزمة) مبشرة متعددة الاستخدامات فائقة الأداء', 45, 90, NULL, NULL, 1, 'available', 'مبشرة الخضروات والفواكه Ltifunction هي أداة متعددة الاستخدامات في المطبخ. تتميز بتصميمها العملي الذي يتضمن أربعة جوانب، مصنوعة من الفولاذ المقاوم للصدأ عالي الجودة. تساعدك هذه المبشرة على تقطيع وبشر الخضروات والفواكه بسهولة وسرعة. يمكن استخدامها لتقطيع الجزر والبصل والبطاطا وغيرها من الخضروات والفواكه. تأتي المبشرة مع حاويات لتجميع المكونات المبشورة، مما يجعل عملية التحضير أكثر نظافة وتنظيمًا. بفضل جودتها العالية وسهولة استخدامها، فإن مبشرة الخضروات والفواكه Ltifunction هي اختيار مثالي لتجهيز الطعام في المنزل وتحضير وجبات صحية ولذيذة.', 'J.44', NULL, NULL, '2023-12-13 20:09:06', '2023-12-13 20:09:06', NULL),
(218, 96, 1, 'مجموعة فرش الجمال الاحترافية', '(حزمة) مجموعة فرش الجمال الاحترافية', 130, 250, NULL, NULL, 1, 'available', 'مجموعة فرش أدوات المكياج الاحترافية هي مجموعة مميزة تحتوي على فرش مكياج عالية الجودة. تم تصميم هذه الفرش بعناية لتلبية احتياجاتك في إنشاء مظهر مكياج متألق واحترافي. تتضمن المجموعة مجموعة متنوعة من الفرش التي تناسب مختلف استخدامات المكياج، مثل فرشاة الأساس، وفرشاة البودرة، وفرشاة العيون، وفرشاة الماسكارا، وغيرها الكثير. تتميز هذه الفرش بشعيراتها الناعمة والكثيفة التي تساعد على توزيع المكياج بشكل متساوٍ ومثالي. بفضل تصميمها المتين والمقاوم للتآكل، ستستمتعين بمدة استخدام طويلة وأداء متميز. احصلي على هذه المجموعة الرائعة واستمتعي بتجربة مكياج احترافية لا مثيل لها.', '00000', NULL, NULL, '2023-12-13 20:17:12', '2023-12-13 20:17:12', NULL);
