(219, 98, 1, 'مسبح المرح المنتفخ', '(حزمة) مسبح المرح المنتفخ', 500, 800, NULL, NULL, 1, 'available', 'حمام السباحة المنتفخ هو منتج ممتع وعالي الجودة يهدف إلى توفير تجربة سباحة رائعة للأطفال والعائلة. يتميز هذا الحمام بأبعاده الكبيرة بقياس 85 × 30 سم، مما يسمح بمساحة واسعة للعب بالماء والاستمتاع بالنشاطات المائية. يمكن استخدامه في الأماكن الداخلية والخارجية، مما يجعله مناسبًا للاستخدام في الحدائق والفناء والمسابح. يتم تصنيع هذا الحمام من مواد عالية الجودة مثل كلوريد البولي فينيل (PVC)، مما يجعله متينًا ومقاومًا للتلف. بالإضافة إلى ذلك، يأتي مع خيارات لتخصيص الشعار والتعبئة والتغليف حسب الطلب. احصل على حمام السباحة المنتفخ هذا واستمتع بوقت ممتع ومنعش في الماء.', '201', NULL, NULL, '2023-12-13 20:36:36', '2023-12-13 20:36:36', NULL),
(220, 92, 1, 'مجموعة أدوات العناية بالأظافر المحترفة', '(حزمة) مجموعة أدوات العناية بالأظافر المحترفة', 150, 240, NULL, NULL, 1, 'available', 'مجموعة العناية بالأظافر هذه هي مجموعة فريدة تحتوي على مقص العناية بالبشرة ومدفع معدني وأدوات متنوعة لتشذيب الأظافر. تم تصميم هذه المجموعة لتلبية احتياجات صالونات التجميل والمستخدمين الشخصيين على حد سواء. صُنعت المجموعة من مواد عالية الجودة، حيث تعتبر الأدوات من الفولاذ المقاوم للصدأ لضمان المتانة والتحمل. توفر هذه المجموعة سهولة الاستخدام والتحكم، مع تصميم خفيف الوزن لراحة الاستخدام الطويلة. تعتبر هذه المجموعة خيارًا مثاليًا للحصول على نتائج احترافية في العناية بالأظافر في المنزل أو في صالون الجمال.', 'jh218', NULL, NULL, '2023-12-13 20:41:32', '2023-12-13 20:41:32', NULL),
(221, 63, 1, 'خلاط البيض المتعدد الوظائف', '(حزمة) خلاط البيض المتعدد الوظائف', 25, 50, NULL, NULL, 1, 'available', 'يعتبر خلاط البيض اليدوي المتعدد الوظائف هذا أداة مطبخ عالية الجودة ومتعددة الاستخدامات. مصنوع من الفولاذ المقاوم للصدأ والسيليكون، مما يجعله قويًا ومتينًا للاستخدام اليومي. يأتي بمقبض خشبي يوفر قبضة مريحة وثابتة. يمكن استخدامه لخفق البيض بسرعة وكفاءة، وكذلك لخلط المكونات الأخرى مثل الصلصات والعجائن. يعتبر هذا الخلاط اليدوي اختيارًا مثاليًا للمطابخ المنزلية والمطاعم والمقاهي. بفضل تصميمه العملي والمريح، يمكن حمله واستخدامه بسهولة. احصل على هذا الخلاط اليدوي متعدد الوظائف واستمتع بتجربة طهي سهلة وممتعة في مطبخك.', '04', NULL, NULL, '2023-12-13 20:43:34', '2023-12-13 20:43:34', NULL),
(222, 89, 1, 'ممسحة النوافذ', '(حزمة) ممسحة النوافذ', 150, 200, NULL, NULL, 1, 'available', 'ممسحة النوافذ الراقية ذات المقبض المصنوع من الفولاذ المقاوم للصدأ والبلاستيك بأبعاد 23*24*2.3 سنتيمتر هي أداة فعالة ومتطورة لتنظيف النوافذ. تتميز بتصميمها المتين وعالي الجودة، حيث يتم استخدام مادة الفولاذ المقاوم للصدأ في المقبض لضمان المتانة والمتانة الطويلة. تتكون رأس الممسحة من شعيرات من البلاستيك الخشن لتنظيف فعال وسريع دون ترك أثار أو بقع. إنها مثالية للاستخدام الشخصي وتنظيف النوافذ المنزلية والتجارية. احصل على هذه الممسحة العالية الجودة الآن واستمتع بنوافذ نظيفة ولامعة بكل سهولة وفعالية.', '05', NULL, NULL, '2023-12-13 20:51:08', '2023-12-13 20:55:10', NULL),
(223, 100, 1, 'حبل قفز اللياقة المرجح', '(حزمة) حبل قفز اللياقة المرجح', 150, 250, NULL, NULL, 1, 'available', 'حبل قفز Pu هو منتج ممتاز لممارسة التمارين الرياضية وتحسين اللياقة البدنية. يأتي الحبل بتصميم قابل للتعديل، مما يسمح للمستخدم بتعديل طوله وفقًا لاحتياجاته. يتميز الحبل بجودة عالية، حيث يتم صنعه من مادة البلوتونيوم المتينة والمتينة التي توفر مقاومة طويلة الأمد. يزن الحبل حوالي 160 جرامًا، مما يجعله مناسبًا للمبتدئين والمحترفين على حد سواء. بالإضافة إلى ذلك، يتميز الحبل بمقبض مريح وقابل للتعديل يضمن قبضة آمنة وثابتة أثناء التمرين. إن حبل القفز Pu هذا هو اختيار مثالي لتحسين التوازن، وزيادة اللياقة البدنية، وتقوية العضلات.', 'jf76', NULL, NULL, '2023-12-13 20:52:45', '2023-12-13 20:52:45', NULL),
(224, 63, 1, 'حامل التوابل الجداري المتعدد الاستخدامات', '(حزمة) حامل التوابل الجداري المتعدد الاستخدامات', 160, 250, NULL, NULL, 1, 'available', 'حامل لتتبيل المطبخ المثبت على الحائط - حامل لتتبيل المطبخ بعشرة مقصورات\r\n\r\nاجعل تنظيم مطبخك أكثر سهولة وفعالية مع حامل تتبيل المطبخ المثبت على الحائط. يحتوي هذا الحامل على عشرة مقصورات تسمح لك بتخزين التوابل والبهارات والاعشاب بشكل منظم ومرتب. يتم تثبيت الحامل على الحائط، مما يوفر لك مساحة قيمة على سطح المطبخ.\r\n\r\nتتميز هذه المنتج بتصميمه الوظيفي والعملي، حيث يحتوي على ثلاثة فتحات لتخزين التوابل والبهارات بشكل آمن وسهل الوصول إليها. يتميز أيضًا بقدرته على الدوران، مما يتيح لك الوصول إلى المقصورات بسهولة وسرعة.\r\n\r\nاحصل على حامل تتبيل المطبخ المثبت على الحائط اليوم واستمتع بمطبخ منظم ونظيف دون الحاجة إلى البحث عن التوابل المطلوبة. اطلبه الآن وتمتع بعرض خاص لعام 2023', 'TV-24', NULL, NULL, '2023-12-13 20:57:22', '2023-12-13 20:57:22', NULL),
(225, 95, 1, 'فرشاة  الشعر', '(حزمة) فرشاة  الشعر', 35, 70, NULL, NULL, 1, 'available', 'فرشاة تدليك الشعر المخصصة والملونة للنساء تعتبر أداة مثالية للعناية بالشعر. تتميز هذه الفرشاة بوسادة مريحة وشعيرات نايلون رطبة توفر تجربة تدليك ممتعة لفروة الرأس. تصميمها الوردي الجميل يضفي مظهرًا أنيقًا ومرحًا. تتميز بشكلها المستدير الذي يسهل حمله واستخدامه. تعمل الفرشاة على تسهيل تمشيط الشعر وفك تشابكه بلطف، مما يقلل من تلف الشعر وتكسره. تعتبر هذه الفرشاة مثالية للاستخدام في صالونات التجميل أو في المنزل. احصلي على شعر صحي وناعم مع فرشاة تدليك الشعر هذه.', '0000', NULL, NULL, '2023-12-13 20:59:40', '2023-12-13 20:59:40', NULL),
(226, 95, 1, 'فرشاة تصفيف الشعر المريحة', '(حزمة) فرشاة تصفيف الشعر المريحة', 40, 80, NULL, NULL, 1, 'available', 'فرشاة شعر Detangler فرشاة شعر Es تعد مثالية لتسهيل تصفيف وتمشيط الشعر الخشن والمتشابك. تتميز هذه الفرشاة بتصميمها المرن والمبتكر الذي يضمن تدليكًا لطيفًا لفروة الرأس وفروة الشعر، مما يحسن تدفق الدم ويحفز نمو الشعر. تم تصميم الشعيرات النايلون اللينة لتمريرها بسهولة عبر الشعر دون أن تتسبب في تلف أو قطع الشعر. تعمل فرشاة Detangler على تقليل التجعيد وتكسير الشعر، كما تساعد في مكافحة الكهرباء الساكنة، مما يمنحك شعراً ناعماً ولامعاً. فرشاة شعر Detangler هي الخيار المثالي للنساء والفتيات اللاتي يبحثن عن تجربة تصفيف مريحة وفعالة لشعرهن.', 'zh69', NULL, NULL, '2023-12-13 21:10:32', '2023-12-13 21:10:32', NULL),
(227, 63, 1, 'ماكينة تقشير متعددة الوظائف', '(حزمة) ماكينة تقشير متعددة الوظائف', 15, 40, NULL, NULL, 1, 'available', 'ماكينة تقشير الخضر المتعددة الوظائف هي أداة مثالية لعشاق الفواكه والطهاة المحترفين على حد سواء. تتميز هذه الماكينة بتصميم يدوي فعال يتيح لك تقشير البرتقال بسهولة وسرعة دون أي جهد. يمكن استخدامها أيضًا لتقطيع البرتقال وتحضير شرائح رفيعة ودقيقة. تتميز بمواد عالية الجودة مثل الفولاذ المقاوم للصدأ والبلاستيك المتين لضمان المتانة والاستدامة. تأتي بحجم مدمج وخفيف الوزن لتسهيل الاستخدام والتخزين. سواء كنت تستخدمها في المطبخ المنزلي أو في المطاعم والفنادق، فإن ماكينة تقشير البرتقال المتعددة الوظائف ستوفر لك تجربة سهلة ومريحة في تحضير الفواكه.', '05', NULL, NULL, '2023-12-13 21:19:02', '2023-12-13 21:19:02', NULL),
(228, 75, 1, 'دبوس العجين الخشبي الطبيعي', '(حزمة) دبوس العجين الخشبي الطبيعي', 60, 120, NULL, NULL, 1, 'available', 'يعد دبوس اللف الخشبي الاقتصادي هذا خيارًا ممتازًا لمطبخ منزلك. يتميز هذا الدبوس بالمواد الخام الطبيعية من الخشب الصلب الخالي من الدهانات الكيميائية، مما يجعله آمنًا وصحيًا للاستخدام في تحضير العجين والمعجنات. بتصميمه الفريد وبلونه الطبيعي الجميل، يضفي هذا الدبوس لمسة من الجمال والأصالة على مطبخك. يمكن استخدامه في المنازل والمطاعم، ويعتبر أداة مثالية لتمديد وتشكيل العجين بسهولة ودقة. بفضل جودته العالية ومتانته، سيكون هذا الدبوس الخشبي رفيقًا موثوقًا لسنوات قادمة في مطبخك. استمتع بتحضير وخبز أشهى الأطعمة مع هذا الدبوس الخشبي العملي والجميل.', '240', NULL, NULL, '2023-12-13 21:39:50', '2023-12-13 21:39:50', NULL),
(229, 75, 1, 'صحن لطحن لأعشاب', '(حزمة) صحن لطحن لأعشاب', 70, 200, NULL, NULL, 1, 'available', 'هاون بتصميم مدقة تقليد الخشب والرخام. يعد هذا المنتج المثالي لطحن وطحن الأعشاب والتوابل بسهولة وفعالية. مصنوع من مواد بولي بروبلين عالية الجودة، مما يجعله متينًا ومقاومًا للتآكل. يتميز بحجم مناسب يسهل استخدامه وتخزينه. يأتي بألوان متنوعة للاختيار من بينها. يمكن استخدامه في المطابخ المنزلية والمطاعم والفنادق وغيرها من الأماكن. مع تصميمه الأنيق والعملي، يعد هذا الهاون والمدقة مثاليًا للتحضيرات المطبخية وإضافة النكهة الطازجة إلى أطباقك المفضلة. يعد هذا المنتج خيارًا ممتازًا لمحبي الطهي والتوابل', '06', NULL, NULL, '2023-12-13 21:59:38', '2023-12-13 21:59:38', NULL),
(230, 63, 1, 'مزيل قشرة السمك', '(حزمة) مزيل قشرة السمك', 30, 70, NULL, NULL, 1, 'available', 'هو منتج عالي الجودة مصمم لتوفير تجربة سهلة وفعالة لإزالة قشرة السمك. يتميز هذا المقياس بشفرة حادة مصنوعة من الفولاذ المقاوم للصدأ 304 المتين، مما يوفر قوة ومتانة استثنائية. يتمتع بتصميم مريح يسهل القبض عليه، ويتميز بمقبض مانع للانزلاق لضمان السلامة أثناء الاستخدام. يعمل هذا المقياس على إزالة قشرة السمك بسهولة وفعالية، مما يوفر لك وقتًا وجهدًا في المطبخ. يعد مقياس سمكة سمكة من الفولاذ المقاوم للصدأ 304 خيارًا مثاليًا لعشاق الطهي وعشاق الأسماك الذين يبحثون عن أداة عالية الجودة وموثوقة لإزالة قشرة السمك بكل سهولة', '07', NULL, NULL, '2023-12-13 22:08:06', '2023-12-13 22:08:06', NULL),
(231, 63, 1, 'الشبكة العازلة للسوائل', '(حزمة) الشبكة العازلة للسوائل', 70, 150, NULL, NULL, 1, 'available', 'أداة مطبخ مبتكرة وعملية تعمل على تصفية وتصريف السوائل والمكونات الصلبة بسهولة وفعالية. يتميز هذا الفلتر بتصميم قوي ومتين مصنوع من أسلاك الفولاذ المقاوم للصدأ عالية الجودة، مما يضمن المتانة والاستدامة. يحتوي على شبكة حلزونية دقيقة تساعد في منع دخول الشوائب والرواسب غير المرغوب فيها. سهل الاستخدام والتنظيف، ويمكن استخدامه في تصفية الشوربات والمرقات والمعكرونة والخضروات وغيرها من المكونات. يعد فلتر شبكي من أسلاك الفولاذ المقاوم للصدأ مع شبكة حلزونية خيارًا مثاليًا للمطابخ المنزلية والمطاعم التجارية لتحسين عملية التصفية والتصريف بكفاءة.', '08', NULL, NULL, '2023-12-13 22:17:47', '2023-12-14 00:56:48', NULL),
(232, 63, 1, 'مخالب اللحم الساخن', '(حزمة) مخالب اللحم الساخن', 70, 140, NULL, NULL, 1, 'available', 'مخالب اللحوم المصنوعة من الفولاذ المقاوم للصدأ هي أداة مثالية لعشاق الشواء وتحضير اللحوم. تتميز هذه المخالب بتصميمها الحلزوني الفريد، مما يوفر قوة وثباتًا استثنائيين أثناء سحب وتمزيق اللحم. تستخدم لسحب وتفتيت لحم الخنزير، والدجاج، ولحوم البقر، وتركيا، وأيضًا في عمليات التقطيع والشواء والشوي. تتميز بمقابض مريحة وسهلة الاستخدام، ومصنوعة من مواد عالية الجودة تجعلها متينة ومقاومة للحرارة. إنها أداة مثالية للطهاة المحترفين وهواة الشواء على حد سواء. احصل على مخالب اللحم هذه الآن واستمتع بتمزيق اللحم بكل سهولة وفعالية.', '08', NULL, NULL, '2023-12-13 22:31:10', '2023-12-13 22:31:10', NULL),
(233, 89, 1, 'ممسحة الأرض', '(حزمة) ممسحة الأرض', 75, 120, NULL, NULL, 1, 'available', 'هي أداة تجارية احترافية واسعة النطاق لتنظيف الأرضيات. تتميز هذه الممسحة ببناءها القوي من الفولاذ المقاوم للصدأ، مما يجعلها متينة ومتينة للاستخدام المكثف. تتميز بتصميم قابل للتعديل، مما يسمح بتعديل زاوية الممسحة لتناسب احتياجات التنظيف المختلفة. تستخدم لتنظيف مجموعة متنوعة من الأرضيات، مثل البلاط، والخشب، والمرمر، والأسمنت. تأتي مع شفرة ممسحة من مادة Eva عالية الجودة لتنظيف فعال وسهل. احصل على ممسحة الأرض الفولاذية المقاومة للصدأ هذه الآن واحصل على نتائج نظافة استثنائية لأرضياتك التجارية.', '010', NULL, NULL, '2023-12-13 22:44:47', '2023-12-14 14:51:19', NULL),
(236, 63, 1, 'حصائر السليكون', '(حزمة) حصائر السليكون', 20, 40, NULL, 100, 1, 'available', 'حصائر سيليكون 35 جرام للأقدور والمقالي الساخنة متعددة الأغراض مانعة للانزلاق\r\n\r\nاحصل على حصائر سيليكون متعددة الاستخدامات والتي تزن 35 جرامًا لحماية أقدورك ومقاليك الساخنة. تعد هذه الحصائر مانعة للانزلاق ومثالية للاستخدام في المطبخ وخارجه. تم تصميمها بمادة سيليكون ناعمة ومرنة عالية الجودة، مما يجعلها تتحمل التواءات والاحتكاك والسحب. تعمل حصائر السيليكون على حماية الأسطح الحساسة من الحرارة العالية وتوفر قاعدة آمنة ومتينة لأقدورك ومقاليك. بالإضافة إلى ذلك، فإنها قابلة للغسل وسهلة التنظيف. احصل على حصائر سيليكون 35 جرام لتجربة طهي آمنة ومريحة في المطبخ.', '00000', NULL, NULL, '2023-12-14 21:09:46', '2023-12-14 21:09:46', NULL),
(237, 97, 1, 'صحن لبلاستيك للحفلات', 'صحن لبلاستيك للحفلات', 10, 30, NULL, NULL, 1, 'available', 'هذا المنتج هو أطقم أدوات مائدة للحفلات بطباعة أعياد الميلاد لمرة واحدة. يتميز بجودة عالية وتصميم ملون مخصص. مثالي لتزيين حفلات الأعياد وتوفير الراحة والسهولة في التنظيف بعد الاحتفالات.', '000', NULL, NULL, '2023-12-14 22:43:51', '2023-12-14 22:43:51', NULL),
(238, 97, 1, '20 كوب ورقية عيد الميلاد', '20 كوب ورقية عيد الميلاد', 40, 150, NULL, NULL, 1, 'available', 'تُعد أكواب ورقية للمشروبات الساخنة ذات الشعار المخصص مثالية للاحتفالات والأحداث المختلفة. تأتي في سعة 380 مل (12 أونصة)، وهي مناسبة للماء والعصائر والقهوة والشاي. صُنعت هذه الأكواب من الورق القابل للتحلل، مما يجعلها صديقة للبيئة وتلبي احتياجات الاستدامة تأتي هذه الأكواب مع لوحة ورقية قابلة للتخلص وتعمل بشكل مثالي في المناسبات الخاصة بالأطفال، مثل حفلات عيد الميلاد. اجعل تجربة تناول المشروبات أكثر متعة واحتفل بأحداثك بأسلوب صديق للبيئة ومخصص.', '0000', NULL, NULL, '2023-12-14 22:49:29', '2023-12-14 22:49:29', NULL),
(239, 63, 1, 'سكين الكعك', 'سكين الكعك', 75, 120, NULL, NULL, 1, 'available', 'مقبض كريستال الفولاذ المقاوم للصدأ كعكة طقم تقديم الزفاف عيد ميلاد سكينة تقطيع الكيك والبيتزا مجرفة مجموعة.\r\n\r\nاحصل على طقم تقديم الكعك والبيتزا الرائع هذا، والذي يتميز بمقبض من الكريستال الفاخر وشفرات مصنوعة من الفولاذ المقاوم للصدأ عالي الجودة. يساعدك هذا الطقم على تقطيع الكعك والبيتزا بسهولة ودقة، مما يجعله مثاليًا للاستخدام في المناسبات الخاصة مثل حفلات الزفاف وأعياد الميلاد. يتميز بتصميم متعدد الألوان يضفي لمسة جمالية على طاولة الحفل. بالإضافة إلى ذلك، يأتي هذا الطقم بحجم مريح وخفيف الوزن، مما يجعله سهل الاستخدام والتنظيف. احصل على هذا الطقم الرائع اليوم واستمتع بتقديم الكعك والبيتزا بأناقة وفخامة.', 'jh-101', NULL, NULL, '2023-12-14 22:53:57', '2023-12-14 22:53:57', NULL),
(240, 97, 1, 'صواعق الإحتفال', 'صواعق الإحتفال', 30, 60, NULL, NULL, 1, 'available', 'صواعق الاحتفال بأشكال متنوعة! استمتع بأجواء الحفل وأضف لمسة ساحرة ومرحة مع منفخ الأوراق الملونة لحفلات الزفاف بطول 30 سم. تتميز هذه الصواعق بتصميم محمول يمكن حمله باليد واستخدامه بسهولة. إنها مثالية للأعراس والحفلات والمناسبات الاحتفالية الأخرى. تحتوي على قصاصات ورقية ملونة تنثر في الهواء لإضفاء لمسة من السحر والبهجة. مصنوعة من مواد عالية الجودة تضمن قوة واستدامة في الاستخدام. بفضل التصميم المبتكر والجودة العالية، ستكون هذه الصواعق إضافة رائعة لحفلتك، وستحظى بإعجاب الضيوف وستخلق لحظات لا تُنسى. احصل عليها الآن واستعد للاحتفال بأسلوب مميز!', '98ia', NULL, NULL, '2023-12-14 23:33:44', '2023-12-14 23:33:44', NULL),
(241, 97, 1, 'صواعق الإحتفال بالورد', 'صواعق الإحتفال بالورد', 40, 75, NULL, NULL, 1, 'available', 'صواعق الاحتفال الملونة قابلة للتحلل الحيوي، حلويات الزفاف 30، قماش محمول باليد، حلويات بيتل روز لحفلات الزفاف وأعياد الميلاد.\r\n\r\nاجعل مناسباتك الخاصة أكثر ابهارًا وسحرًا مع صواعق الاحتفال الملونة قابلة للتحلل الحيوي. تتميز هذه الحلويات بأنها صديقة للبيئة وقابلة للتحلل الحيوي، مما يجعلها خيارًا مثاليًا للحفلات والمناسبات الخاصة. يمكن استخدامها في حفلات الزفاف وأعياد الميلاد والأحداث الاحتفالية الأخرى.\r\n\r\nتأتي هذه الحلويات بتصميم جميل لبيتل روز، مما يضفي لمسة من الجمال والأناقة على الحفلات. بالإضافة إلى ذلك، تأتي بقماش محمول باليد سهل الاستخدام والتشغيل.\r\n\r\nاستمتع بمناسباتك بألوان مبهجة ولحظات ساحرة مع صواعق الاحتفال الملونة قابلة للتحلل الحيوي.', '98ib', NULL, NULL, '2023-12-14 23:48:42', '2023-12-14 23:48:42', NULL),
(242, 101, 1, 'ماكينة قص الشعر الاحترافية وايكيل', 'ماكينة قص الشعر الاحترافية وايكيل', 450, 650, NULL, NULL, 1, 'available', 'ماكينة قص الشعر الماركة (waikil) هي ماكينة قص الشعر الاحترافية التي توفر لك تجربة قص الشعر عالية الجودة في راحة منزلك. تتميز هذه الماكينة بشاشة LCD T9 التي تعرض معلومات مهمة مثل مستوى البطارية ووقت الاستخدام. يمكن شحنها بسهولة باستخدام مدخل USB، مما يجعلها مريحة للاستخدام في أي مكان وفي أي وقت. تأتي مع ملحقات متعددة لتلبية احتياجات قص الشعر المختلفة. تمتاز بجودة الصنع والمواد المستخدمة، وتصميمها العصري والمريح يجعل من السهل التحكم فيها أثناء الاستخدام. احصل على هذه الماكينة الاحترافية الآن واستمتع بقص الشعر بدقة وسهولة.', 'yn-75', NULL, NULL, '2023-12-15 00:06:51', '2023-12-15 00:06:51', NULL),
(243, 101, 1, 'ماكينة قص الشعر الكثيف', 'ماكينة قص الشعر الكثيف', 220, 380, NULL, NULL, 1, 'available', 'ماكينة قص الشعر العالمية USB كليبرز هي ماكينة حلاقة احترافية وموثوقة. تأتي بتصميم تلقائي يضمن أداءً ممتازًا للحلاقة. تتميز بسرعتين قابلتين للتحكم، مما يسمح لك بتعديل سرعة القص وفقًا لاحتياجاتك. تتميز الماكينة بمشابك شعر قوية ومتينة، تسهل عملية القص وتضمن الحصول على نتائج متساوية ودقيقة. يمكن تشغيلها عن طريق USB أو البطارية، مما يجعلها ملائمة للاستخدام الشخصي أو في صالونات الحلاقة. تتميز أيضًا بمادة الشفرة المصنوعة من الفولاذ المقاوم للصدأ، مما يعزز دقة القص ويضمن المتانة. هذه الماكينة هي حلاقة شعر متعددة الاستخدامات تلبي احتياجات الرجال والمحترفين.', 'yn81', NULL, NULL, '2023-12-15 00:11:06', '2023-12-15 00:11:06', NULL),
(244, 101, 1, 'مقص الحلاقة الكهربائي دالينغ', 'مقص الحلاقة الكهربائي دالينغ', 200, 400, NULL, NULL, 1, 'available', 'دالينغ Dl-1052 الكهربائية مقص حلاّق قابلة للشحن الحلاقة الأطفال راشدين هادئة المنزل دفع كهربائي مقص بالجملة.\r\n\r\nقم بتجربة تجربة حلاقة مريحة وسهلة مع مقص الحلاقة الكهربائي دالينغ DL-1052. يتميز هذا المقص بتصميم قابل للشحن ومناسب للاستخدام المنزلي وللأطفال والبالغين على حد سواء. فهو يوفر قصًا هادئًا ومريحًا للشعر دون إحداث ضوضاء مزعجة. يتميز المقص بشفراته المصنوعة من الفولاذ المقاوم للصدأ، مما يوفر دقة القص ومتانة عالية. يمكن شحنه عن طريق المنفذ USB ويمتاز بوقت تشغيل يصل إلى 60 دقيقة. كما يتميز بحجم مدمج وسهولة الاستخدام. احصل على مقص الحلاقة الكهربائي دالينغ DL-1052 الآن واستمتع بتجربة حلاقة مثالية في راحة منزلك.', 'yn78', NULL, NULL, '2023-12-15 00:14:42', '2023-12-15 00:14:42', NULL),
(245, 101, 1, 'ماكينة قص الشعر ذات شفرات الشفافة', 'ماكينة قص الشعر ذات شفرات الشفافة', 600, 950, NULL, NULL, 1, 'available', 'آلة قص الشعر اللاسلكية ذات الشفرات الشفافة للرجال تعد اختيارًا مثاليًا للحصول على قصة شعر محترفة في منزلك. تأتي هذه الآلة بتصميم مهني وشفرات حادة مصنوعة من الفولاذ المقاوم للصدأ، مما يوفر قصًا سريعًا ودقيقًا. وبفضل تقنية الشحن اللاسلكي عبر USB، يمكنك استخدامها بسهولة ومن أي مكان ترغب فيه. تعمل لفترة طويلة بعد كل عملية شحن واحدة، مما يوفر لك الكفاءة والراحة. هذه الآلة قابلة للتنظيف والغسل بسهولة، وتأتي مع ملحقات إضافية لتلبية احتياجات العناية بالشعر الشخصية. احصل على مجموعة قص الشعر اللاسلكية هذه اليوم واستمتع بتجربة قص شعر ممتازة في المنزل.', 'yn-97', NULL, NULL, '2023-12-15 00:20:34', '2023-12-15 00:20:34', NULL),
(246, 101, 1, 'مقص الشعر اللاسلكي المصغر', 'مقص الشعر اللاسلكي المصغر', 450, 750, NULL, NULL, 1, 'available', 'يعرض هذا المنتج مشابك شعر وتشذيب مصغرة للشعر قابلة لإعادة الشحن. يأتي هذا المشذب بتصميم صغير ومدمج، مما يجعله مثاليًا للاستخدام في المنزل أو أثناء التنقل. يتميز بقدرة الشحن اللاسلكية، مما يوفر سهولة في الاستخدام وحرية الحركة. يحتوي على شفرات من الفولاذ المقاوم للصدأ، والتي توفر قصًا دقيقًا وفعالًا للشعر. كما يتمتع بزمن تشغيل طويل يصل إلى 90 دقيقة بعد الشحن لمدة 2 ساعة. يمكن استخدامه للحلاقة والتشذيب في السيارة، أو أثناء التخييم، أو في الفنادق، مما يجعله منتجًا متعدد الاستخدامات وعمليًا للرجال والنساء على حد سواء.', 'yn29', NULL, NULL, '2023-12-15 00:26:06', '2023-12-15 00:26:06', NULL),
(247, 101, 1, 'ماكينة قص الشعر الإحترافية', 'ماكينة قص الشعر الإحترافية', 130, 280, NULL, NULL, 1, 'available', 'مقص الشعر الرجالي عالي الجودة والمقص الانتهازي المهني هو منتج مثالي لتحقيق قصة الشعر المثالية في راحة منزلك. يتميز هذا المقص بجودة فائقة وسعر منخفض، مما يجعله خيارًا رائعًا للرجال الذين يرغبون في تصفيف وقص شعرهم بأنفسهم. يتميز المقص بشفرات فولاذية مقاومة للصدأ توفر قصًا سلسًا ودقيقًا، بالإضافة إلى وظائف التحكم المتعددة التي تسمح لك بتخصيص طول القص وفقًا لتفضيلاتك الشخصية. كما يتمتع المقص بقوة عالية وكفاءة فائقة في الأداء، مما يوفر لك تجربة قص شعر سهلة ومريحة. احصل على مظهرٍ مذهلٍ وأنيقٍ بفضل هذا المقص الرجالي عالي الجودة والاقتصادي.', 'yn-03', NULL, NULL, '2023-12-15 00:30:16', '2023-12-15 00:30:16', NULL),
(248, 101, 1, 'ماكينة قص الشعر الألمانية', 'ماكينة قص الشعر الألمانية', 220, 390, NULL, NULL, 1, 'available', 'آلة صالونات الشعر هي أداة احترافية وقديمة تستخدم في نحت وتصفيف الشعر. تتميز برأس قاطع متعدد الاستخدامات قابل للاستبدال، مما يوفر مرونة ومتانة عالية. تعمل الآلة بالطاقة الكهربائية وتتمتع بضغط قص قوي لتحقيق نتائج مذهلة. تأتي مع مجموعة ملحقات تشمل مشط وفرشاة وزيت وشاحن. تتميز بشفرات من الحديد الصلب الذي يجعلها مناسبة للغسل وتدوم طويلًا. تعد هذه الآلة مثالية للاستخدام في صالونات الشعر المحترفة وتلبية احتياجات العناية بالشعر الشخصية. احصل على مظهرٍ مميزٍ واحترافيٍ بواسطة آلة صالونات الشعر هذه.', 'yn22', NULL, NULL, '2023-12-15 00:34:48', '2023-12-15 00:34:48', NULL),
(249, 101, 1, 'ماكينة الحلاقة الصغيرة', 'ماكينة الحلاقة الصغيرة', 100, 200, NULL, NULL, 1, 'available', 'مقص الشعر المحترف متعدد الوظائف قابل للشحن ومنخفض الضوضاء مصمم خصيصًا لتحقيق تجربة حلاقة مثالية. يتميز هذا المقص بالقوة والكفاءة العالية، حيث يعمل بفعالية في قص وتشذيب الشعر بسهولة وسلاسة. يتميز بشفراته المصنوعة من الفولاذ المقاوم للصدأ، مما يوفر دقة ومتانة عالية للقص. بالإضافة إلى ذلك، يتمتع بتقنية الشحن اللاسلكي، مما يسهل استخدامه بلا حواجز ويضمن تنقل مريح. يعد هذا المقص مثاليًا للاستخدام المنزلي وأيضًا للاستخدام المهني في صالونات التجميل ومحلات الحلاقة. استمتع بتجربة حلاقة مريحة ودقيقة مع مقص الشعر المحترف هذا.', 'yn-12', NULL, NULL, '2023-12-15 00:37:27', '2023-12-15 00:37:27', NULL),
(250, 101, 1, 'ماكينة حلاقة الحية', 'ماكينة حلاقة الحية', 380, 590, NULL, NULL, 1, 'available', 'ماكينة حلاقة الشعر الكهربائية المحمولة عالية الجودة والتي يمكن غسلها هي ماكينة حلاقة متعددة الوظائف بسعر مناسب. تتضمن هذه الماكينة ثلاث وظائف في جهاز واحد، حيث تعمل كماكينة حلاقة للشعر ومحفظة للأنف. تتميز بجودة عالية وتصميم محمول يسهل حملها أثناء السفر. يمكن غسلها بسهولة للحفاظ على النظافة والصحة الشخصية. توفر هذه الماكينة أداءً قويًا وفعالًا في قص الشعر وتشذيب الشعر في الأنف. إنها اختيار مثالي للأشخاص الذين يبحثون عن جهاز متعدد الاستخدامات وعالي الجودة للعناية بمظهرهم الشخصي.', 'yn54', NULL, NULL, '2023-12-15 00:47:54', '2023-12-15 00:47:54', NULL),
(251, 101, 1, 'ماكينة حلاقة المناطق الحساسة', 'ماكينة حلاقة المناطق الحساسة', 300, 500, NULL, NULL, 1, 'available', 'مشابك شعر قادين قابلة للشحن المحمولة الكهربائية من Surker هي أداة مثالية للحصول على تسريحة شعر مثالية في راحة منزلك. تتميز بتصميمها المحمول والمريح، مما يجعلها مثالية للاستخدام في السفر أو أثناء التنقل. تعمل بالبطارية القابلة للشحن، مما يوفر لك الحرية في الحركة دون الحاجة إلى توصيلها بمصدر طاقة. تتميز بشفراتها المصنوعة من الفولاذ المقاوم للصدأ، مما يضمن قوة ودقة القص. بالإضافة إلى ذلك، توفر لك تجربة قص هادئة وسلسة بفضل تقنية الاهتزاز المنخفضة. احصل على تجربة قص الشعر المهنية في المنزل مع مشابك شعر قادين قابلة للشحن المحمولة الكهربائية من Surker.', 'yn68', NULL, NULL, '2023-12-15 00:51:13', '2023-12-15 00:51:13', NULL),
(252, 101, 1, 'ماكينة حلاقة الحية', 'ماكينة حلاقة الحية', 160, 360, NULL, NULL, 1, 'available', 'المحلق الرخيص بشحن البطارية وحجم جيب Pemangkas Jenggot هو جهاز حلاقة لللحية محمول وبسيط يمكن حمله في الجيب. يعد هذا المحلق الكهربائي الصغير والمحمول حلاقة مثالية للحفاظ على لحيتك بشكل مرتب ومهذب في أي وقت وفي أي مكان. يأتي بنصلين مزدوجين لتحقيق نتائج دقيقة ومتسقة. يعمل ببطاريتي AAA ويتميز بتصميم أنيق بحجم 6 × 4.5 × 11 سم. يأتي المحلق مع عبوة لونية جذابة. هذا المنتج مثالي للاستخدام الشخصي ويمكن أن يكون أيضًا هدية رائعة للرجال الذين يهتمون بتهذيب لحيتهم بشكل منتظم.', '160', NULL, NULL, '2023-12-15 00:55:26', '2023-12-15 00:55:26', NULL),
(253, 101, 1, 'مكينة تبييض الشعر', 'مكينة تبييض الشعر', 250, 480, NULL, NULL, 1, 'available', 'مجموعة مشذب الشعر المهنية هذه هي الحلاقة المثالية للرجال. تتضمن المجموعة مقصات قوية لدفع الشعر ومشذب شعر T-Shape قابل للشحن لتحقيق تصفيف شعر مثالي. يتميز المشذب بتصميم أنيق ومريح يجعله سهل الاستخدام والتحكم. يمكن استخدامه في صالونات التجميل أو في المنزل لتصفيف وتشذيب الشعر بدقة وسهولة. صُنعت المقصات والمشذب من مواد عالية الجودة مثل الفولاذ المقاوم للصدأ والبلاستيك المتين لضمان المتانة والأداء الفائق. احصل على هذه المجموعة المميزة اليوم واستمتع بتجربة قص الشعر الاحترافية في راحة منزلك.', 'yn-80', NULL, NULL, '2023-12-15 00:58:45', '2023-12-15 00:58:45', NULL),
(254, 101, 1, 'مكينة قص الشعر الكثيف', 'مكينة قص الشعر الكثيف', 350, 560, NULL, NULL, 1, 'available', 'قصافة شعر رجالية قابلة لإعادة الشحن - أعلى مبيعاً من المصنع\r\n\r\nاحصل على قصة شعر مثالية في راحة منزلك مع قصافة الشعر الرجالية قابلة لإعادة الشحن. تم تصميمها بأحدث التقنيات لتقديم تجربة قص مريحة ودقيقة. تأتي هذه القصافة بمقبض مريح يمكن التحكم به بسهولة، مما يسمح لك بتحقيق نتائج مذهلة. تعمل ببطارية قابلة لإعادة الشحن، مما يمنحك حرية الحركة وعدم الاعتماد على الأسلاك. تتميز بشفرة حادة وقوية مصنوعة من الفولاذ، مما يعطي قصًا سلسًا ودقيقًا دون أي تهيج للبشرة. احصل على أفضل تجربة قص الشعر في المنزل مع هذه القصافة الرجالية القابلة لإعادة الشحن، واحصل على طلة رائعة في أي وقت.', 'yn-77', NULL, NULL, '2023-12-15 01:02:51', '2023-12-15 01:02:51', NULL),
(255, 101, 1, 'مكينة حلاقة الشعر  كهربائية', 'مكينة حلاقة الشعر  كهربائية', 320, 530, NULL, NULL, 1, 'available', 'مقص الشعر المتقلب Vgr V180 المهنية اللاسلكي هو منتج عالي الجودة ومتعدد الاستخدامات. يتميز بتصميم قابل للشحن يجعله مثاليًا للاستخدام في أي مكان وفي أي وقت. يتميز المقص بشفرات فولاذية مقاومة للصدأ توفر قصًا دقيقًا وسلسًا للشعر. يحتوي على تطبيقات تحكم متعددة تسمح بضبط طول القص وفقًا لتفضيلاتك الشخصية. بفضل قدرته على التشغيل لأكثر من 90 دقيقة، يمكنك الاعتماد على هذا المقص لتحقيق نتائج مذهلة بدون قلق من الانقطاع في منتصف العملية. سهل الاستخدام ومريح في اليد، فإن مقص الشعر المتقلب Vgr V180 هو الخيار الأمثل لتحقيق تسريحات شعر رائعة في المنزل أو في صالونات التجميل.', '0000', NULL, NULL, '2023-12-15 01:07:01', '2023-12-15 01:07:01', NULL),
(256, 101, 1, 'مكينة الحلاقة بطارية قوية', 'مكينة الحلاقة بطارية قوية', 350, 560, NULL, NULL, 1, 'available', 'هذا المنتج هو مشبك شعر رجالي مهني من سوكاني، وهو مشبك شعر كهربائي عالي الجودة. يتميز بتصميمه المتقن والمبتكر، ويعتبر أداة مثالية لتصفيف وتحديد الشعر بسهولة ودقة. يأتي هذا المشبك بشفرات حادة مصنوعة من الفولاذ المقاوم للصدأ، مما يوفر قصًا نظيفًا ودقيقًا دون سحب الشعر. يتمتع بمزايا إضافية مثل شحن USB ومؤشرات ضوئية LED لعرض مستوى البطارية المتبقية. يعمل هذا المشبك الكهربائي لفترة طويلة تصل إلى 180 دقيقة بفضل بطاريته سعة 2000mAh. يعتبر هذا المشبك الكهربائي مثاليًا للاستخدام المهني في صالونات التجميل أو للاستخدام الشخصي في المنزل.', 'yn43', NULL, NULL, '2023-12-15 01:10:02', '2023-12-15 15:03:29', NULL),
(257, 101, 1, 'مكينة الحلاقة منخفضة الصوت', 'مكينة الحلاقة منخفضة الصوت', 300, 520, NULL, NULL, 1, 'available', 'جهاز تشذيب الشعر الكهربائي القابل لإعادة الشحن ومنخفض الضوضاء هو منتج عالي الجودة يهدف إلى تلبية احتياجات تشذيب الشعر المهني. يأتي هذا الجهاز بتصميم محمول ومريح يتيح لك تحقيق نتائج مذهلة في راحة منزلك أو في صالون الحلاقة. يتميز بشفرات فولاذية مكربنة قابلة للغسل توفر قطعًا دقيقة وسلسة دون سحب أو جروح الجلد. يتمتع بوقت تشغيل طويل يصل إلى 90 دقيقة بعد الشحن الكامل، مما يوفر لك حرية التحرك والاستخدام المريح. كما يتميز بتقنية الشحن عبر USB لسهولة الشحن في أي وقت وفي أي مكان. احصل على هذا الجهاز الاحترافي اليوم واستمتع بتجربة تشذيب الشعر المثالية.', 'yn51', NULL, NULL, '2023-12-15 01:13:53', '2023-12-15 01:13:53', NULL),
(258, 101, 1, 'ماكينة دالينغ حلاقة الشعر', 'ماكينة دالينغ حلاقة الشعر', 500, 830, NULL, NULL, 1, 'available', 'دالينغ DL-1059 هو مقص حلاق كهربائي مهني يعمل ببطارية ليثيوم، مصمم خصيصًا لقص الشعر وحلاقته. يتميز بأداء عالي الجودة وسهولة الاستخدام. يأتي المقص بمؤشر طاقة يوضح مستوى الشحن، مما يساعدك على مراقبة حالة البطارية. يمكن شحن البطارية بسرعة في غضون 4 ساعات وتعمل لمدة تصل إلى 180 دقيقة من الاستخدام المستمر. يحتوي المقص على شفرات من الفولاذ المقاوم للصدأ تتميز بالدقة والمتانة. يأتي بتصميم أنيق باللون الأسود والخشب الحبوب، ويعد خيارًا مثاليًا للمحترفين والاستخدام المنزلي. سواء كنت ترغب في قص الشعر أو حلاقة لحية، فإن مقص الحلاقة الكهربائي DL-1059 سيقدم لك تجربة حلاقة مريحة وفعالة.', 'zw-yn18', NULL, NULL, '2023-12-15 01:17:33', '2023-12-15 01:17:33', NULL),
(259, 101, 1, 'مكينة حلاقة 6 قطع في 1', 'مكينة حلاقة 6 قطع في 1', 750, 1300, NULL, NULL, 1, 'available', 'آلة قص الشعر Kemei Km-600 الكهربائية 6 في 1 هي أداة متعددة الاستخدامات تناسب جميع احتياجات الحلاقة. تتميز بتصميم مريح وعملي يوفر قصًا سلسًا ودقيقًا للشعر. تتضمن هذه الآلة مقص الشعر وماكينة حلاقة الأنف والشعر الانتهازي، مما يمنحك القدرة على تحقيق مظهر مهني في راحة منزلك. تأتي الآلة مع شفرات فولاذية مقاومة للصدأ وقابلة للغسل، وتوفر أكثر من 90 دقيقة من وقت التشغيل المستمر. بفضل مصدر الطاقة الكهربائي والبطارية، يمكنك استخدامها في أي مكان وزمان. هذه الآلة تجمع بين الأداء الممتاز والمتانة، وهي اختيار مثالي للحصول على تجربة حلاقة مريحة ومتميزة.', 'yn-95', NULL, NULL, '2023-12-15 01:21:19', '2023-12-15 01:21:19', NULL),
(260, 101, 1, 'ماكينة حلاقة كهربائية محمولة صغيرة لاسلكية', 'ماكينة حلاقة كهربائية محمولة صغيرة لاسلكية', 350, 500, NULL, NULL, 1, 'available', 'ماكينة حلاقة كهربائية محمولة صغيرة لاسلكية Koofex هي ماكينة حلاقة فويل مصممة خصيصًا للرجال الأصلع. تعتبر هذه الماكينة محمولة وصغيرة الحجم، مما يسهل حملها واستخدامها أثناء التنقل. تأتي مع تقنية الحلاقة بالفويل لتوفير حلاقة ناعمة ومريحة، وتتميز بشفرة ثلاثية الأبعاد لضمان أداء دقيق وفعال. تعمل بالبطارية وتدعم الشحن عبر USB، مما يوفر لك الراحة والمرونة في الاستخدام. تتميز أيضًا بشاشة LCD رقمية لعرض مستوى البطارية ووقت العمل. بفضل تصميمها المقاوم للماء (IPX6)، يمكن استخدامها في الوجه والجسم وتحت الإبطين. احصل على مظهر أنيق ومتقن مع ماكينة حلاقة كهربائية محمولة صغيرة لاسلكية Koofex.', 'yn99', NULL, NULL, '2023-12-15 01:25:01', '2023-12-15 01:25:01', NULL),
(261, 101, 1, 'مكينة الحلاقة اصلية', 'مكينة الحلاقة اصلية', 900, 1600, NULL, NULL, 1, 'available', 'مقص كهربائي للشعر من ماركة Sokany9970 هو منتج عالي الجودة ومتميز في أدائه. يتميز بتصميمه الشفاف الأنيق، مما يسمح لك برؤية الشعر أثناء الحلاقة للحصول على نتائج دقيقة ومتسقة. يعمل بتقنية كهربائية لاسلكية، مما يوفر لك حرية الحركة والتنقل دون قيود. يتميز المقص بشفراته المصنوعة من الفولاذ المقاوم للصدأ، ما يجعلها قوية ومتينة وقادرة على القص الدقيق والسلس. يحتوي على بطارية مدمجة توفر وقت تشغيل طويل بدون الحاجة إلى إعادة الشحن المتكررة. بفضل جودته وسهولة استخدامه، يعد مقص Sokany9970 خيارًا مثاليًا للرجال الذين يهتمون بتصفيف وتحديث تسريحات شعرهم بأنفسهم.', 'yn102', NULL, NULL, '2023-12-15 01:29:22', '2023-12-15 01:29:22', NULL),
(262, 101, 1, 'حلاقة الشعر المتقلبة الاحترافية', 'حلاقة الشعر المتقلبة الاحترافية', 1000, 1500, NULL, NULL, 1, 'available', 'حلاقة الشعر المتقلبة المتاحة على الرابط المذكورة هي منتج مميز واحترافي لتقليم الشعر. تتميز هذه الحلاقة بتصميمها المعدني القوي والجودة العالية التي تضمن دقة ومتانة في الأداء. تعمل بالكهرباء وتتميز بقدرة قوية للتعامل مع مختلف أنماط الشعر. تأتي بلون فضي جذاب وتحتوي على مقبض مريح للتحكم السهل والدقيق. إنها مثالية للاستخدام المهني في صالونات الحلاقة وأيضًا للاستخدام الشخصي في المنزل. تأتي الحلاقة في عبوة هدية جذابة وتحمل شهادات الجودة CE و ROHS. احصل على حلاقة الشعر المتقلبة هذه اليوم واستمتع بتجربة تقليم شعر محترفة ومثالية.', 'yn104', NULL, NULL, '2023-12-15 01:32:49', '2023-12-15 01:32:49', NULL),
(263, 101, 1, 'حلاقة الشعر الكهربائية القوية', 'حلاقة الشعر الكهربائية القوية', 500, 800, NULL, NULL, 1, 'available', 'الحلاقة الكهربائية المتقدمة للشعر هي أداة قوية وعملية للرجال. تتميز بمشابك شعر قابلة للشحن وشفرة T الفولاذية المقاومة للصدأ. تم تصميمها خصيصًا لتهذيب اللحية وتحديد خطوط الشعر بدقة. تعمل بتقنية الشحن السريع وتوفر وقت تشغيل طويل يصل إلى 90 دقيقة. يمكن استخدامها في الاستخدامات التجارية والمنزلية. تحتوي على وظائف تحكم متعددة لتناسب تفضيلات الاستخدام الشخصية. تتميز بشفرة قابلة للغسل لسهولة التنظيف والصيانة. تتوفر بألوان متعددة للاختيار من بينها. تعتبر هذه الحلاقة المتقدمة أداة مثالية للرجال الذين يهتمون بتصفيف الشعر وتهذيب اللحية بشكل احترافي.', 'yn101', NULL, NULL, '2023-12-15 01:36:09', '2023-12-15 15:03:07', NULL),
(264, 100, 1, 'مجموعة تمارين اللياقة البدنية القوية', 'مجموعة تمارين اللياقة البدنية القوية', 150, 260, NULL, NULL, 1, 'available', 'تمتع بتمارين اللياقة البدنية بسهولة وكفاءة مع مجموعة تمارين اللياقة البدنية الرياضية السهلة للغاية مع فرقة تدريب القوة بحبل سحب اليوغا. تتضمن هذه المجموعة مجموعة متنوعة من الأشرطة المطاطية المقاومة التي توفر تمارين متعددة للجسم بشكل شامل. تستخدم هذه الفرقة في تمارين مثل تمارين الصدر وتمارين السحب وتمارين الساق وتمارين اليوغا والمزيد. مصنوعة من مواد عالية الجودة ومرونة فائقة، تضمن هذه الأشرطة المطاطية القوة والمتانة اللازمتين لممارسة التمارين الرياضية بكفاءة. تعتبر هذه المجموعة مناسبة لجميع مستويات اللياقة البدنية وتوفر تجربة تمرين ممتعة وفعالة في المنزل أو في الصالة الرياضية.', 'tv26', NULL, NULL, '2023-12-15 01:41:59', '2023-12-15 01:41:59', NULL),
(265, 73, 1, 'سلة الخيزران المبطنة', 'سلة الخيزران المبطنة', 80, 190, NULL, NULL, 1, 'available', 'صندوق الخيزران المبطن بالبلاستيك للتزيين هو منتج عملي وجميل يمكن استخدامه في الأماكن الخارجية لإضفاء لمسة فريدة على الديكور. يأتي هذا الصندوق في تصميم متعدد الاستخدامات يمكن استخدامه لتنظيم الأشياء وتخزينها بشكل منظم. يتميز ببناء متين من الخيزران والبلاستيك، مما يجعله متينًا ومقاومًا للعوامل الجوية. بفضل التصميم الوظيفي والأبعاد المثالية، يمكن استخدامه في النزهات والرحلات في الهواء الطلق. كما يتميز بأنه صديق للبيئة وقابل لإعادة التدوير. احصل على صندوق الخيزران المبطن بالبلاستيك لإضافة لمسة جمالية وعملية إلى ديكورك.', '012', NULL, NULL, '2023-12-15 03:00:26', '2023-12-27 01:28:12', NULL),
(266, 89, 1, 'مكنسة لأرضية', 'مكنسة لأرضية', 80, 130, NULL, NULL, 1, 'available', 'مكنسة الأرض عالية الجودة برأس مكنسة لينة ومقبض خشبي مناسبة للاستخدام المنزلي. تتميز برأس مكنسة ناعمة تصمم خصيصًا لتنظيف الأرضيات بلطف وفعالية. يوفر المقبض الخشبي قبضة مريحة وقوية للتحكم السهل أثناء التنظيف. تعد هذه المكنسة مثالية لإزالة الغبار والشوائب من الأرضيات الخشبية والبلاط والموكيت والأسطح الأخرى. بفضل جودتها العالية وتصميمها المتين، فإنها توفر أداءً متفوقًا وتدوم طويلاً. إنها أداة تنظيف أساسية لأي منزل، تجمع بين الجودة والمتانة والأداء الفعال في تنظيف الأرضيات.', '011', NULL, NULL, '2023-12-15 03:04:19', '2023-12-15 03:04:19', NULL),
(267, 102, 1, 'ناثرة الهواء السيارة المنعشة', 'ناثرة الهواء السيارة المنعشة', 30, 80, NULL, NULL, 1, 'available', 'زجاجة بلاستيكية بسعة 3 * 8 مللي تشكل ناثرة عطر مثالية للسيارة. توفر رائحة منعشة ومميزة تدوم لفترة طويلة. تستخدم لتعطير الهواء داخل السيارة وتحافظ على رائحة منعشة وممتعة أثناء القيادة. تتميز بتصميمها المدروس والعملي، فهي مثالية لتثبيتها في فتحة التهوية بسهولة. تحتوي الزجاجة على سائل عطر عالي الجودة يتم تبخيره بلطف في الهواء، مما ينشر رائحة ممتعة ومنعشة في المقصورة. إنها منتج مثالي لأولئك الذين يرغبون في تحسين تجربة القيادة وإضفاء لمسة من الانتعاش والراحة على السيارة.', 'ZH;72', NULL, NULL, '2023-12-15 03:13:43', '2023-12-15 18:31:07', NULL),
(268, 63, 1, 'غشاء تغليف الأغذية الشفاف', 'غشاء تغليف الأغذية الشفاف', 60, 100, NULL, NULL, 1, 'available', 'شفافة شريط ستريتش البلاستيك Pe غشاء تغليف هو منتج مثالي لتغليف المواد الغذائية. يتميز بجودته العالية ومرونته، مما يسمح بتمدده بسهولة حول الأطعمة المعبأة للحفاظ على النضارة والطعم. يتكون هذا الغشاء من مادة PE البلاستيكية المتينة والمقاومة للرطوبة، مما يساعد في تأمين المنتجات الغذائية من التلوث والتأثيرات الخارجية. كما يتميز بشفافيته العالية، مما يسمح لك برؤية المنتجات المعبأة بوضوح. إنه مناسب للاستخدام الصناعي والتجاري، بالإضافة إلى تغليف المواد الغذائية. يعد شفافة شريط ستريتش البلاستيك Pe غشاء تغليف حلاً مثاليًا للحفاظ على جودة وطازجة المنتجات الغذائية.', 'ZW_100M', NULL, NULL, '2023-12-15 03:25:44', '2023-12-15 03:25:44', NULL),
(269, 63, 1, 'غشاء تغليف الشفاف', 'غشاء تغليف الشفاف', 250, 450, NULL, NULL, 1, 'available', 'غشاء تغليف فيلم Alimentaire 30*300 M هو منتج عالي الجودة يستخدم لتغليف الأغذية. يتميز بمادة البولي إيثيلين منخفض الكثافة التي توفر مرونة وقابلية للتمدد، مما يجعله مثاليًا لتغليف الأطعمة والحفاظ على نضارتها وجودتها. يتميز بقوة تماسك عالية ومقاومة للرطوبة، مما يحمي الأطعمة من التلوث والتأثيرات البيئية الضارة. يمكن استخدامه في الصناعات الغذائية والمنازل والمطاعم والمتاجر للحفاظ على الأطعمة طازجة ومحمية. بفضل الشفافية العالية، يمكن رؤية المحتوى بسهولة، مما يسهل تحديد محتوى العبوة. يأتي بحجم 30 سم * 300 متر وبسمك 10 ميكرون. هذا الفيلم المثابر هو اختيارك الأمثل لتغليف الأغذية بطريقة آمنة ومريحة.', '300 CM', NULL, NULL, '2023-12-15 03:32:18', '2023-12-15 03:32:18', NULL),
(270, 63, 1, 'مغلف الألمنيوم', 'مغلف الألمنيوم', 100, 160, NULL, NULL, 1, 'available', 'مثالية للاستخدام في المطابخ المنزلية ومؤسسات التموين. تتميز هذه اللفة بجودة عالية وسماكة مناسبة تضمن تغليفًا فعالًا وحماية ممتازة للأطعمة. تستخدم في تغليف وتخزين الأطعمة وحفظها من التلف وفقدان الطعم والعناصر الغذائية. تأتي اللفة بتخصيص حجم لتلبية احتياجاتك الفردية. مصنوعة من قصدير الألومنيوم قابل لإعادة التدوير، مما يجعلها خيارًا صديقًا للبيئة. استمتع بسهولة الاستخدام والتنظيف السريع مع هذه اللفة المتينة التي تضمن الحفاظ على نضارة وجودة الأطعمة لفترة أطول. احصل على لفة الألومنيوم احباط جامبو اليوم واستمتع بتجربة تغليف طعام فعالة وسهلة.', 'ZW.50', NULL, NULL, '2023-12-15 03:37:21', '2023-12-15 03:37:21', NULL),
(271, 63, 1, 'مقشرة الخضروات المتعددة الوظائف مع تخزين', 'مقشرة الخضروات المتعددة الوظائف مع تخزين', 35, 60, NULL, NULL, 1, 'available', 'مقشرة خضروات متعددة الوظائف مع تخزين مع مقشرة فواكه هي أداة مثالية لمطبخك. تتميز بشفرة فولاذية مقاومة للصدأ تضمن قوة وتحمل عاليين. تتيح لك هذه المقشرة تقشير وتقطيع الخضروات والفواكه بكل سهولة وفعالية. بفضل وظيفتها المتعددة، يمكنك استخدامها لتقشير الجزر، الخيار، الكوسا، البطاطس وغيرها من الخضروات، بالإضافة إلى تقشير الفواكه مثل التفاح والكيوي. تأتي مع صندوق تخزين مرفق للحفاظ على الشفرات آمنة ومنظمة. تصميمها المريح وسهولة الاستخدام تجعلها أداة مثالية لتجهيز الطعام في المنزل. استمتع بالتحضير السريع والفعال مع هذه المقشرة المتعددة الوظائف.', 'TV54', NULL, NULL, '2023-12-15 03:51:59', '2023-12-15 03:51:59', NULL),
(272, 63, 1, 'صانعة العجينة السهلة', 'صانعة العجينة السهلة', 80, 130, NULL, NULL, 1, 'available', 'أداة صانعة العجينة السهلة هي أداة مثالية لصنع زلابية شهية ولذيذة بكل سهولة. تأتي هذه الأداة بقوالب مصنوعة من الفولاذ المقاوم للصدأ عالي الجودة، مما يضمن المتانة والاستدامة. تتضمن الأداة قاطعًا لعجينة الزلابية، مما يسهل عليك قص العجينة بشكل متساوٍ وسريع. كما تحتوي الأداة على مقابض مريحة تسهل التعامل والاستخدام. بفضل هذه الأداة، يمكنك صنع زلابية محشوة بالحشوة التي تفضلها بسهولة ويسر. احصل على أداة صانعة الزلابية السهلة اليوم واستمتع بصنع زلابية لذيذة في منزلك بكل سهولة ومتعة.', '013', NULL, NULL, '2023-12-15 15:02:27', '2023-12-15 15:02:27', NULL),
(273, 63, 1, 'قطاعة الثوم الذكية', 'قطاعة الثوم الذكية', 40, 70, NULL, NULL, 1, 'available', 'قطاعة بلاستيكية للثوم - عصارة ثوم\r\n\r\nقطاعة الثوم البلاستيكية هي منتج جديد ومبتكر يسهل استخدامه في مطبخك. تم تصميمها خصيصًا لتوفير وقتك وجهدك عند تقطيع الثوم. تأتي القطاعة بتصميم مريح ومصنوعة من مواد بلاستيكية عالية الجودة. تتيح لك هذه القطاعة قطع الثوم بسهولة وبدقة متناهية، بفضل شفرات حادة تقوم بتقطيع الثوم بسرعة وسهولة. بالإضافة إلى ذلك، يمكن استخدامها أيضًا كعصارة للثوم، حيث يمكنك عصر الثوم لاستخدامه في وصفاتك المفضلة. احصل على هذه القطاعة البلاستيكية للثوم العملية والعصرية واجعل تجربة قطع الثوم أكثر سهولة وفعالية في المطبخ.', '013', NULL, NULL, '2023-12-15 15:40:29', '2023-12-16 17:58:46', NULL),
(274, 63, 1, 'مقشرة فواكه يدوية إزالة سهلة', 'مقشرة فواكه يدوية إزالة سهلة', 250, 450, NULL, NULL, 1, 'available', 'مقشرة فواكه يدوية رخيصة مقشرة فاكهة البطاطس\r\n\r\nاحصل على مقشرة فواكه يدوية عالية الجودة وبأسعار معقولة. تعتبر هذه المقشرة مثالية لتقشير الفواكه والخضروات بسهولة وفعالية. تم تصميمها لتلبية احتياجات المطبخ المنزلي، وتوفر تجربة سهلة ومريحة في التعامل. مصنوعة من مواد عالية الجودة، مما يضمن المتانة والاستخدام الطويل الأمد. تتميز بتصميم مريح يسمح بالتحكم الدقيق أثناء عملية القشر. بفضل هذه المقشرة الفعالة، ستتمكن من تقشير الفواكه والخضروات بسرعة وسهولة، مما يوفر وقتًا وجهدًا في المطبخ. احصل على هذه المقشرة الرائعة الآن واستمتع بتجربة قشر مريحة وفعالة.', 'TV76', NULL, NULL, '2023-12-15 15:49:45', '2023-12-15 15:49:45', NULL),
(275, 63, 1, 'آلة تشكيل قوالب الشعبية', 'آلة تشكيل قوالب الشعبية', 150, 250, NULL, NULL, 1, 'available', 'آلة تغليف زلابية يدوية لصنع قوالب جيوزا الشعبية هي أداة ممتازة لعشاق الطهي ومحبي الطعام. تتيح لك هذه الآلة صنع قوالب الجيوزا الشهية بكل سهولة ويسر. تأتي الآلة بتصميم يدوي مريح يسمح لك بتشكيل العجينة بسرعة ودقة. تتميز بمواد عالية الجودة مع غطاء زلابية مناسب للاستخدام المنزلي. بفضل هذه الآلة، يمكنك الاستمتاع بإعداد قوالب الجيوزا الشهية في راحة منزلك، سواء لتناولها مع العائلة أو لإبهار ضيوفك في المناسبات الخاصة. احصل على هذه الآلة العملية والمفيدة اليوم واستمتع بإعداد وجبات شهية بطريقة سهلة وممتعة.', 'TV47', NULL, NULL, '2023-12-15 16:16:35', '2023-12-15 16:16:35', NULL),
(276, 110, 1, 'أداة صنع الزلابية المتداولة', 'أداة صنع الزلابية المتداولة', 100, 170, NULL, NULL, 1, 'available', '\"مطبخ 2 في 1 أداة ضغط العجين المتداول للضغط على الجلد أداة ضغط زلابية\" هي أداة مميزة لصنع الزلابية في المنزل. تتيح لك هذه الأداة العملية صنع الزلابية بسهولة وسرعة. تتكون الأداة من قوالب لضغط العجين وصنع قشور الزلابية بشكل متساوٍ ومثالي. يمكنك استخدامها في المطبخ الخاص بك لإعداد الزلابية اللذيذة بأشكال وأحجام مختلفة. تتميز بتصميم متين ومواد عالية الجودة لتوفير المتانة والاستدامة. تعتبر هذه الأداة أيضًا سهلة الاستخدام والتنظيف، مما يجعلها مناسبة للاستخدام في المنزل أو المطاعم. احصل على هذه الأداة العملية واستمتع بتحضير زلابية شهية في أي وقت.', 'TV71', NULL, NULL, '2023-12-15 16:24:50', '2023-12-16 17:58:21', NULL),
(277, 65, 1, 'ملعقة شوربة مصفاة الخشب الحبوب بمقبض من الفولاذ المقاوم للصدأ', 'ملعقة ملعقة شوربة مصفاة الخشب الحبوب بمقبض من الفولاذ المقاوم للصدأ', 70, 120, NULL, NULL, 1, 'available', 'منتج الفولاذ المقاوم للصدأ الملعقة ملعقة شوربة ملعقة مصفاة الخشب الحبوب مقبض العزل المطبخ أدوات المائدة خمسة قطعة بدلة يمكن أن يكون اسمه \"مجموعة أدوات المائدة الفولاذية المقاومة للصدأ بمقابض خشبية\"', 'TV55', NULL, NULL, '2023-12-15 16:31:06', '2023-12-15 16:31:06', NULL),
(278, 65, 1, 'معلقة الفولاذ المقاوم للصدأ', 'معلقة الفولاذ المقاوم للصدأ', 70, 120, NULL, NULL, 1, 'available', 'تيرنر مشقوق الطبيعي عالي الجودة، مصنوع من الفولاذ المقاوم للصدأ الرملي، ومزود بمقبض من الزان الخشبي. يعتبر هذا التيرنر أداة مطبخ أساسية لتحويل الأطعمة واستخدامها بسهولة وفعالية. يتميز بتصميمه المتين والمتين الذي يضمن مقاومته للتآكل والتلف. كما يتمتع بقدرة عالية على التحمل والاستخدام الطويل الأمد. بفضل مقبضه الخشبي، يوفر قبضة مريحة وقوية أثناء الاستخدام. يعد هذا التيرنر الفولاذي المقاوم للصدأ أداة مثالية للطهاة المحترفين وأيضًا للاستخدام المنزلي. احصل على التحكم والكفاءة في المطبخ مع هذا التيرنر المميز.', 'TV55', NULL, NULL, '2023-12-15 16:38:42', '2023-12-15 16:38:42', NULL),
(279, 94, 1, 'أداة العناية الصحية للبشرة واللحية والشعر', 'أداة العناية الصحية للبشرة واللحية والشعر', 40, 90, NULL, NULL, 1, 'available', 'اكتشف هذا العنصر المذهل \r\n عبارة عن أداة للعناية بالبشرة واللحية والشعر تعمل بتقنية الأسنان الدقيقة بقطر 0.3 ملم. تستخدم للوجه والجسم وتعزز نمو الشعر واللحية بفضل تحفيز الدورة الدموية في فروة الرأس. تعمل هذه الأداة على تحسين مظهر البشرة وتعزيز نمو الشعر بطريقة آمنة وفعالة. تصميمها المحمول والعملي يسمح بسهولة الاستخدام في المنزل أو أثناء التنقل. استمتع ببشرة صحية وشعر مزدهر مع هذه الأداة المبتكرة للعناية بالبشرة والشعر', 'tv18', NULL, NULL, '2023-12-15 16:41:03', '2023-12-15 16:41:03', NULL),
(280, 73, 1, 'بخاخ الصنبور المتحرك 360 درجة', 'بخاخ الصنبور المتحرك 360 درجة', 80, 180, NULL, NULL, 1, 'available', 'قطعة غيار بخاخ صنبور المطبخ، قطعة غيار رشاش المطبخ القابل للدوران 360 درجة مزودة بـ 3 فوهات لفوهات الصنبور. هذه القطعة مصممة لتحسين تجربة استخدام صنبور المطبخ وتوفير أداء ممتاز ومريح. تتميز بخاصية الدوران 360 درجة مما يسمح بالوصول السهل إلى جميع أجزاء المغسلة. بفضل الفوهات الثلاثة المتوفرة، يمكنك تحقيق تدفق المياه المناسب لاحتياجاتك المحددة. صُنعت هذه القطعة من الفولاذ المقاوم للصدأ وتم تشطيبها بالكروم لمظهر أنيق ومتين. إنها قطعة غيار عالية الجودة تضمن سهولة التركيب والاستخدام الطويل الأمد. احصل على هذه القطعة واستمتع بتجربة استخدام فعالة ومريحة لصنبور مطبخك.', 'tv-30', NULL, NULL, '2023-12-15 16:47:44', '2023-12-15 16:47:44', NULL),
(281, 82, 1, 'مدلك الرقبة الذكي', 'مدلك الرقبة الذكي', 250, 480, NULL, NULL, 1, 'available', 'يُعدّ \"الذكية الكهربائية الرقبة تدليك المنتجات\" الخيار المثالي لتخفيف الألم والاسترخاء العميق في منطقة الرقبة والكتفين. يوفر هذا المدلك التدليك بتقنية الشياتسو والاهتزاز، حيث يتم توجيه النبضات إلى الأنسجة العميقة لتخفيف التوتر والألم. يمتاز المنتج بتصميمه المحمول والمرن، مما يتيح استخدامه في أي مكان وفي أي وقت. كما يوفر ميزة التسخين لتوفير تأثير مهدئ للعضلات وتحسين تدفق الدم. يعمل بالبطارية قابلة للشحن ويتميز بوظائف توقيت مختلفة لتلبية احتياجاتك الشخصية. احصل على تجربة تدليك مريحة وفعالة مع هذا المدلك المبتكر.', 'dt-35', NULL, NULL, '2023-12-15 16:53:26', '2023-12-15 16:53:26', NULL),
(282, 94, 1, 'مزيل الوبر الكهربائي المحمول', 'مزيل الوبر الكهربائي المحمول', 130, 290, NULL, NULL, 1, 'available', 'مزيل الكتان الكهربائي المحمول والصغير هو جهاز منزلي عالي الجودة يساعدك على إزالة الوبر والشعر الغير مرغوب فيه من الملابس والأقمشة. يأتي هذا المزيل بتصميم محمول ولاسلكي، مما يجعله سهل الاستخدام والتنقل به. يعمل بشكل تلقائي، حيث يتم تشغيله بمجرد تشغيله وتمريره على سطح النسيج. بفضل قوته الكهربائية، يقوم المزيل بإزالة الوبر والشعر بشكل فعال وسريع، مما يعيد لمعان الملابس ويمنحها مظهرًا جديدًا. يعتبر مزيل الكتان الكهربائي المحمول والصغير اختيارًا مثاليًا للحفاظ على ملابسك نظيفة ومرتبة في كل مرة تستخدمها.', 'yn-07', NULL, NULL, '2023-12-15 17:01:40', '2023-12-15 17:01:40', NULL),
(283, 94, 1, 'مزيل الوبر من القماش', 'مزيل الوبر من القماش', 180, 300, NULL, NULL, 1, 'available', 'يقدم مزيل الوبر الكهربائي المحمول الوبر إزالة القماش سترة الوبر إزالة قابلة للشحن من دالينغ حلاً جديدًا واحترافيًا. يعد هذا المنتج أداة مثالية لإزالة الكرات والشعر المتراكم على الملابس والأقمشة. يتميز بتصميمه المحمول والمريح، مما يسهل حمله في أي مكان تحتاج إليه. يعمل بنظام شحن قابل للتوصيل، مما يجعله ملائمًا للاستخدام المتكرر والمستمر. يتميز بقوة عالية وأداء فعال في إزالة الوبر والشعر بسرعة وبدقة. بفضل تصميمه المتين والعملي، يعد مزيل الوبر هذا خيارًا آمنًا وموثوقًا لتحسين مظهر ملابسك والحفاظ على مظهرها الجديد والنظيف.', 'yn08', NULL, NULL, '2023-12-15 17:05:16', '2023-12-15 17:05:16', NULL),
(284, 102, 1, 'صندوق الراحة المتعدد الوظائف للسيارة', 'صندوق الراحة المتعدد الوظائف للسيارة', 120, 290, NULL, NULL, 1, 'available', 'صندوق مناديل متعدد الوظائف مخصص للسيارات خاص بحامل الأكواب\r\n\r\nيعد صندوق المناديل متعدد الوظائف هذا حلاً عمليًا ومريحًا للسيارات. يتميز بتصميمه المخصص لحامل الأكواب في السيارة، مما يوفر لك سهولة الوصول إلى المناديل والمشروبات في الوقت نفسه. بفضل مواده البلاستيكية عالية الجودة، يتميز بالمتانة والصلابة، مما يضمن استخدامه لفترة طويلة دون تلف. يأتي بحجم مثالي يناسب المسند الأمامي للسيارة، ويمكن وضعه بسهولة وثبات على مقعد السيارة. بفضل تصميمه العصري والعملي، يضفي صندوق المناديل الوظيفية هذا لمسة من الأناقة والتنظيم على داخل سيارتك. احصل عليه الآن واستمتع براحة وسهولة الوصول إلى المناديل والمشروبات أثناء القيادة.', 'tv-33', NULL, NULL, '2023-12-15 17:11:02', '2023-12-15 18:25:58', NULL),
(285, 63, 1, 'آلة صنع القوالب اليدوية متعددة الوظائف', 'آلة صنع القوالب اليدوية متعددة الوظائف', 70, 120, NULL, NULL, 1, 'available', 'آلة صنع بالضغط اليدوي 2 في 1 هي آلة متعددة الوظائف تعمل بواسطة آلة إمباندا. تستخدم هذه الآلة في صنع القوالب اليدوية بواسطة الضغط اليدوي. تتميز بجودة تصنيع عالية ومواد غذائية صديقة للبيئة. تستخدم في صنع الحبوب والمساحيق والأقراص الصغيرة بسهولة وفعالية. تأتي معها مجموعة متنوعة من الألوان للاختيار من بينها. تعد هذه الآلة مثالية للاستخدام المنزلي أو التجاري. بفضل تصميمها المدمج والمريح، يمكنك استخدامها بسهولة وتخزينها بشكل مريح. إنها خيار مثالي للأشخاص الذين يرغبون في صنع المنتجات اليدوية بجودة عالية وكفاءة عالية.', 'TV55', NULL, NULL, '2023-12-15 17:52:12', '2023-12-15 17:52:12', NULL),
(286, 65, 1, 'ملقط الخمس اصابع', 'ملقط الخمس اصابع', 75, 130, NULL, NULL, 1, 'available', 'جميع الأدوات مصنوعة من الفولاذ المقاوم للصدأ عالي الجودة، مما يجعلها متينة ومقاومة للصدأ. تصميمها العصري يضفي لمسة أنيقة على مطبخك. إنها مناسبة للاستخدام في المناسبات الخاصة مثل الزفاف، ويمكن استخدامها أيضًا في الاستخدام اليومي. بفضل هذه الأدوات، يمكنك التعامل بسهولة مع العديد من الأطعمة مثل السلطة، والكعك، والخبز. إنها مجموعة عملية وعصرية تضيف قيمة لمطبخك وتسهل تحضير وتقديم الطعام بكل أناقة', '014', NULL, NULL, '2023-12-15 17:57:52', '2023-12-15 17:57:52', NULL),
(287, 63, 1, 'سلة التصفية المعدنية', 'سلة التصفية المعدنية', 100, 150, NULL, NULL, 1, 'available', 'صفيحة تصفية من الفولاذ المقاوم للصدأ القابلة لإعادة الاستخدام، تعتبر حلاً مثاليًا للمطابخ وأعمال التصفية. تتميز هذه السلة بجودتها العالية ومتانتها الفائقة بفضل استخدام المواد المعدنية عالية الجودة. تساعدك هذه السلة في تصفية الأطعمة والسوائل بسهولة وفعالية، مما يسهم في تحسين نتائج عملية التصفية. تتميز بتصميمها الحديث البسيط واللون الفضي الأنيق، مما يضفي لمسة جمالية على مطبخك. تستخدم في المنازل والمطاعم على حد سواء، وتعتبر اختيارًا مثاليًا للمحترفين والهواة في عالم الطهي. استمتع بالتصفية الفعالة والاستدامة مع هذه السلة المصنوعة من الفولاذ المقاوم للصدأ', 'CF56', NULL, NULL, '2023-12-15 18:02:37', '2023-12-15 18:02:37', NULL),
(288, 65, 1, 'مجموعة سكاكين الجبن', 'مجموعة سكاكين الجبن', 60, 100, NULL, NULL, 1, 'available', 'تتميز مجموعة سكاكين الجبن ذات اللون التيتانيوم الذهبي بأنها صديقة للبيئة وعصرية في التصميم. تتضمن المجموعة سكاكين مفيدة لتقطيع وتقديم الجبن، بما في ذلك سكين زبدة الجبن وقطاعة الجبن وسكاكين صغيرة. صُنعت هذه السكاكين من الفولاذ المقاوم للصدأ عالي الجودة، مما يجعلها متينة ومقاومة للتآكل. تتميز بلون ذهبي مطلي بالتيتانيوم، مما يمنحها مظهرًا فريدًا وجذابًا. تعتبر هذه المجموعة مثالية للاستخدام في المطاعم والفنادق والمنازل. استمتع بقطع الجبن بأناقة ودقة باستخدام هذه المجموعة الجميلة والعملية.', '015', NULL, NULL, '2023-12-15 18:09:32', '2023-12-15 18:09:32', NULL),
(289, 63, 1, 'علبة طعام قوس قزح', 'علبة طعام قوس قزح', 140, 240, NULL, NULL, 1, 'available', 'تتميز علبة الطعام قوس قزح البلاستيكية الشفافة PP بخصائص فريدة تجعلها الاختيار المثالي لتخزين الطعام. صُنعت هذه العلبة من مادة PP عالية الجودة، مما يجعلها آمنة للاستخدام في الميكروويف. تأتي العلبة في مجموعة مكونة من 5 أحجام مختلفة، بحيث يمكنك تخزين مختلف أنواع الطعام والوجبات بسهولة. تتميز بتصميم حديث وجذاب، وتأتي بألوان قوس قزح المشرقة التي تضفي لمسة من البهجة على مطبخك. بفضل خاصية إعادة التدوير والصديقة للبيئة، فإن علبة الطعام قوس قزح البلاستيكية الشفافة PP هي الخيار المثالي للحفاظ على طعامك طازجًا ومنظمًا في المنزل أو أثناء التنقل.', 'JH55', NULL, NULL, '2023-12-15 18:13:57', '2023-12-15 18:13:57', NULL),
(290, 63, 1, 'علبة طعام بينتو المتعددة الاستخدامات', 'علبة طعام بينتو المتعددة الاستخدامات', 100, 170, NULL, NULL, 1, 'available', 'هذه المنتجات هي علب طعام بينتو قابلة لإعادة الاستخدام، مصنوعة من البلاستيك المقسم بثلاث مقصورات. تصميمها المحمول يجعلها مثالية لحمل الغذاء أثناء التنقل، سواء في العمل أو المدرسة أو الرحلات. تتميز بجودة عالية ومتانة، مما يضمن استخدامها الطويل الأمد. تأتي مع غطاء آمن للحفاظ على الطعام طازجًا ومحمولًا بشكل آمن. تعد هذه العلبة المقسمة مثالية لفصل الأطعمة المختلفة والحفاظ على تناولها بشكل منظم. بفضل سعتها الكبيرة، يمكن وضع مجموعة متنوعة من الأطعمة في المقصورات المختلفة. إنها خيار مثالي لمن يهتمون بتناول وجبات صحية ومنظمة في أي وقت وفي أي مكان.', 'JH188', NULL, NULL, '2023-12-15 18:18:09', '2023-12-15 18:18:09', NULL);
INSERT INTO `products` (`id`, `subcategory_id`, `supplier_id`, `unit_name`, `pack_name`, `purchasing_price`, `unit_price`, `pack_price`, `pack_units`, `unit_type`, `status`, `description`, `code_supplier`, `code_bar`, `file`, `created_at`, `updated_at`, `deleted_at`) VALUES
(291, 77, 1, 'مشبك القماش الملون المتعدد الاستخدامات', 'مشبك القماش الملون المتعدد الاستخدامات', 20, 40, NULL, NULL, 1, 'available', 'مشبك قماش بلاستيكي ملون عالي الجودة، يعد هذا المشبك المنتج الجديد خيارًا مثاليًا للاستخدام المتعدد. مصنوع من البلاستيك عالي الجودة، مما يجعله قويًا ومتينًا للاستخدام اليومي. يتميز بتصميم متعدد الوظائف يناسب العديد من الاحتياجات، حيث يمكن استخدامه في الحقائب، والفراش، والأدوات، والحمام، والمعطف والكاب، والسفر، والغذاء، والملابس، والتنظيف، والشرب/الطعام، والمشروبات، والأحذية. يأتي بألوان متنوعة وتصميم جذاب يضيف لمسة من الحيوية والأناقة إلى منتجاتك. سواء كنت في حاجة إلى تنظيم الملابس أو تثبيت الأشياء في مكانها، فإن هذا المشبك البلاستيكي سيكون خيارًا مثاليًا لك.', '015', NULL, NULL, '2023-12-15 18:33:08', '2023-12-15 18:33:08', NULL),
(292, 63, 1, 'وعاء الفطيرة مكون من10 اطباق', 'وعاء الفطيرة مكون من 10 اطباق', 70, 120, NULL, NULL, 1, 'available', 'جولة فطيرة المقالي 6 بوصة وعاء من ورق القصدير (الفويل) مربع البحر الغذاء الصف مشوي المتاح. هذا المنتج عبارة عن وعاء فطيرة مصنوع من ورق القصدير (الفويل) عالي الجودة بحجم 6 بوصة. يتميز بتصميمه المستدير والعملي لاستيعاب الفطائر والمقبلات بشكل مثالي. يمكن استخدامه في المناسبات المنزلية والأحداث التجارية لتقديم الأطباق المشوية والكيك والفطائر. يتميز بخصائصه العالية، حيث يتحمل درجات الحرارة العالية ويحافظ على التوزيع المتساوي للحرارة لضمان طهي مثالي. كما أنه متاح بتصميم مشوي مزخرف يعزز جاذبيته البصرية. منتج آمن للاستخدام الغذائي وسهل التخزين والتنظيف', 'CL56', NULL, NULL, '2023-12-15 18:40:49', '2023-12-15 18:40:49', NULL),
(293, 63, 1, 'بطانة ورقية مكون من 50 ورقة', 'بطانة ورقية مكون من 50 ورقة', 70, 120, NULL, NULL, 1, 'available', 'بطانة ورقية قابلة للتصرف بقياس 6.3 × 7.9 بوصة، تستخدم للفرايات الهوائية والخبز، مصنوعة من الورق العالي الجودة والسميك لضمان أداء ممتاز في عملية الطهي. تأتي هذه البطانة بكميات تبدأ من 50 قطعة إلى 100 قطعة، مما يجعلها خيارًا مثاليًا للاستخدام المنزلي والتجاري. تتميز بطانة الورق بمرونة وقوة تحمل عالية، كما أنها سميكة بما يكفي لمنع التسرب والالتصاق. تتميز بخصائص صديقة للبيئة وقابلية للتحلل، مما يجعلها خيارًا مستدامًا وصديقًا للبيئة. احصل على راحة البال والسهولة في الطهي مع بطانة الورق القابلة للتصرف هذه، المثالية لتعبئة الطعام وتحقيق نتائج مثالية في المطبخ.', 'CL55', NULL, NULL, '2023-12-15 19:09:02', '2023-12-26 17:31:20', NULL),
(294, 65, 1, 'عجلة القاطع بيتزا', 'عجلة القاطع بيتزا', 70, 120, NULL, NULL, 1, 'available', 'عجلة القاطع بيتزا من الفولاذ المقاوم للصدأ 18/0 - احصل على هذا المنتج عالي الجودة لمطبخك الآن! تم تصميمها بعناية لتوفر لك تجربة قطع سلسة وفعالة للبيتزا والمعجنات. مصنوعة من الفولاذ المقاوم للصدأ 18/0، مما يمنحها متانة وصلابة عالية. تتميز بشفرة حادة وقوية تقوم بقطع البيتزا بسهولة ودقة. تتمتع بحجم مناسب ومقبض مريح يوفر قبضة آمنة وسهلة الاستخدام. منتج فعال وعملي يجعل تقطيع البيتزا مهمة سهلة وممتعة. احصل على عجلة القاطع بيتزا من الفولاذ المقاوم للصدأ 18/0 اليوم واستمتع بتجربة تقطيع البيتزا السلسة والمثالية.', '60', NULL, NULL, '2023-12-15 19:15:05', '2023-12-15 19:15:05', NULL),
(295, 63, 1, 'علبة الغداء المعدنية المتعددة الطبقات', 'علبة الغداء المعدنية المتعددة الطبقات', 120, 180, NULL, NULL, 1, 'available', 'علبة الغداء بتصميم البينتو ذات الطبقتين والمصنوعة من الفولاذ المقاوم للصدأ هي حل مثالي لتخزين وحمل وجبات الطعام بشكل آمن ومنظم. تتميز بتصميم متعدد الوظائف يتضمن طبقتين توفر مساحة كافية لوضع أنواع مختلفة من الأطعمة والوجبات، مما يسهل الفصل بينها ويحافظ على نكهتها الأصلية. مصنوعة من مواد ذات جودة عالية، حيث تتكون العلبة من الفولاذ المقاوم للصدأ والبولي بروبيلين، مما يجعلها متينة وآمنة للاستخدام. تتميز بحجم مدروس يجعلها مثالية للتخزين في حقيبة الظهر أو الحقيبة العملية. هذه العلبة العملية والأنيقة هي رفيقك المثالي لتناول الوجبات في العمل أو المدرسة أو أثناء التخييم.', 'ZA18', NULL, NULL, '2023-12-15 19:21:27', '2023-12-27 01:04:45', NULL),
(296, 63, 1, 'رف تخزين أطباق المطبخ المتعدد الطبقات', 'رف تخزين أطباق المطبخ المتعدد الطبقات', 350, 650, NULL, NULL, 1, 'available', 'رف تخزين أطباق المطبخ للبيع بالجملة Cxt671 هو رف عملي ومتعدد الوظائف لتخزين أدوات المائدة. يتميز بتصميم طبقتين مزدوجة توفر مساحة وفيرة لتنظيم وتخزين الأطباق والأدوات المختلفة. يتميز بوجود رف تصريف متكامل يسمح بتصريف الماء بسهولة وتجفيف الأطباق بشكل فعال. مصنوع من مواد عالية الجودة لتوفير المتانة والاستدامة. يتميز بتصميم أنيق وعصري يضفي لمسة جمالية على المطبخ. مناسب للاستخدام في المنازل والمطاعم والمكاتب والفنادق وغيرها. هذا الرف هو الحل الأمثل لتنظيم وتخزين أطباق المطبخ بأسلوب منظم وفعال.', 'CF16', NULL, NULL, '2023-12-15 19:28:30', '2023-12-15 19:28:30', NULL),
(297, 87, 1, 'حامل معجون الأسنان', 'حامل معجون الأسنان', 65, 195, NULL, NULL, 1, 'available', 'تقدم لك هذه التجهيزات المتعددة الوظائف مجموعة كاملة من منتجات الحمام المبتكرة والعملية. يتضمن هذا المنتج المذهل موزعًا آليًا لمعجون الأسنان وحاملًا لفرشاة الأسنان ورفًا مركبًا على الحائط. بفضل هذه الميزات الرائعة، يمكنك الاستمتاع بتخزين معجون الأسنان وفرشاة الأسنان وأدوات الحمام الأخرى بشكل منظم ومرتب في الحمام الخاص بك. يتميز التصميم بالبلاستيك عالي الجودة والمتانة، وهو سهل التركيب على الحائط. إنها خيار مثالي لتحسين منظر الحمام الخاص بك وتوفير مساحة قيمة. احصل على هذا المنتج العملي اليوم واستمتع بتجربة حمام أكثر راحة وتنظيمًا.', 'tv03', NULL, NULL, '2023-12-15 19:28:30', '2023-12-15 19:28:30', NULL),
(298, 87, 1, 'فرشاة أسنان الذكية', 'فرشاة أسنان الذكية', 150, 400, NULL, NULL, 1, 'available', 'تعتبر فرشاة الأسنان الكهربائية المهنية بالموجات الصوتية منتجًا مبتكرًا وفعالًا للعناية بصحة الفم. تتميز الفرشاة بتقنية الأمواج الصوتية التي تقدم تنظيفًا عميقًا وفعالًا للأسنان واللثة. توفر الفرشاة ستة طرق لحماية اللثة، مما يساعد في الوقاية من الالتهابات والتهابات اللثة. كما أنها قابلة للشحن، مما يوفر الراحة والاستخدام المستمر. تأتي الفرشاة بثلاثة خيارات لونية مختلفة للاختيار من بينها. بفضل تصميمها المقاوم للماء، يمكن استخدامها أثناء الاستحمام أو تنظيفها بسهولة. احصل على فرشاة الأسنان الكهربائية هذه واستمتع بابتسامة صحية ونظيفة بكل ثقة.', 'tv95', NULL, NULL, '2023-12-15 19:32:26', '2023-12-15 19:32:26', NULL),
(299, 70, 1, 'مدفأة الهواء الكهربائية المحمولة', 'مدفأة الهواء الكهربائية المحمولة', 300, 650, NULL, NULL, 1, 'available', 'الغرفة الكهربائية الشخصية بتصميم جديد ساخنة مع جدار صغير محمولة للمنزل هي منتج عالي الجودة يوفر تدفئة فعالة ومريحة في المنزل. تعمل هذه المدفأة الكهربائية على توفير تدفئة سريعة وقوية، مما يساعد في إبقاء الغرفة دافئة ومريحة في أيام الشتاء الباردة. بفضل حجمها الصغير وتصميمها المحمول، يمكن وضعها بسهولة في أي غرفة ترغب في تسخينها، سواء في المنزل أو المكتب. كما يتميز هذا الجهاز بوجود تحكم عن بُعد ووظيفة ترموستات قابلة للضبط، مما يتيح لك ضبط درجة الحرارة المثالية والاستمتاع بالراحة والدفء اللازمين في الغرفة.', 'jf106', NULL, NULL, '2023-12-15 19:36:01', '2023-12-15 19:36:01', NULL),
(300, 66, 1, 'إبريق العصير الشفاف المتين', 'إبريق العصير الشفاف المتين', 150, 230, NULL, NULL, 1, 'available', 'إبريق عصير بلاستيكي شفاف متين لتر مع 4 أكواب\r\n\r\nاستمتع بتجربة تناول العصائر والمشروبات بأريحية مع إبريق العصير البلاستيكي ذو السعة اللتر والذي يأتي مع 4 أكواب. يتميز هذا الإبريق بتصميمه الشفاف الذي يسمح لك بالاستمتاع بمشاهدة العصير أو المشروبات الأخرى بوضوح. صُنع الإبريق من مواد بلاستيكية متينة تضمن متانة وطول العمر الافتراضي. يعتبر هذا المنتج مثاليًا للاستخدام في المنزل أو أثناء التخييم أو السفر. كما يمكن استخدامه كهدية مميزة للأحباء. احصل على إبريق العصير البلاستيكي شفاف المتين مع 4 أكواب الآن واستمتع بتجربة تناول المشروبات بأناقة وراحة.', 'CL38', NULL, NULL, '2023-12-15 19:36:32', '2023-12-16 17:57:19', NULL),
(301, 63, 1, 'مجموعة لتخزين المواد الغذائية', 'مجموعة لتخزين المواد الغذائية', 80, 130, NULL, NULL, 1, 'available', 'طقم حاويات مستديرة من زجاج المطبخ هو منتج عالي الجودة ومفيد لتخزين وتنظيم المواد الغذائية في المطبخ. يتكون هذا الطقم من حاويات مستديرة مصنوعة من زجاج فائق الجودة، مما يضمن المتانة والشفافية. تأتي الحاويات بأحجام متنوعة لتناسب احتياجات التخزين المختلفة. يمكن استخدامها لتخزين الأطعمة المجففة، البهارات، الشاي، القهوة، وغيرها. تأتي مع أغطية خشبية تعزز إحكام الإغلاق وتحمي المحتوى من الرطوبة والروائح الخارجية. بفضل تصميمها المتين والعملي، فإن هذا الطقم المستدير من حاويات زجاج المطبخ هو اختيار مثالي لتحسين تنظيم وتخزين مستلزمات المطبخ الخاصة بك.', 'CL60', NULL, NULL, '2023-12-15 19:40:41', '2023-12-15 19:40:41', NULL),
(302, 70, 1, 'مروحة الشتاء المحمولة', 'مروحة الشتاء المحمولة', 400, 700, NULL, NULL, 1, 'available', 'تأتي مدفأة الشتاء المحمولة سطح المكتب الرأسي والأفقي المزدوج الغرض بسرعتين للرياح وتكملة الصوت المنخفضة الضوضاء لتوفير الراحة والدفء في فصل الشتاء. تعد هذه المدفأة الكهربائية الشتوية المحمولة حلاً مثاليًا لمكاتب العمل أو المنازل، حيث يمكن وضعها على الطاولة أو التثبيت على الحائط. تتميز بطريقتي تدفئة مختلفتين، الرأسية والأفقية، لتوزيع الحرارة بشكل متساوٍ في الغرفة. بفضل وظيفة التحكم عن بُعد، يمكنك ضبط درجة الحرارة وسرعة الرياح بسهولة. تصميمها المدمج والعصري يجعلها محمولة وسهلة الاستخدام وتوفر أداءً موثوقًا وآمنًا. احصل على هذه المدفأة الكهربائية المحمولة واستمتع بشتاء دافئ ومريح.', 'jf104', NULL, NULL, '2023-12-15 19:41:05', '2023-12-15 19:41:05', NULL),
(303, 66, 1, 'حاويات البلاستيك', 'حاويات البلاستيك', 130, 190, NULL, NULL, 1, 'available', 'حاويات البلاستيك المتميز تأتي الحاويات بأنواع مختلفه يمكن استخدامها لتخزين لأطعمة المجففة', 'CL59', NULL, NULL, '2023-12-15 19:44:54', '2023-12-15 19:44:54', NULL),
(304, 77, 1, 'قاعدة الغسالة المحمولة مع العجلات القابلة للقفل', 'قاعدة الغسالة المحمولة مع العجلات القابلة للقفل', 250, 430, NULL, NULL, 1, 'available', 'وحدة الحامل المحمولة للغسالة والمجفف هذه تتميز بقدمين بتعديل ارتفاع يصل إلى 2 قدم وعجلات قابلة للقفل. تم تصميمها خصيصًا لتكون قاعدة متحركة للأثاث والأجهزة المنزلية مثل الغسالات والمجففات. توفر هذه الوحدة الاستقرار والقوة للأجهزة الثقيلة وتجعل من السهل نقلها وتحريكها داخل المنزل. تعمل العجلات القابلة للقفل على تأمين الوحدة في مكانها ومنعها من الانزلاق أثناء الاستخدام. بفضل التصميم القوي والقابلية للتعديل في الارتفاع، فإن هذه الوحدة توفر الراحة والمرونة في استخدام الغسالة والمجفف في المنزل.', 'tv72', NULL, NULL, '2023-12-15 19:56:32', '2023-12-15 19:56:32', NULL),
(305, 103, 1, 'مطحنة بن كهربائية', 'مطحنة بن كهربائية', 380, 680, NULL, NULL, 1, 'available', 'مطحنة بن كهربائية آلة 150 واط وسعة 300 مللي من الفولاذ المقاوم للصدأ. تعتبر هذه المطحنة المنزلية المحمولة مثالية لعشاق القهوة. تتميز بتصميمها العصري والمدمج، مما يجعلها سهلة الاستخدام والتخزين. تتيح لك المطحنة الكهربائية القوية طحن حبوب البن بسرعة وكفاءة، مما يضمن الحصول على قهوة طازجة ومذاق رائع في كل مرة. يمكنك ضبط درجة الطحن وفقًا لتفضيلاتك، سواء كنت ترغب في الحصول على قهوة ناعمة أو خشنة. بفضل جودة الفولاذ المقاوم للصدأ، تعد هذه المطحنة متينة ومتينة، وستستمتع بأدائها المتفوق لفترة طويلة. تجربة قهوة متميزة تنتظرك مع هذه المطحنة الكهربائية المحمولة.', 'xjd-91', NULL, NULL, '2023-12-15 20:06:26', '2023-12-15 20:06:26', NULL),
(306, 68, 1, 'كوب الخلط الكهربائي', 'كوب الخلط الكهربائي', 250, 480, NULL, NULL, 1, 'available', 'كوب الخلط الكهربائي الدوّار الكسول هو منتج مبتكر يمنحك تجربة مميزة في تحضير المشروبات. يتميز الكوب بتصميمه الذكي والعملي، حيث يحتوي على آلية دوّارة تقوم بخلط المشروبات بشكل تلقائي. يمكن استخدامه لخلط مسحوق البروتين، قهوة الصباح، أو أي مشروب آخر تود تحضيره. مصنوع من الفولاذ المقاوم للصدأ عالي الجودة، مما يجعله متينًا وصحيًا للاستخدام اليومي. يعمل بواسطة الكهرباء ويتم تشغيله ببساطة عن طريق الضغط على زر التشغيل. يعد كوب الخلط الكهربائي الدوّار الكسول خيارًا مثاليًا للأشخاص الذين يهتمون بسهولة التحضير والراحة في تحضير المشروبات.', '0000', NULL, NULL, '2023-12-15 20:10:52', '2023-12-15 20:10:52', NULL),
(307, 103, 1, 'ماكينة القهوة والشاي اللاسلكية الذهبية', 'ماكينة القهوة والشاي اللاسلكية الذهبية', 600, 860, NULL, NULL, 1, 'available', 'ماكينة القهوة والشاي اللاسلكية هذه هي طريقة جديدة ومتطورة لتحضير القهوة التركية والشاي. تتميز بتصميم فريد وعصري يتضمن وعاءً لصنع القهوة التركية ووعاءً لصنع الشاي. تعمل بتقنية اللاسلكية، مما يعني أنها لا تحتاج إلى وصلة كهربائية ويمكن استخدامها في أي مكان ترغب فيه. تتميز بقوة 600 واط وسعة تصل إلى 500 كوب، مما يتيح لك تحضير كمية كبيرة من المشروبات بسرعة وسهولة. كما تتميز بنظام تحكم في درجة الحرارة وتوفر خدمة واحدة لتلبية احتياجاتك المختلفة. صُممت هذه الماكينة لتكون مثالية للاستخدام في الفنادق والمطاعم والمنازل والمكاتب.', 'xjd-99', NULL, NULL, '2023-12-15 20:23:09', '2023-12-15 20:23:09', NULL),
(308, 103, 1, 'وعاء القهوة التركية الكهربائي المصغر', 'وعاء القهوة التركية الكهربائي المصغر', 200, 390, NULL, NULL, 1, 'available', 'وعاء صغير ممتاز 0.3 لتر من البلاستيك لجسم الطعام والغلاية الكهربائية ووعاء صنع قهوة تركي للمنزل والفندق هو منتج عالي الجودة ومتعدد الاستخدامات. يتميز بتصميم صغير الحجم وسعة 0.3 لتر، مما يجعله مثالياً للمنزل والفندق والرحلات. يتميز الوعاء بجسم مصنوع من البلاستيك ذات جودة عالية وآمن للطعام. يحتوي على غلاية كهربائية لسرعة التسخين وتحضير المشروبات بسهولة وراحة. يمكن استخدامه أيضًا لصنع القهوة التركية التقليدية بمذاقها الغني والمميز. هذا المنتج يوفر لك تجربة استخدام عملية ومريحة، وهو مناسب لكل محبي القهوة والشاي.', 'xjd67', NULL, NULL, '2023-12-15 20:27:22', '2023-12-15 20:27:22', NULL),
(309, 68, 1, 'عصارة الحمضيات الكهربائية القوية', 'عصارة الحمضيات الكهربائية القوية', 350, 520, NULL, NULL, 1, 'available', 'عصارة حمضيات كهربائية عالية الجودة تعد هذه العصارة المثالية لاستخراج عصير الليمون والبرتقال بسهولة وفعالية. تتميز بتصميم متطور وأداء ممتاز، حيث تعمل بقوة 40 واط وجهاز تحكم كهربائي للاستخدام المريح. تتميز بوظيفة منخفضة الضوضاء، مما يجعل تحضير العصائر صامتًا ومريحًا. تأتي بشفرات مصنوعة من الفولاذ المقاوم للصدأ لضمان استخراج كامل للعصير من الفواكه. توفر سعة 0.7 لتر، مما يسمح بإعداد كمية كافية من العصير في وقت واحد. تعتبر هذه العصارة الكهربائية المصغرة العصارة المثالية للاستخدام المنزلي وتضيف لمسة من الطازجة والصحة في روتينك اليومي.', 'xjd34', NULL, NULL, '2023-12-15 20:30:59', '2023-12-15 20:30:59', NULL),
(310, 103, 1, 'مشبك تهوية تكييف الهواء في السيارة', 'مشبك تهوية تكييف الهواء في السيارة', 70, 160, NULL, NULL, 1, 'available', 'يعد مشبك مخرج تكييف الهواء في السيارة من أكسسوارات السيارات ذو أهمية كبيرة للحفاظ على نظام التهوية في سيارتك بأفضل حالاته. يتميز هذا المنتج بتصميمه المتطور وقاعدته المختلفة التي تتوافق مع مختلف أنواع السيارات. يتم تثبيته بسهولة على فتحة تهوية السيارة، مما يتيح لك توجيه تدفق الهواء بشكل مثالي وفقًا لتفضيلاتك. يتميز بمرونة دوران 360 درجة لضمان توجيه الهواء بالاتجاه المطلوب. يعد هذا المشبك مثاليًا لتركيب هواتف السيارات أو حاملات الجوالات، وهو منتج لا غنى عنه لمحبي السفر والاستمتاع بتجربة قيادة مريحة ومرتبة.', '0000', NULL, NULL, '2023-12-15 20:34:07', '2023-12-15 21:28:20', NULL),
(311, 65, 1, 'رف تجفيف الصحون المعدني المزدوج', 'رف تجفيف الصحون المعدني المزدوج', 550, 900, NULL, NULL, 1, 'available', 'رف تجفيف الصحون بتصميم عصري وعملي، مصنوع من الفولاذ المقاوم للصدأ عالي الجودة. يأتي هذا الرف مع حامل صحون مزدوج وصينية صرف مدمجة لتوفير مساحة إضافية لتجفيف الصحون والأواني. يوفر تصميمه المتعدد الطبقات مساحة كافية لتجفيف العديد من الصحون والأكواب في نفس الوقت. يعتبر هذا الرف مثاليًا للاستخدام في المطابخ المنزلية والمطاعم والمكاتب، حيث يوفر تنظيمًا فعالًا وتجفيفًا سريعًا للأواني المبللة. بفضل تصميمه المتين ومقاومته للصدأ، ستستمتع بالاستخدام الطويل الأمد لهذا الرف دون الحاجة إلى التغيير المتكرر. كما يتميز بسهولة التركيب والتخزين المريح، مما يجعله خيارًا مثاليًا لتجفيف الصحون بكفاءة وأناقة.', 'CF-44', NULL, NULL, '2023-12-15 21:01:30', '2023-12-15 21:45:52', NULL),
(312, 65, 1, 'حزمة ملاعق صغيرة يدوية', 'حزمة ملاعق صغيرة يدوية', 30, 60, NULL, NULL, 1, 'available', 'وملعقة الطعام الملكية المزخرفة، مما يضفي لمسة ملكية على تجربة تناول الطعام. تصميمها الجميل يجمع بين الفولاذ المقاوم للصدأ عالي الجودة وقاعدة الخيزران اليدوية، مما يخلق توازنًا رائعًا بين الأناقة والوظائف العملية. إنها مثالية للاستخدام في المنزل أو المطعم أو حفلات الزفاف. هذه القلادة توفر لك تجربة تناول الطعام ذات طابع راقي ومميز، وتعد خيارًا مثاليًا لهدية مميزة وملفتة للأنظار.', '016', NULL, NULL, '2023-12-15 21:31:06', '2023-12-15 21:31:06', NULL),
(313, 65, 1, 'مغرفة لآيس كريم', 'مغرفة لآيس كريم', 60, 120, NULL, NULL, 1, 'available', 'مغرفة الآيس كريم الجديدة الأكثر مبيعًا، مغرفة البسكويت، مغرفة الخبز من الفولاذ المقاوم للصدأ. هذه المغرفة مصنوعة من الفولاذ المقاوم للصدأ عالي الجودة وتتميز بتصميم عصري وعملي لتلبية احتياجاتك المطبخية. تعد هذه المغرفة مثالية لتقديم الآيس كريم اللذيذ، والبسكويت الطازج، والخبز اللذيذ. توفر لك مقبضًا مريحًا لسهولة الاستخدام والتحكم الدقيق. بفضل موادها المستدامة والقوية، فإنها تعد أداة متينة وتدوم طويلاً. احصل على مغرفة الآيس كريم هذه اليوم واستمتع بتجربة تقديم الحلويات بأناقة وسلاسة.', '017', NULL, NULL, '2023-12-15 21:36:18', '2023-12-15 21:36:18', NULL),
(314, 63, 1, 'شعلة المقاومة لأرياح', 'شعلة المقاومة لأرياح', 40, 80, NULL, NULL, 1, 'available', 'شعلة البيوتان صانعة شعلة أتوماتيكية اشتعال صغيرة للشواء ولاعة البيوتان للتخييم هي أداة متعددة الاستخدامات وعملية للاستخدام في الشواء والتخييم والطهي المنزلي. تتميز بتصميم صغير الحجم ومحمول يسهل حملها واستخدامها في أي مكان. تأتي مع نظام أتوماتيكي للاشتعال بزر واحد، مما يجعلها سهلة الاستخدام وآمنة للاستخدام. يمكن استخدامها لتوليد شعلة قوية وثابتة لإشعال النار وتسخين الأطعمة والمشروبات بسرعة. مصنوعة من مواد عالية الجودة تضمن المتانة والاستدامة. إن شعلة البيوتان صانعة شعلة أتوماتيكية اشتعال صغيرة للشواء ولاعة البيوتان للتخييم هي رفيق مثالي لكل من محبي الشواء ومحبي التخييم والرحلات في الهواء الطلق', '017', NULL, NULL, '2023-12-15 21:44:48', '2023-12-15 23:01:59', NULL),
(315, 104, 1, 'طنجرة اللطهي', 'طنجرة اللطهي', 320, 520, NULL, NULL, 1, 'available', 'وعاء الطهي للمطبخ باخرة هو جزء أساسي في أطقم طهي الأواني الأكثر مبيعًا. يتميز هذا الوعاء بتصميمه الحديث والعصري، وهو مصنوع من مواد عالية الجودة لضمان المتانة والأداء الممتاز في المطبخ. يتميز بطلاء غير قابل للالتصاق للطهي الصحي والسهل التنظيف. يحتوي على مقبض مصنوع من الفولاذ المقاوم للصدأ لسهولة الحمل والاستخدام. يمكن استخدام هذا الوعاء في المطاعم والفنادق والمنازل. يتوفر بأحجام مخصصة لتلبية احتياجاتك. احصل على تجربة طهي متينة وفعالة مع وعاء الطهي للمطبخ باخرة.', 'zw-c3-16', NULL, NULL, '2023-12-15 21:52:55', '2023-12-15 23:00:09', NULL),
(316, 75, 1, 'ماكينة صنع المعكرونة الكهربائية', 'ماكينة صنع المعكرونة الكهربائية', 500, 850, NULL, NULL, 1, 'available', 'ماكينة صنع المعكرونة الكهربائية عالية الطاقة\r\n\r\nاحصل على ماكينة صنع المعكرونة الكهربائية عالية الطاقة واستمتع بتحضير مختلف أنواع المعكرونة اللذيذة في راحة منزلك. تتميز هذه الماكينة بأداء قوي وكفاءة عالية في تصنيع الشعرية والنودلز الطازجة بسرعة وسهولة.\r\n\r\nتتميز هذه الماكينة بتصميمها المتين وموادها عالية الجودة، مما يضمن المتانة والاستدامة. تتضمن الماكينة مجموعة متنوعة من القوالب والملحقات لصنع أنواع مختلفة من المعكرونة والنودلز والشعرية، مما يسمح لك بتنويع وجباتك وتلبية احتياجاتك الغذائية.\r\n\r\nاستمتع بتجربة الطهي الممتعة والمبتكرة مع ماكينة صنع المعكرونة الكهربائية عالية الطاقة، واستمتع بوجبات لذيذة وطازجة في أي وقت تشاء.', 'xjd76', NULL, NULL, '2023-12-15 22:09:35', '2023-12-15 22:09:35', NULL),
(317, 105, 1, 'ستاند الهاتف قابل للإنحناء', 'ستاند الهاتف قابل للإنحناء', 50, 250, NULL, NULL, 1, 'available', 'حامل سطح العمل البسيطة الإسفنج حامل هاتف المحمول بث مباشر ترايبود متعددة الوظائف في الهواء الطلق داخلي حامل هاتف المحمول ل فون - يعد حامل سطح العمل البسيطة الإسفنج حامل هاتف المحمول بث مباشر ترايبود متعددة الوظائف حلاً مثاليًا لجميع احتياجاتك المحمولة. يمكن استخدامه في الهواء الطلق أو داخل المنزل، ويوفر استقرارًا ودعمًا قويًا لهاتفك المحمول أثناء البث المباشر أو التصوير. يتميز بتصميم قابل للتعديل وقابل للطي، مما يسمح لك بضبط الزاوية والارتفاع المناسبين لتلبية احتياجاتك. مصنوع من مواد عالية الجودة مثل ABS، مما يجعله متينًا ومستدامًا. كما يتميز بدوران 360 درجة، مما يوفر لك مرونة إضافية في استخدامه. احصل على هذا الحامل العملي والموثوق به لتحقيق أقصى استفادة من هاتفك المحمول.', '0000', NULL, NULL, '2023-12-15 22:14:11', '2023-12-15 22:14:11', NULL),
(318, 104, 1, 'طناجر اللطهي', 'طناجر اللطهي', 300, 550, NULL, NULL, 1, 'available', 'طقم غلاية وبخار مزدوج من الفولاذ المقاوم للصدأ يعتبر منتجًا عالي الجودة وعمليًا لمطابخك. يتكون الطقم من غلاية وبخار مزدوج، مصنوع من الفولاذ المقاوم للصدأ الذي يضمن المتانة والمتانة الطويلة. يتميز هذا الطقم بطبقتين، مما يتيح لك طهي العديد من الأطعمة في وقت واحد. إنه مثالي لتحضير الخضروات اللذيذة وحبات البخار والمأكولات البحرية والدمبلنغ والمزيد. يأتي الطقم مع غطاء فولاذي، مما يساعد على الاحتفاظ بالحرارة والرطوبة في الوعاء. بفضل تصميمه العصري والعملي، سيكون هذا الطقم إضافة رائعة إلى مطبخك وسيساعدك في إعداد وجبات شهية وصحية بكل سهولة', 'zw', NULL, NULL, '2023-12-15 23:07:44', '2023-12-15 23:07:44', NULL),
(319, 63, 1, 'سلة تصفية', 'سلة تصفية', 60, 90, NULL, NULL, 1, 'available', 'هذا المنتج هو سلة شطف وتصفية الخضروات وسلة تصفية الأرز. تأتي السلة بتصميم فريد يتكون من 4 طبقات لتوفير مساحة تخزين كبيرة. تستخدم لغسل وتصفية الخضروات والفواكه وتصفية الأرز بكفاءة. مصنوعة من الفولاذ المقاوم للصدأ، مما يجعلها متينة ومقاومة للصدأ. تتميز بفتحات صغيرة تمنع سقوط الأطعمة الصغيرة وتسمح بتدفق الماء بسلاسة. تصميمها القابل للطي يجعلها سهلة التخزين والتنقل. تعد هذه السلة العملية والعصرية حلاً مثاليًا لتنظيم مطبخك وتوفير وقتك وجهدك في عملية الغسيل والتصفية.', 'cf22', NULL, NULL, '2023-12-15 23:16:23', '2023-12-15 23:16:23', NULL),
(320, 68, 1, 'خلاط العصا القابل للشحن', 'خلاط العصا القابل للشحن', 450, 760, NULL, NULL, 1, 'available', 'هذا الخلاط الترويجي بالتحكم في السرعة الكهربائية المتغيرة هو منتج متعدد الوظائف وعملي للغاية. يتميز بتصميم العصا القابلة للغمر، مما يتيح لك خلط وتقطيع المكونات بسهولة. يأتي الخلاط مع ضبط سرعة كهربائية متغيرة، مما يسمح لك بتعديل السرعة وفقًا لاحتياجاتك. يعمل ببطارية قابلة للشحن، مما يمنحك حرية التنقل واستخدامه في أي مكان ترغب فيه. يتميز بمواد عالية الجودة مثل الفولاذ المقاوم للصدأ والبلاستيك المتين، مما يمنحه المتانة والاستدامة. يعتبر هذا الخلاط مثاليًا للاستخدام في المطابخ التجارية والمنازل، ويساعدك في إعداد العصائر والصلصات والشوربات والمزيد بكل سهولة وسرعة.', 'xpdp05', NULL, NULL, '2023-12-15 23:19:54', '2023-12-15 23:19:54', NULL),
(321, 68, 1, 'خلاط العصا الكهربائي الفولاذي', 'خلاط العصا الكهربائي الفولاذي', 500, 740, NULL, NULL, 1, 'available', 'خلاط الطعام الكهربائي من الفولاذ المقاوم للصدأ هذا هو منتج عالي الجودة ومتعدد الاستخدامات. يتميز بوعاءه القوي والمصنوع من الفولاذ المقاوم للصدأ، والذي يمكنه تحمل الاستخدام اليومي والتحمل الشديد. يتم تشغيله بواسطة محرك كهربائي بقوة 300 واط، مما يوفر أداءً قويًا وفعالًا في الخلط والطحن. يحتوي الخلاط على سرعتين قابلتين للتعديل لتناسب احتياجاتك المختلفة. يمكن استخدامه لخلط المكونات المختلفة للأطعمة والمشروبات بسهولة، وتحقيق نتائج مثالية. مع ضمان لمدة سنة وخدمة ما بعد البيع المقدمة، يعد هذا الخلاط الكهربائي الفولاذي المقاوم للصدأ من Haeger خيارًا مثاليًا لمساعدتك في إعداد وجبات شهية في المطبخ.', '842', NULL, NULL, '2023-12-15 23:22:33', '2023-12-15 23:22:33', NULL),
(322, 110, 1, 'قالب كعكة المهنية غير اللاصقة', 'قالب كعكة المهنية غير اللاصقة', 120, 220, NULL, NULL, 1, 'available', 'المهنية 9 بوصة غير عصا كعكة عموم هي أداة ممتازة لمحبي صنع الكعكة. تتميز بتصميم غير عصا يضمن سهولة فصل الكعكة عن القالب بعد الخبز، مما يجعلها مثالية للحصول على نتائج مثالية في كل مرة. تم تصنيعها من الفولاذ الكربوني عالي الجودة، مما يوفر توزيعًا متساويًا للحرارة ويضمن تحميص متساوٍ ومناسب للكعكة. بقطر 9 بوصة، فإنها توفر حجمًا مناسبًا للكعكات المتوسطة والصغيرة. يمكن استخدامها في المنزل والمطاعم والفنادق، وهي مثالية للاستخدام الشخصي والاحترافي على حد سواء. احصل على هذا القالب المتين والعملي لتحضير كعكة عموم لذيذة ومثالية في كل مناسبة.', 'DGM30', NULL, NULL, '2023-12-15 23:23:41', '2023-12-16 17:37:20', NULL),
(323, 68, 1, 'محضر الطعام المحمول الذكي', 'محضر الطعام المحمول الذكي', 300, 470, NULL, NULL, 1, 'available', 'جهاز غمر صغير محمول للاستخدام باليد من Leazo هو منتج عالي الجودة ومريح الاستخدام. يتميز هذا الجهاز بوظيفة غمر صغيرة ومحمولة تساعدك في تحضير العديد من الوصفات بسهولة. يأتي الجهاز مع محرك كهربائي بقوة 250 واط وسرعتين لتلبية احتياجاتك المختلفة. يمكن استخدامه لخفق البيض وعجن العجين وتحضير اللحمة المفرومة. يأتي الجهاز مع خلاط يدوي ومفرمة وخفاقة لتلبية احتياجات مختلفة في المطبخ. يتميز بتصميم متين ومواد عالية الجودة مثل الفولاذ المقاوم للصدأ والبلاستيك. يعد جهاز غمر صغير محمول للاستخدام باليد هذا أداة مثالية لتحضير الطعام بسرعة وسهولة في المنزل.', '838', NULL, NULL, '2023-12-15 23:25:04', '2023-12-15 23:32:42', NULL),
(324, 110, 1, 'قالب كعكة توست', 'قالب كعكة توست', 80, 150, NULL, NULL, 1, 'available', 'قالب كعكة توست طويل غير لاصق صندوق خبز كيك مقلاة خبز أدوات منزلية تستخدم في الفرن قالب توست.\r\n\r\nتمتع بتحضير كعكة توست شهية ومثالية مع هذا القالب المميز. يتميز بتصميمه الطويل الذي يتيح لك إعداد كعكة توست بطول مثالي. يتميز القالب بطلاء غير لاصق يضمن سهولة إزالة الكعكة دون الإلتصاق بها.\r\n\r\nمصنوع من مادة عالية الجودة وآمنة للاستخدام في الفرن. يوفر صندوق الخبز الكيك المقلاة الخبز المتساوي والمثالي في كل مرة. يمكن استخدامه أيضًا لتحضير العديد من وصفات الخبز الأخرى.\r\n\r\nاحصل على هذا القالب المنزلي العملي والمتعدد الاستخدامات لتحضير أشهى الكعكات والخبز في منزلك.', 'DGM28', NULL, NULL, '2023-12-15 23:28:05', '2023-12-16 17:34:55', NULL),
(325, 84, 1, 'مصباح قاتل البعوض الشمسي القوي', 'مصباح قاتل البعوض الشمسي القوي', 200, 390, NULL, NULL, 1, 'available', 'يعتبر مصباح قاتل البعوض الشمسي القوي هذا حلاً مثالياً للتخلص من البعوض والحماية منها في المنزل والحديقة. يتميز بقدرته العالية على جذب وقتل البعوض بواسطة التكنولوجيا فوق البنفسجية. كما أنه مقاوم للماء، مما يجعله مناسبًا للاستخدام في الهواء الطلق. يوفر المصباح إضاءة ليلية هادئة ويمكن استخدامه كمصدر ضوء إضافي. بالإضافة إلى ذلك، يعمل بالطاقة الشمسية ويحتوي على بطارية قابلة للشحن. يعد مصباح قاتل البعوض الشمسي القوي هذا اختيارًا مثاليًا للتمتع بالهواء الطلق دون الإزعاج من البعوض.', 'jf-80', NULL, NULL, '2023-12-15 23:30:03', '2023-12-15 23:30:03', NULL),
(326, 73, 1, 'مرطب الهواء المحمول USB', 'مرطب الهواء المحمول USB', 280, 490, NULL, NULL, 1, 'available', 'يعتبر \"التلقائي USB زيت عطري الناشر سيارة ناشر رائحة USB المرطب\" منتجًا محمولًا وعمليًا يعمل على تعزيز الراحة والاسترخاء أثناء السفر في السيارة. يتميز بتصميم USB التلقائي الذي يتوافق مع منافذ USB المتوفرة في السيارة، مما يجعله سهل الاستخدام والتشغيل. يقوم هذا الجهاز بتشتيت الزيوت العطرية بلطف في الهواء، مما يعطي رائحة مميزة ومنعشة في المقصورة. بالإضافة إلى ذلك، يعمل كمرطب للهواء، مما يساعد في ترطيب البشرة وتخفيف الجفاف. يعتبر هذا المنتج منتجًا مثاليًا للأشخاص الذين يهتمون بالراحة والعافية أثناء السفر في السيارة.', 'jf-15', NULL, NULL, '2023-12-15 23:34:35', '2023-12-15 23:45:13', NULL),
(327, 110, 1, 'حوض كعكة', 'حوض كعكة', 150, 230, NULL, NULL, 1, 'available', 'حوض مقالي الكعك الجنيه الكربون الصلب من نونستيك [بوندت] هو منتج ممتاز لعشاق صنع الكعك. يتميز بتصميمه العميق والجولة، مما يسمح بإعداد كعكة الجنيه اللذيذة بسهولة وبشكل متساوٍ. يتم صنعه من الكربون الصلب عالي الجودة، مما يوفر توزيعًا متساويًا للحرارة ويضمن قوة ومتانة استثنائية. يأتي الحوض مع مزمر أنبوب للكعكة، مما يساعد على الحصول على نتائج مثالية في كل مرة. كما يوفر الحوض العميق مساحة كافية للخليط ويمنح الكعكة هيكلًا متماسكًا. يمكن استخدامه في الفرن وهو آمن للاستخدام في صنع الكعك والمخبوزات الأخرى. يعد حوض مقالي الكعك الجنيه الكربون الصلب من نونستيك [بوندت] اختيارًا مثاليًا للحصول على نتائج مثالية في صنع الكعك اللذيذ', 'DGM31', NULL, NULL, '2023-12-15 23:36:15', '2023-12-16 17:56:46', NULL),
(328, 106, 1, 'ساعة ذكية M6', 'ساعة ذكية M6', 200, 470, NULL, NULL, 1, 'available', '\"ساعة ذكية M6 الجديدة لعام 2022 هي منتج فريد ورخيص الثمن يجمع بين الأناقة والوظائف المتقدمة. تتميز بشاشة IPS بحجم 0.96 بوصة ودقة 240x240 لتوفير تجربة عرض مذهلة. تدعم الساعة الذكية العديد من الميزات المثيرة مثل الإشعارات المتصلة بالهاتف، ومراقبة معدل ضربات القلب، وقياس مستوى الرطوبة، ومراقبة الدم الأكسجيني، وتتبع النشاط الرياضي. تأتي الساعة بتصميم أنيق ومقاومة للماء بتصنيف IP67، وتعمل بنظام التشغيل Android و iOS. تتوفر خيارات تخصيص الشعار والتغليف حسب الطلب. احصل على ساعة ذكية M6 الجديدة لتحقيق الراحة والأناقة في البس', '0000', NULL, NULL, '2023-12-15 23:41:32', '2023-12-15 23:44:48', NULL),
(329, 63, 1, 'مقلاة الكعك غير اللاصقة بـ 6 حفرات', 'مقلاة الكعك غير اللاصقة بـ 6 حفرات', 50, 120, NULL, NULL, 1, 'available', 'غير عصا 6 حفرة كعكة العفن جولة مسطحة القاع كاسات للمفن كيك مقلاة خبز المنزلية الخبز العفن.\r\n\r\nاحصل على هذه المقلاة المميزة التي تتميز بـ 6 حفرات لتحضير كعكة العفن بشكل سهل ومثالي. تتميز بتصميم جولة مع قاع مسطح يساعد على توزيع الحرارة بالتساوي وتحقيق نتائج خبز مثالية. المقلاة مصنوعة من مادة غير عصا عالية الجودة، مما يجعل من السهل إخراج الكعكة بسلاسة وتنظيفها بسهولة.\r\n\r\nمناسبة للاستخدام المنزلي والتجاري، ويمكن استخدامها في المطاعم والفنادق. ستضيف هذه المقلاة العملية والعصرية لمسة من الاحترافية إلى مطبخك. احصل على تجربة خبز ممتعة ونتائج رائعة مع هذه المقلاة ذات الجودة العالية.', 'DGM09', NULL, NULL, '2023-12-15 23:43:05', '2023-12-16 00:04:11', NULL),
(330, 78, 1, 'سماعات زيادة الصوت لكبار السن', 'سماعات زيادة الصوت لكبار السن', 100, 290, NULL, NULL, 1, 'available', 'سماعة الأذن الرقمية قابلة للتعديل ومكبرة للصوت مصممة خصيصًا للصم وكبار السن. توفر هذه السماعة تجربة سمعية متميزة ومحسّنة للأشخاص الذين يعانون من صعوبات في السمع. تأتي السماعة بتصميم قابل للتعديل لتناسب مختلف أحجام الأذن، وتتميز بأداء صوتي عالي الجودة ومكبر للصوت لتعزيز الأصوات وتحسين سمع المستخدم. كما تتميز بتقنية رقمية متقدمة تساعد على تقليل التشويش وتوفير صوت واضح ونقي. تعتبر سماعة الأذن هذه صديقة للبيئة وتوفر راحة مطولة للمستخدم، وتأتي مع ضمان لمدة عام. هذه السماعة الرقمية هي اختيار مثالي لتحسين السمع وتعزيز جودة الحياة اليومية للأشخاص ذوي صعوبات في السمع.', 'tv38', NULL, NULL, '2023-12-15 23:45:28', '2023-12-15 23:45:28', NULL),
(331, 107, 1, 'مصباح المفتاح المحمول بتقنية COB LED', 'مصباح المفتاح المحمول بتقنية COB LED', 80, 150, NULL, NULL, 1, 'available', 'مصباح مفتاح LED متعدد الوظائف والذي يشحن عبر USB، هو منتج محمول وعملي مصمم للاستخدام في الهواء الطلق. يتميز بتقنية COB LED عالية الجودة ذات سطوع عالٍ يوفر إضاءة قوية وواضحة. يمكن استخدامه كمصباح عمل لتفتيش الأماكن الضيقة، أو كمصباح تخييم بسيط وفعال، أو حتى كدلاية مفاتيح لتوفير إضاءة فائقة الصغر في الظروف المظلمة. يأتي بحجم صغير ومحمول يسهل حمله في الجيب أو تعليقه على حقيبة الظهر. يعد هذا المصباح القابل لإعادة الشحن من المنتجات المثالية للنشاطات الخارجية مثل التخييم والمشي ليلاً والرحلات البرية.', 'jf95', NULL, NULL, '2023-12-15 23:50:13', '2023-12-15 23:50:13', NULL),
(332, 108, 1, 'كاميرا A9 الذكية', 'كاميرا A9 الذكية', 250, 480, NULL, NULL, 1, 'available', 'كاميرا A9 عالية الدقة لاسلكية واي فاي هي جهاز متعدد الاستخدامات يوفر تجربة تصوير ممتازة وسهولة الاستخدام. تأتي الكاميرا بدقة 1080 بكسل لتوفير صور واضحة وحادة، وتعمل على توفير صور رائعة حتى في الإضاءة المنخفضة. بفضل اتصالها اللاسلكي ووظيفة الواي فاي المدمجة، يمكنك الاتصال بها عن بُعد ومشاركة الصور والفيديوهات على الهواء مباشرة عبر تطبيق الهاتف المحمول المخصص. بفضل حجمها الصغير وتصميمها المحمول، يمكنك حملها بسهولة في جيبك أو تثبيتها في أي مكان ترغب في التصوير. إنها كاميرا مثالية لتوثيق اللحظات الخاصة والرحلات المشوقة، وتعد خيارًا مثاليًا للمستخدمين الذين يبحثون عن تجربة تصوير عالية الجودة وسهلة الاستخدام.', 'a9', NULL, NULL, '2023-12-16 00:08:42', '2023-12-16 00:23:59', NULL),
(333, 110, 1, 'قالب خبز الكربون الصلب', 'قالب خبز الكربون الصلب', 60, 150, NULL, NULL, 1, 'available', 'هذا المنتج هو أداة مثالية لعشاق الخبز والحلويات. يتميز بتصميمه عالي الجودة ومصنوع من مادة الكربون الصلب المتينة والمستدامة. يأتي مع طلاء غير لاصق يضمن عدم الالتصاق وسهولة التنظيف. يمتاز بأنابيب مخبوطة D25cm، مما يسمح بتوزيع متساوٍ للحرارة وطهي متساوٍ للكعك والمخبوزات. يمكن استخدامه في غسالة الأطباق لتسهيل عملية التنظيف. هذا المنتج هو اختيار مثالي لمحبي الخبز اللذيذ والحلويات المحلية في المنزل أو في المخبز التجاري', 'DGM05', NULL, NULL, '2023-12-16 00:13:51', '2023-12-16 17:36:42', NULL),
(334, 73, 1, 'سخان المياه الكهربائي المحمول الفوري', 'سخان المياه الكهربائي المحمول الفوري', 650, 950, NULL, NULL, 1, 'available', 'سخان المياه الكهربائي المحمول عالي الجودة - 110 فولت و 220 فولت\r\n\r\nقدمنا لكم سخان المياه الكهربائي المحمول عالي الجودة، وهو منتج يتميز بالأداء الممتاز والتصميم المبتكر. يمكنك الاعتماد على هذا السخان للاستمتاع بمياه ساخنة فورية في أي وقت وفي أي مكان. يتوفر بجهدين كهربائيين، 110 فولت و 220 فولت، مما يتيح لك استخدامه في مختلف البيئات. يعد هذا السخان مضغوطًا وسهل الاستخدام، بالإضافة إلى كونه خيارًا مستدامًا لأنه مصنوع من الفولاذ المقاوم للصدأ. استمتع بالمياه الساخنة بسرعة وسهولة مع سخان المياه الكهربائي المحمول عالي الجودة', '018', NULL, NULL, '2023-12-16 00:18:17', '2023-12-16 00:23:15', NULL),
(335, 65, 1, 'مجموعة شواء الفولاذ المقاوم للصدأ المحمولة', 'مجموعة شواء الفولاذ المقاوم للصدأ المحمولة', 40, 100, NULL, NULL, 1, 'available', 'مجموعة من 10 أسياخ الشواء قابلة لإعادة الاستخدام، مصنوعة من الفولاذ المقاوم للصدأ عالي الجودة. تصميم مثالي لشيش الكباب وشواء اللحم والخضروات. مثالية للتخييم والرحلات وشواء الهواء الطلق. تتميز بشوكة شواء مسطحة لتثبيت الطعام بشكل آمن ومريح. مقاومة للحرارة وسهلة التنظيف بفضل تصميمها المضاد للالتصاق. تأتي هذه الأسياخ معبأة بشكل مرتب ومناسب، مما يجعلها سهلة التخزين والحمل. استمتع بتجربة شواء استثنائية مع هذه المجموعة المتينة وعالية الجودة من أسياخ الشواء. احصل عليها الآن واستمتع بمتعة الشواء مع العائلة والأصدقاء.', '019', NULL, NULL, '2023-12-16 00:22:56', '2023-12-16 01:45:34', NULL),
(336, 66, 1, 'صينية قوالب مكعبات الثلج المربعة', 'صينية قوالب مكعبات الثلج المربعة', 40, 80, NULL, NULL, 1, 'available', 'صينية قوالب مكعبات الثلج المصنوعة من السيليكون هي منتج مثالي لصنع مكعبات الثلج المميزة بشكل هوكي المحببة. تتميز الصينية بتصميمها المربع الشكل الذي يحتوي على 24 فتحة، مما يتيح لك صنع العديد من مكعبات الثلج في وقت واحد. مصنوعة من مواد السيليكون عالية الجودة والموافقة على الاستخدام الغذائي، مما يجعلها آمنة للاستخدام في تجميد المشروبات والمشروبات الأخرى. بفضل تصميمها العملي، يمكنك بسهولة إزالة المكعبات من الصينية عند الحاجة. كما تأتي مع غطاء للصينية لمنع التسرب والحفاظ على نضارة المكعبات. احصل على هذه الصينية العملية والمتينة لتجربة تصنع فيها مكعبات الثلج بأشكال ممتعة ومبتكرة.', 'ZW-363', NULL, NULL, '2023-12-16 01:54:51', '2023-12-16 01:54:51', NULL),
(337, 106, 1, 'ساعة اللياقة الرياضية المقاومة للماء', 'ساعة اللياقة الرياضية المقاومة للماء', 1200, 1950, NULL, NULL, 1, 'available', 'تقدم لك هذه المنتجات الرياضية الجديدة عالية الجودة ومقاومة للماء من Kakusig-2023 تجربة متميزة في ممارسة التمارين ومراقبة صحتك. تعمل بنظام تشغيل أندرويد و iOS وتضمن التوافق مع هواتفك الذكية. تتميز بشاشة كبيرة قياس 1.39 بوصة ودقة عالية 240*240 لعرض بياناتك بوضوح. تتمتع بتصميم مقاوم للماء بتصنيف IP68، مما يسمح لك باستخدامها أثناء السباحة وممارسة الرياضات المائية. تحتوي على بطارية بقوة 250mAh توفر لك مدة تشغيل تصل إلى 10 أيام قبل الشحن. كما تتضمن ميزات متعددة مثل مراقبة معدل ضربات القلب، ومتابعة النوم، وتنبيهات الرسائل والمكالمات الواردة، مما يجعلها رفيقًا مثاليًا لنمط حياتك النشط والصحي.', 'ws3', NULL, NULL, '2023-12-16 01:55:50', '2023-12-16 01:55:50', NULL),
(338, 106, 1, 'E18 Pro ساعة ذكية', 'E18 Pro ساعة ذكية', 1500, 2500, NULL, NULL, 1, 'available', 'ساعة E18 الذكية هي ساعة مراقبة ضغط الدم ومقاومة للماء ومصممة لعشاق الرياضة. تتميز بتقنية NFC و GPS لتتبع النشاط البدني وحرق السعرات الحرارية. تحتوي أيضًا على مستشعر درجة الحرارة ومراقبة معدل ضربات القلب على المعصم. تتضمن الساعة أيضًا ميزات الأعمال مثل إشعارات المكالمات والرسائل وتحكم الموسيقى. تتميز بشاشة IPS ملونة بحجم 1.32 بوصة ودقة 360 × 360 بكسل. تأتي الساعة بتصميم أنيق ومتين مع حزام مطاطي قابل للتعديل. هذه الساعة مثالية للرجال الذين يهتمون بمتابعة صحتهم ولممارسة الرياضة بشكل أكثر ذكاء وكفاءة.', 's6', NULL, NULL, '2023-12-16 02:02:36', '2023-12-16 02:02:36', NULL),
(339, 65, 1, 'مجموعة 4 قطع', 'مجموعة 4 قطع', 65, 140, NULL, NULL, 1, 'available', '4 قطع من أفضل المنتجات التي تتميز بها الصين. يأتي هذا المنتج كمجموعة تحتوي على أربعة مقشرات مصنوعة من الصلب المقاوم للصدأ عالي الجودة. يتميز كل مقشر بتصميمه المتين والمريح، مما يوفر تجربة سهلة وفعالة لتقشير الشعر. بالإضافة إلى ذلك، تتميز الأدوات بمقابضها ذات اللون الأسود الأنيق المصنوعة من مادة عالية الجودة توفر قبضة مريحة وقوية. سواء كنت تحتاج إلى تقشير الشعر في صالون الحلاقة أو في المنزل، فإن مقشر الشعر من الصلب المقاوم للصدأ 4 قطع يعد الخيار المثالي للحصول على أداء متميز ونتائج مذهلة.', '019', NULL, NULL, '2023-12-16 02:02:53', '2023-12-16 02:02:53', NULL),
(340, 105, 1, 'حامل هاتف المحمول المطوي مع سطح مكتب قابل للتعديل', 'حامل هاتف المحمول المطوي مع سطح مكتب قابل للتعديل', 80, 180, NULL, NULL, 1, 'available', 'يعد حامل الهاتف المحمول المطوي مع سطح مكتب قابل للتعديل وحامل الهاتف المحمول مع واجهة زجاجية مثاليًا لتجربة مشاهدة البث المباشر عبر الهاتف المحمول ومتابعة الدروس عبر الإنترنت. يتميز بتصميم متعدد الوظائف يتيح لك تثبيت هاتفك المحمول بأمان على سطح المكتب وتعديل زاوية العرض حسب رغبتك. يمنحك حامل الهاتف المحمول المطوي هذا الراحة والمرونة أثناء استخدام هاتفك المحمول في العمل أو المنزل أو أثناء المشاهدة أو التعلم عبر الإنترنت. يأتي بتصميم متين وعصري يناسب مجموعة متنوعة من الهواتف المحمولة بحجم 4 - 7 بوصات. استمتع بتجربة مريحة وعملية مع حامل الهاتف المحمول هذا.', '00000', NULL, NULL, '2023-12-16 02:05:29', '2023-12-16 02:05:29', NULL),
(341, 66, 1, 'مغرفة المياه البلاستيكية', 'مغرفة المياه البلاستيكية', 30, 60, NULL, NULL, 1, 'available', 'مغرفة المياه البلاستيكية للحمام مع مقبض طويل\r\n\r\nاستمتع بالراحة والسهولة أثناء استخدامك للماء في الحمام مع مغرفة المياه البلاستيكية ذات المقبض الطويل. تصميمها البسيط والعملي يجعلها منتجًا مثاليًا للاستخدام اليومي في المطبخ والحمام. تم تصنيعها من مواد بلاستيكية عالية الجودة وآمنة للاستخدام مع الأغذية. بفضل المقبض الطويل، يمكنك الوصول بسهولة إلى الماء وصبه بدقة ودون إتلاف أو إسقاطه. بالإضافة إلى ذلك، فهي متينة ولا تتأثر بالتآكل أو التلف. احصل على مغرفة المياه البلاستيكية ذات المقبض الطويل لتجربة مريحة وعملية للاستخدام اليومي في المطبخ والحمام.', '020', NULL, NULL, '2023-12-16 02:09:18', '2023-12-16 02:37:24', NULL),
(342, 102, 1, 'حامل هاتف المرآة الخلفية', 'حامل هاتف المرآة الخلفية', 60, 140, NULL, NULL, 1, 'available', 'حامل هاتف المرآة الخلفية للسيارة، حامل هاتف قابل للسحب، هو منتج مبتكر وعملي يهدف إلى توفير حلاً مريحًا وآمنًا لاستخدام الهاتف المحمول في السيارة. يتم تثبيته بسهولة على المرآة الخلفية للسيارة ويتميز بقابلية السحب والتعديل لتلبية احتياجاتك الشخصية. يتيح لك هذا الحامل الوصول السريع والمريح إلى هاتفك المحمول أثناء القيادة، مما يمكنك من استخدام التطبيقات الضرورية مثل GPS والمكالمات الهاتفية بطريقة آمنة ومرئية. بالإضافة إلى ذلك، يتميز بتصميمه المدمج والقوي الذي يحمي هاتفك من الاهتزازات والصدمات أثناء القيادة. احصل على حامل هاتف المرآة الخلفية للسيارة الآن واستمتع بتجربة قيادة آمنة ومريحة.', 'k3', NULL, NULL, '2023-12-16 02:09:33', '2023-12-16 02:09:33', NULL),
(343, 102, 1, 'حامل الهاتف ل السيارة', 'حامل الهاتف ل السيارة', 70, 160, NULL, NULL, 1, 'available', 'يعد حامل الهاتف المحمول للسيارة Ount نموذج جديد مرآة مراجعة الهاتف المحمول جبل مع امتصاص الصدمات شاحنة دعم قوس للمقعد الخلفي منتجًا مبتكرًا وعالي الجودة. يتميز الحامل بتصميم مرآة السيارة المراجعة، مما يتيح لك استخدام الهاتف بشكل آمن ومريح أثناء القيادة. يتمتع الحامل بقوة تثبيت فائقة وقدرة على امتصاص الصدمات، مما يحافظ على استقرار الهاتف أثناء الحركة. كما يحتوي الحامل على قوس دعم للمقعد الخلفي، مما يسمح للركاب في المقعد الخلفي بالاستفادة من مشاهدة الهاتف بسهولة. إنه منتج أنيق وعملي يوفر تجربة استخدام مثالية أثناء السفر في السيارة.', 'h6', NULL, NULL, '2023-12-16 02:12:33', '2023-12-16 02:12:33', NULL),
(344, 73, 1, 'سلة النزهة', 'سلة النزهة', 80, 140, NULL, NULL, 1, 'available', 'سلة النزهة اليدوية من الروطان PP هي منتج عملي وجميل يمكن استخدامه في النزهات والرحلات. تم تصميمها بعناية باستخدام الروطان البلاستيكي عالي الجودة والمستدام، مما يجعلها مقاومة للتآكل وخفيفة الوزن. تتميز بتصميم يدوي متقن يضفي عليها لمسة فنية وجمالية. تأتي بأحجام وأشكال متعددة للاختيار من بينها. تستخدم هذه السلة لتخزين وحمل الخبز والمأكولات الأخرى أثناء النزهات والرحلات في الهواء الطلق. إنها منتج مثالي لأولئك الذين يحبون الاستمتاع بالمناظر الطبيعية وتناول وجباتهم في الهواء الطلق بأناقة وراحة.', 'ZH56', NULL, NULL, '2023-12-16 02:14:04', '2023-12-16 02:14:04', NULL),
(345, 105, 1, 'مجموعة التصوير المتنقلة', '\"مجموعة التصوير المتنقلة', 350, 600, NULL, NULL, 1, 'available', 'يعد آلة التصوير الفوتوغرافية Vlogging Kit لعام 2022 مثالية لهواة التصوير والمسوقين الرقميين. يحتوي هذا الكيت على كل ما تحتاجه للتصوير عالي الجودة أثناء السفر والتجول. يأتي الكيت مع حامل أرضي وترايبود مصغر خفيف الوزن، وميكروفون لتسجيل صوت واضح، ومرآة Selfie للتصوير الذاتي. تم تصميم الكيت بشكل محمول ومرن، مما يسهل حمله واستخدامه في أي مكان. بفضل جودة الصورة العالية والصوت الواضح، يمكنك إنشاء محتوى رائع وجذاب لقنوات التواصل الاجتماعي الخاصة بك. احصل على هذا الكيت الرائع واستعد لتجربة تصوير استثنائية أثناء سفرك.', '0000', NULL, NULL, '2023-12-16 02:16:04', '2023-12-16 02:20:25', NULL),
(346, 73, 1, 'سلة اللفاكهة', 'سلة اللفاكهة', 80, 150, NULL, NULL, 1, 'available', 'سلة النزهة المنسوجة من الروطان PP هي منتج رائع وعملي يمكن استخدامه في النزهات والرحلات في الهواء الطلق. تم تصميمها بعناية باستخدام الروطان البلاستيكي عالي الجودة، مما يمنحها متانة ومقاومة للعوامل الجوية. تتميز بتصميم منسوج يدويًا بأناقة وفنية، مما يضفي عليها مظهرًا جميلًا وطبيعيًا. تحتوي على مساحة واسعة لتخزين الأطعمة والمشروبات واللوازم الأخرى التي تحتاجها أثناء النزهة. بفضل مقابضها المريحة، يمكن حملها بسهولة. سلة النزهة المنسوجة من الروطان PP هي الرفيق المثالي للنزهات العائلية والتجمعات في الهواء الطلق، حيث تجمع بين الأناقة والوظائف العملية.', 'ZH-58', NULL, NULL, '2023-12-16 02:19:57', '2023-12-16 02:19:57', NULL),
(347, 102, 1, 'حامل الهاتف دراجة النارية', 'حامل الهاتف دراجة النارية', 100, 190, NULL, NULL, 1, 'available', 'قفل تلقائي للبيع بالجملة Oem دراجة أجرة متنقلة قابلة للتعديل من أجل الدراجة النارية Porta Celulares Para Moto - يعتبر حامل الهاتف النقال للدراجات النارية هذا حلاً مثاليًا للأشخاص الذين يرغبون في الاستمتاع بتجربة ركوب آمنة ومريحة. يمتاز بتصميمه العالمي الذي يتيح تثبيته على مقابض الدراجات النارية بسهولة وثبات. يوفر حامل الهاتف القابل للتعديل بزاوية ٣٦٠ درجة إمكانية مشاهدة الهاتف بسهولة وراحة أثناء الركوب. كما يتميز بميزة مكافحة الاهتزاز والصدمات لحماية الهاتف من الاهتزازات أثناء الرحلات. يعد هذا المنتج مثاليًا لعشاق الدراجات النارية الذين يحتاجون إلى الوصول السريع والآمن إلى هواتفهم أثناء التنقل.', '00000', NULL, NULL, '2023-12-16 02:20:31', '2023-12-16 02:24:48', NULL),
(348, 73, 1, 'سلة تخزين الطعام والفاكهة', 'سلة تخزين الطعام والفاكهة', 85, 170, NULL, NULL, 1, 'available', 'عرض منزلي مخصص مستدير للطعام والفاكهة مزخرف لتخزين الخبز من البلاستيك. إنها سلة تخزين عملية وجميلة لترتيب وتنظيم المطبخ الخاص بك. مصنوعة من البلاستيك المنسوج بشكل متين وعالي الجودة، مما يضمن متانتها واستدامتها. تصميمها المستدير يوفر مساحة كبيرة لتخزين الخبز والفواكه والأطعمة الأخرى. بفضل تصميمها المزخرف، تضفي لمسة جمالية رائعة على المطبخ الخاص بك. إنها مثالية للاستخدام المنزلي وتنظيم المواد الغذائية بشكل أنيق. بفضل جودتها العالية ومظهرها الجذاب، فإنها تضيف لمسة من الأناقة إلى ديكور منزلك. كما أنها سهلة التنظيف وصديقة للبيئة. استمتع بترتيب وتنظيم مطبخك بهذه السلة المنزلية المخصصة للطعام والفاكهة.', 'ZH47', NULL, NULL, '2023-12-16 02:24:20', '2023-12-16 02:24:20', NULL),
(349, 105, 1, 'حامل هاتف محمول قابل للطي', 'حامل هاتف محمول قابل للطي', 80, 195, NULL, NULL, 1, 'available', 'هذا المنتج هو حامل الهاتف المحمول المحمول والقابل للطي، والذي يوفر حلاً مثالياً لتثبيت هاتفك المحمول بشكل آمن ومريح. صُمم هذا الحامل بأناقة باستخدام مواد عالية الجودة، بما في ذلك الألومنيوم المتين. يوفر الحامل قاعدة قابلة للتعديل تتيح لك ضبط زاوية العرض والارتفاع حسب تفضيلاتك. يتميز بتصميم محمول وخفيف الوزن، مما يجعله مثاليًا للاستخدام في المنزل، في المكتب، أو أثناء التنقل. بفضل تصميمه المضغوط، يمكنك حمله بسهولة في حقيبتك أو جيبك. استمتع بتجربة استخدام مريحة وتثبيت آمن لهاتفك المحمول مع هذا الحامل المحمول والعصري.', '0000', NULL, NULL, '2023-12-16 02:26:07', '2023-12-16 02:26:07', NULL),
(350, 73, 1, 'سلة التخزين المنسوجة', 'سلة التخزين المنسوجة', 170, 270, NULL, NULL, 1, 'available', 'سلة التخزين هي خيار مثالي لتخزين الأغراض في منزلك. تتميز بتصميمها الخوص المنسوج الخمري ولونها البني الداكن، مما يضفي لمسة رائعة وأنيقة على ديكور المنزل. تُعد هذه السلة قابلة للتراص، مما يوفر مساحة تخزين إضافية ويسهل تنظيم الأشياء. بالإضافة إلى ذلك، تحتوي على خاصية المغناطيس القوي المدمج، مما يسمح بتثبيتها بسهولة على الأسطح المعدنية مثل الثلاجة أو الأجهزة المنزلية الأخرى. تعد سلة Basketive خيارًا مثاليًا لتخزين الفواكه والخضروات في المطبخ أو تنظيم الأدوات والملحقات في الحمام أو غرفة المعيشة. احصل على سلة التخزين المغناطيسية Basketive اليوم واستمتع بمظهر منزلك المرتب والمنظم.', 'ZH-60', NULL, NULL, '2023-12-16 02:28:17', '2023-12-16 02:28:17', NULL),
(351, 102, 1, 'حامل الهاتف لسيارة الاصق', 'حامل الهاتف لسيارة الاصق', 80, 240, NULL, NULL, 1, 'available', 'هذا المنتج هو حامل هاتف سيارة عالمي بتصميم علامة تجارية جديدة. يتميز بحاجب زجاجي للسيارة ويثبت على لوحة القيادة، مما يوفر استقرارًا وأمانًا أثناء استخدام الهاتف المحمول أثناء القيادة. يتيح لك هذا الحامل تثبيت هاتفك المحمول بشكل آمن وسهل الوصول، مما يسمح لك بالاستفادة من خدمات تحديد المواقع والمساعد الشخصي الرقمي أثناء السفر. يتميز بتصميمه القابل للتعديل والقوي، مما يتيح لك ضبط زاوية العرض بسهولة وفقًا لتفضيلاتك. إنه منتج عملي وعالي الجودة يوفر حلاً مثاليًا للأشخاص الذين يرغبون في استخدام هواتفهم المحمولة بأمان أثناء القيادة.', '00000', NULL, NULL, '2023-12-16 02:30:04', '2023-12-16 02:30:04', NULL),
(352, 66, 1, 'معرفة ماء', 'معرفة ماء', 50, 90, NULL, NULL, 1, 'available', 'ملعقة مياه منزلية شفافة كريستال، ملعقة مياه شفافة من البلاستيك\r\n\r\nاستمتع براحة وسهولة في الاستخدام مع ملعقة المياه المنزلية الشفافة كريستال. تم تصميم هذه الملعقة بشكل دقيق ومصنوعة من مواد بلاستيكية عالية الجودة لتوفير المتانة والاستدامة. تأتي بتصميم شفاف يمكنك من رؤية محتوى الملعقة بوضوح، مما يسهل تحديد كمية المياه التي تحتاجها. بفضل حجمها المثالي وشكلها الدائري، يمكن استخدامها في المنزل أو المطعم بكل سهولة. احصل على ملعقة المياه الشفافة المنزلية الكريستالية الآن واستمتع بتجربة مريحة وعملية لتناول المياه.', 'JH145', NULL, NULL, '2023-12-16 02:32:25', '2023-12-16 02:32:25', NULL),
(353, 78, 1, 'سماعات الرأس اللاسلكية', 'سماعات الرأس اللاسلكية', 250, 520, NULL, NULL, 1, 'available', 'سماعات الرأس اللاسلكية A10 هي حلاقة متعددة الاستخدامات لعشاق الرياضة وأولئك الذين يرغبون في الاستمتاع بالموسيقى بحرية. تتميز هذه السماعات بتصميمها المبتكر حول ياقة الملابس الرقبة، مما يوفر راحة فائقة وثباتًا آمنًا أثناء الحركة. تتميز السماعات بأداء صوت عالي الجودة وميكروفون مدمج لإجراء مكالمات واضحة. كما أنها مقاومة للماء بتصنيف IPX-3، مما يجعلها مثالية لممارسة الرياضة في الهواء الطلق أو حتى أثناء التمرينات الشاقة. تعمل السماعات لمدة تصل إلى 8 ساعات متواصلة، وتدعم الاتصال اللاسلكي، وتأتي بتصميم عصري وأنيق. استمتع بتجربة استماع مريحة وحرة اليدين مع سماعات الرأس اللاسلكية A10.', '0000', NULL, NULL, '2023-12-16 02:33:33', '2023-12-16 02:33:33', NULL),
(354, 66, 1, 'مصفات بلاستيكية', 'مصفات بلاستيكية', 25, 50, NULL, NULL, 1, 'available', 'مصفاة بلاستيكية للمطبخ مصفاة شبكية بمقبض مصفاة بلاستيكية للمطبخ هي أداة مثالية للاستخدام في المطبخ. تتميز هذه المصفاة بتصميمها الدائري والشبكي، مما يتيح تصفية السوائل والمواد الصلبة بسهولة وفعالية. تتميز بمقبض مريح يوفر قبضة قوية ومريحة أثناء الاستخدام. تتميز بمواد بلاستيكية عالية الجودة تجعلها متينة وقوية ومقاومة للتآكل. تتوفر بألوان متنوعة لتناسب أذواقك وديكور مطبخك. إن حجمها المناسب يجعلها مثالية لصفية الشوربات والمعكرونة والخضروات والفواكه والمزيد. احصل على مصفاة بلاستيكية للمطبخ مصفاة شبكية بمقبض الآن واستمتع بتجربة سهلة ومريحة لتصفية وتحضير الطعام في مطبخك.', 'JH;104', NULL, NULL, '2023-12-16 02:36:56', '2023-12-16 02:36:56', NULL),
(355, 73, 1, 'سلة الفاكهة والخضروات', 'سلة الفاكهة والخضروات', 80, 150, NULL, NULL, 1, 'available', 'تقدم Haosen الصين مربعًا جديدًا من الروطان بتصميم يدوي مميز، وهو سلة تخزين خشبية مصنوعة من الروطان بشكل دائري مع مقابض للسلال الفاكهة. تعد هذه السلة مثالية لتنظيم وتخزين الفواكه والخبز والخضروات في المطبخ. تتميز بجودة عالية ومتانة فائقة بفضل استخدام مواد PP Rattan عالية الجودة. يمكن تخصيص اللون والحجم والشعار حسب الاحتياجات الشخصية. إنها قطعة ديكور عصرية تضفي لمسة جمالية على المطبخ وتجعله منظمًا ومرتبًا. هذه السلة المدهشة هي اختيار مثالي لتحسين تجربة التخزين وإضافة لمسة فريدة من الأناقة إلى المطبخ.', 'JH76', NULL, NULL, '2023-12-16 03:29:46', '2023-12-16 03:29:46', NULL),
(356, 73, 1, 'سلة التسوق المنسوجة البلاستيكية', 'سلة التسوق المنسوجة البلاستيكية', 80, 150, NULL, NULL, 1, 'available', 'هذه السلة المنسوجة البلاستيكية هي منتج متعدد الاستخدامات وعملي للغاية. تتميز بتصميمها الواسع والكبير الحجم، مما يجعلها مثالية للاستخدامات المختلفة في المنزل والمطبخ. يمكن استخدامها كسلة تسوق لحمل البقالة والمشتريات بسهولة، كما يمكن استخدامها كحقيبة نزهة لحمل الأطعمة والمشروبات أثناء الرحلات والنزهات. تتميز بجودتها المتينة ومقاومتها للتآكل، مما يضمن استخدامها لفترة طويلة. تتوفر بتشكيلة من الألوان المختلفة ويمكن تخصيصها وفقًا للمتطلبات الشخصية. إنها سلة تنظيمية مثالية للمطبخ وتستوعب بسهولة الفواكه والخضروات والأدوات المنزلية الصغيرة. تعتبر هذه السلة المنسوجة البلاستيكية اختيارًا مثاليًا للأشخاص الذين يبحثون عن منتج عملي وعصري لتخزين وحمل المستلزمات المنزلية بطريقة منظمة.', 'ZH71', NULL, NULL, '2023-12-16 03:33:04', '2023-12-16 03:33:04', NULL),
(357, 73, 1, 'وعاء الزهور المنسوج بلاستيكياً زهرة الألوان', 'وعاء الزهور المنسوج بلاستيكياً زهرة الألوان', 200, 300, NULL, NULL, 1, 'available', 'وعاء زهرة نبات اصطناعي ملون وسعة كبيرة مصنوع من البلاستيك المتين والعالي الجودة. يعد هذا الوعاء المنسوج البلاستيكي المصمم بشكل جميل وإبداعي إضافة رائعة لديكور منزلك. يأتي مع زهرة اصطناعية بديعة تضفي لمسة من الجمال والحياة على أي مساحة داخلية. يمكن استخدامه في تزيين المكاتب والمداخل والمطابخ وغرف النوم والصالونات وأماكن أخرى. بفضل تصميمه المتين ومقاومته للتأثيرات البيئية، يمكنك الاستمتاع بجماله لفترة طويلة دون الحاجة إلى القلق بشأن الصيانة. اجعل منزلك مذهلاً مع وعاء زهرة نبات اصطناعي بسعة كبيرة وألوان متعددة.', '021', NULL, NULL, '2023-12-16 03:38:59', '2023-12-16 03:38:59', NULL),
(358, 73, 1, 'منظم قلم الألوان المتعدد الوظائف', 'منظم قلم الألوان المتعدد الوظائف', 20, 50, NULL, NULL, 1, 'available', 'قلم رصاص وقلم وجاف مخصص منظم مكتب البلاستيك هو حامل متعدد الوظائف يمكن استخدامه في المكتب والمنزل. يتميز بتصميمه المربع الأنيق والمصنوع من مادة البلاستيك PP عالية الجودة. يوفر هذا المنظم مكانًا مثاليًا لتنظيم أدوات الكتابة مثل أقلام الرصاص والأقلام والأقلام الجافة. بفضل حجمه الكبير (41 × 25 × 57 سم)، يمكن أن يتسع لعدد كبير من الأدوات. بالإضافة إلى ذلك، يمكن تخصيص هذا المنظم بشعار مخصص حسب الطلب. إنه منتج متعدد الاستخدامات وعملي لتوفير مساحة مرتبة ومنظمة على مكتبك أو طاولتك.', 'CL31', NULL, NULL, '2023-12-16 03:42:43', '2023-12-16 03:42:43', NULL),
(359, 73, 1, 'وعاء الزهرة البلاستيكي الفاخر', 'وعاء الزهرة البلاستيكي الفاخر', 20, 50, NULL, NULL, 1, 'available', 'وعاء زهرة نبات اصطناعي بسعة كبيرة ومصنوع من البلاستيك المتين عالي الجودة. يتميز هذا الوعاء بتصميمه الجميل والإبداعي، وهو إضافة رائعة لديكور منزلك. يأتي مع زهرة اصطناعية بديعة تضيف لمسة من الجمال والحياة إلى أي مساحة داخلية. يمكن استخدامه في تزيين المكاتب والمداخل والمطابخ وغرف النوم والصالونات والأماكن الأخرى. بفضل تصميمه المتين ومقاومته للتأثيرات البيئية، يمكنك الاستمتاع بجماله لفترة طويلة دون الحاجة إلى القلق بشأن الصيانة. اجعل منزلك مذهلاً مع وعاء زهرة نبات اصطناعي بسعة كبيرة وألوان متعددة. يعكس هذا الوعاء الرقي والأناقة في أي مكان توضع فيه.', 'CL32', NULL, NULL, '2023-12-16 03:46:32', '2023-12-16 03:46:32', NULL);
INSERT INTO `products` (`id`, `subcategory_id`, `supplier_id`, `unit_name`, `pack_name`, `purchasing_price`, `unit_price`, `pack_price`, `pack_units`, `unit_type`, `status`, `description`, `code_supplier`, `code_bar`, `file`, `created_at`, `updated_at`, `deleted_at`) VALUES
(360, 110, 1, 'جهاز تكوير المعجنات', 'جهاز تكوير المعجنات', 80, 150, NULL, NULL, 1, 'available', 'وصف المنتج:\r\n\r\nالخبز والمعجنات أداة على البخار محشوة كعكة صنع العفن كعكة صانع 1 قطعة المطبخ DIY المعجنات فطيرة جهاز صناعة زلابية الصينية Baozi العفن هو منتج عالي الجودة ومصنوع من مواد بلاستيكية ممتازة. يتيح لك هذا العفن إعداد الكعك والمعجنات المحشوة بكل سهولة ويسر. يمكن استخدامه لصنع البخار وتحضير الباوزي والفطائر والزلابية والدمبلينغ وغيرها من الوجبات اللذيذة. يأتي العفن بتصميم عملي وسهل الاستخدام، مما يسهل عليك صنع الأطباق المثالية في المطبخ الخاص بك. إنه أداة مثالية لمحبي الخبز والمعجنات اللذيذة ويمكن استخدامه في المنزل أو في المطاعم. قم بشراء هذا العفن الرائع واستمتع بتحضير الأطباق الشهية والمحشوة بسهولة وإبداع.', 'TV48', NULL, NULL, '2023-12-16 03:51:46', '2023-12-16 17:36:14', NULL),
(361, 63, 1, 'زجاجة زيت الطهي المتعددة الاستخدامات', 'زجاجة زيت الطهي المتعددة الاستخدامات', 200, 320, NULL, NULL, 1, 'available', 'زجاجة زيت زجاجية مع بلاستيك هي منتج أساسي في المطبخ يتميز بجودته وتصميمه العملي. تستخدم للطهي والخبز وتوفر سهولة ودقة في توزيع الزيت. تأتي الزجاجة مع فرشاة زيت سيليكون تساعد في توزيع الزيت بشكل متساوٍ على الأطعمة. تتميز بتصميمها الكلاسيكي ومقاسها الملائم لتخزين الزيت بشكل آمن ومحافظة على نضارته. مصنوعة من مواد عالية الجودة بما في ذلك زجاج متين وغطاء سيليكون. تعد هذه الزجاجة مثالية للاستخدام في المطابخ المنزلية والمطاعم والفنادق. احصل على هذه الزجاجة العملية والعصرية لتعزيز تجربتك في الطهي والخبز.', 'TV27', NULL, NULL, '2023-12-16 04:07:09', '2023-12-16 04:07:09', NULL),
(362, 81, 1, 'مكبر صوت محمول', 'مكبر صوت محمول', 200, 400, NULL, NULL, 1, 'available', 'مكبر الصوت اللاسلكي TWS مع مصباح LED هو جهاز محمول يتمتع بوظائف متعددة وتصميم بسيط. يتيح لك الاستمتاع بتجربة صوتية استثنائية وإضاءة مميزة في آن واحد. يتميز بتقنية البلوتوث 5.0 للاقتران السريع والاستقرار في الاتصال مع الأجهزة المتوافقة. يمكنك استخدامه لتشغيل الموسيقى من هاتفك المحمول والاستماع إلى صوت عالي الجودة ونقي. يحتوي أيضًا على مدخل AUX ومنفذ USB ودعم بطاقة الذاكرة لمزيد من خيارات التوصيل. يعمل المصباح LED كإضاءة خافتة وعملية في الأماكن المظلمة. مع تصميمه المحمول والمريح، يمكنك الاستمتاع بالموسيقى وإضاءة البيئة في أي مكان تذهب إليه.', 't6', NULL, NULL, '2023-12-16 13:28:02', '2023-12-16 13:28:02', NULL),
(363, 107, 1, 'مصباح ليلي للأطفال', 'مصباح ليلي للأطفال', 120, 290, NULL, NULL, 1, 'available', 'مصباح ليلي للأطفال يعمل بالتحكم عن بعد، مصمم خصيصًا لإضفاء الراحة والأمان على أطفالكم أثناء النوم. يأتي هذا المصباح بجهاز استشعار تلقائي يعمل بالتحكم عن بعد، مما يتيح لكم ضبط إضاءته وتشغيله وإيقافه عن بُعد بكل سهولة. يعمل المصباح بتقنية الإضاءة اللطيفة والدافئة لخلق جو مريح ومهدئ في غرفة النوم. كما يتمتع بوضع الخفت لتناسب احتياجات الطفل أثناء النوم. بفضل تقنية الشحن القابل للإعادة، لن تحتاجوا إلى القلق بشأن استبدال البطاريات بانتظام. يعتبر هذا المصباح الليلي للأطفال القابل للشحن خيارًا مثاليًا لتوفير إضاءة هادئة وآمنة لأطفالكم أثناء النوم.', '0000', NULL, NULL, '2023-12-16 13:32:09', '2023-12-16 13:32:09', NULL),
(364, 64, 1, 'قلاية هوائية سعة كبيرة 8.8 لتر', 'قلاية هوائية سعة كبيرة 8.8 لتر', 2500, 4200, NULL, NULL, 1, 'available', 'قلاية هوائية سعة كبيرة 10.5 لتر خالية من الزيت بتصميم جديد تعد حلاً مثاليًا لتحضير وجبات صحية ولذيذة. تتميز بوظيفة الهواء المقلاة وتحكم ترموستات قابل للضبط، مما يتيح لك ضبط درجة الحرارة حسب الاحتياجات الخاصة بك. تحظى هذه القلاية بحجم كبير بسعة 10.5 لتر، مما يمكنك من طهي الوجبات بكميات كبيرة. تأتي مع حاوية زيت قابلة للانفصال، ومؤشر إضاءة، ونافذة مراقبة، وشاشة LED لعرض المعلومات. تتميز بتصميم آمن وسهل التنظيف، وتوفر حماية من الحرارة العالية وتشتمل على شهادات CE/CB للجودة والأمان. احصل على هذه القلاية الهوائية العملية واستمتع بوجبات صحية ولذيذة بدون استخدام الزيت.', 'xjd111', NULL, NULL, '2023-12-16 13:35:06', '2023-12-16 13:35:06', NULL),
(365, 68, 1, 'عصارة الحمضيات اليدوية الفولاذية', 'عصارة الحمضيات اليدوية الفولاذية', 1400, 2300, NULL, NULL, 1, 'available', 'عصارة حمضيات يدوية من الفولاذ المقاوم للصدأ هي أداة ممتازة لعصر الفواكه الحمضية بسهولة وفعالية في المطبخ. تتميز بتصميم قوي ومتين مصنوع من الفولاذ المقاوم للصدأ ذو الجودة العالية، مما يجعلها متينة ومستدامة للاستخدام اليومي. بفضل آلية الضغط اليدوية، يمكنك استخلاص العصير بكفاءة عالية من الفواكه مثل البرتقال والليمون والجريب فروت. تتميز العصارة بحجم مدروس وسهولة التنظيف، مما يجعلها مثالية للاستخدام المنزلي وفي المطاعم والفنادق. احصل على عصارة حمضيات يدوية من الفولاذ المقاوم للصدأ عالية الجودة واستمتع بعصير طازج وصحي في أي وقت.', 'xjd-92', NULL, NULL, '2023-12-16 13:37:59', '2023-12-16 13:37:59', NULL),
(366, 75, 1, 'آلة كسر كتل الثلج', 'آلة كسر كتل الثلج', 1250, 1950, NULL, NULL, 1, 'available', 'آلة كسارة كتل الثلج الكهربائية المنزلية الاحترافية من شركة التصنيع الأصلية هي منتج عالي الجودة ومثالي للاستخدام المنزلي. تأتي الآلة بشفرة واحدة قوية تقوم بكسر وتجميد كتل الثلج بسهولة وسرعة. بفضل تصميمها الشبه التلقائي والمراقبة الدقيقة، يمكنك الاستمتاع بكوكتيلات منعشة ومشروبات باردة في أي وقت. تتميز هذه الآلة بمواصفات فائقة، وتتضمن محركًا كهربائيًا بقوة 250 واط وسرعة دوران تصل إلى 1450 دورة في الدقيقة. كما تتميز بالمتانة والقوة بفضل شفرة الفولاذ المقاوم للصدأ والمواد الألومنيوم. سواء كنت ترغب في تحضير مشروبات منعشة في المنزل أو في تأسيس عمل تجاري، فإن آلة كسارة كتل الثلج الكهربائية هذه هي الاختيار المثالي.', 'xjd29', NULL, NULL, '2023-12-16 13:40:59', '2023-12-16 13:40:59', NULL),
(367, 64, 1, 'قلاية كهربائية صغيرة', 'قلاية كهربائية صغيرة', 280, 520, NULL, NULL, 1, 'available', 'تقدم لك Zogifts مقلاة كهربائية مصغرة متعددة الوظائف، تعد هذه المقلاة الكهربائية الأداة المثالية لمطبخك. تتميز بقاع مسطح غير لاصق يمنحك نتائج طهي مثالية وسهولة في التنظيف. تتضمن الوظائف المتعددة للمقلاة الكهربائية طهي البيض وغليه وصنع العجة وتحضير العديد من الأطباق الشهية. تتمتع بتصميم حديث ومدمج يوفر مساحة في المطبخ وسهولة في التخزين. تعمل بكفاءة عالية وقوة 100 واط، وتأتي مع غطاء شفاف لمراقبة عملية الطهي. احصل على مقلاة كهربائية مصغرة متعددة الوظائف من Zogifts اليوم واستمتع بتحضير وجبات لذيذة بسهولة وسرعة في منزلك.', 'xjd-55', NULL, NULL, '2023-12-16 13:44:15', '2023-12-16 13:44:15', NULL),
(368, 75, 1, 'خلاط كريم', 'خلاط كريم', 180, 350, NULL, NULL, 1, 'available', 'خلاط كريم بلاستيك متعدد الوظائف بالجملة من الصين طقم مع خطاف وخطافات من الفولاذ المقاوم للصدأ. يعد هذا الخلاط الكهربائي مثاليًا للاستخدام المنزلي ويوفر تجربة خلط مريحة وفعالة. يتميز بتصميم بلاستيكي عالي الجودة يوفر المتانة والاستدامة. يأتي مع مجموعة من خطافات الفولاذ المقاوم للصدأ التي تساعد في الخفق والعجن بسهولة. يتميز بسبع إعدادات للسرعة، مما يتيح لك تعديل السرعة وفقًا لاحتياجاتك الخاصة. يعد هذا الخلاط الكهربائي مثاليًا لتحضير العجائن والكريمات والمزيجات الأخرى بسهولة وفعالية. احصل على هذا الخلاط بالجملة الآن واستمتع بوظائفه المتعددة والأداء الرائع.', '00000', NULL, NULL, '2023-12-16 13:46:46', '2023-12-16 13:46:46', NULL),
(369, 75, 1, 'خلاط للعجينة حجم كبير', 'خلاط للعجينة حجم كبير', 480, 780, NULL, NULL, 1, 'available', '2.0L صحن الفولاذ المقاوم للصدأ مطلي بالكروم تصفيح الإسكان Batidor الكهربائية الجدول الوقوف خلاط كعكة خافق البيض\r\n\r\nصممت خلاطة الوقوف هذه لتلبية احتياجاتك في المطبخ بكفاءة وأناقة. تتميز بسعة 2.0 لتر وصحن فولاذي مقاوم للصدأ مطلي بالكروم تصفيح، وهو مثالي لخلط وعجن المكونات بسهولة. تتوفر 7 سرعات مختلفة لتناسب جميع احتياجاتك، بما في ذلك خفق البيض وخلط العجين. يأتي الخلاط مع خاصية زر القاذف للخافق لتسهيل عملية الاستخدام. يعمل بقوة 150 واط ويتوفر بجهد 220 فولت/110 فولت. يتميز بتصميم صلب وعصري يضيف لمسة جمالية إلى مطبخك. احصل على هذا الخلاط الكهربائي العملي والأنيق لتحضير أشهى الوصفات في منزلك.', 'xjd-30', NULL, NULL, '2023-12-16 13:50:24', '2023-12-16 13:50:24', NULL),
(370, 75, 1, 'خلاط عجين الخبز الكهربائي العملي', 'خلاط عجين الخبز الكهربائي العملي', 420, 680, NULL, NULL, 1, 'available', '\"خلاط البيض وعجين الخبز الكهربائي الصغير الرأسي هو أداة مطبخ عالية الجودة ومفيدة لتحقيق نتائج مثالية في تحضير الأطعمة. يتميز الخلاط بقوة عالية وقدرة سريعة على الخلط، مما يتيح لك خلط وعجن البيض وعجين الخبز بسهولة وفعالية. يأتي الخلاط مع زوجين من الأعواد لتحسين أداء الخفق والتخلص من صفار البيض والبياض بشكل منفصل. يتميز بتصميمه المتين والأنيق من الفولاذ المقاوم للصدأ. يعتبر هذا الخلاط أداة ضرورية لأي مطبخ، حيث يوفر سهولة الاستخدام والقوة العالية لتحقيق نتائج مثالية في الخبز والخفق', 'x5d-45', NULL, NULL, '2023-12-16 13:53:03', '2023-12-16 13:53:03', NULL),
(371, 75, 1, 'مطحنة الحم', 'مطحنة الحم', 600, 950, NULL, NULL, 1, 'available', 'مطحنة اللحمة اليدوية No.32-5 من سبائك الألومنيوم محشوة للصلصات هي أداة مثالية للمطبخ المنزلي. تتميز بتصميمها المتين والقوي من سبائك الألومنيوم، مما يجعلها قادرة على طحن وطحن اللحوم بكفاءة عالية. بفضل مشبكها المدمج، يمكن تثبيتها بأمان على الطاولة أثناء الاستخدام، مما يوفر استقرارًا أثناء العملية. تتميز هذه المطحنة أيضًا بإمكانية استخدامها في تحضير الصلصات وطحن المكونات الأخرى. تعد مطحنة اللحمة اليدوية هذه أداة متعددة الاستخدامات وعملية، مما يجعلها اختيارًا مثاليًا للمطابخ المنزلية التي ترغب في تحضير اللحوم المفرومة والصلصات اللذيذة بسهولة وسرعة.', 'xjd103', NULL, NULL, '2023-12-16 13:58:37', '2023-12-16 13:58:37', NULL),
(372, 68, 1, 'مطحنة الحم اليدوية صغيرة', 'مطحنة الحم اليدوية صغيرة', 250, 480, NULL, NULL, 1, 'available', 'مطحنة اللحم اليدوية هذه هي إضافة مثالية لجهاز المطبخ المنزلي الخاص بك. بتصميمها الجديد والعصري، تتمتع هذه المطحنة الصغيرة بقدرة رائعة على طحن اللحم بسهولة وفعالية. تتميز بوظيفة التشغيل الآمنة التي تضمن سلامتك أثناء الاستخدام. تستطيع استخدامها في المطابخ المنزلية، الفنادق، المطاعم، والأماكن التجارية الأخرى. تأتي مع ضمان لمدة سنة، وتوفر قطع الغيار مجانًا. تعتبر مادة الإسكان من الألومنيوم متينة ومتينة. يمكنك طلبها الآن بسهولة وتجربة تحضير اللحم المطحون الطازج في منزلك بكل يسر وسلاسة. استمتع بتجربة فريدة من نوعها في تحضير الأطعمة مع هذه المطحنة اليدوية للحم المصممة بعناية.', '00000', NULL, NULL, '2023-12-16 15:44:27', '2023-12-16 15:44:27', NULL),
(373, 75, 1, 'طاحونة زاوية كهربائية', 'طاحونة زاوية كهربائية', 950, 1450, NULL, NULL, 1, 'available', 'منتجنا هو طاحونة زاوية كهربائية بزاوية حامل صغيرة من طراز Ronix 2020. تعتبر هذه الطاحونة مثالية للاستخدام في المنزل أو الورشة أو الصناعة. تأتي الطاحونة بمحرك كهربائي بقوة 1200 واط، وسرعة تشغيل بدون حمولة تصل إلى 28000 دورة في الدقيقة. تتميز بقرص قطع عالي الجودة ويمكن استخدامها للعديد من التطبيقات مثل القطع والطحن والتشذيب. تتميز بتصميم صغير ومريح يسهل حملها واستخدامها بسهولة في المساحات الضيقة. تأتي الطاحونة مع ضمان لمدة سنة وتدعم خيارات التخصيص والشعارات المخصصة. احصل على هذه الطاحونة الكهربائية عالية الأداء واستمتع بالدقة والكفاءة في أعمالك.', 'xjd-28', NULL, NULL, '2023-12-16 16:23:24', '2023-12-16 17:56:17', NULL),
(374, 65, 1, 'مجموعة أدوات الطبخ', 'مجموعة أدوات الطبخ', 450, 700, NULL, NULL, 1, 'available', 'مجموعة أدوات الطبخ بـ 12 قطعة من السيليكون باللون الأرجواني هي مجموعة رائعة لمطبخك. تأتي هذه المجموعة بتصميم متعدد الاستخدامات ومواد عالية الجودة بحيث تكون مثالية للاستخدام اليومي. تتضمن المجموعة مجموعة واسعة من الأدوات المهمة للطهي مثل الملعقة، المغرفة، الملقط، المعولة، وغيرها الكثير. جميع الأدوات مصنوعة من السيليكون المرن والمتين، مما يجعلها مقاومة للحرارة وآمنة للاستخدام على الأسطح اللاصقة. بفضل اللون الأرجواني الجميل، ستضفي هذه المجموعة لمسة من الأناقة والألوان على مطبخك. احصل على مجموعة أدوات الطبخ بـ 12 قطعة من السيليكون الأرجواني وتمتع بتجربة طهي سهلة وممتعة.', 'CT56', NULL, NULL, '2023-12-16 17:01:24', '2023-12-16 17:01:24', NULL),
(375, 112, 1, 'إبريق حراري مزدوج الجدران', 'إبريق حراري مزدوج الجدران', 450, 650, NULL, NULL, 1, 'available', 'إبريق قهوة شاي معزول فراغي مزدوج الجدران لإناء قهوة حراري - احصل على هذا الإبريق المميز الذي يوفر لك تجربة شرب قهوة وشاي ساخنة مثالية في أي وقت. يتميز بتصميم معزول فراغي مزدوج الجدران من الفولاذ المقاوم للصدأ، مما يحافظ على درجة حرارة المشروبات لفترة طويلة ويحمي يديك من الحرارة الزائدة. بسعة 2.0 لتر، يوفر هذا الإبريق كمية كبيرة من المشروبات الساخنة لمشاركتها مع العائلة والأصدقاء. بتصميمه الكلاسيكي والأنيق، يضيف لمسة من الفخامة إلى منزلك أو مكتبك. احصل على هذا الإبريق المثالي للاستمتاع بمشروباتك الساخنة في أي وقت وفي أي مكان بكل راحة وسهولة.', 'JH', NULL, NULL, '2023-12-16 17:06:12', '2023-12-24 05:25:32', NULL),
(376, 73, 1, 'مجموعة ادوات لقطع لأعصان', 'مجموعة ادوات لقطع لأعصان', 1000, 1600, NULL, NULL, 1, 'available', 'منشار السلسلة اللاسلكي CS02 هو أداة قوية ومتعددة الاستخدامات لقطع الخشب. يتميز هذا المنشار بتصميمه المتطور والمحسّن، حيث يحتوي على محرك قوي بقدرة 550 وات وبطارية صغيرة قابلة للشحن. يتميز المنشار بالمرونة والسهولة في الاستخدام، حيث يمكن استخدامه لقطع الأغصان والجذوع الخشبية بسرعة ودقة. يتميز بجودة التصنيع العالية والمواد المتينة مثل ABS، مما يجعله متينًا وموثوقًا. يعد منشار السلسلة اللاسلكي CS02 خيارًا مثاليًا للحرفيين والمتخصصين في الحدائق وأعمال النجارة، حيث يوفر قوة وأداءً استثنائيًا في قطع الخشب.', 'TV80', NULL, NULL, '2023-12-16 17:15:44', '2023-12-16 17:15:44', NULL),
(377, 93, 1, 'مقص منزلي', 'مقص منزلي', 35, 60, NULL, NULL, 1, 'available', 'هو منتج عالي الجودة ومتعدد الاستخدامات. يأتي هذا المنتج بشفرات حادة مصنوعة من الفولاذ المقاوم للصدأ المتين، مما يضمن قوة وتحمل عاليين. يتميز بتصميمه الأنيق وبطاقة OEM البلاستيكية PP التي توفر قبضة مريحة وقوية أثناء الاستخدام. يمكن استخدامه في المكتب والمنزل والمطبخ والمدرسة. إنه مثالي لقص مجموعة متنوعة من المواد مثل الورق والبلاستيك والقماش وغيرها. بالإضافة إلى ذلك، فإنه يأتي بسعر مناسب وتخفيضات كبيرة، مما يجعله اختيارًا مثاليًا للأفراد الذين يبحثون عن جودة عالية وقيمة ممتازة.', 'JH-132', NULL, NULL, '2023-12-16 17:20:45', '2023-12-16 17:20:45', NULL),
(378, 112, 1, 'وعاء قهوة الشمس المشرقة', 'وعاء قهوة الشمس المشرقة', 250, 450, NULL, NULL, 1, 'available', 'وعاء القهوة التركية، وعاء الدلة العربية، وعاء القهوة العربي - منتج عالي الجودة صُنع من مواد جسم PP المعزولة حراريًا. هذا الوعاء يتميز بتصميمه الكلاسيكي والأنيق، وهو مناسب للاستخدام في الأعمال والهدايا. يمكنه الاحتفاظ بالمشروبات الساخنة والباردة لمدة تصل إلى 24 ساعة. يتميز بجودة العزل الحراري العالية ويأتي بسعة 1.0 لتر. مصنوع من الفولاذ المقاوم للصدأ ومادة PP. يتمتع بشكل مسقيم وتصميم عربي أنيق. مناسب للاستخدام في المكتب أو في المنزل أو أثناء السفر. يعتبر هذا الوعاء خيارًا مثاليًا لمحبي القهوة العربية ولأولئك الذين يرغبون في الاستمتاع بمشروباتهم المفضلة في أي وقت وفي أي مكان.', 'JH200', NULL, NULL, '2023-12-16 17:24:58', '2023-12-16 17:43:28', NULL),
(379, 75, 1, 'مطحنة حبوب كهربائية', 'مطحنة حبوب كهربائية', 1800, 2700, NULL, NULL, 1, 'available', 'مطحنة الحبوب الكهربائية من الفولاذ المقاوم للصدأ هي أداة عملية وعالية الجودة لطحن الحبوب وتحويلها إلى مسحوق. تتميز بتصميمها القوي والمتين من الفولاذ المقاوم للصدأ، مما يجعلها مقاومة للتآكل وسهلة التنظيف. تعمل بالطاقة الكهربائية وتتمتع بمحرك قوي يضمن طحن سريع وفعال للحبوب. يمكن استخدام هذه المطحنة لطحن مجموعة متنوعة من الحبوب مثل القمح والشعير والأرز والشوفان والتوابل الجافة. تتميز بسهولة الاستخدام والتحكم، حيث يمكن ضبط درجة الطحن وفقًا للتفضيلات الشخصية. إنها منتج ممتاز للمطابخ المنزلية والمطاعم والأماكن التجارية التي تحتاج إلى طحن الحبوب بكفاءة وسرعة.', 'xjd70', NULL, NULL, '2023-12-16 17:41:45', '2023-12-16 17:43:43', NULL),
(380, 103, 1, 'ماكينة القهوة الاحترافية', 'ماكينة القهوة الاحترافية', 3200, 5200, NULL, NULL, 1, 'available', 'ماكينة القهوة إسبريسو من الفولاذ المقاوم للصدأ بسعة 1.5 لتر وقوة 220 فولت وضغط 15 بار تعتبر خيارًا مثاليًا لتحضير القهوة اللذيذة في المنزل أو في الفنادق. تتميز هذه الماكينة بوظائف متقدمة مثل التحكم في درجة الحرارة ونظام الشراب ونظام الماء الساخن، مما يضمن تجربة قهوة فريدة وممتعة. تصميمها الأنيق والمتين من الفولاذ المقاوم للصدأ يمنحها مظهرًا جذابًا ويضمن متانتها واستدامتها. بفضل سعة خزان المياه البالغة 1.5 لتر، يمكنك تحضير العديد من أكواب القهوة دون الحاجة إلى إعادة ملء الخزان بشكل متكرر. استمتع بتجربة قهوة إسبريسو محترفة في راحة منزلك مع هذه الماكينة المهنية.', '00000', NULL, NULL, '2023-12-16 17:44:51', '2023-12-16 17:49:17', NULL),
(381, 112, 1, 'إبريق قهوة فراغي ذكي', 'إبريق قهوة فراغي ذكي', 350, 550, NULL, NULL, 1, 'available', 'غلاية قهوة حرارية ذكية/إبريق قهوة فراغي/عربية مع صندوق هدايا زجاجي قوارير فراغية كلاسيكية كوب للبطن - قم بشراء غلاية القهوة الحرارية الذكية المصنوعة من الفولاذ المقاوم للصدأ. تعتبر هذه الغلاية الفراغية مثالية للاستمتاع بقهوتك الساخنة في أي وقت من اليوم. تأتي بشاشة عرض LED تعرض درجة الحرارة بوضوح لتتحكم بدقة في حرارة القهوة. بسعة 500 مل، يمكنك الاستمتاع بكمية كافية من القهوة المشروبة لفترة طويلة. تصميمها الكلاسيكي يجمع بين الأناقة والأداء المتميز. هذه الغلاية الذكية تأتي مع صندوق هدايا زجاجي قوارير فراغية كلاسيكية، مما يجعلها هدية مثالية لعشاق القهوة.', 'JH202', NULL, NULL, '2023-12-16 17:48:55', '2023-12-16 17:48:55', NULL),
(382, 103, 1, 'ماكينة صنع القهوة البسيطة', 'ماكينة صنع القهوة البسيطة', 600, 850, NULL, NULL, 1, 'available', 'مع ماكينة القهوة البسيطة المحمولة الكهربائية، يمكنك الاستمتاع بكوب من القهوة اللذيذة في أي وقت وأي مكان. تتميز هذه الماكينة بتصميمها المحمول العصري والمريح، مما يجعلها مثالية للاستخدام في المنزل، الفندق، المكتب، أو أثناء السفر. بفضل وظيفتها البسيطة لصنع القهوة بالتنقيط، يمكنك الحصول على قهوة طازجة ولذيذة بلمسة واحدة. تعمل بالكهرباء وتأتي بخزان ماء بسعة 0.6 لتر أو 0.75 لتر، مما يتيح لك تحضير عدة أكواب من القهوة في وقت واحد. احصل على تجربة قهوة مثالية في أي مكان مع ماكينة القهوة البسيطة المحمولة الكهربائية.', 'xjd113', NULL, NULL, '2023-12-16 17:49:37', '2023-12-16 17:49:37', NULL),
(383, 111, 1, 'موقد الفحم الكهربائي المحمول', 'موقد الفحم الكهربائي المحمول', 250, 450, NULL, NULL, 1, 'available', 'موقد الفحم للنرجيلة عالي الجودة والأداء. يتميز بتصميم بسيط وكهربائي يوفر سهولة الاستخدام. يمكن استخدامه لتشغيل الفحم بسرعة وسهولة، مما يتيح لك الاستمتاع بجلسات الشيشة دون عناء إشعال الفحم التقليدي. يتميز بقدرة 450 واط لتسخين الفحم بسرعة والحفاظ على درجة حرارته المثالية لتجربة شيشة ممتعة. كما يتميز بمفتاح تحكم قابل للتعديل لضبط درجة حرارة الفحم وفقًا لتفضيلاتك. تصميمه العملي والعصري يجعله قطعة مثالية لمحبي الشيشة. استمتع بجلسات النرجيلة الممتعة والمريحة مع موقد الفحم هذا.', 'x5d-18', NULL, NULL, '2023-12-16 17:52:53', '2023-12-16 17:52:53', NULL),
(384, 86, 1, 'جرة حرارية ساخنة للأطفال', 'جرة حرارية ساخنة للأطفال', 1200, 1850, NULL, NULL, 1, 'available', 'جرة حرارية معزولة للحرارة مع فراغ من الفولاذ المقاوم للصدأ للأطفال\r\n\r\nاحتفظ بطعام أطفالك دافئًا وطازجًا لفترة طويلة مع جرة الطعام الحرارية المعزولة هذه. تم تصميمها خصيصًا لتلبية احتياجات الأطفال، وتتميز بتقنية الفراغ المبتكرة التي تحافظ على درجة حرارة الطعام داخل الجرة لفترة طويلة. مصنوعة من الفولاذ المقاوم للصدأ عالي الجودة، وتتميز بخصائص مثل حفظ النضارة وإمكانية التسخين. تأتي بسعة متنوعة لتناسب احتياجاتك، وتحتوي على غطاء محكم الإغلاق لمنع التسرب. سهلة الحمل ومحمولة، تعد هذه الجرة الحرارية خيارًا مثاليًا للأمهات الراغبات في إبقاء طعام أطفالهم ساخنًا وشهيًا أثناء التنقل.', 'BW-04', NULL, NULL, '2023-12-16 17:53:49', '2023-12-16 17:53:49', NULL),
(385, 86, 1, 'صندوق الغداء الحراري المتين', 'صندوق الغداء الحراري المتين', 2000, 3100, NULL, NULL, 1, 'available', 'جهاز تدفئة الطعام من الفولاذ المقاوم للصدأ يعد حلاً مثاليًا للحفاظ على طعامك دافئًا وطازجًا أثناء التنقل. يتميز بتصميمه العصري والعملي، ومصنوع من الفولاذ المقاوم للصدأ عالي الجودة. يتمتع هذا الجهاز بسعة واسعة تتسع لما بين 2 إلى 10 لترات من الطعام. يأتي مع مقبض مريح لسهولة الحمل والنقل. يمكن استخدامه في المناسبات المختلفة مثل الرحلات والنزهات والعمل. يعمل على الحفاظ على درجة حرارة الطعام لفترة طويلة، مما يسمح لك بالاستمتاع بوجبات دافئة ولذيذة في أي وقت وأي مكان.', 'BW01', NULL, NULL, '2023-12-16 18:11:55', '2023-12-26 17:25:50', NULL),
(386, 103, 1, 'آلة صنع القهوة الكهربائية المحمولة', 'آلة صنع القهوة الكهربائية المحمولة', 200, 400, NULL, NULL, 1, 'available', 'آلة صنع القهوة الكهربائية  \r\n هي جهاز عملي ومثالي لصنع القهوة اللذيذة في راحة منزلك. تتميز هذه الآلة بوظيفة مانعة للتسرب، مما يضمن عدم تسرب القهوة أثناء الاستخدام. تتميز بتصميم صغير ومحمول، مما يجعلها مثالية للاستخدام في المنزل، أو في السفر، أو أثناء التخييم. تأتي بسعة 0.6 لتر، وتعمل بقوة 600 واط وجهد 220 فولت. تتوفر بألوان متنوعة، وتحتوي على مقبض مريح لسهولة الاستخدام. مع هذه الآلة، يمكنك الاستمتاع بكوب من القهوة التركية الغنية والمذاق الرائع في أي وقت ومن أي مكان.', 'XJD15', NULL, NULL, '2023-12-16 18:17:14', '2023-12-16 18:35:39', NULL),
(387, 127, 1, 'مفرمة الخضروات', 'مفرمة الخضروات', 100, 180, NULL, NULL, 1, 'available', 'أداة تقطيع الخضروات والفواكه والأعشاب هذه هي حلاً مثاليًا للأشخاص الذين يبحثون عن طريقة سهلة وسريعة لتحضير الطعام. تتميز بتصميم محمول يمكن حمله باليد، مما يجعلها مناسبة للاستخدام في المنزل أو أثناء السفر. تسمح لك بتقطيع الخضروات، الفواكه، الأعشاب، الزنجبيل، والمكسرات بسهولة وسرعة. تتضمن أيضًا سلسلة سحب لتفريم الثوم وقطع البصل بسهولة. تم تصميمها بمواد عالية الجودة مثل ABS و PS والفولاذ المقاوم للصدأ للتحمل والمتانة. هذه الأداة مثالية لتوفير الوقت والجهد في المطبخ، وتعد اختيارًا رائعًا للأفراد الذين يرغبون في تحضير وجبات طعام صحية بسهولة.', 'XJD-102', NULL, NULL, '2023-12-16 18:25:23', '2023-12-26 17:26:23', NULL),
(388, 113, 1, 'مفرمة الثوم مسحوبة يدويا', 'مفرمة الثوم مسحوبة يدويا', 65, 110, NULL, NULL, 1, 'available', 'مفرمة الثوم اليدوية هي منتج رائع يضفي الكفاءة والسهولة على عملية تحضير الثوم في المطبخ. تأتي هذه المفرمة بتصميم صغير الحجم ومسحوبة يدويًا، مما يجعلها مثالية للاستخدام في المطابخ الصغيرة وأثناء السفر. تتميز ببنية متينة مصنوعة من الفولاذ المقاوم للصدأ، مما يضمن متانة وطول عمر المنتج. تتميز أيضًا بشفرات حادة تسمح بفرم الثوم بسهولة وسرعة. بفضل هذه المفرمة، يمكنك تجهيز الثوم بسرعة لإضافته إلى الأطباق المفضلة لديك مثل الصلصات والمأكولات البحرية والمخبوزات. احصل على هذه المفرمة العملية اليوم واستمتع بتحضير الثوم بكل سهولة ويسر.', 'XJD102A', NULL, NULL, '2023-12-16 18:42:27', '2023-12-16 18:42:27', NULL),
(389, 127, 1, 'مفرمة اللحم الكهربائية المتطورة', 'مفرمة اللحم الكهربائية المتطورةX', 350, 550, NULL, NULL, 1, 'available', 'مفرمة لحم كهربائية فاخرة بسعة 2 لتر من الفولاذ المقاوم للصدأ عالية الجودة. هذه المفرمة المحمولة هي أداة مثالية لطحن اللحم والعظام بسهولة وفعالية في المنزل. تتميز بسعة كبيرة تبلغ 2 لتر، مما يتيح لك طحن كميات كبيرة من اللحم دفعة واحدة. مصنوعة من الفولاذ المقاوم للصدأ عالي الجودة، مما يجعلها قوية ومتينة ومقاومة للصدأ. تأتي مع وظيفة التشغيل الآمن للحفاظ على سلامتك أثناء الاستخدام. بفضل تصميمها المدمج والمحمول، يمكنك استخدامها في المطبخ أو في الرحلات والتخييم. سهلة الاستخدام والتنظيف. هذه المفرمة الكهربائية هي خيار رائع لكل منزل لتلبية احتياجاتك في طحن اللحم بسهولة وسرعة', 'XJD-71A', NULL, NULL, '2023-12-16 18:46:22', '2023-12-26 17:23:11', NULL),
(390, 127, 1, 'مفرمة البصل الكهربائية القوية', 'مفرمة البصل الكهربائية القوية', 150, 250, NULL, NULL, 1, 'available', 'مفرمة البصل القاطعة الكهربائية المتطورة هي أداة مثالية لتسهيل عملية تقطيع الطعام. تتميز بسعة كبيرة تبلغ 2 لتر، مما يسمح لك بتقطيع كميات كبيرة من البصل والخضروات والفواكه بسرعة وسهولة. تعمل هذه المفرمة بالطاقة الكهربائية، مما يوفر لك الوقت والجهد في المطبخ. تتميز بتصميم قوي ومتين، وتستخدم شفرات حادة مصنوعة من الفولاذ المقاوم للصدأ لضمان قطع سريع ودقيق. بفضل هذه المفرمة، يمكنك الاستمتاع بتجهيز الأطعمة بسرعة وسهولة، مما يجعلها خيارًا مثاليًا للمطابخ المنزلية والمطاعم والمقاصف.', 'XD003', NULL, NULL, '2023-12-16 18:51:28', '2023-12-26 17:22:46', NULL),
(391, 127, 1, 'مفرمة البصل', 'مفرمة البصل', 80, 160, NULL, NULL, 1, 'available', 'ماكينة تقطيع البصل الزنجبيل الثوم بالفولاذ المقاوم للصدأ:\r\nاحصل على ماكينة قطع البصل الزنجبيل الثوم المصنوعة من الفولاذ المقاوم للصدأ عالية الجودة. تتميز هذه الماكينة بقوتها وكفاءتها في قطع البصل والزنجبيل والثوم بسرعة وسهولة. تصميمها المبتكر يوفر قبضة مريحة وسهلة الاستخدام، مما يجعل عملية التقطيع أكثر سلاسة وأمانًا. بفضل المواد عالية الجودة والمستدامة، فإن هذه الماكينة متينة وتدوم لفترة طويلة. بالإضافة إلى ذلك، تتميز بتصميم يسمح بتفكيكها بسهولة لتسهيل التنظيف. احصل على هذه الماكينة العملية والفعالة لتسهيل عملية تحضير الطعام في المطبخ.', 'CF-34', NULL, NULL, '2023-12-16 18:56:54', '2023-12-26 17:22:07', NULL),
(392, 127, 1, 'مفرمة الخضروات', 'مفرمة الخضروات', 250, 450, NULL, NULL, 1, 'available', 'مفرمة البصل والخضروات هي أداة متعددة الوظائف تسهل عليك تقطيع وتمزيق الخضروات بسهولة وسرعة. تأتي هذه المفرمة مع شفرات حادة مصنوعة من الفولاذ المقاوم للصدأ، مما يضمن قدرة فعالة على تقطيع البصل والجزر والبطاطس والفواكه والخضروات الأخرى. تتميز بتصميم قابل للتعديل يمكنك تغييره للحصول على أحجام قطع مختلفة حسب احتياجاتك. تحتوي أيضًا على رف تصريف لتسهيل تصريف السوائل. بفضل هذه المفرمة، ستوفر الكثير من الوقت والجهد في عمليات تجهيز الطعام في المطبخ. إنها أداة مثالية للمطبخ وستجعل تجربة الطهي أكثر متعة وسهولة', 'YN-66', NULL, NULL, '2023-12-16 20:22:33', '2023-12-26 17:21:06', NULL),
(393, 103, 1, 'مطحنة القهوة الكهربائية', 'مطحنة القهوة الكهربائية', 600, 850, NULL, NULL, 1, 'available', 'مطحنة القهوة الكهربائية من الفولاذ المقاوم للصدأ هي أداة رائعة لعشاق القهوة. تتميز هذه المطحنة بأداء قوي وتصميم عصري. تسمح لك بطحن حبوب البن بسهولة وسرعة للحصول على قهوة طازجة ومفعمة بالنكهة. تأتي بشفرة قوية مصنوعة من الفولاذ المقاوم للصدأ تساعد على طحن البن بشكل متساوٍ وفعال. يمكنك ضبط درجة الطحن وفقًا لتفضيلاتك، سواء كنت ترغب في قهوة ناعمة أو خشنة. بفضل تصميمها الكهربائي، يمكنك استخدامها بسهولة دون تعب أو مجهود. إنها مثالية للاستخدام في المنزل أو في المكتب. استمتع بتجربة القهوة الممتعة والطازجة مع مطحنة القهوة الكهربائية من الفولاذ المقاوم للصدأ.', 'xpdp06', NULL, NULL, '2023-12-16 20:26:35', '2023-12-16 20:26:35', NULL),
(394, 127, 1, 'قطاعة الخضروات السريعة', 'قطاعة الخضروات السريعة', 230, 400, NULL, NULL, 1, 'available', 'قطاعة الخضروات والبصل هي أداة ممتازة لمطبخك. تتميز هذه القطاعة بقدرتها على تقطيع الخضروات بسرعة وسهولة، مما يوفر الكثير من الوقت والجهد في عملية التحضير. تتميز هذه القطاعة بتصميمها اليدوي المريح، مما يسهل عليك قطع البصل والخضروات بدون مجهود كبير. بفضل حجمها الصغير وخفة وزنها، يمكنك استخدامها بسهولة في المطبخ أو أثناء السفر. تتميز هذه القطاعة بجودتها العالية ومتانتها، مما يجعلها تستمر لفترة طويلة دون أن تفقد كفاءتها. احصل على قطاعة الخضروات والبصل هذه اليوم واستمتع بتحضير الوجبات بكل سهولة', 'XJD-70', NULL, NULL, '2023-12-16 20:27:33', '2023-12-26 17:20:39', NULL),
(395, 114, 1, 'ماكينة فشار الهواء الساخن', 'ماكينة فشار الهواء الساخن', 500, 820, NULL, NULL, 1, 'available', 'آلة صنع الفشار بالهواء الساخن مع كوب قياس الميكروويف صانع الفشار غلاية صغيرة هي منتج عملي ومثالي لعشاق الفشار في المنزل. تتميز هذه الآلة بتقنية الهواء الساخن التي تسمح بإعداد الفشار اللذيذ بطريقة صحية وخالية من الزيوت الزائدة. تأتي الآلة مع كوب قياس الميكروويف لضمان قياس الكمية المناسبة من حبوب الفشار. تتميز الغلاية الصغيرة بتصميم مدمج وسهل الاستخدام، مما يسهل حملها وتخزينها. بفضل وظيفتها السريعة للحرارة، يمكنك الاستمتاع بوجبات الفشار الطازجة في دقائق قليلة. استمتع بتحضير الفشار المقرمش واللذيذ في أي وقت تشاء مع هذه الآلة المميزة.', 'x5d-73', NULL, NULL, '2023-12-16 20:33:16', '2023-12-16 20:33:16', NULL),
(396, 68, 1, 'عصارة الحمضيات اليدوية', 'عصارة الحمضيات اليدوية', 250, 450, NULL, NULL, 1, 'available', 'عصارة الحمضيات اليدوية هي أداة ممتازة لعصر البرتقال والليمون والحمضيات الأخرى بسهولة وفعالية. تتميز بتصميمها اليدوي الذي يوفر قوة ضغط قوية لاستخلاص كل قطرة من العصير. مصنوعة من الفولاذ المقاوم للصدأ عالي الجودة، مما يجعلها متينة ومقاومة للصدأ. بفضل تصميمها البسيط والعملي، يمكنك استخدامها في المنزل أو في المطبخ بسهولة. تعد عصارة الحمضيات اليدوية مثالية لتحضير عصائر الحمضيات الطازجة والمشروبات الصحية. احصل على هذه العصارة اليدوية العملية والموثوقة لتجربة عصير طازجة ولذيذة في أي وقت تشاء', 'DAM17', NULL, NULL, '2023-12-16 20:34:05', '2023-12-16 20:34:05', NULL),
(397, 66, 1, 'زجاجة ماء', 'زجاجة ماء', 70, 110, NULL, NULL, 1, 'available', 'زجاجة الماء الرياضية ذات الطبقة المزدوجة والتصميم الشفاف هي رفيقك المثالي للنشاطات البدنية والرياضة في الهواء الطلق. تم تصميم هذه الزجاجة لتكون محمولة ومانعة للتسرب، مما يضمن عدم تسرب الماء أثناء النشاطات المكثفة. تتميز بتصميم طبقة مزدوجة يوفر عزلًا حراريًا ممتازًا للحفاظ على برودة الماء في الصيف والحفاظ على دفء المشروبات في الشتاء. تتمتع الزجاجة بسعة كبيرة وتصميم مريح يوفر قبضة محكمة في اليد، وتأتي مع غطاء للحفاظ على نظافة المشروبات ومع حبل لسهولة حملها. اجعل زجاجة الماء الرياضية هذه رفيقك الدائم للتمرينات والمغامرات الخارجية', 'ZN76', NULL, NULL, '2023-12-16 20:38:10', '2023-12-16 20:38:10', NULL),
(398, 114, 1, 'مكينة صنع الفشار الحم الكبير', 'مكينة صنع الفشار الحم الكبير', 750, 1250, NULL, NULL, 1, 'available', 'الأوروبية محلية الصنع مصغرة جهاز إعداد الفشار هو منتج فريد وعالي الجودة. يتميز هذا الجهاز بكونه مصغر الحجم، مما يجعله مناسبًا للاستخدام في المنزل أو في الفعاليات الصغيرة. يتمتع بتصميم متكامل ومبتكر يعمل بشكل تلقائي، مما يوفر سهولة وسرعة في إعداد الفشار. يحتوي الجهاز على محرك كهربائي صغير يمكنه تشغيل الفشار بكفاءة عالية. يعد هذا الجهاز مثاليًا للأطفال الذين يحبون تحضير الفشار بأنفسهم، حيث يمكنهم الاستمتاع بتجربة صنع الفشار بطريقة آمنة وممتعة. احصل على هذا الجهاز المدهش واستمتع بأشهى الفشار في أي وقت تشاء.', 'xjd-74', NULL, NULL, '2023-12-16 20:44:00', '2023-12-16 20:44:00', NULL),
(399, 122, 1, 'زجاجة الماء المرافقة للأطفال', 'زجاجة الماء المرافقة للأطفال', 75, 130, NULL, NULL, 1, 'available', 'زجاجة الماء ذات الفم العريض للأطفال هي منتج ممتاز يهدف إلى تلبية احتياجات الأطفال في شرب الماء بطريقة صحية وممتعة. تتميز الزجاجة بألوان جميلة ومشرقة، وهي مصنوعة من مواد خالية من مادة BPA الضارة، مما يجعلها آمنة للأطفال. تتميز بفم عريض يسهل شرب الماء وتعبئتها بسهولة. تعتبر هذه الزجاجة مثالية لتنشيط الأطفال وتشجيعهم على شرب الماء بانتظام. بفضل أداءها العزل الحراري، فإنها تحافظ على درجة حرارة المشروبات لفترة أطول. تأتي الزجاجة بتصميم عصري وعملي، مما يجعلها رفيقًا مثاليًا للأطفال أثناء السفر والرحلات وممارسة النشاطات الخارجية', 'ZN75', NULL, NULL, '2023-12-16 20:46:07', '2023-12-27 01:02:08', NULL),
(400, 101, 1, 'آلة تشذيب صوف الخراف الكهربائية الاحترافية', 'آلة تشذيب صوف الخراف الكهربائية الاحترافية', 2500, 4300, NULL, NULL, 1, 'available', 'آلة تشذيب صوف الخراف الكهربائية هي منتج مثالي لتحقيق نتائج مذهلة في تشذيب صوف الخراف. تتميز هذه الآلة بتصميمها العالي الجودة والموثوقية العالية، ما يجعلها مثالية للاستخدام في المزارع والمشاغل الحيوانية. تعمل الآلة بتقنية الشعر الساخن لتقديم تجربة تشذيب سلسة وفعالة، حيث تزيل الصوف الزائد بدقة ودون إلحاق الأذى بالحيوانات. كما تتميز بالراحة والسهولة في الاستخدام، مع وجود مقبض مريح للتحكم السهل. بفضل جودتها العالية وأدائها الممتاز، فإن آلة تشذيب صوف الخراف الكهربائية ستكون اختيارًا مثاليًا لمحترفي تربية الخراف ومربي الحيوانات المحترفين.', 'yn108', NULL, NULL, '2023-12-16 20:48:04', '2023-12-16 20:48:04', NULL),
(401, 103, 1, 'آلة صنع القهوة الكهربائية المحمولة', 'آلة صنع القهوة الكهربائية المحمولة', 180, 280, NULL, NULL, 1, 'available', 'آلة صنع القهوة الكهربائية من Sinbo هي آلة رائعة لصنع القهوة التركية والاسبريسو والكابتشينو بسهولة. تأتي هذه الآلة بتصميم محمول وسلك كهربائي سهل الاستخدام والتوصيل. تتميز بقوة 1000 واط وسعة 0.4 لتر، مما يتيح لك صنع حتى 5 أكواب من القهوة في وقت قصير. توفر هذه الآلة سهولة الاستخدام والتنظيف، وتضمن تحضير قهوة طازجة ولذيذة في كل مرة. بفضل تصميمها المحمول، يمكنك الاستمتاع بقهوتك المفضلة في المنزل أو في العمل أو أثناء السفر. استمتع بتجربة قهوة تركية أصيلة مع هذه الآلة الكهربائية المحمولة من Sinbo.', 'XJD-14', NULL, NULL, '2023-12-16 21:17:06', '2023-12-16 21:17:06', NULL),
(402, 73, 1, 'فرشاة إزالة الشعر المتساقط للحيوانات الأليفة', 'فرشاة إزالة الشعر المتساقط للحيوانات الأليفة', 150, 280, NULL, NULL, 1, 'available', 'فرشاة Cepillo Removedor De Pelo Para Mascotas قابلة لإعادة الاستخدام هي أداة احترافية لإزالة الشعر للحيوانات الأليفة. تم تصميمها بعناية لتلبية احتياجات تنظيف الحيوانات الأليفة وإزالة الشعر المتساقط بفعالية. تأتي الفرشاة بتصميم مريح يسهل الاستخدام ويقلل من التشابك والتطاير الزائد للشعر. تستخدم الفرشاة شعيرات ناعمة ومرنة تعمل على التقاط وإزالة الشعر الميت والمتشابك من فراء الحيوانات دون التسبب في أي إزعاج لها. بفضل جودتها ومتانتها، فإن هذه الفرشاة تعتبر اختيارًا مثاليًا لأصحاب الحيوانات الأليفة الذين يرغبون في الحفاظ على نظافة وصحة فراء حيواناتهم. تأتي الفرشاة بألوان متنوعة لتناسب تفضيلات العملاء المختلفة.', 'yn-65', NULL, NULL, '2023-12-16 21:21:41', '2023-12-16 21:21:41', NULL),
(403, 87, 1, 'حامل فرش الأسنان المتعدد الاستخدامات العائلي', 'حامل فرش الأسنان المتعدد الاستخدامات العائلي', 300, 500, NULL, NULL, 1, 'available', 'حامل فرش الأسنان متعدد الاستخدامات، حامل فرش الأسنان متعدد الاستخدامات مثبت على الحائط من البلاستيك مع ثلاث أكواب عائلية مع حامل تخزين. يعد هذا الحامل مثاليًا لتنظيم فرش الأسنان لجميع أفراد العائلة. يمكن تثبيته بسهولة على الحائط، مما يوفر مساحة قيمة في الحمام. يحتوي على ثلاثة أكواب عائلية للفرشاة، مما يجعله مناسبًا للاستخدام العائلي. يتميز بتصميمه المتعدد الوظائف الذي يتضمن حامل تخزين لتنظيم مستلزمات الحمام الأخرى مثل المعجون والخيط الطبي. مصنوع من مواد عالية الجودة من البلاستيك، مما يجعله متينًا ومقاومًا للصدأ. هذا الحامل العملي والعصري يوفر حلاً مثالياً للحفاظ على نظافة وتنظيم أدوات العناية بالفم لك ولعائلتك.', 'tv-04', NULL, NULL, '2023-12-16 21:27:28', '2023-12-16 21:27:28', NULL),
(404, 94, 1, 'جهاز الحجامة', 'جهاز الحجامة', 70, 190, NULL, NULL, 1, 'available', 'جهاز الحجامة، 6 الحجامة جهاز فراغ آلة العلاج قطعة مضخة الحجامة و دبوس مغناطيسي 6 علب فراغ الحجامة العلاج آلة هو منتج مبتكر للعناية بالصحة والعلاج. يأتي الجهاز بمجموعة متكاملة تتضمن 6 أكواب حجامة مصنوعة من مواد ذات جودة عالية. يعمل الجهاز بتقنية الفراغ لإنشاء شفط قوي وتدليك للجلد، مما يعزز تدفق الدم ويحفز العلاج والاسترخاء. يتضمن الجهاز مضخة هواء ودبوس مغناطيسي لتعزيز فوائد الحجامة. يعد جهاز الحجامة هذا منتجًا متعدد الاستخدامات ومناسبًا للاستخدام المنزلي والعيادات الطبية. يساعد في تحسين الصحة العامة والتخفيف من آلام العضلات والتوتر وتعزيز الشعور بالراحة.', 'tv74', NULL, NULL, '2023-12-16 21:31:24', '2023-12-16 21:31:24', NULL),
(405, 94, 1, 'فرشاة الاستحمام الكهربائية', 'فرشاة الاستحمام الكهربائية', 300, 540, NULL, NULL, 1, 'available', 'اللاسلكية الكهربائية الجسم فرشاة اغتسال طويلة مقبض تدليك الغسيل هي أداة مبتكرة وعملية للعناية بالجسم أثناء الاستحمام. تتميز هذه الفرشاة بتصميمها اللاسلكي الذي يوفر حرية الحركة والراحة أثناء الاستخدام. تأتي الفرشاة بمقبض طويل يسهل الوصول إلى الأماكن الصعبة وتدليك الجسم بلطف.\r\n\r\nتعمل الفرشاة الكهربائية على تنظيف البشرة وإزالة الأوساخ والشوائب بفعالية، مما يترك البشرة نظيفة ومنتعشة. تتميز برأس فرشاة متعدد الاستخدامات يمكن استخدامه مع الأسفنجة أو الفرشاة الشبكية لتلبية احتياجات العناية المختلفة.\r\n\r\nتعد الفرشاة اللاسلكية الكهربائية الجسم فرشاة اغتسال طويلة مقبض تدليك الغسيل خيارًا مثاليًا للأفراد الذين يبحثون عن طريقة سهلة وفعالة لتحسين عملية استحمامهم والاستمتاع بتجربة العناية بالجسم.', 'yn-45', NULL, NULL, '2023-12-16 21:36:14', '2023-12-16 21:36:14', NULL),
(406, 73, 1, 'حامل الناشف الورقية', 'حامل الناشف الورقية', 60, 90, NULL, NULL, 1, 'available', 'حامل المناشف الورقية المطبخ من الفولاذ المقاوم للصدأ هو منتج عالي الجودة وعملي يتيح لك الاستمتاع بمطبخ منظم ومرتب. تصميمه الحديث يتناسب مع أي ديكور المطبخ، ويوفر لك مساحة قيمة على سطح العمل. يمكنك استخدامه لتخزين لفات الأنسجة وحامل المناشف الورقية وحامل ورق المرحاض بشكل منظم ومريح. مصنوع من مواد متينة ومتينة مثل الفولاذ المقاوم للصدأ، مما يضمن المتانة والاستدامة. بفضل حجمه المناسب، يمكنك وضعه بسهولة على الجدول أو الرف. اجعل مطبخك منظمًا وأنيقًا مع حامل المناشف الورقية المطبخ هذا.', '022', NULL, NULL, '2023-12-16 21:39:51', '2023-12-16 21:39:51', NULL),
(407, 73, 1, 'حامل لأنسجة', 'حامل لأنسجة', 60, 90, NULL, NULL, 1, 'available', 'رف حامل الأنسجة الصغير الإبداعي هو منتج عملي وعصري يمكن استخدامه في الحمام أو غرفة المعيشة. يأتي بتصميم صغير وأنيق يتناسب مع أي ديكور داخلي. مصنوع من إطار حديدي عالي الجودة يمنحه المتانة والاستدامة. يوفر هذا الرف مساحة جيدة لتخزين وتنظيم عبوات الأنسجة، مما يجعلها سهلة الوصول ومتاحة دائمًا. يمكن استخدامه أيضًا لتخزين المناديل الورقية والمنتجات الأخرى بشكل منظم. بفضل تصميمه الفريد وجودته العالية، فإنه يوفر حلاً مثاليًا لتنظيم المساحات الصغيرة في المنزل. احصل على رف حامل الأنسجة الصغير الإبداعي الآن وتمتع بترتيب وتنظيم أفضل لمنزلك.', '023', NULL, NULL, '2023-12-16 21:44:33', '2023-12-16 22:13:51', NULL),
(408, 74, 1, 'غطاء الطاولة', 'غطاء الطاولة', 25, 70, NULL, NULL, 1, 'available', 'غطاء طاولة بيفا العادي هو منتج عالي الجودة ومقاوم للماء، مصمم للاستخدام المرة الواحدة. يتميز بتصميمه المربع ولونه العادي الجميل، مما يجعله مناسبًا للاستخدام في الأماكن المنزلية والفنادق والفعاليات الاجتماعية. يتم صنعه من مادة PEVA عالية الجودة ومحبوكة بتقنيات متقدمة، مما يجعله مقاومًا للماء ومناسبًا للهواء الطلق. كما أنه متاح بأحجام مختلفة وسماكات متعددة لتلبية احتياجاتك المحددة. يعد غطاء الطاولة بيفا العادي خيارًا مثاليًا لتزيين وحماية طاولتك وإضفاء لمسة من الأناقة على أي مناسبة.', '024', NULL, NULL, '2023-12-16 21:48:43', '2023-12-16 22:14:42', NULL),
(409, 94, 1, 'جهاز إزالة الشعر بالشمع الكهربائي', 'جهاز إزالة الشعر بالشمع الكهربائي', 300, 495, NULL, NULL, 1, 'available', 'جهاز إزالة الشعر بالشمع بشعار مخصص ، طقم تدفئة شمع لإزالة الشعر ، شمع مع مع سخان بوعاء إذابة\r\n\r\nاحصل على بشرة ناعمة وخالية من الشعر بكل سهولة وفعالية مع جهاز إزالة الشعر بالشمع هذا. يأتي الجهاز مع طقم تدفئة شمع مصمم لإزالة الشعر بكل سلاسة وراحة. يتميز الجهاز بتصميم مدمج وعملي يتيح لك استخدامه في المنزل أو في صالون التجميل. يمكن تخصيص الشعار على الجهاز حسب احتياجاتك وتفضيلاتك. مع سخان البوعاء المدمج، ستتمكن من ذوبان الشمع بسرعة وسهولة. استمتع ببشرة ناعمة وخالية من الشعر لفترة طويلة مع هذا الجهاز العملي والفعال.', '00000', NULL, NULL, '2023-12-16 22:17:10', '2023-12-16 22:17:10', NULL),
(410, 73, 1, 'غطاء طاولة بيفا المضاد للماء القابل للاستخدام مرة واحدة', 'غطاء طاولة بيفا المضاد للماء القابل للاستخدام مرة واحدة', 60, 130, NULL, NULL, 1, 'available', 'هذا هو غطاء طاولة بيفا مقاوم للماء وقابل للاستخدام مرة واحدة. يتميز بتصميمه العادي ولونه الأنيق، مما يجعله مناسبًا لأي مناسبة. يتم صنعه من مادة عالية الجودة تسمى PEVA، وهي مادة صديقة للبيئة وخالية من المواد الضارة. يوفر هذا الغطاء الحماية المثالية لطاولتك من السوائل والبقع، مما يجعله مثاليًا للاستخدام في الحفلات والمأدبات والفنادق والمنزل والفعاليات الخارجية. بفضل سهولة استخدامه وإزالته، فإنه يوفر الراحة والنظافة. احصل على هذا الغطاء المميز الآن واستمتع بحماية مثالية لطاولتك في كل مناسبة.', '024', NULL, NULL, '2023-12-16 22:18:45', '2023-12-16 22:18:45', NULL),
(411, 73, 1, 'مفرش طاولة', 'مفرش طاولة', 150, 280, NULL, NULL, 1, 'available', 'مفرش طاولة للبلاستيك الفينيل الفانيلا المدعومة مع مرونة حافة لعيد الميلاد الأطراف للماء سماط ل طاولة قابلة للطي\r\n\r\nاحصل على مفرش الطاولة المثالي لديك لموسم الأعياد مع مفرش الطاولة البلاستيكي الفينيل الفانيلا المدعوم. يتميز هذا المفرش بتصميمه المتين والعملي، حيث يمنحك حماية فائقة لطاولتك ويجعلها مقاومة للماء. يتميز بحواف مرنة تضمن ثباته على الطاولة وتمنعه من الانزلاق. يمكن استخدامه في المنزل وفي الهواء الطلق، وهو مثالي للاحتفالات والمناسبات الخاصة مثل عيد الميلاد والحفلات. يتوفر بتصميمات متعددة وألوان جميلة تضفي لمسة من الأناقة والبهجة على طاولتك. احصل على مفرش الطاولة البلاستيكي الفانيلا المدعوم اليوم واستمتع بتجربة طعام مميزة وأنيقة.', '025', NULL, NULL, '2023-12-16 22:23:23', '2023-12-16 22:23:23', NULL),
(412, 84, 1, 'مصباح القاتل الداخلي للبعوض بتقنية الفوتوكاتاليست', 'مصباح القاتل الداخلي للبعوض بتقنية الفوتوكاتاليست', 150, 300, NULL, NULL, 1, 'available', 'يقدم هذا المنتج الذي يتميز بالبيع المباشر من المصنع، قاتل البعوض الداخلي القابل للشحن بتقنية الفوتوكاتاليست عنصرًا فعالًا للتخلص من البعوض في منزلك. يعمل المصباح الطارد للبعوض هذا بطريقة ذكية عن طريق استنشاق البعوض إلى داخل الجهاز والتقاطهم في فخ محكم. يعتبر هذا المصباح القاتل للبعوض مناسبًا للاستخدام في غرف النوم الداخلية. يمكن شحنه بسهولة عن طريق منفذ USB، مما يجعله مريحًا وقابلًا لإعادة الاستخدام. يعتبر هذا المنتج هدية مثالية لأحبائك للحصول على منزل خالٍ من البعوض وللتمتع بالراحة والنوم الهانئ.', 'jf21', NULL, NULL, '2023-12-16 22:23:28', '2023-12-16 22:23:28', NULL),
(413, 84, 1, 'مصباح القاتل القابل لإعادة الشحن للبعوض', 'مصباح القاتل القابل لإعادة الشحن للبعوض', 180, 280, NULL, NULL, 1, 'available', 'مصباح قاتل البعوض القابل لإعادة الشحن هو جهاز فعال لمكافحة البعوض وحشرات الطائرات الضارة. يتميز هذا المصباح بتصميم محمول ومريح يسهل حمله واستخدامه في أي مكان. يعمل المصباح بتقنية الموجات فوق الصوتية التي تكون غير مزعجة للبشر ولكنها فعالة في قتل البعوض. يتم شحنه بواسطة كابل USB، مما يجعله ملائمًا للاستخدام المتكرر والمستدام. يمتاز بمادة الصنع عالية الجودة والتي تضمن متانته واستدامته. سواء كنت في المنزل أو في الهواء الطلق، يعد مصباح قاتل البعوض القابل لإعادة الشحن هو الحل المثالي للحصول على حماية فعالة ضد البعوض والحشرات الضارة.', 'zw-jf-20', NULL, NULL, '2023-12-16 22:28:42', '2023-12-16 22:28:42', NULL),
(414, 84, 1, 'مصباح القاتل القابل لإعادة الشحن للبعوض', 'مصباح القاتل القابل لإعادة الشحن للبعوض', 180, 290, NULL, NULL, 1, 'available', 'مصباح قاتل البعوض القابل لإعادة الشحن هو جهاز فعال لمكافحة البعوض وحشرات الطائرات الضارة. يتميز هذا المصباح بتصميم محمول ومريح يسهل حمله واستخدامه في أي مكان. يعمل المصباح بتقنية الموجات فوق الصوتية التي تكون غير مزعجة للبشر ولكنها فعالة في قتل البعوض. يتم شحنه بواسطة كابل USB، مما يجعله ملائمًا للاستخدام المتكرر والمستدام. يمتاز بمادة الصنع عالية الجودة والتي تضمن متانته واستدامته. سواء كنت في المنزل أو في الهواء الطلق، يعد مصباح قاتل البعوض القابل لإعادة الشحن هو الحل المثالي للحصول على حماية فعالة ضد البعوض والحشرات الضارة.', 'zw-jf-20', NULL, NULL, '2023-12-16 22:39:34', '2023-12-16 22:39:34', NULL),
(415, 115, 1, 'مجموعة تنظيف زجاجات الأطفال', 'مجموعة تنظيف زجاجات الأطفال', 80, 130, NULL, NULL, 1, 'available', 'أضف هذه المجموعة الرائعة من فرش تنظيف الزجاجات للأطفال إلى روتين العناية بالطفل اليومي الخاص بك. تتكون المجموعة من 6 قطع فرش تنظيف متعددة الوظائف، مثالية لتنظيف زجاجات الرضاعة والحلمات بكل سهولة وفعالية. تتميز الفرش بشعيرات ناعمة ولينة للغاية، تنظف بعمق وتزيل البقايا والرواسب بدقة، مما يضمن نظافة وسلامة طفلك.\r\n\r\nتصميمها المريح والسهل الاستخدام يسمح لك بالوصول إلى الأماكن الضيقة والزوايا الصعبة بكل يسر. كما تتميز المجموعة بمقبض قوي ومريح يوفر قبضة محكمة أثناء التنظيف. مصنوعة من مواد عالية الجودة ومستدامة، تعد هذه المجموعة مثالية للاستخدام الطويل الأمد.\r\n\r\nاستمتع بتجربة تنظيف زجاجات الأطفال بسهولة وفعالية مع هذه المجموعة العملية والعالية الجودة.', '026', NULL, NULL, '2023-12-16 22:39:40', '2023-12-16 22:39:40', NULL),
(416, 94, 1, 'مجفف الأظافر السريع', 'مجفف الأظافر السريع', 180, 350, NULL, NULL, 1, 'available', 'مجفف الأظافر FD-201 هو جهاز قوي وعملي يستخدم لتجفيف الأظافر بسرعة وكفاءة. يأتي هذا المجفف بتصميم مصنوع من المواد البلاستيكية عالية الجودة، مما يجعله متينًا ومقاومًا للصدمات. يعمل بقوة 36 واط ويتميز بمصدر ضوء عالي الجودة يعمل بطول موجي يصل إلى 365 نانومتر و405 نانومتر، مما يساعد على تجفيف الهلام وطلاء الأظافر بسرعة وفعالية. يحتوي على مؤقتات متعددة للتحكم في وقت التجفيف بشكل مريح. بفضل تصميمه المدمج والعملي، يمكن استخدام مجفف الأظافر FD-201 في صالونات الأظافر المحترفة وأيضًا في المنزل لتجفيف الأظافر بشكل سريع وسهل.', 'jf-50', NULL, NULL, '2023-12-16 22:44:58', '2023-12-16 22:44:58', NULL),
(417, 124, 1, 'زجاجة نشاط رياضي مائية', 'زجاجة نشاط رياضي مائية', 120, 170, NULL, NULL, 1, 'available', 'زجاجة مياه مصنوعة من مادة البلاستيك عالية الجودة، وتوفر الراحة والمتانة أثناء ممارسة الأنشطة الرياضية. تأتي الزجاجة مع قشة لسهولة شرب الماء أثناء التنقل، وتوفر فوهة متدفقة لتدفق الماء بسلاسة. تصميمها العصري يجعلها مناسبة للرحلات والنزهات وأنشطة الهواء الطلق بشكل عام. الزجاجة مجهزة بغطاء آمن للأغذية، وتعد مثالية للمشروبات الباردة والساخنة. كما يمكن تخصيص الزجاجة بشعارك الخاص لتكون هدية ترويجية فريدة من نوعها', 'ZN80', NULL, NULL, '2023-12-16 22:45:15', '2023-12-24 05:28:42', NULL),
(418, 75, 1, 'مطحنة الدقيق الكهربائية الصغيرة', 'مطحنة الدقيق الكهربائية الصغيرة', 200, 500, NULL, NULL, 1, 'available', 'مطحنة الدقيق الكهربائية للمطبخ هي منتج أساسي يجب أن يكون في كل مطبخ. تتميز هذه المطحنة بقدرتها على طحن الدقيق بسرعة وكفاءة. تصميمها المصغر يجعلها مناسبة للاستخدام المنزلي والتجاري. بفضل قوتها الكهربائية ومحركها عالي الأداء، يمكنها طحن الحبوب بسهولة وسرعة. تأتي المطحنة مع إسكان من الفولاذ المقاوم للصدأ عالي الجودة، مما يجعلها قوية ومتينة. تعد هذه المطحنة الكهربائية حلاً مثاليًا لطحن الدقيق في المطابخ المنزلية والمطاعم والفنادق والمحلات التجارية الأخرى. احصل على هذه المطحنة العملية والفعالة لتحقيق نتائج ممتازة في طهيك اليومي.', '00000', NULL, NULL, '2023-12-17 01:44:27', '2023-12-17 01:44:27', NULL),
(419, 84, 1, 'مصباح قاتل البعوض الكهربائي القوي', 'مصباح قاتل البعوض الكهربائي القوي', 1300, 1950, NULL, NULL, 1, 'available', 'مصباح قاتل البعوض الكهربائي بقوة 6 واط هو جهاز فعال في التخلص من الذباب والبعوض. يستخدم هذا المصباح تقنية الصدمة الكهربائية لقتل الحشرات، مما يساهم في منع انتشار الأمراض المنقولة عن طريق البعوض مثل فيروس الدينجي. يتميز المصباح بتصميم فعال يجذب البعوض ويقوم بإمساكها. يعمل بقوة 6 واط ويعد خيارًا مثاليًا للحماية من البعوض في المنزل أو في الأماكن الخارجية. يتميز بسهولة الاستخدام وفعاليته في قتل الحشرات الطائرة، مما يوفر لك ولعائلتك بيئة هادئة وخالية من البعوض المزعجة.', 'hx02', NULL, NULL, '2023-12-17 01:48:42', '2023-12-17 01:48:42', NULL),
(420, 92, 1, 'إسفنجة الاستحمام  المنعشة', 'إسفنجة الاستحمام  المنعشة', 35, 70, NULL, NULL, 1, 'available', 'إسفنجة استحمام للأطفال باللون الأخضر + إسفنجة استحمام طويلة + قماش استحمام\r\n\r\nاستمتع بتجربة الاستحمام المريحة والممتعة لطفلك مع هذه الإسفنجة المبتكرة. تأتي هذه الإسفنجة بتصميمها اللطيف والجذاب باللون الأخضر المنعش. تمتاز بجودة عالية ومواد آمنة لبشرة الطفل الحساسة. تمتاز أيضًا بطولها الإضافي الذي يسهل استخدامها والوصول إلى الأماكن الصعبة. بفضل قماش استحمامها الناعم والفعال، ستتمتع بتجربة تنظيف ممتازة ورغوة غنية. تعد هذه الإسفنجة المثالية للاستخدام اليومي ومناسبة لكل منزل وفندق. احرص على منح طفلك الراحة والنظافة مع هذه الإسفنجة العملية والعصرية.', '0000', NULL, NULL, '2023-12-17 01:51:43', '2023-12-17 01:51:43', NULL),
(421, 94, 1, 'مجموعة فرشاة تنظيف الوجه المتعددة الوظائف 6 في 1', 'مجموعة فرشاة تنظيف الوجه المتعددة الوظائف 6 في 1', 130, 270, NULL, NULL, 1, 'available', 'وجه فرشاة تنظيف الوجه للماء تدور فرشاة مجموعة 6 في 1 هي أداة متعددة الوظائف للعناية بالبشرة. تأتي هذه المجموعة مع ست فرش صغيرة ودقيقة تدور بلطف لتنظيف الوجه بعمق وفعالية. تساعد على إزالة الأوساخ والشوائب من البشرة وتحسين مظهرها وملمسها. تحتوي الفرش على شعيرات ناعمة وناعمة للغاية، مما يجعلها مناسبة للاستخدام اليومي على جميع أنواع البشرة، بما في ذلك البشرة الحساسة. بالإضافة إلى ذلك، فإن المجموعة تشمل أدوات إضافية مثل فرشاة تدليك الوجه وفرشاة للتقشير. هذه المجموعة هي اختيار مثالي لمن يهتمون بصحة وجمال بشرتهم ويرغبون في تحقيق بشرة نظيفة ومشرقة.', 'yn-14', NULL, NULL, '2023-12-17 01:55:26', '2023-12-17 01:55:26', NULL),
(422, 87, 1, 'مجموعة تسليك الأسنان النايلونية الفردية بـ 30 قطعة', 'مجموعة تسليك الأسنان النايلونية الفردية بـ 30 قطعة', 150, 280, NULL, NULL, 1, 'available', 'تحتوي هذه المجموعة على 30 قطعة من خيوط تسليك الأسنان النايلونية، والتي تمنحك راحة وفعالية في تنظيف الأسنان وتأمين صحة الفم. تصميمها الفريد يتيح لك الوصول إلى المناطق الضيقة بين الأسنان، حيث يمكن أن يتراكم البلاك والبقايا الغذائية. تأتي هذه الخيوط بمقابض طويلة تمكنك من الوصول بسهولة إلى الأسنان الخلفية والصعبة الوصول. إنها مثالية للاستخدام الفردي وتأتي بألوان جذابة من الأبيض والوردي. تعد هذه القطع المتاحة بين الأسنان مثالية للحصول على نظافة فم متكاملة وتعزيز الصحة العامة للأسنان واللثة.', '358', NULL, NULL, '2023-12-17 02:06:20', '2023-12-17 02:06:20', NULL),
(423, 87, 1, '10 علب عيدان الأسنان كبيرة', '10 علب عيدان الأسنان كبيرة', 150, 290, NULL, NULL, 1, 'available', 'منزل بسيط أنبوب مسواك عادي محمول مطعم الفندق هو حامل مسواك عملي ومريح يوفر طريقة نظيفة ومرتبة لتخزين المسواك. صُمم هذا المنزل البسيط ليكون محمولًا وسهل الاستخدام في المنزل أو المطعم أو الفندق. مصنوع من مواد عالية الجودة، وهو متين ومستدام للاستخدام اليومي. يتسع لعدد كبير من المسواك، مما يسهل حفظها واستخدامها بشكل مرتب ومنظم. يأتي بتصميم أنيق وبسيط يتناسب مع أي ديكور داخلي. سواء كنت تبحث عن حلاً للاستخدام الشخصي أو لتجهيز مساحة الضيوف في مطعمك أو فندقك، سيكون منزل بسيط أنبوب مسواك عادي محمول مطعم الفندق الخيار المثالي لك.', '00000', NULL, NULL, '2023-12-17 02:17:14', '2023-12-17 02:17:14', NULL),
(424, 87, 1, '10 علب عيدان الأسنان', '10 علب عيدان الأسنان', 100, 200, NULL, NULL, 1, 'available', 'مسواك تنظيف الأسنان عيدان أسنان مستديرة من خشب الخيزران في بلاستيك شفاف!\r\n\r\nاحصل على هذا المسواك المحمول المصنوع من خشب الخيزران عالي الجودة والمستدام. يأتي في شكل عيدان أسنان مستديرة ومغلف في بلاستيك شفاف للحفاظ على النظافة والسلامة. يوفر هذا المنتج تجربة تنظيف فعالة ومريحة لأسنانك في أي وقت وفي أي مكان. يمكنك استخدامه في المنزل، أثناء السفر، في العمل أو في أي مكان ترغب فيه. بفضل الخيزران الطبيعي، فإنه يوفر أيضًا بديلًا صديقًا للبيئة للاستخدام اليومي. احرص على الاستمتاع بنظافة أسنانك وصحة فمك مع هذا المسواك المحمول عالي الجودة.', 'jh25', NULL, NULL, '2023-12-17 02:20:42', '2023-12-17 02:22:44', NULL),
(425, 124, 1, 'زجاجة الرياضة المائية', 'زجاجة الرياضة المائية', 160, 230, NULL, NULL, 1, 'available', 'زجاجة اللياقة البدنية والرياضات المائية هي حل مثالي للمحافظة على ترطيبك أثناء ممارسة النشاطات الرياضية. تتميز هذه الزجاجة بتصميمها العصري والعملي، حيث تأتي مع قشة وغطاء صنبور يسهل الوصول إليهما. تعتبر قابلة لإعادة الاستخدام، مما يساعد في الحفاظ على البيئة وتقليل استخدام الزجاجات البلاستيكية القابلة للتخلص. كما تحتوي الزجاجة على وقت علامة لمراقبة استهلاك الماء الخاص بك، ومزوّدة بمقبض وحزام كتف لسهولة الحمل أثناء التنقل. تعتبر هذه الزجاجة رفيقًا مثاليًا لأنشطتك الرياضية وتأكيد على التزامك بالصحة والبيئة', 'CL92', NULL, NULL, '2023-12-17 02:22:26', '2023-12-24 05:29:13', NULL),
(426, 85, 1, 'فرشاة فروة الشعر', 'فرشاة فروة الشعر', 40, 90, NULL, NULL, 1, 'available', 'فرشاة سوبر الشامبو لفروة الرأس هي منتج عالي الجودة ومصمم خصيصًا لتحسين تجربة غسيل الشعر. تعمل الفرشاة على تنظيف فروة الرأس بلطف وتدليكها في نفس الوقت، مما يعزز تدفق الدورة الدموية ويحسن صحة فروة الرأس. تتميز الفرشاة بتصميم مريح يناسب قبضة اليد وسهلة الاستخدام. تحتوي على شعيرات ناعمة ومرنة مصنوعة من السيليكون لتوفير تجربة لطيفة للشعر والفروة. تستخدم الفرشاة أيضًا لتوزيع المنتجات العناية بالشعر بشكل متساوٍ وفعال. احصل على الفرشاة الآن واستمتع بشعر صحي ونظيف وفروة رأس منتعشة.', '0000', NULL, NULL, '2023-12-17 02:24:14', '2023-12-17 02:24:14', NULL),
(427, 124, 1, 'زجاجة الرياضة المعدنية', 'زجاجة الرياضة المعدنية', 100, 180, NULL, NULL, 1, 'available', 'زجاجة الرياضة المائية المتعددة الاستخدامات بسعة 430 مللي تأتي بتصميم جدار مزدوج ومعزول بالكامل من الفولاذ المقاوم للصدأ، مما يضمن الحفاظ على درجة حرارة المشروبات لفترة طويلة. تتميز بغطاء قش قابل للفتح بلمسة واحدة لسهولة الاستخدام أثناء ممارسة الرياضة. تصميمها العصري يجعلها مناسبة لجميع الأعمار والجنسين، وتتميز بأداء عالي في العزل الحراري والمتانة. تستخدم للأنشطة الخارجية والرحلات وفي المنزل، وتأتي بمواد مستدامة وطلاء مضاد للتآكل. يمكن تخصيص اللون والشعار وفقًا لاحتياجاتك الشخصية. استمتع بمشروباتك الباردة أو الساخنة لفترة طويلة مع زجاجة المياه الرياضية المتعددة الاستخدامات هذه', 'ZN2', NULL, NULL, '2023-12-17 02:26:02', '2023-12-24 05:29:36', NULL),
(428, 118, 1, 'كوب مفرغ لأطفال', 'كوب مفرغ لأطفال', 200, 300, NULL, NULL, 1, 'available', 'كوب مفرغ عالي القيمة لفتاة كرتونية غريبة كوب ماء محكم الإغلاق بسعة كبيرة ومضاد للتسرب عالي الجودة، مما يجعله متينًا ومقاومًا للصدأ. يتميز بتصميم مميز لفتاة كرتونية غريبة، مما يجعله جذابًا ومرحًا للاستخدام اليومي. يأتي الكوب بسعة كبيرة تسمح بتخزين كمية كبيرة من الماء أو المشروبات الأخرى. كما يتميز بإحكام إغلاقه، مما يضمن عدم تسرب السوائل. يعد هذا الكوب خيارًا مثاليًا للذهاب إلى المدرسة أو العمل أو النشاطات اليومية، ويعتبر هدية رائعة لأحبائك', '027', NULL, NULL, '2023-12-17 02:30:55', '2023-12-17 02:38:00', NULL);
INSERT INTO `products` (`id`, `subcategory_id`, `supplier_id`, `unit_name`, `pack_name`, `purchasing_price`, `unit_price`, `pack_price`, `pack_units`, `unit_type`, `status`, `description`, `code_supplier`, `code_bar`, `file`, `created_at`, `updated_at`, `deleted_at`) VALUES
(429, 117, 1, 'لصقة الماء بوبو 24 قطعة', 'لصقة الماء بوبو 24 قطعة', 300, 600, NULL, NULL, 1, 'available', 'في عذوبة الخيال وإثارة الإبداع، تتميز \"BOBO Water Glue\" بأداءها الاستثنائي في عالم المواد اللاصقة. تصميمها المتقن وسعة الزجاجة البالغة 50 مل تجعلها الخيار المثالي للمستخدمين الذين يحتاجون إلى لاصقة متعددة الاستخدامات. سواء كنت تستخدمها في الأعمال الفنية، الحرف اليدوية، أو حتى في الأعمال المكتبية، فإن \"BOBO Water Glue\" تتميز بالقوة والمتانة. فهي توفر تصاقًا قويًا وسريعًا، مما يجعلها الأداة المثالية لتحقيق نتائج رائعة في مشاريعك. احصل على \"BOBO Water Glue\" الآن واستمتع بجودة لاصقة استثنائية.', 'zw-915', NULL, NULL, '2023-12-17 02:32:24', '2023-12-17 02:32:24', NULL),
(430, 118, 1, 'مجموعة هايليتر اللطيفة', 'مجموعة هايليتر اللطيفة', 80, 160, NULL, NULL, 1, 'available', 'طالب مخصص ملون صغير لطيف هايليتر Kawaii - احصل على مجموعة أقلام التحديد القلمية اللطيفة والمميزة، والتي توفر تجربة ممتعة وعصرية للتمييز والتظليل. تحتوي هذه المجموعة على 6 ألوان مختلفة، مما يتيح لك إضافة لمسات ساحرة وملونة إلى مذكراتك وملفاتك ومشاريعك الفنية. يتميز القلم برأسين ذو طرف فرشاة مائلة، مما يوفر تجربة كتابة مريحة وسلسة. يمكنك استخدامه للكتابة والرسم بطريقة مبتكرة وممتعة. يأتي القلم بحجم صغير ومناسب للاستخدام اليومي، ويمتاز بجودة عالية وتصميم فريد. احصل على هذه المجموعة الرائعة وأضف لمسة رائعة وملونة إلى حياتك اليومية', '028', NULL, NULL, '2023-12-17 02:41:16', '2023-12-17 02:41:16', NULL),
(431, 118, 1, 'مجموعة القرطاسية الإبداعية', 'مجموعة القرطاسية الإبداعية', 80, 170, NULL, NULL, 1, 'available', 'مجموعة القرطاسية الإبداعية للطلاب تتميز برسوم كرتونية لطيفة وتعتبر هدية مثالية للطلاب. تحتوي المجموعة على مجموعة متنوعة من الأدوات المكتبية العملية والعصرية. تشمل المجموعة أقلام وأقلام رصاص وممحاة ومبراة ومقص وغيرها من الأدوات المهمة للطلاب في المدرسة. يتميز التصميم الإبداعي بالجودة العالية والتفاصيل الدقيقة، مما يجعلها تلهم الطلاب وتزيد من رغبتهم في الدراسة والإبداع. يمكن استخدام هذه المجموعة كجوائز مدرسية أو هدايا للطلاب. بفضل الجودة العالية والتنوع، فإن هذه المجموعة تعد اختيارًا مثاليًا للمدارس والمعلمين الذين يسعون لتقديم هدايا مميزة وعملية للطلاب.', '029', NULL, NULL, '2023-12-17 02:45:01', '2023-12-17 02:55:20', NULL),
(432, 118, 1, 'زجاجة الماء اللامعة بتدرج الألوان', 'زجاجة الماء اللامعة بتدرج الألوان', 250, 400, NULL, NULL, 1, 'available', 'زجاجة ماء بلاستيكية بسعة 2 لتر بتصميم فريد وجذاب. مصنوعة من مواد بلاستيكية عالية الجودة ومستدامة لتوفير تجربة استخدام طويلة الأمد. تتميز بتدرج لوني متناسق ومشرق يضفي لمسة عصرية وحيوية على الزجاجة. تحتوي على مؤشر وقت محفور عليها لتذكيرك بتناول الماء بانتظام والحفاظ على ترطيب جسمك. مثالية للسفر والنشاطات في الهواء الطلق وممارسة الرياضة. مزودة بغطاء وحبل لسهولة الحمل والاستخدام. تتميز بأداء عزل حراري ممتاز يحافظ على برودة المشروبات الباردة وسخونة المشروبات الساخنة. احصل على هذه الزجاجة الرائعة واستمتع بالمشروبات الصحية أثناء تنقلاتك وأنشطتك اليومية.', '030', NULL, NULL, '2023-12-17 02:48:36', '2023-12-17 02:48:36', NULL),
(433, 118, 1, 'حافظة المستندات', 'حافظة المستندات', 100, 220, NULL, NULL, 1, 'available', 'حقيبة بيانات اللون مجلد A4 ، مقسمة واضحة ، تتميز بمشبك شفاف مقاوم للماء. تُعد هذه الحقيبة من البلاستيك بولي كلوريد الفينيل عالي الجودة، وهي مثالية للاستخدام في المكاتب والمدارس والمؤسسات التجارية. تأتي بتصميم مقسم يتيح تنظيم وتجزئة المستندات والأوراق بسهولة. بفضل واجهتها الشفافة، يمكنك رؤية محتوى الملف بوضوح، مما يوفر سهولة الوصول والتنظيم. بالإضافة إلى ذلك، تأتي بحجم A4 القياسي، ما يجعلها ملائمة لتخزين وحماية المستندات والورق بشكل آمن. احصل على حقيبة بيانات اللون مجلد A4 الشفافة والعملية لتلبية احتياجاتك القرطاسية والمكتبية!', '031', NULL, NULL, '2023-12-17 02:51:54', '2023-12-17 02:51:54', NULL),
(434, 99, 1, 'حصيرة تعليمية لغز الأطفال المبكرة', 'حصيرة تعليمية لغز الأطفال المبكرة', 80, 200, NULL, NULL, 1, 'available', 'تصميم جديد 5x5 بساط للأطفال في التعلم المبكر حصيرة بانوراما للأطفال بلاط أرضي أبجدي متشابك\r\n\r\nاجعل تجربة التعلم المبكر ممتعة وتثقيفية لطفلك مع هذا البساط المصمم خصيصًا. يتكون البساط من بلاط أرضي متشابك بحجم 5x5 سم، وهو مصنوع من مادة إيفا عالية الجودة وخالية من المواد الضارة. يحتوي البساط على أبجديات وأشكال ملونة تساعد الأطفال على تعلم الحروف والأرقام والأشكال بطريقة ممتعة وتفاعلية. يمكن تجميع البساط بطرق مختلفة لتشكيل لغز كبير يحفّز الإبداع والتفكير الهندسي لدى الأطفال. هذا البساط مثالي للعب المجموعات وتعزيز التفاعل الاجتماعي وتطوير المهارات الحركية. اجعل التعلم متعة ومثيرة مع هذا البساط المبتكر للأطفال في مرحلة التعلم المبكر.', '032', NULL, NULL, '2023-12-17 02:54:54', '2023-12-17 02:54:54', NULL),
(435, 118, 1, 'حقيبة اللوازم المدرسه', 'حقيبة اللوازم المدرسه', 25, 60, NULL, NULL, 1, 'available', 'حقيبة اللوازم المدرسية والكتابية هذه هي منتج عالي الجودة ومتعدد الوظائف، تصميمها يتيح لك حمل وتخزين مجموعة متنوعة من القرطاسية والأدوات في مكان واحد. تأتي الحقيبة بحجم مثالي ومتوسط، مما يسمح لك بحملها بسهولة في حقيبة الظهر أو الحقيبة المدرسية. تتميز بمواد عالية الجودة مثل PVC وجلد PU، مما يجعلها متينة ومقاومة للتآكل. تصميمها البسيط يناسب الأولاد والبنات، وتتوفر بألوان مشرقة ومبهجة مثل الأزرق والأحمر. سواء كنت في المدرسة أو في المكتب، فإن هذه الحقيبة ستحافظ على كل أدواتك المهمة منظمة وآمنة', 'ZW-447', NULL, NULL, '2023-12-17 02:59:28', '2023-12-17 02:59:28', NULL),
(436, 118, 1, 'قلم الفن المتعدد الوظائف', 'قلم الفن المتعدد الوظائف', 30, 80, NULL, NULL, 1, 'available', 'قلم تحديد بأشكال افعلها بنفسك 6 ألوان للنقش الدائم على القمصان والحقائب والأحذية FM206\r\n\r\nقم بتحويل قطع الملابس والحقائب والأحذية الخاصة بك إلى قطع فريدة وشخصية باستخدام قلم تحديد بأشكال افعلها بنفسك FM206. يتميز هذا القلم بستة ألوان مختلفة، مما يتيح لك إضافة لمسات إبداعية وجميلة على المواد القماشية. يمكنك استخدامه للنقش الدائم على القمصان والحقائب والأحذية بكل سهولة ودقة.\r\n\r\nيتميز القلم بطرف فرشاة يمكنه رسم خطوط دقيقة وتفاصيل مذهلة. كما يتميز بحبر دائم ومقاوم للماء، مما يضمن أن التصميم الذي تقوم برسمه سيبقى دائمًا ومشرقًا. بالإضافة إلى ذلك، فإن القلم مزود بتقنية الكتابة المتوسطة، مما يوفر لك تجربة رسم سلسة ومريحة.\r\n\r\nاجعل إبداعك يتألق مع قلم تحديد بأشكال افعلها بنفسك FM206 وأضف لمسة فريدة إلى ملابسك وحقائبك وأحذيتك.', '033', NULL, NULL, '2023-12-17 03:02:54', '2023-12-17 03:02:54', NULL),
(437, 118, 1, 'اقلام رصاص', 'اقلام رصاص', 50, 90, NULL, NULL, 1, 'available', 'قلم رصاص Hb الخشبي المخصص هو هدية أنيقة وعملية للأعمال والمناسبات الخاصة. يأتي هذا القلم في مجموعة تحتوي على 4 أقلام رصاص، مزودة بممحاة للمسح السريع والسهل. يتميز القلم بجسمه المصنوع من خشب البوبلار الناعم والمريح للمس، بالإضافة إلى قطر قلم الرصاص Hb القياسي البالغ 2.2 ملم. يتميز بتصميمه الأنيق ولونه اللامع، مما يجعله مثاليًا للاستخدام في المكتب والمدرسة. كما يمكن تخصيص هذا القلم بشعار مخصص لتعزيز الهوية الشخصية أو العلامة التجارية. قلم الرصاص Hb الخشبي المخصص هو اختيار مثالي للتمتع بكتابة سلسة ومريحة في جو من الأناقة والفخامة', '034', NULL, NULL, '2023-12-17 03:09:21', '2023-12-17 03:09:21', NULL),
(438, 118, 1, 'مجموعة فن المدرسة المتعددة الوظائف', 'مجموعة فن المدرسة المتعددة الوظائف', 45, 100, NULL, NULL, 1, 'available', 'مجموعة أدوات مكتبية فاخرة ومبتكرة تتضمن 7 قطع في واحدة، مثالية للأطفال. صُنعت هذه المجموعة الرائعة في مصنع موثوق به في الصين، وهي مثالية كهدية للأطفال في المدارس أو المناسبات الخاصة. تحتوي المجموعة على مجموعة متنوعة من الأدوات المكتبية مثل أقلام الرصاص وأقلام الألوان والمساطر والممحاة والمشبك والمبراة والألوان اللاصقة. تتميز بتصميم كارتوني جذاب يجعلها جاهزة للاستخدام وتشجيع الإبداع والتعلم. اجعل تجربة الكتابة والرسم ممتعة ومشوقة للأطفال مع هذه المجموعة المميزة', '035', NULL, NULL, '2023-12-17 03:14:00', '2023-12-17 03:14:00', NULL),
(439, 98, 1, 'مجموعة بالونات الزفاف الملونة الشفافة', 'مجموعة بالونات الزفاف الملونة الشفافة', 35, 90, NULL, NULL, 1, 'available', 'تعتبر مجموعة بالونات اللاتكس الشفافة مع الزخارف الملونة منتجًا رائعًا لتزيين حفلات الزفاف والمناسبات الخاصة. تتضمن المجموعة 10 قطع من البالونات بقياس 12 بوصة، مصنوعة من اللاتكس الشفاف عالي الجودة. تتميز البالونات بتصميم شفاف يتيح رؤية الزخارف الملونة الموجودة بداخلها، مما يضفي لمسة ساحرة وجمالية على الديكور. مناسبة للاستخدام مع الهليوم لإضفاء مظهر مبهج ومثير للإعجاب على حفلتك. اجعل لحظات الاحتفال لا تُنسى ومليئة بالسعادة والألوان مع مجموعة بالونات اللاتكس الشفافة والزخارف الملونة.', '036', NULL, NULL, '2023-12-17 03:18:15', '2023-12-17 03:18:15', NULL),
(440, 110, 1, 'تاج كعكة عيد ميلاد', 'تاج كعكة عيد ميلاد', 500, 600, NULL, NULL, 1, 'available', 'تعتبر زينة كعكة عيد الميلاد الأكريليكية بتصميم الذهب الأسود الوردي الأحمر خيارًا مثاليًا لتزيين كعكة الاحتفال بعيد الميلاد. تتميز هذه الزينة بجمالها وأناقتها وتضفي لمسة ساحرة ومميزة على الكعكة. مصنوعة من مادة الأكريليك عالية الجودة، وهي مستدامة وآمنة للاستخدام الغذائي. تأتي بشكل رسالة مميزة تعبر عن عيد الميلاد السعيد. يمكن استخدامها كزينة لكعكة عيد الميلاد أو كتوبر لتزيين الكعكة. تأتي معبأة بشكل جيد في حقيبة Opp، وتوفر مرونة كبيرة في التخصيص وفقًا لاحتياجاتك الشخصية. اجعل مناسبة عيد الميلاد أكثر سحرًا وتألقًا مع هذه الزينة الرائعة.', '037', NULL, NULL, '2023-12-17 03:44:14', '2023-12-17 03:44:14', NULL),
(441, 118, 1, 'حقيبة الأقلام المحمولة الكرتونية اللطيفة', 'حقيبة الأقلام المحمولة الكرتونية اللطيفة', 75, 140, NULL, NULL, 1, 'available', 'حقيبة أقلام بسعة كبيرة كرتونية لطيفة مع قلادة مظهر عالي المستوى تصميم بسيط وعملي. تعد هذه الحقيبة المحمولة مثالية للطلاب ومحبي الكتابة والرسم. تتميز بسعة كبيرة تتسع للعديد من الأقلام الرصاص والأقلام الجافة وأدوات الكتابة الأخرى. تأتي بتصميم كرتوني لطيف يضفي جاذبية على الحقيبة، وتحتوي على قلادة تضفي مظهرًا عالي المستوى وتزيد من سحرها. مصنوعة من مواد ذات جودة عالية تضمن المتانة والاستدامة. تتوفر خيارات تخصيص الألوان والشعارات، مما يجعلها هدية مثالية أو منتجًا ترويجيًا. احصل على هذه الحقيبة الرائعة واستمتع بتنظيم أدواتك الكتابية بشكل جميل وعملي', 'WJB-08', NULL, NULL, '2023-12-17 03:48:00', '2023-12-17 03:48:00', NULL),
(442, 118, 1, 'مجموعة اقلام ملونة', 'مجموعة اقلام ملونة', 30, 60, NULL, NULL, 1, 'available', 'تقدم لك هذه المجموعة المذهلة من أقلام للأطفال فرصة رائعة للتعبير الفني والرسم. تحتوي المجموعة على 12/18/24/36 لونًا ساحرًا وغنيًا يمكن استخدامه في الرسم والتظليل والتأثيرات الفنية المختلفة. تم تصميم هذه الأقلام خصيصًا للأطفال، وهي غير سامة وآمنة للاستخدام. تتميز بقوام ناعم ينساب بسهولة على الورق ويمكن مزج الألوان بسلاسة لإنشاء تأثيرات فنية مدهشة. مناسبة للاستخدام في المدارس أو كهدية للأطفال المبدعين، تعتبر هذه المجموعة إضافة رائعة لمجموعة أدوات الرسم والفنون الخاصة بهم. استمتع بتجربة الرسم المليئة بالألوان والإبداع مع مجموعة أقلام زيت الباستيل النفطية للأطفال هذه.', 'WS-30', NULL, NULL, '2023-12-17 03:52:28', '2023-12-17 03:52:28', NULL),
(443, 118, 1, 'مجموعة اقلام الرسم الفنية الملونة', 'مجموعة اقلام الرسم الفنية الملونة', 50, 90, NULL, NULL, 1, 'available', 'أقماع تلوين غير سامّة بحجم هي منتجات فنية ممتعة وآمنة للأطفال. تتميز هذه الأقماع بجودتها العالية وتصميمها المميز، حيث تأتي بمجموعة متنوعة من الألوان الزاهية التي تعزز خيال الأطفال وإبداعهم. تعتبر هذه الأقماع ذات حجم مثالي لأيدي الأطفال الصغيرة، مما يسهل عليهم الاستخدام والتحكم فيها بسهولة. كما أنها مصنوعة من مواد غير سامة وآمنة للأطفال، حيث تلبي معايير السلامة العالمية. هذه الأقماع الملونة توفر فرصة مثالية للأطفال للتعبير عن إبداعهم الفني وتطوير مهاراتهم الفنية بطريقة ممتعة وترفيهية', 'WS-32', NULL, NULL, '2023-12-17 03:55:15', '2023-12-17 03:55:15', NULL),
(444, 89, 1, 'فرشاة غسيل أواني المطبخ مزودة بأسلاك تنظيف', 'فرشاة غسيل أواني المطبخ مزودة بأسلاك تنظيف', 1, 80, NULL, NULL, 1, 'available', 'تعتبر فرشاة غسيل أواني المطبخ مزودة بأسلاك تنظيف أداة مثالية لتنظيف الأواني المنزلية. تتميز بتصميم فعال وعملي يجعلها سهلة الاستخدام وفعالة في إزالة الأوساخ والدهون العنيدة. تم تصنيعها من الفولاذ المقاوم للصدأ عالي الجودة، مما يضمن متانة واستدامة المنتج.\r\n\r\nتتميز الفرشاة بحجم مناسب وشكل مريح يتيح القبضة بسهولة ويمنحك راحة أثناء الاستخدام. كما تتميز بأسلاك تنظيف قوية تساعد في إزالة الأوساخ بشكل فعال، بينما تحافظ على سطح الأواني الخاصة بك.\r\n\r\nاحصل على فرشاة غسيل أواني المطبخ مزودة بأسلاك تنظيف اليوم واستمتع بنظافة ولمعان أوانيك المنزلية بكل سهولة وفعالية.', '00000', NULL, NULL, '2023-12-17 14:47:12', '2023-12-17 14:47:12', NULL),
(445, 73, 1, '10 علاقات ملابس', '10 علاقات ملابس', 50, 100, NULL, NULL, 1, 'available', 'شماعات معدنية بولي كلوريد الفينيل 16\" - منتج رائع لتعليق الملابس بأسلوب فريد وعملي. تتميز هذه الشماعات بجودتها العالية وتصميمها المتين، مما يجعلها مثالية لتنظيم ملابسك في خزانتك. تم تصنيعها من البولي كلوريد الفينيل المتين والمعدن عالي الجودة، مما يمنحها قوة وثباتية فائقة. بطول 16 بوصة، فإنها توفر مساحة كافية لتعليق الأزياء المختلفة بمختلف الأحجام والأنماط. تتوفر بألوان متعددة تضيف لمسة من الأناقة والتنوع إلى خزانة الملابس الخاصة بك. استمتع بتجربة فريدة وسهلة لتنظيم ملابسك مع شماعات بولي كلوريد الفينيل 16\" المعدنية، المنتج الأمثل للسوق والمحلات التجارية.', '00000', NULL, NULL, '2023-12-17 14:50:27', '2023-12-17 14:50:27', NULL),
(446, 73, 1, 'جرس الباب اللاسلكي', 'جرس الباب اللاسلكي', 120, 320, NULL, NULL, 1, 'available', 'هذا الجرس اللاسلكي مع مؤشر ضوئي هو منتج عصري وممتع يمكن استخدامه في غرف الأطفال وغيرها. يعمل بالبطارية ومزود بتصميم مبتكر يجعله قطعة ديكور جميلة في أي منزل. يتميز بمجموعة متنوعة من الألحان البهجة والصوت العالي الواضح. يعمل على تردد 315 ميجاهرتز/433 ميجاهرتز ويمتلك نطاق عمل يصل إلى 100 متر. يتم تشغيله ببطارية 23A 12V للزر، ويمكن استخدامه في البيت أو الفندق أو أي مكان آخر. مصنوع من مواد عالية الجودة مثل البلاستيك ABS. إنه منتج موثوق وعملي يضيف لمسة من المرح والعملية إلى بيئتك المنزلية.', '00000', NULL, NULL, '2023-12-17 14:53:49', '2023-12-17 14:53:49', NULL),
(447, 73, 1, '13 ستارة جودة عالية', '13 ستارة جودة عالية', 1, 950, NULL, NULL, 1, 'available', 'ستارة المطبخ المنسوجة تحقق تصميم 3 قطع هي إضافة رائعة لديكور مطبخك. تتألف من قطعتين من الطبقات العلوية ولوحة واحدة للزخرفة، تتميز هذه الستارة بتصميم أنيق مزدوج المنسوجات. صُنعت من البوليستر عالي الجودة، مما يجعلها متينة وقابلة للغسل. توفر لك هذه الستارة الزخارف الرائعة والظل الفاتح، مما يسمح بدخول الضوء الطبيعي إلى المطبخ ويعطيه مظهرًا جماليًا مذهلاً. بفضل تصميمها العصري والعملي، فإن هذه الستارة مناسبة للاستخدام في المنازل والفنادق والمستشفيات والمقاهي. استمتع بجمال وأناقة هذه الستارة المنسوجة وأضف لمسة فريدة إلى مطبخك.', '00000', NULL, NULL, '2023-12-17 15:37:05', '2023-12-17 15:37:05', NULL),
(448, 73, 1, 'ستارة حمام', 'ستارة حمام', 120, 250, NULL, NULL, 1, 'available', 'ستارة حمام بيضاء من القماش المصنوع من بولي إيثيلين المقاوم للماء، تأتي بدون غطاء وتحتوي على نافذة شفافة بيفا ثلاثية الأبعاد. هذه الستارة المثالية تعطي لمسة أنيقة وعصرية لحمامك. تصميمها البسيط والكلاسيكي يتناسب مع أي ديكور داخل الحمام. مصنوعة من مواد عالية الجودة تجعلها مقاومة للماء وتحافظ على جفاف الحمام. بفضل النافذة الشفافة ثلاثية الأبعاد، يمكنك الاستمتاع بالخصوصية داخل الحمام دون الحاجة إلى غطاء إضافي. تأتي الستارة بحجم 180 × 180 سم وتتوفر عينات للتحقق من الجودة قبل الشراء. اجعل حمامك مكانًا منعشًا وأنيقًا مع ستارة الحمام البيضاء هذه.', 'hx11', NULL, NULL, '2023-12-17 15:39:49', '2023-12-17 15:39:49', NULL),
(449, 89, 1, 'إسفنجة معدنية', 'إسفنجة معدنية', 30, 80, NULL, NULL, 1, 'available', 'إسفنجة تنظيف للمطبخ ذات قدرة تنظيف قوية مصنوعة من أسلاك الفولاذ المقاوم للصدأ. تعتبر هذه الإسفنجة أداة مثالية لتنظيف وتلميع الأواني والأطباق والأدوات المعدنية في المطبخ. تتميز بتصميم متين ومقاوم للصدأ، مما يضمن استخدامها لفترة طويلة دون أن تفقد فعاليتها. تحتوي الإسفنجة على أسلاك فولاذية قوية تساعد في إزالة الأوساخ والدهون العنيدة بسهولة وفعالية. كما تتميز بامتصاص الماء بشكل جيد، مما يسهم في تحقيق نتائج تنظيف ممتازة. احصل على إسفنجة تنظيف للمطبخ بجودة عالية وأداء ممتاز للمساعدة في تنظيف مطبخك بكفاءة وسهولة.', '0000', NULL, NULL, '2023-12-17 15:42:00', '2023-12-17 16:02:48', NULL),
(450, 118, 1, 'حقيبة اقلام للفتيات', 'حقيبة اقلام للفتيات', 120, 180, NULL, NULL, 1, 'available', 'هي حقيبة قرطاسية أنيقة وعملية للفتيات. تأتي المقلمة بتصميم ثلاثي الأبعاد يونيكورن، مصنوعة من مادة إيفا عالية الجودة، مما يجعلها متينة ومقاومة للماء. تتميز بسعة كبيرة تسمح بتخزين العديد من الأقلام والأدوات المدرسية الأخرى. بفضل تصميمها العصري والملون، فإنها تلهم الإبداع وتعزز الحب للمدرسة والدراسة. إنها مناسبة للاستخدام في المدرسة أو المكتب أو أثناء السفر. بفضل قدرتها على حمل الأدوات بشكل آمن وحمايتها من الماء، فإن مقلمة يونيكورن المحمولة المخصصة للماء هي اختيار رائع للفتيات الصغيرات اللواتي يرغبن في الاستمتاع بتنظيم أدواتهن القرطاسية بطريقة مرحة وعصرية.', 'WZB-07', NULL, NULL, '2023-12-17 16:10:02', '2023-12-17 16:10:02', NULL),
(451, 118, 1, 'دفتر الملاحظات الأطفال', 'دفتر الملاحظات الأطفال', 320, 550, NULL, NULL, 1, 'available', 'احصل على دفتر الكرتون المحمول الجديد من رونجوي بتصميمات سانريو الرائعة! يحتوي هذا الكتاب على 20 قطعة من الصفحات الداخلية الصغيرة بتصاميم سينامورول، كورومي، ميلودي، وسانريو الشهيرة. يأتي الكتاب بحجم مريح يناسب جيبك، مما يجعله مثاليًا للاستخدام المحمول في أي وقت وأي مكان. يمكنك استخدامه للكتابة، أخذ الملاحظات أو رسم الرسومات الصغيرة. كما يعتبر تحفيزًا ممتعًا للأطفال والكبار على حد سواء. احصل على كتاب الكرتون المحمول هذا الآن واستمتع بالجودة والأناقة والأناشيد المفعمة بالحيوية من سانريو.', 'WJ65', NULL, NULL, '2023-12-17 16:14:35', '2023-12-17 16:14:35', NULL),
(452, 118, 1, 'دفتر الملاحظات ابداعية', 'دفتر الملاحظات ابداعية', 480, 650, NULL, NULL, 1, 'available', '\"دفتر ملاحظات جيب كرتوني لطيف من Kawaii للأطفال\" هو منتج رائع يهدف إلى إشباع حاجة الأطفال للتعبير عن أفكارهم وتدوين مغامراتهم اليومية بطريقة ممتعة وجذابة. يأتي هذا الدفتر بتصميم كرتوني لطيف يجعله جاهزًا للمرافقة في جيوبهم الصغيرة. يتميز بحجمه المناسب للأيدي الصغيرة وصفحاته الفريدة من نوعها التي تمنحهم مساحة كافية للكتابة والرسم. كما يحتوي على ملصقات ملونة وجميلة لتزيين الصفحات وجعلها أكثر إبداعًا. يعد دفتر الملاحظات الكرتوني هذا مناسبًا كهدية مثالية للأطفال، سواء للاستخدام الشخصي أو لمشاركتها مع الأصدقاء. سيكون هذا الدفتر اللطيف رفيقًا ممتعًا للأطفال لتنمية خيالهم وتعزيز مهاراتهم الإبداعية', 'WJ64', NULL, NULL, '2023-12-17 16:17:52', '2023-12-17 16:17:52', NULL),
(453, 118, 1, 'مجموعة دفتر الملاحظات', 'مجموعة دفتر الملاحظات', 800, 1000, NULL, NULL, 1, 'available', 'مجموعة دفتر الملاحظات القرطاسية عيد الميلاد القلم مع دفتر مجموعة لطيفة سيارة الحيوان هلام القلم سانريو المفكرة مصممة خصيصًا للأطفال. تتضمن هذه المجموعة ملاحظات ملونة ومرحة مع تصميمات شخصيات سانريو المحبوبة، وقلم هلام سلس ومريح للكتابة، ومجموعة من القرطاسية المبهجة مثل ملصقات ومشابك وأشرطة القرطاسية. تتميز المجموعة بجودة عالية ومواد صديقة للبيئة، مما يجعلها مثالية للاستخدام اليومي في المدرسة أو المنزل. هذه المجموعة القرطاسية ستضفي لمسة من المرح والإبداع على مذكرات الأطفال وستلهمهم للتعبير عن أفكارهم وإبداعاتهم.', 'WJ63', NULL, NULL, '2023-12-17 16:30:53', '2023-12-17 16:30:53', NULL),
(454, 119, 1, 'الواح الكتابة', 'الواح الكتابة', 50, 90, NULL, NULL, 1, 'available', 'لوحة تثبيت من طبقتين بتصميم كوكب مميز، مطبوعة عليها إضاءة فوق بنفسجية، متوفرة للبيع بالجملة من المصنع. تعتبر هذه اللوحة من الأكريليك عالية الجودة وتنقل الحرارة بفعالية. تتميز بتصميم فريد يعكس شكل كوكب، مما يمنحها مظهرًا جذابًا ومميزًا. تستخدم هذه اللوحة كوسيلة للتثبيت على عجلة القيادة، مما يوفر راحة وثباتًا أثناء القيادة. كما يمكن استخدامها كلوحة تثبيت عامة في مختلف الأغراض. بفضل تقنية الطباعة بالأشعة فوق البنفسجية، يمكن تحقيق تأثير إضاءة جميل عند استخدام اللوحة في الظلام. احصل على هذه اللوحة الفريدة والعملية الآن وتمتع بتجربة استخدام مميزة', '035', NULL, NULL, '2023-12-17 16:36:21', '2023-12-17 16:36:21', NULL),
(455, 118, 1, 'المسطرة الرقمية المرنة', 'المسطرة الرقمية المرنة', 15, 30, NULL, NULL, 1, 'available', 'نقدّم لكم وصفًا لمنتج \"نموذج أزياء قالب حاكم البلاستيك الرقمية مسطرة قياس مجموعة للمدرسة\". إنها مجموعة متعددة الاستخدامات تتضمن حاكمًا مستقيمًا ومسطرة قياس رقمية قابلة للتعديل بطول مرن. تصميمها القابل للطي يتيح لك تشكيلها بسهولة في أي شكل تود قياسه أو رسمه. تعتبر هذه المجموعة مثالية للطلاب والمدرسين وهواة الرسم لأنها تسهل عملية القياس والرسم بدقة ودون عناء. تأتي المسطرة الرقمية مع وظائف متقدمة مثل القياس الرقمي والتحويل بين الوحدات المختلفة. كما يمكن تخصيص الألوان والشعار وحجم المنتج وفقًا لاحتياجاتك. هذه المجموعة تجمع بين العملية والجودة العالية، مما يجعلها خيارًا مثاليًا للاستخدام المدرسي والإبداعي', 'WJ02', NULL, NULL, '2023-12-17 16:40:49', '2023-12-17 16:40:49', NULL),
(456, 118, 1, 'مسطرة متعددة الوظائف', 'مسطرة متعددة الوظائف', 25, 50, NULL, NULL, 1, 'available', 'مسطرة متعددة الوظائف من المصنع مكتب ترويحي مجموعة بلاستيكية مع شعار مخصص\r\n\r\nاحصل على مسطرة متعددة الوظائف المصنوعة من مواد بلاستيكية عالية الجودة مع هذه المجموعة المذهلة. تأتي هذه المسطرة بتصميم متين ومطوّل يسمح بالقياسات الدقيقة والرسم بسهولة ودقة. تتميز بمرونة فائقة وتستخدم في المدارس والمكاتب والمنازل.\r\n\r\nبفضل الشعار المخصص، يمكنك إبراز هويتك الفريدة وتعزيز مظهرك المهني. تأتي هذه المسطرة بألوان متنوعة ومتعددة الاستخدامات، مما يجعلها اختيارًا مثاليًا للهدايا أو الاستخدام الشخصي.\r\n\r\nاستمتع بالدقة والمتانة مع هذه المسطرة المتعددة الوظائف، فهي ستكون إضافة رائعة إلى مجموعتك القرطاسية. احصل عليها الآن واستمتع بالقياسات الدقيقة والرسم بأسلوب احترافي', 'WJ01', NULL, NULL, '2023-12-17 16:43:31', '2023-12-17 16:43:31', NULL),
(457, 118, 1, 'مجموعة قلم رصاص', 'مجموعة قلم رصاص', 25, 60, NULL, NULL, 1, 'available', 'قلم رصاص HB مثلث الشكل الملون بتصميم بيرليزيد ومزود بممحاة هو منتج مثالي للطلاب والمكاتب. يأتي هذا القلم بحجم مثلثي يوفر قبضة مريحة ويسهل التحكم فيه أثناء الكتابة والرسم. يتميز ببنية خشبية ناعمة وطبقة بيرليزيد ملونة تضفي عليه مظهرًا جماليًا وجذابًا. يحتوي القلم على رصاص HB عالي الجودة يوفر خطوطًا داكنة وواضحة، ويأتي مع ممحاة ناعمة لتصحيح الأخطاء بسهولة. يأتي في مجموعة تحتوي على 12 قلمًا ملونًا، مما يجعله خيارًا رائعًا للاستخدام في المدارس والمكاتب. احصل على هذه المجموعة الرائعة واستمتع بتجربة الكتابة السلسة والإبداعية', '037', NULL, NULL, '2023-12-17 17:27:19', '2023-12-17 17:27:19', NULL),
(458, 120, 1, 'آلة حاسبة متعددة الوظائف لأطفال', 'آلة حاسبة متعددة الوظائف لأطفال', 85, 150, NULL, NULL, 1, 'available', 'آلة حاسبة للطلاب اختبار متعدد الوظائف آلة حاسبة وظيفة الكمبيوتر العلمية المحددة\r\n\r\nاحصل على آلة حاسبة متعددة الوظائف مصممة خصيصًا للطلاب والطلاب الجامعيين. تتميز هذه الآلة الحاسبة بوظائف متعددة تلبي احتياجاتك الرياضية والعلمية. تتضمن ميزاتها حسابات الدوال والمعادلات والإحصاءات وتحويل الوحدات والأرقام العشرية والجبر وأكثر من ذلك بكثير. تصميمها المدمج وشاشتها الواضحة يسهل عليك استخدامها وحملها في أي مكان. تعمل بواسطة بطاريات AAA، وتأتي مع إمكانية تخصيص الشعار الخاص بك. احصل على هذه الآلة الحاسبة العلمية المحددة واستمتع بأداء موثوق ودقيق في حل المسائل الرياضية والعلمية.', 'JZJ11', NULL, NULL, '2023-12-17 17:32:19', '2023-12-17 17:32:19', NULL),
(459, 118, 1, 'علبة الأقلام المبتكرة', 'علبة الأقلام المبتكرة', 40, 80, NULL, NULL, 1, 'available', 'تعتبر هذه السيارة الإبداعية الكورية صغيرة المقاس ومزدوجة الطبقات علبة أقلام رصاص كرتونية عصرية مكواة مثالية للمدارس الابتدائية. تتميز بتصميمها المبتكر والجذاب الذي يلفت انتباه الأطفال. تحتوي على طبقتين لتنظيم الأقلام والمستلزمات المدرسية بشكل مناسب. تتميز بجودة التصنيع والمتانة، حيث تم إنتاجها من مواد عالية الجودة. تأتي في شكل علبة رصاص صغيرة ومكواة، مما يجعلها مثالية لحملها في حقائب الظهر أو الحقائب المدرسية. إنها طريقة عملية وأنيقة لتنظيم القرطاسية والأدوات المدرسية. ستكون إضافة رائعة لمستلزمات طلاب المدارس الابتدائية، وستساعدهم في البقاء منظمين ومرتبين طوال اليوم الدراسي.', '886', NULL, NULL, '2023-12-17 17:36:46', '2023-12-17 17:36:46', NULL),
(460, 89, 1, '5 إسفنجة تنظيف', 'إسفنجة تنظيف', 40, 80, NULL, NULL, 1, 'available', 'إسفنجة تنظيف منزلية عالية الجودة للمطبخ، والتي تتميز بقدرتها الفائقة على الامتصاص وثلاث طبقات تصفية. تعد هذه الإسفنجة مثالية لتنظيف المطبخ والأواني بسهولة وفعالية. تم تصميمها باستخدام مواد عالية الجودة وتقنية متقدمة لتوفير أداء تنظيف ممتاز ومتانة طويلة الأمد. يمكن استخدامها في جميع فصول السنة ومناسبة للاستخدام التجاري والمنزلي. تتميز بحجم مريح وسهولة الاستخدام. بفضل تصميمها المستدام، فإنها تعد خيارًا صديقًا للبيئة. احصل على هذه الإسفنجة عالية الجودة لتجربة تنظيف فعالة وفعالة لمطبخك.', '0000', NULL, NULL, '2023-12-17 19:28:01', '2023-12-17 19:28:01', NULL),
(461, 120, 1, 'آلة حاسبة علمية', 'آلة حاسبة علمية', 120, 220, NULL, NULL, 1, 'available', 'قدمت آلة الحاسبة العلمية Ay Ms-osalo 10 + 2 أرقام عرض اتجاهين لتلبية احتياجاتك الرياضية والعلمية. تتميز هذه الآلة الحاسبة بشاشة عرض واضحة ومقاسات أرقام كبيرة تسهل القراءة والاستخدام. تحتوي الآلة الحاسبة على مجموعة واسعة من الوظائف العلمية التي تشمل العمليات الأساسية والمتقدمة مثل الجذور التربيعية والأسس واللوغاريتمات والتحويلات بين الوحدات. بفضل تصميمها المدمج والمحمول، يمكنك حمل هذه الآلة الحاسبة معك في أي مكان واستخدامها في الدروس والامتحانات والأنشطة اليومية. استفد من دقة وسهولة استخدام الآلة الحاسبة العلمية Ay Ms-osalo 10 + 2 أرقام عرض اتجاهين في رحلتك العلمية والرياضية', '991MS', NULL, NULL, '2023-12-17 19:30:13', '2023-12-17 19:35:05', NULL),
(462, 89, 1, 'مجموعة ادوات تنظيف الصحون', 'مجموعة ادوات تنظيف الصحون', 1, 200, NULL, NULL, 1, 'available', 'مقشرة الاستانلس ستيل بتصميم ليني Xulin هي أداة مثالية لتنظيف المطبخ والحمام. تتميز بخصائص استثنائية تجعلها فعالة في إزالة الأوساخ والبقع الصعبة. تأتي المقشرة بشكل ليفي وجلي خشن، مصنوعة من خيوط فولاذية مقاومة للصدأ عالية الجودة. تتميز بامتصاص الماء بنسبة تصل إلى 250٪، مما يمنحها قدرة فائقة في التنظيف والتجفيف السريع. تعد المقشرة مثالية لاستخدامها في تنظيف الأواني والأدوات الفولاذية والأحواض والمراحيض. بفضل تصميمها اللولبي والكرات الموجودة على سطحها، توفر المقشرة تجربة تنظيف فعالة ومريحة. احصل على مقشرة الاستانلس ستيل لتحصل على نتائج مذهلة في تنظيف منزلك.', '0000', NULL, NULL, '2023-12-17 19:30:34', '2023-12-17 19:35:35', NULL),
(463, 120, 1, 'آلة حاسبة إلكترونية عصرية', 'آلة حاسبة إلكترونية عصرية', 65, 130, NULL, NULL, 1, 'available', 'آلات حاسبة إلكترونية وظيفية جديدة، بيضاء/سوداء، بحجم 14 × 11 سنتيمترًا ومزودة بشاشة تعرض 12 رقمًا. تعد هذه الآلات الحاسبة المثالية للاستخدام في المكتب والمدرسة. تتميز بتصميم مدقة وأنيقة، ومصنوعة من مواد عالية الجودة تضمن المتانة والأداء العالي. تعمل بواسطة بطاريات العملة لتوفير الطاقة والاستخدام الطويل. تتميز الآلة الحاسبة بوظائف متعددة تشمل التقويم والحسابات العلمية، مما يجعلها أداة مثالية للمهام اليومية والحسابات المعقدة على حد سواء. بفضل الألوان البيضاء والسوداء الأنيقة، تتماشى هذه الآلة الحاسبة مع أي بيئة مكتبية أو تعليمية. احصل على هذه الآلة الحاسبة الإلكترونية العملية والعصرية لتلبية احتياجاتك الحسابية بدقة وسهولة.', 'JSI', NULL, NULL, '2023-12-17 19:34:20', '2023-12-17 19:34:51', NULL),
(464, 89, 1, 'منظف المرحاض ومزيل الروائح', 'منظف المرحاض ومزيل الروائح', 1, 170, NULL, NULL, 1, 'available', 'مزيل الروائح العطري للمرحاض ومنتج تنظيف الحمام الذي يأتي على شكل كتلة صلبة. يعد هذا المنتج مثالياً لتحسين رائحة المرحاض وتنظيفه بشكل كامل. يحتوي على تركيبة فعالة تنزع الأوساخ والرواسب وتزيل الروائح الكريهة بفعالية. تعمل كتلة المرحاض الصلبة على تركيب حاجز واقٍ يمنع تكوّن البقع والترسبات. يمتاز بسهولة الاستخدام، حيث يتم وضعه مباشرة في الخزان ويترك ليعمل بفعالية طوال الوقت. هذا المنتج يوفر لك تجربة نظافة وانتعاش مثالية للمرحاض والحمام.', '0000', NULL, NULL, '2023-12-17 19:39:28', '2023-12-17 19:39:28', NULL),
(465, 120, 1, 'ماكينة الحاسبة', 'ماكينة الحاسبة', 60, 90, NULL, NULL, 1, 'available', 'ماكينة الحاسبة ذات الشاشة العرضية تعمل بالطاقة الشمسية وتتميز بأزرار كبيرة وأرقام بحجم كبير. تصميمها العصري والمتطور يجعلها مثالية للاستخدام في البيئات المكتبية والتعليمية. تعمل بالطاقة الشمسية وتحتوي على بطارية قابلة للشحن لتوفير الطاقة في حالة الإضاءة المنخفضة. تسمح الأزرار الكبيرة والأرقام الكبيرة بقراءة واضحة وسهلة وتشغيل مريح للأشخاص ذوي الرؤية الضعيفة أو الصعوبات في الحركة. تتميز بالدقة والموثوقية في الأداء، وتوفر وظائف حسابية متعددة مثل الجمع والطرح والضرب والقسمة. احصل على هذه الماكينة الحاسبة المزودة بتقنية الطاقة الشمسية والأزرار الكبيرة لتلبية احتياجاتك الحسابية اليومية بكفاءة وسهولة', 'J12', NULL, NULL, '2023-12-17 19:41:42', '2023-12-17 19:41:42', NULL),
(466, 120, 1, 'ماكينة فائقة الأداء', 'ماكينة فائقة الأداء', 100, 160, NULL, NULL, 1, 'available', 'ماكينة حاسبة مكتبية Eates هي آلة حاسبة متطورة تعمل بالطاقة الشمسية، مصممة خصيصًا للاستخدام في المكاتب. تتميز بشاشة عرض تحتوي على 12 رقمًا، مما يوفر لك قدرة حسابية عالية الدقة وكفاءة في الأداء. تأتي هذه الماكينة الحاسبة بتصميم متين وأنيق، حيث يتم تصنيعها من لوح ألومنيوم عالي الجودة، مما يجعلها متينة ومستدامة للاستخدام اليومي في البيئة المكتبية. بالإضافة إلى ذلك، يحتوي هذا المنتج على بطارية داخلية لتوفير الطاقة في حالة ضعف إضاءة الشمس. استمتع بالتحسينات التقنية والأداء الفائق مع ماكينة الحاسبة المكتبية Eates التي تجمع بين الدقة والجودة في تصميم واحد', 'JSJ-14', NULL, NULL, '2023-12-17 20:06:09', '2023-12-17 20:06:09', NULL),
(467, 73, 1, '3 علاقات للملابس', '3 علاقات للملابس', 1, 220, NULL, NULL, 1, 'available', 'هوك الحائط لتزيين المنزل وراء الباب من Rts هو منتج إبداعي وعملي يضفي لمسة أنيقة على ديكور منزلك. صُنع الهوك من مادة الراتنج السلس والسيراميك، مما يمنحه متانة وجودة عالية. يأتي الهوك بتصميم ذاتي لاصق بسيط، مما يسهل تركيبه واستخدامه. يمكن استخدامه لتعليق الملابس والأغراض الأخرى وراء الأبواب في غرفة المعيشة، الحمام أو المطبخ. يتميز هذا الهوك بالأبعاد المثلى والتسامح الدقيق، مع إمكانية تخصيص اللون والشعار وفقًا لاحتياجاتك. احصل على هذا الهوك الرائع لتحسين تنظيم منزلك وإضفاء لمسة جمالية فريدة.', '0000', NULL, NULL, '2023-12-17 20:06:15', '2023-12-17 20:06:15', NULL),
(468, 85, 1, 'إسفنجة تويست الشعر', 'إسفنجة تويست الشعر', 1, 120, NULL, NULL, 1, 'available', 'جهاز تويست الشعر \"ماجيك الحلاق الإسفنج\" هو منتج ساخن لعام 2022، يستخدم لإنشاء تسريحات الشعر بالضفائر والتويست. صُنع هذا الجهاز من إسفنجة عالية الجودة، وهو مثالي للاستخدام في صالونات الحلاقة وللاستخدام الشخصي أيضًا. يتميز بتصميمه المريح والسهل الاستخدام، حيث يمكن استخدامه لتشكيل وتنسيق الشعر بسهولة وسرعة. يوفر تجربة تصفيف الشعر المثالية والنتائج المهنية. إنه مثالي للحصول على تسريحات الشعر الجميلة والمتنوعة في أي مناسبة. احصل على جهاز تويست الشعر الفريد والعصري لتحقيق تسريحات شعر مذهلة بكل سهولة.', '0000', NULL, NULL, '2023-12-17 20:09:13', '2023-12-17 20:18:35', NULL),
(469, 120, 1, 'آلة حاسبة موثوقة', 'آلة حاسبة موثوقة', 200, 320, NULL, NULL, 1, 'available', 'مكتب ، سعر المصنع 14 يوم عمل عرض كبير بخطوات التحقق من الآلة الحاسبة الصحيحة - اشترِ آلة حاسبة بخطوات تحقق صحيحة تحتوي على 112 خطوة، آلة حاسبة إلكترونية للمكتب، ومخصصة للاستخدام الشمسي. تعد هذه الآلة الحاسبة مثالية للاستخدام في الأعمال والمكاتب والمدارس وغيرها. تأتي بتصميم مدقة وأنيقة، وتوفر 14 رقمًا للعرض. تعمل بالطاقة الشمسية والبطارية، مما يضمن استدامة واستقلالية في الاستخدام. تتميز بجودة عالية وأداء موثوق به، وتحتوي على شهادة CE وبنفايات. احصل على هذه الآلة الحاسبة الصحيحة والعملية التي تساعدك على إجراء الحسابات بدقة وسهولة.', 'JSJ13', NULL, NULL, '2023-12-17 20:11:10', '2023-12-17 20:11:10', NULL),
(470, 66, 1, 'أكواب ورقية بيضاء مغلفة بطبقة PE', 'أكواب ورقية بيضاء مغلفة بطبقة PE', 50, 110, NULL, NULL, 1, 'available', 'تتميز أكواب الورق البيضاء بطبقة PE المغلفة بالجملة بجودتها العالية ومتانتها، مما يجعلها خيارًا مثاليًا للاستخدامات المختلفة. تأتي هذه الأكواب بسعة تتراوح بين 3 أونصات و12 أونصة، مما يجعلها مناسبة للعديد من المشروبات مثل القهوة والمشروبات الباردة وعصائر الفاكهة. تصميمها القابل للتصرف يجعلها مريحة وسهلة الاستخدام، بينما تكون قابلة للتحلل الحيوي وصديقة للبيئة. تعتبر هذه الأكواب الورقية المغلفة بالجملة خيارًا مثاليًا للمطاعم والمقاهي وحفلات الشاي والمناسبات الخاصة، وتوفر تجربة شرب مريحة وصحية.', '00000', NULL, NULL, '2023-12-17 20:12:11', '2023-12-17 20:12:11', NULL),
(471, 89, 1, 'مناشف للمطبخ', 'مناشف للمطبخ', 30, 90, NULL, NULL, 1, 'available', 'مناشف الألياف الميكرو للمطبخ مصنوعة خصيصًا لتلبية احتياجاتك في المطبخ. تأتي هذه المناشف بتقنية الألياف الميكرو العالية الجودة، مما يجعلها قوية ومتينة للاستخدام المتكرر. تتميز بامتصاص فائق للرطوبة وقدرة سريعة على التجفيف، مما يجعلها مثالية لتنظيف الأواني والأسطح في المطبخ. بفضل تصميمها ذو الخطوط المميزة والألوان الجميلة، فإنها تضيف لمسة أنيقة وعصرية إلى المطبخ الخاص بك. هذه المناشف متوفرة بمقاسين مختلفين (30*30 سم و40*40 سم) ويمكن تخصيص شعارك عليها. احصل على هذه المناشف ذات الجودة العالية لتجربة مطبخ فعالة ونظيفة.', '00000', NULL, NULL, '2023-12-17 20:21:42', '2023-12-17 20:21:42', NULL),
(472, 89, 1, 'منشفة من القماش السويدي', 'منشفة من القماش السويدي', 30, 95, NULL, NULL, 1, 'available', 'قماش صحن سويدي بطباعة مخصصة من Microfiber هو منتج عالي الجودة يتميز بتصميم فريد ومخصص. يتكون القماش من مادة Microfiber، وهي مادة فائقة الامتصاص وقوية في إزالة الأوساخ والدهون. يمكن استخدامه في تنظيف الأطباق والمطبخ والفندق والمنزل بشكل عام. بفضل تقنية الطباعة المخصصة المتاحة، يمكنك طباعة أي تصميم أو شعار ترغب فيه على القماش، مما يجعله مناسبًا للاستخدام الشخصي أو كهدية ترويجية. يأتي القماش بحجم 40x40 سم ووزن 40 جم، ويمكن تخصيص لون الطباعة والتعبئة حسب الاحتياجات الخاصة بك. احصل على هذا القماش المميز واستمتع بتنظيف سهل وفعال مع لمسة شخصية.', '0000', NULL, NULL, '2023-12-17 20:26:53', '2023-12-17 20:27:20', NULL),
(473, 117, 1, 'لاصق الورق', 'لاصق الورق', 180, 320, NULL, NULL, 1, 'available', 'عصا الغراء هي مستلزم مكتبي أساسي يستخدم في العديد من التطبيقات المختلفة. تتميز عصا الغراء بجودتها العالية وقوتها اللاصقة الموثوقة. تصميمها الصلب والمدمج يجعلها سهلة الاستخدام ومريحة للحمل. تعتبر عصا الغراء حلاً مثاليًا للاستخدام في المدارس والمكاتب والمشاريع الحرفية. يمكن استخدامها للتصاق ورق، الصور، البطاقات، والمواد الأخرى بسهولة وثبات. بفضل حجمها المدمج، يمكن حمل عصا الغراء بسهولة في الحقائب أو الجيوب. إنها إضافة ممتازة لأي مجموعة مستلزمات مكتبية وتساعد في إكمال المهام بسهولة ودقة.', '037', NULL, NULL, '2023-12-17 20:26:54', '2023-12-17 20:26:54', NULL),
(474, 63, 1, 'قفازات المطبخ عازلة الحرارة', 'قفازات المطبخ عازلة الحرارة', 25, 85, NULL, NULL, 1, 'available', 'قفازات مطبخ قطنية مانعة للانزلاق بتصميم زهرة هي منتجات عالية الجودة وعملية للاستخدام في المطبخ. تتميز بتصميم زهرة جميل يُضفي لمسة من الأناقة على مهام الطهي اليومية. صُنعت هذه القفازات من القطن الناعم، مما يوفر راحة فائقة أثناء الاستخدام. تأتي هذه القفازات بتقنية مانعة للانزلاق لضمان قبضة آمنة على الأواني والأدوات المطبخية. كما تتميز بخاصية العزل الحراري لحماية اليدين من الحرارة العالية أثناء استخدام الميكروويف أو الفرن. إنها منتجات متعددة الاستخدامات ومثالية للطهاة المحترفين والهواة على حد سواء. احصل على هذه القفازات العملية والأنيقة لتجربة طهي آمنة وممتعة.', '0000', NULL, NULL, '2023-12-17 20:30:47', '2023-12-17 20:30:47', NULL),
(475, 118, 1, 'مقص الورق', 'مقص الورق', 50, 90, NULL, NULL, 1, 'available', 'مقص سانريو كاواي من Ruunjoy هو منتج رائع يتميز بتصميمه الكرتوني المحمول ومتعدد الوظائف، وهو مثالي كهدية لعشاق الفن والأطفال. يتميز هذا المقص بتصميم مستوحى من شخصيات سانريو الشهيرة مثل ماي ميلودي وكيوت كارتون، مما يعزز الجاذبية الجميلة له. يمكن استخدامه في القص والتصميم الفني وقص الورق، ويأتي بنصل حاد وقابل للطي لسهولة التخزين والحمل. كما يتميز بغلاف سيليكون آمن للأطفال. إن مقص سانريو كاواي هو منتج ممتع وعملي يوفر تجربة قص فريدة ويعد هدية مثالية للأطفال ومحبي الفن', 'WJ54B', NULL, NULL, '2023-12-17 20:31:25', '2023-12-17 20:31:25', NULL),
(476, 102, 1, 'حامل الهاتف فتحات التهوية في السيارة', 'حامل الهاتف فتحات التهوية في السيارة', 1, 280, NULL, NULL, 1, 'available', 'حامل هاتف الجوال على فتحات التهوية في السيارة - حامل الهاتف النقال للسيارة بتصميم مبتكر يتيح لك تثبيت هاتفك الجوال بأمان وسهولة أثناء القيادة. مصنوع من سبيكة الألومنيوم عالية الجودة، يتميز بتصميمه الأنيق والمتين. يتم تركيبه بسهولة على فتحات التهوية في السيارة، مما يوفر استخدامًا مريحًا وآمنًا للهاتف الجوال أثناء القيادة. يمكن تعديله وتدويره بسهولة للحصول على زاوية رؤية مثالية. يعد هذا الحامل مناسبًا لمختلف أحجام الهواتف الجوالة ويوفر استقرارًا فائقًا أثناء القيادة. احصل على حامل هاتف الجوال للسيارة واستمتع بتجربة قيادة آمنة ومريحة.', '00000', NULL, NULL, '2023-12-17 20:34:52', '2023-12-17 20:34:52', NULL),
(477, 118, 1, 'قلم رصاص ملون', 'قلم رصاص ملون', 80, 130, NULL, NULL, 1, 'available', 'قلم رصاص قياسي لحماية البيئة Hb معكرون بشعار مخصص هو منتج مميز وعالي الجودة. يأتي هذا القلم بتصميم قياسي يسهم في حماية البيئة، حيث يتم استخدام خشب الباسوود في صنعه. إنه مناسب للاستخدام في المدارس والمكاتب وأيضًا يمكن استخدامه كهدية ترويجية. يتميز بصلابة الرصاص Hb، مما يوفر كتابة سلسة وواضحة. يمكن تخصيص شعارك الخاص على هذا القلم، مما يجعله خيارًا مثاليًا للاستخدام الشخصي أو كهدية تجارية. بفضل جودته العالية وتصميمه المبتكر، فإن هذا القلم يعكس الاهتمام بالبيئة ويوفر تجربة كتابة مريحة وممتعة', 'WJ06', NULL, NULL, '2023-12-17 20:35:49', '2023-12-17 21:00:19', NULL),
(478, 118, 1, 'قلم رصاص', 'قلم رصاص', 80, 140, NULL, NULL, 1, 'available', 'قلم رصاص خشبي بشكل مثلث 2B - اشترِ منتج قلم رصاص خشبي بشكل مثلث يعتبر هذا القلم رفيقًا مثاليًا للمكتب والمدرسة. صُنع القلم من الخشب عالي الجودة ويحتوي على قلب رصاص 2B الأسود. يتميز بتصميمه ذو الشكل المثلثي الفريد الذي يوفر قبضة مريحة وقابلية للتحكم. إن طوله المناسب يجعله سهل الاستخدام ومناسبًا للكتابة والرسم. يأتي القلم في عبوة تحتوي على 30 قلمًا، مما يجعله مثاليًا للاستخدام الشخصي أو كهدية. احصل على هذا القلم الرصاص الخشبي بشكل مثلث 2B الجذاب والعملي اليوم وتمتع بتجربة كتابة فريدة ومميزة', 'WJ06', NULL, NULL, '2023-12-17 21:00:02', '2023-12-17 21:00:02', NULL),
(479, 66, 1, 'مصاصة الشرب (100)', 'مصاصة الشرب (100)', 1, 210, NULL, NULL, 1, 'available', 'قش الشرب البلاستيكي غير القابل للتلويث هو منتج مثالي للاستخدام في المناسبات المختلفة وفي المنزل. تم تصنيعه من مادة نشا الذرة 100% القابلة للتحلل البيولوجي، مما يجعله صديقًا للبيئة وآمنًا للاستخدام. يتميز بتصميمه الملون والأنيق، مما يجعله مثاليًا للاستخدام في الحفلات والمناسبات الاحتفالية. كما يمكن استخدامه في تناول المشروبات الساخنة والباردة، بما في ذلك الشاي والقهوة والعصائر. يأتي في عبوة مريحة ومتاح بعدة ألوان جميلة. استمتع بتجربة شرب مريحة وممتعة مع قش الشرب البلاستيكي الملون غير القابل للتلويث.', '0000', NULL, NULL, '2023-12-17 21:48:28', '2023-12-17 21:59:33', NULL),
(480, 94, 1, 'مجموعة العناية ب الأظافر', 'مجموعة العناية ب الأظافر', 55, 180, NULL, NULL, 1, 'available', 'مجموعة أظافر 11 من كماشة قطع الجلد الميت بكماشة هي مجموعة أدوات مانيكير عالية الجودة ومتعددة الاستخدامات. تتضمن المجموعة كماشة قطع الجلد الميت بكماشة وأدوات أخرى مهمة للعناية بالأظافر. مصنوعة من الفولاذ المقاوم للصدأ للتحمل والمتانة. تأتي الأدوات في تصميم مريح وسهل الاستخدام، مما يجعلها مناسبة للاستخدام المنزلي والاحترافي. تساعدك هذه المجموعة على قص وتنظيف الأظافر بسهولة ودقة، وتزيل براوي الجلد الميت بأمان ودقة. سواء كنت تقوم بجلسة مانيكير في المنزل أو في صالون التجميل، فإن مجموعة أظافر 11 هي الخيار المثالي للحصول على أظافر جميلة ومرتبة.', '0000', NULL, NULL, '2023-12-17 21:50:40', '2023-12-17 21:51:26', NULL),
(481, 118, 1, 'عصا رقمية تعليمية خشبية للأطفال', 'عصا رقمية تعليمية خشبية للأطفال', 60, 160, NULL, NULL, 1, 'available', 'عصا رقمية تعليمية خشبية للأطفال هي لعبة تعليمية مونتيسوري مصنوعة من الخشب الطبيعي عالي الجودة. تعتبر هذه العصا الرقمية أداة فعالة لتعليم الأطفال المفاهيم الرقمية والحسابية بطريقة ممتعة وتفاعلية. تحتوي العصا على أعداد من 1 إلى 10 والعلامات الرقمية المقابلة، مما يساعد الأطفال على فهم العد والتسلسل الرقمي. بفضل تصميمها الخشبي الآمن والمتين، فإنها تعزز مهارات التنسيق العين-اليد والتركيز والتفكير الإبداعي لدى الأطفال. بالإضافة إلى ذلك، فإن هذه العصا الرقمية تعتبر هدية مثالية للأطفال، تساعدهم على التعلم والتطور بطريقة ممتعة وتحفيزية', '038', NULL, NULL, '2023-12-17 21:55:42', '2023-12-17 21:55:42', NULL),
(482, 118, 1, 'مجموعة اقلام مبتكرة مزدوجة', 'مجموعة اقلام مبتكرة مزدوجة', 60, 90, NULL, NULL, 1, 'available', 'وصف المنتج (باللغة العربية):\r\n\r\nتُعد مجموعة خطوط القلم المكونة من خطين خارج الخط القلم منتجًا مميزًا ومفيدًا. يأتي القلم بتصميم ثنائي الجانب يتيح الكتابة بخطين في نفس الوقت، مما يوفر تجربة ممتعة ومثيرة للاهتمام. يمكن استخدام هذه المجموعة الرائعة في الرسم والتظليل والكتابة الإبداعية. يأتي القلم بستة خيارات مختلفة من الألوان لتلبية احتياجاتك المختلفة. صُنع القلم من مواد عالية الجودة، وهو متين ويدوم طويلاً. يأتي القلم في عبوة مريحة تحتوي على ستة قطع، وهو مثالي للأطفال والبالغين على حد سواء. احصل على مجموعة خطوط القلم المميزة هذه اليوم واستمتع بتجربة الكتابة الإبداعية والفنية الممتعة', '039', NULL, NULL, '2023-12-17 21:58:40', '2023-12-17 21:58:40', NULL),
(483, 118, 1, 'قلم الإبداع الأبيض المتميّز', 'قلم الإبداع الأبيض المتميّز', 30, 60, NULL, NULL, 1, 'available', 'قلم جل باللون الأبيض للرسم بتصميم مميز وجودة عالية. يعد هذا القلم المبتكر والمخصص بشعار Inkjoy جل قلم مناسبًا للاستخدام في الرسم والكتابة. يأتي بحبر جل عالي الجودة يوفر خطوطًا نقية وسلسة، مما يجعله مثاليًا للأعمال الفنية والمشاريع الإبداعية. يتميز القلم بتصميمه الأنيق والمريح، ما يجعله سهل الاستخدام لفترات طويلة دون إجهاد اليد. إنه منتج مثالي للمدارس والجامعات والمكاتب، كما يمكن استخدامه كهدية ترويجية أو هدية تذكارية. احصل على هذا القلم الرائع الآن واستمتع بتجربة كتابة فريدة وممتعة', 'WJ39', NULL, NULL, '2023-12-17 22:03:30', '2023-12-17 22:03:30', NULL),
(484, 118, 1, 'صندوق الإبداع الملون', 'صندوق الإبداع الملون', 240, 350, NULL, NULL, 1, 'available', 'صندوق أقلام رصاص ملون خشبي قابل للتخصيص يحتوي على 12 لونًا متنوعًا مع شعار مخصص. هذا الصندوق المصغر يحتوي على أقلام رصاص ملونة عالية الجودة تمنحك تجربة فنية مذهلة. مصنوعة من الخشب الطبيعي، توفر هذه الأقلام قبضة مريحة ومستقرة أثناء الرسم والتلوين. يُعتبر هذا المنتج مناسبًا للطلاب والفنانين والهواة على حد سواء. يتميز بألوان زاهية ومشرقة تتيح لك إضافة لمسات من الجمال والتعبير الفني إلى أعمالك الفنية. باستخدام هذا الصندوق الرائع، ستكون قادرًا على استكشاف إبداعك وخلق أعمال فنية مذهلة تلهم الآخرين. احصل على هذا الصندوق المميز اليوم واستمتع بتجربة فنية لا تنسى.', '901', NULL, NULL, '2023-12-18 00:08:17', '2023-12-18 00:08:17', NULL),
(485, 118, 1, 'مجموعة ألوان سداسية اللون الفنية', 'مجموعة ألوان سداسية اللون الفنية', 150, 300, NULL, NULL, 1, 'available', 'مجموعة ألوان رصاص سداسية اللون، تتكون من 12 قطعة عالية الجودة. هذه المجموعة المذهلة توفر تجربة فريدة لعشاق الرسم والتلوين. تحتوي المجموعة على ألوان رصاص زاهية ومشرقة تتناسب مع جميع الأعمار والمهارات. تصميمها السداسي يجعلها سهلة الاستخدام ومريحة في القبضة. تتميز بقلم رصاص Hb العالي الجودة، مما يضمن خطوطًا ناعمة وواضحة. تأتي هذه المجموعة مع شحن سريع وتغليف جيد لحماية الأقلام. احصل على هذه المجموعة الرائعة اليوم واستمتع بتجربة فنية ممتعة وإبداعية. مناسبة للفنانين المبتدئين والمحترفين على حد سواء', '900', NULL, NULL, '2023-12-18 00:12:10', '2023-12-18 00:12:10', NULL),
(486, 118, 1, 'مجموعة أقلام اللوح الأبيض المبتكرة', 'مجموعة أقلام اللوح الأبيض المبتكرة', 30, 70, NULL, NULL, 1, 'available', 'مجموعة من 4 قطع لوح أبيض غير سام مع ممحاة، تعد هذه المجموعة الأمثل للاستخدام في المكتب أو لأغراض الترويج. تأتي هذه الأقلام باللون الأبيض وتتميز بجودة عالية وأداء ممتاز. تم تصميم هذه الأقلام لتكون علامات فنية قابلة للمسح، مما يتيح لك إمكانية التعديل والتحرير بسهولة. يمكنك استخدامها على الجانبين المختلفين من اللوح الأبيض لتحقيق أقصى استفادة. بفضل تصميمها المريح والمميز، ستحصل على كتابة سلسة ودقيقة. تعتبر هذه المجموعة مناسبة للترويج للعلامة التجارية أو استخدامها في البيئة المكتبية. قم بشراء هذه المجموعة الرائعة اليوم واستمتع بتجربة كتابة مثالية ومميزة', '30', NULL, NULL, '2023-12-18 00:16:43', '2023-12-18 00:16:43', NULL),
(487, 118, 1, 'مجموعة القرطاسية الكرتونية', 'مجموعة القرطاسية الكرتونية', 45, 90, NULL, NULL, 1, 'available', 'مجموعة قرطاسية كرتونية هي منتج رائع للأطفال. تتضمن المجموعة أقلام رصاص خشبية مصممة بتصاميم كرتونية جذابة ومشوقة. تتميز هذه الأقلام بقلم رصاص HB عالي الجودة، مما يجعلها مثالية للاستخدام في المدرسة والمكتب. تأتي المجموعة بألوان متعددة تضفي مرحًا وحيوية على تجربة الكتابة والرسم. تتميز بحجم مناسب يناسب أيدي الأطفال، وتحتوي على ممحاة للتصحيح السريع والسهل. بفضل تصميمها الكرتوني الجميل وجودتها العالية، تعد مجموعة قرطاسية كرتونية  هدية مثالية للأطفال الذين يحبون الكتابة والرسم.', 'Z08', NULL, NULL, '2023-12-18 00:27:30', '2023-12-18 00:27:30', NULL),
(488, 87, 1, 'حامل فرشاة الأسنان بشفط الجدار', 'حامل فرشاة الأسنان بشفط الجدار', 50, 120, NULL, NULL, 1, 'available', 'اكسسوارات الحمام البلاستيكية المنزلية جدار شفط كأس فرشاة أسنان بالغين حامل.\r\n\r\nهذا المنتج هو حامل فرشاة أسنان للبالغين يتم تثبيته على جدار الحمام بواسطة شفط الكأس. يتميز بتصميمه العصري والعملي ويساعد في تنظيم وترتيب الفرشاة وكأس الفرشاة بشكل فعال. مصنوع من مواد عالية الجودة مثل البلاستيك PP وABS و PVC لضمان المتانة والمتانة الطويلة الأمد. يأتي بحجم مناسب يتناسب مع الفرشاة وكأس الفرشاة، وهو متوفر باللون البيج ويمكن تخصيص اللون حسب الطلب. مناسب للاستخدام في غرف النوم والحمامات، ويتم تغليفه بشكل محكم لضمان سلامته أثناء الشحن والتخزين.\r\n\r\nاحصل على حامل الفرشاة هذا الآن واستمتع بترتيب وتنظيم أفضل للفرشاة وكأس الفرشاة في حمامك المنزلي.', '348', NULL, NULL, '2023-12-18 01:51:47', '2023-12-18 01:51:47', NULL),
(489, 87, 1, 'حامل الفرشاة وكأس الفم الجداري', 'حامل الفرشاة وكأس الفم الجداري', 85, 160, NULL, NULL, 1, 'available', 'يعتبر حامل فرشاة الأسنان بشفط الجدار هذا منتجًا ملحقًا مثاليًا لحمام الأسرة. يتميز بتصميم بلاستيكي عالي الجودة يوفر مساحة تخزين فعالة لفرشاة الأسنان وكأس الفم. يحتوي على شفط قوي يتيح تثبيته بثبات على الجدار بدون الحاجة إلى ثقوب أو مسامير. يأتي بألوان متعددة مثل الأخضر والوردي والرمادي والبولي، مما يسمح لك باختيار اللون المفضل لديك. يتميز بحجم مناسب وسهولة الاستخدام، ويمكن استخدامه في حمام الأطفال وحمامات الضيوف وغيرها من المساحات. احصل على هذا الحامل العملي اليوم واحافظ على نظام الحمام الخاص بك بترتيب ونظافة.', 'jh-51', NULL, NULL, '2023-12-18 01:55:08', '2023-12-18 01:55:08', NULL),
(490, 87, 1, 'مجموعة تنظيم فرش الأسنان وملحقات المكياج', 'مجموعة تنظيم فرش الأسنان وملحقات المكياج', 120, 210, NULL, NULL, 1, 'available', 'حامل مضرب الأسنان هو منتج فريد وعملي يساعدك في تنظيم وتخزين مضارب الأسنان وملحقات المكياج ومستلزمات الحمام بشكل مرتب ومنظم. يأتي هذا الحامل مع طقم منتجات متنوعة تشمل مربع تخزين وخطافات شفط لتثبيته على الحائط بسهولة. يتميز الحامل بتصميمه الوظيفي الذي يوفر مساحة كبيرة لتخزين مضارب الأسنان وأدوات المكياج ومستحضرات العناية الشخصية. كما يتميز بجودته العالية ومتانته لضمان الاستخدام الطويل الأمد. احصل على هذا الحامل العملي والأنيق الذي يضفي لمسة من النظام والترتيب على حمامك أو منطقة المكياج.', 'jh-27', NULL, NULL, '2023-12-18 01:59:10', '2023-12-18 01:59:10', NULL),
(491, 73, 1, 'حامل الصابون', 'حامل الصابون', 80, 150, NULL, NULL, 1, 'available', 'صندوق صابون حامل تصريف بلاستيكي، صندوق صابون معلق على الحائط القوي وخالي من الثقب مثالي للحمام. يتميز هذا الصندوق بتصميمه المعاصر والعصري، حيث يمكن تثبيته بسهولة على الحائط دون الحاجة إلى حفر ثقوب. فهو يوفر مكانًا آمنًا ومرتبًا لوضع قطع الصابون وحمايتها من الانزلاق والتلف. يتميز بتصميمه العملي ومتعدد الوظائف، ويأتي بأبعاد مناسبة تناسب جميع أحجام الصابون. يتميز بجودته العالية ومتانته، حيث يتم تصنيعه من مواد بلاستيكية عالية الجودة. احصل على صندوق صابون حائطي عصري وعملي لتحسين تجربة استخدامك في الحمام.', 'zw-jf-21', NULL, NULL, '2023-12-18 02:02:35', '2023-12-18 02:02:35', NULL),
(492, 73, 1, 'علاقات الملابس المعدنية القوية', 'علاقات الملابس المعدنية القوية', 180, 280, NULL, NULL, 1, 'available', 'شماعات الملابس المعدنية ذات القوة العالية والتصميم المبتكر تعد حلاً مثاليًا لتجفيف وتنظيم الملابس. تتميز هذه الشماعات بمادة المعدن عالية الجودة، مما يجعلها متينة ومستدامة للاستخدام الطويل الأمد. تصميمها غير زلق، مما يضمن عدم انزلاق الملابس وتجنب تجاعيد التجفيف. تأتي الشماعات مزودة بمشابك لتعليق البنطلونات والتنانير بإحكام، مما يوفر مساحة إضافية في الخزانة. إنها مثالية للاستخدام في الحمام، غرفة المعيشة، خزانة الملابس، غرفة الغسيل وغيرها. احصل على شماعات الملابس المعدنية غير الزلقة والقوية الآن واستمتع بتنظيم ملابسك بسهولة وفعالية.', '00000', NULL, NULL, '2023-12-18 02:17:00', '2023-12-18 02:17:00', NULL),
(493, 73, 1, 'حاملة المعاطف الخشبية العصرية', 'حاملة المعاطف الخشبية العصرية', 50, 95, NULL, NULL, 1, 'available', 'صممت حاملة المعاطف المعلقة على الحائط هذه لتوفير الأناقة والوظائف المتعددة في منزلك. تتميز بتصميم خشبي جذاب وأنيق، مع خمس سنانير لتعليق المعاطف والقبعات والحقائب. تعد هذه الحاملة المعلقة خيارًا رائعًا لتنظيم مدخل منزلك أو غرفة المعيشة أو غرفة النوم. صُنعت من الخيزران، مما يجعلها قوية ومتينة، وتتحمل الاستخدام اليومي لسنوات عديدة. بفضل حجمها المناسب، يمكن تركيبها بسهولة على الحائط الخاص بك. إنها ليست فقط مفيدة وعملية، بل تضيف أيضًا لمسة من الجمال والأناقة إلى ديكور منزلك. استمتع بتخزين ملابسك واحتياجاتك اليومية بشكل منظم وأنيق مع هذه الحاملة المعلقة على الحائط.', '393', NULL, NULL, '2023-12-18 02:19:41', '2023-12-18 02:19:41', NULL),
(494, 121, 1, 'ماكينة الخياطة المحمولة الصغيرة', 'ماكينة الخياطة المحمولة الصغيرة', 450, 800, NULL, NULL, 1, 'available', 'ماكينة الخياطة المحمولة 202 هي ماكينة خياطة صغيرة وكهربائية تناسب الاستخدام المنزلي. تتميز بحجمها الصغير وسهولة حملها، مما يجعلها مثالية للخياطة على الذهاب. تتيح لك هذه الماكينة القدرة على الخياطة بشكل سريع وفعال، حيث يمكنها خياطة طبقات مختلفة من الأقمشة بسماكة تتراوح من 0.3 مم إلى 1.8 مم. بفضل تصميمها البسيط والمرن، يمكن ضبط طول الغرزة واختيار الخيط المناسب لمشاريعك. إنها ماكينة مثالية للأطفال والمبتدئين في فن الخياطة. قم بشراء ماكينة الخياطة المحمولة 202 اليوم واستمتع بالخياطة السهلة والمريحة في منزلك.', 'jf-64', NULL, NULL, '2023-12-18 02:24:44', '2023-12-18 02:24:44', NULL),
(495, 89, 1, 'فرشاة الشيشة', 'فرشاة الشيشة', 25, 50, NULL, NULL, 1, 'available', 'فرشاة تنظيف الشيشة - اكسسوار ضروري لعشاق التدخين بالشيشة. تعمل هذه الفرشاة على تنظيف الزجاجة والزجاج والأنبوب الداخلي لضمان تجربة تدخين نقية وطعم ممتاز. مصنوعة من مواد عالية الجودة مثل المعدن والبلاستيك، تضمن متانة وفعالية في الاستخدام اليومي. بفضل تصميمها المستقيم والمرآة، يسهل استخدام هذه الفرشاة والوصول إلى الأماكن الصعبة. تأتي بحجم مناسب وتعبئة عملية، مما يجعلها مثالية للاستخدام المنزلي والتنقل. مع فرشاة تنظيف الشيشة، ستحافظ على نظافة وصحة شيشتك وستستمتع بتجربة تدخين مريحة ولذيذة.', '038', NULL, NULL, '2023-12-18 02:26:43', '2023-12-18 02:26:43', NULL),
(496, 73, 1, 'منظف الأرضيات الصغير', 'منظف الأرضيات الصغير', 25, 50, NULL, NULL, 1, 'available', 'ملابس منزلية بتصميم عصري على شكل حديد لغسيل وتنظيف الأرضيات\r\n\r\nتعتبر هذه الملابس المنزلية بتصميمها العصري على شكل حديدة أداة مثالية لغسيل وتنظيف الأرضيات. صُممت هذه الفرشاة بعناية فائقة باستخدام مادة عالية الجودة، حيث تتميز بشعيرات قوية ومتينة تعمل على إزالة الأوساخ والبقع الصعبة بكفاءة فائقة. بفضل شكلها على شكل حديدة، تتيح لك هذه الملابس المنزلية الوصول إلى الزوايا والمساحات الضيقة بسهولة، مما يجعل عملية التنظيف أكثر فعالية وسرعة. إنها أداة مثالية للاستخدام في المنازل والمكاتب والمرافق العامة. احصل على هذه الملابس المنزلية العملية والعصرية اليوم واستمتع بنظافة جذابة ونتائج مذهلة.', '385', NULL, NULL, '2023-12-18 02:27:52', '2023-12-18 02:27:52', NULL),
(497, 84, 1, 'فرشاة الحمام السيليكونية المملؤة بالسائل', 'فرشاة الحمام السيليكونية المملؤة بالسائل', 30, 70, NULL, NULL, 1, 'available', 'من الشركة المصنعة بالجملة سيليكون فرشاة حمام ملء السائل طفل الكبار منشفة حمام الظهر\r\n\r\nاستمتع بتجربة حمام مريحة ومنعشة مع فرشاة حمام سيليكون ملء السائل. تم تصميم هذه الفرشاة بشكل مبتكر ومريح لتنظيف الجسم بكفاءة وسهولة. يتميز التصميم بوجود حجرة داخلية يمكن ملؤها بالسائل، مما يتيح لك توزيع الصابون أو المنتجات الأخرى بشكل متساوٍ أثناء الاستحمام. تساعد الشعيرات الناعمة والمرونة على تدليك وتنظيف الجلد بلطف دون التسبب في أي تهيج. بالإضافة إلى ذلك، يتميز هذا المنتج بحزام قابل للتعديل يسمح لك بالوصول إلى أماكن صعبة الوصول مثل الظهر بسهولة. احصل على فرشاة حمام سيليكون ملء السائل الآن واستمتع بتجربة حمام مريحة ومنعشة.', 'tv91', NULL, NULL, '2023-12-18 02:30:43', '2023-12-18 02:30:43', NULL);
INSERT INTO `products` (`id`, `subcategory_id`, `supplier_id`, `unit_name`, `pack_name`, `purchasing_price`, `unit_price`, `pack_price`, `pack_units`, `unit_type`, `status`, `description`, `code_supplier`, `code_bar`, `file`, `created_at`, `updated_at`, `deleted_at`) VALUES
(498, 124, 1, 'زجاجة المياه الرياضية', 'زجاجة المياه الرياضية', 150, 250, NULL, NULL, 1, 'available', 'زجاجة المياه الرياضية عالية الجودة هي رفيقك المثالي في التمارين الرياضية والنشاطات الخارجية. تتميز هذه الزجاجة بتصميم ملون ومخصص وفريد من نوعه يتناسب مع ذوقك الشخصي. صُنعت من مواد بلاستيكية عالية الجودة ومستدامة، مما يضمن متانة واستدامة المنتج. تتميز الزجاجة بأداء حراري ممتاز للحفاظ على برودة المشروبات في الصيف واستمتاعك بمشروب منعش طوال الوقت. تأتي بقبضة يد مريحة لسهولة الحمل والاستخدام. كما يمكن تخصيص الزجاجة بشعارك الخاص أو اسمك لإضافة لمسة شخصية. هذه الزجاجة هي اختيار مثالي لأولئك الذين يهتمون بالجودة والأداء والتصميم الفريد', '039', NULL, NULL, '2023-12-18 02:30:47', '2023-12-24 05:29:58', NULL),
(499, 124, 1, 'زجاجة المياه الرياضية بحبل الرفع', 'زجاجة المياه الرياضية بحبل الرفع', 1, 250, NULL, NULL, 1, 'available', 'زجاجة المياه الرياضية ذات السعة الكبيرة بحبل الرفع هي منتج مثالي لتلبية احتياجاتك في توفير المياه أثناء ممارسة الأنشطة الرياضية والسفر. تتميز هذه الزجاجة بسعة كبيرة تبلغ 1400 مل، مما يعني أنه يمكنك حمل كمية كبيرة من الماء للاستمتاع بالراحة طوال اليوم. تصميمها العصري والملون يجعلها جذابة ومناسبة للاستخدام اليومي. تأتي مع حبل رفع مريح، مما يسهل حملها وتعليقها على حقيبتك أو حقيبة الظهر. الزجاجة مصنوعة من مواد عالية الجودة ومستدامة، وتوفر أداءً ممتازًا في العزل الحراري. احصل على هذه الزجاجة الرياضية المتعددة الاستخدامات والعملية لتلبية احتياجاتك المائية في أي وقت وفي أي مكان', '040', NULL, NULL, '2023-12-18 02:36:38', '2023-12-24 05:30:29', NULL),
(500, 121, 1, 'ماكينة الخياطة المحمولة والمصغرة', 'ماكينة الخياطة المحمولة والمصغرة', 150, 350, NULL, NULL, 1, 'available', 'ماكينة الخياطة المحمولة والمصغرة هي منتج يتميز بسهولة الاستخدام والحمل. تتميز بتصميم صغير وخفيف الوزن، مما يجعلها مثالية للاستخدام في الهواء الطلق أو في المنزل. تأتي هذه الماكينة بخيارات مختلفة للخياطة، مثل ضبط سمك الخيط وطول الغرزة، مما يوفر مرونة في الخياطة وتلبية احتياجات المستخدم. بفضل تقنيتها العالية والسرعة العالية، يمكنك الاعتماد على هذه الماكينة للحصول على نتائج دقيقة ومثالية في الخياطة. بالإضافة إلى ذلك، تأتي هذه الماكينة مزوَّدة بملحقات متعددة لتلبية احتياجاتك المختلفة. احصل على ماكينة الخياطة المحمولة والمصغرة اليوم واستمتع بتجربة خياطة مريحة وعملية.', 'jf61', NULL, NULL, '2023-12-18 02:37:28', '2023-12-18 02:39:55', NULL),
(501, 115, 1, 'كوب الشرب السحري للأطفال', 'كوب الشرب السحري للأطفال', 75, 130, NULL, NULL, 1, 'available', 'كوب شرب للأطفال مضاد للانزلاق بالماء مع كرة الجاذبية للتعلم\r\n\r\nاجعل تجربة شرب طفلك ممتعة وآمنة مع كوب الشرب للأطفال المضاد للانزلاق. يتميز هذا الكوب بتصميمه اللطيف والجذاب، وهو مثالي للأطفال الذين يتعلمون كيفية شرب الماء بأنفسهم. يتميز بمقبض مريح يسهل الامساك به، بالإضافة إلى قشة مدمجة تساعد الأطفال على تعلم كيفية استخدامها بسهولة.\r\n\r\nتتميز الكرة الموجودة بالداخل بتأثير الجاذبية، حيث تتحرك مع حركة الكوب وتشجع الطفل على الشرب بطريقة صحية وممتعة. كما يتميز بتصميم مضاد للانزلاق، مما يحافظ على ثباته أثناء استخدامه ويقلل من احتمالية سقوط الماء.\r\n\r\nصُنع هذا الكوب من مواد عالية الجودة وآمنة للاستخدام اليومي، وهو سهل التنظيف ومناسب للأطفال الذين تجاوزوا سن السنتين. اجعل شرب الماء تجربة ممتعة وتعليمية لطفلك مع كوب الشرب المضاد للانزلاق بالماء وكرة الجاذبية.', '040', NULL, NULL, '2023-12-18 02:43:39', '2023-12-18 03:06:25', NULL),
(502, 124, 1, 'زجاجة الرياضة المتينة', 'زجاجة الرياضة المتينة', 70, 110, NULL, NULL, 1, 'available', 'الزجاجة الرياضية عالية الجودة والمتينة بسعة 750 مللي، مصنوعة من الفولاذ المقاوم للصدأ ومزودة بحافة ملفوفة/بلاستيكية. تعتبر هذه الزجاجة مثالية لممارسة الأنشطة الرياضية والترفيه في الهواء الطلق. تتميز بتصميم متين ومقاوم للصدمات، مما يجعلها مثالية للاستخدام في الرحلات والتخييم والرياضة. بفضل قدرتها على الاحتفاظ بدرجة حرارة المشروبات لفترة طويلة، ستتمكن من الاستمتاع بالمشروبات الباردة أو الساخنة في أي وقت. كما تتوفر بعدة خيارات للألوان، مما يسمح لك بالاختيار المناسب وفقًا لذوقك الشخصي. احصل على هذه الزجاجة الرياضية العملية والعصرية اليوم واستمتع بالترطيب المثالي أثناء نشاطاتك الرياضية', '041', NULL, NULL, '2023-12-18 02:47:27', '2023-12-24 05:30:48', NULL),
(503, 122, 1, 'زجاجة المياه الصديقة للأطفال', 'زجاجة المياه الصديقة للأطفال', 120, 180, NULL, NULL, 1, 'available', 'زجاجة ماء للأطفال من البلاستيك بطباعة لطيفة وخالية من مادة BPA. تتميز هذه الزجاجة بتصميم مستقيم وقش مرفق للشرب المريح. صُنعت الزجاجة من مواد البلاستيك عالية الجودة وخالية من مادة BPA، مما يجعلها آمنة لصحة الطفل. تأتي الزجاجة بتصميم كرتوني جذاب يجذب انتباه الأطفال، مما يجعلها مثالية كهدية. بفضل أداءها العالي في العزل الحراري، تحافظ الزجاجة على درجة حرارة الماء لفترة طويلة. تُعتبر هذه الزجاجة مثالية للاستخدام في المدرسة أو أثناء النشاطات الخارجية. بالإضافة إلى ذلك، فإنها مزودة بحبل لسهولة حملها. استمتع بالوقت الرائع مع طفلك واحرص على إبقاءه مشربًا بشكل صحي ومرح', 'ZN-65', NULL, NULL, '2023-12-18 03:01:02', '2023-12-18 03:06:55', NULL),
(504, 122, 1, 'كوب الشرب السحري للأطفال', 'كوب الشرب السحري للأطفال', 75, 120, NULL, NULL, 1, 'available', 'كوب شرب للأطفال مضاد للانزلاق بالماء مع كرة الجاذبية للتعلم\r\n\r\nاجعل تجربة شرب طفلك ممتعة وآمنة مع كوب الشرب للأطفال المضاد للانزلاق. يتميز هذا الكوب بتصميمه اللطيف والجذاب، وهو مثالي للأطفال الذين يتعلمون كيفية شرب الماء بأنفسهم. يتميز بمقبض مريح يسهل الامساك به، بالإضافة إلى قشة مدمجة تساعد الأطفال على تعلم كيفية استخدامها بسهولة.\r\n\r\nتتميز الكرة الموجودة بالداخل بتأثير الجاذبية، حيث تتحرك مع حركة الكوب وتشجع الطفل على الشرب بطريقة صحية وممتعة. كما يتميز بتصميم مضاد للانزلاق، مما يحافظ على ثباته أثناء استخدامه ويقلل من احتمالية سقوط الماء.\r\n\r\nصُنع هذا الكوب من مواد عالية الجودة وآمنة للاستخدام اليومي، وهو سهل التنظيف ومناسب للأطفال الذين تجاوزوا سن السنتين. اجعل شرب الماء تجربة ممتعة وتعليمية لطفلك مع كوب الشرب المضاد للانزلاق بالماء وكرة الجاذبية.', '040', NULL, NULL, '2023-12-18 03:06:07', '2023-12-18 03:06:47', '2023-12-18 03:06:47'),
(505, 122, 1, 'قنينة الأطفال', 'قنينة الأطفال', 120, 190, NULL, NULL, 1, 'available', 'قنينة الأطفال الرياضية تأتي بغطاء قابل للطي وخالي من التسريب. تصميم صديق للبيئة ومثالي للأطفال. تتميز بقشة مريحة لتناول السوائل بسهولة وأمان. تستخدم في حفظ السوائل ساخنة أو باردة لفترة طويلة. سعة القنينة تناسب الأطفال وتجعلها مثالية للنشاطات الرياضية والمدرسة. تأتي بتصميم أنيق وبسيط، يمكن تخصيص اللون والشعار حسب الرغبة. قنينة الأطفال الرياضية هذه هي الخيار الأمثل للوالدين الذين يهتمون بتوفير مشروبات صحية وآمنة لأطفالهم أثناء نشاطاتهم اليومية', 'JH409', NULL, NULL, '2023-12-18 03:09:29', '2023-12-18 03:09:29', NULL),
(506, 122, 1, 'قارورة الطالب المثالية', 'قارورة الطالب المثالية', 70, 110, NULL, NULL, 1, 'available', 'قارورة ماء بلاستيكية جديدة عالية السعة وخالية من مادة البيسفينول أ المضرة، مصممة خصيصًا للطلاب اللطفاء. تتميز بكأس مقاوم للحرارة العالية، مما يسمح باستخدامها للمشروبات الساخنة والباردة على حد سواء. تصميمها اللطيف يجعلها مثالية للاستخدام في الأماكن الداخلية والخارجية، سواء في المنزل، أو في المدرسة، أو في النزهات والرحلات. تتوفر بأحجام مختلفة، بسعة تصل إلى 600 مل، مما يسمح بتخزين كمية كافية من المشروبات. مصنوعة من مواد بلاستيكية صديقة للبيئة وصحية، مما يجعلها خيارًا مثاليًا للأشخاص الذين يهتمون بالاستدامة والصحة. استمتع بمشروباتك المفضلة مع هذه القارورة الرائعة والعملية', '3X', NULL, NULL, '2023-12-18 03:13:30', '2023-12-18 03:13:30', NULL),
(507, 122, 1, 'زجاجة المياه البلاستيكية الكرتونية للأطفال', 'زجاجة المياه البلاستيكية الكرتونية للأطفال', 100, 190, NULL, NULL, 1, 'available', 'تعرّف على زجاجة Feiيو للماء البلاستيكية ذات السعة الكبيرة والمحمولة بتصميم فتاة سفر كرتوني جميل. تُعد هذه الزجاجة مثالية للأطفال، حيث تضمن لهم تجربة شرب ممتعة وصحية. صُنعت الزجاجة من مواد بلاستيكية عالية الجودة ومستدامة، مما يجعلها آمنة للاستخدام وتحافظ على جودة المياه. تتميز بتصميم معاصر وملون جذاب، وهي مثالية للاستخدام في المدرسة أو أثناء النشاطات الرياضية أو في الهواء الطلق. تتميز بغطاء محكم الإغلاق لمنع التسرب، وتوفر تدفقًا مريحًا للمياه المباشرة. احصل على زجاجة المياه البلاستيكية Feiيو الآن واجعل تجربة شرب الماء ممتعة ومريحة لأطفالك', '042', NULL, NULL, '2023-12-18 03:16:29', '2023-12-18 03:16:29', NULL),
(508, 124, 1, 'زجاجة الماء الرياضية المخصصة', 'زجاجة الماء الرياضية المخصصة', 75, 140, NULL, NULL, 1, 'available', 'زجاجة الماء البلاستيكية بسعة 28 أونصة مع غطاء فم واسع مصممة خصيصًا للصالة الرياضية. تتميز هذه الزجاجة بألوان وشعار مخصصين، مما يجعلها مثالية للترويج للصالة الرياضية أو الاستخدام الشخصي. مصنوعة من مواد بلاستيكية عالية الجودة وخالية من مادة البيسفينول أ (BPA)، مما يضمن سلامة الماء المخزن فيها. يمكن استخدامها لتناول الماء أثناء التمرينات الرياضية أو النشاطات الخارجية، وتتميز بأداء العزل الحراري للحفاظ على برودة المشروبات في الأيام الحارة. تصميمها الأنيق والعملي يتيح سهولة الشرب المباشر وتدفق المياه بسلاسة. هذه الزجاجة الماء البلاستيكية هي رفيق مثالي لنمط حياة صحي ونشط.', '-44', NULL, NULL, '2023-12-18 03:19:11', '2023-12-24 04:47:28', NULL),
(509, 124, 1, 'زجاجة الماء الرياضية', 'زجاجة الماء الرياضية', 200, 300, NULL, NULL, 1, 'available', 'زجاجة المياه البلاستيكية الصحية ذات التريتان هي زجاجة رياضية مثالية للاستخدام الخارجي. تأتي الزجاجة بسعة 500 ملليتر ومزودة بمرشح شاي، مما يتيح لك تحضير الشاي المفضل لديك أثناء ممارسة النشاطات الرياضية أو التخييم في الهواء الطلق. تصميمها المتين والمصنوع من مادة البلاستيك التريتان الصحية يضمن مقاومتها للكسر والتآكل. تتميز بأداء عزل حراري ممتاز يحافظ على برودة المشروبات في الصيف وحرارة الشاي في الشتاء. تأتي بألوان متعددة وتصميمات جذابة. احصل على زجاجة الماء البلاستيكية هذه واستمتع بشرب الماء وتحضير الشاي أثناء ممارسة نشاطاتك الرياضية في الهواء الطلق.', '043', NULL, NULL, '2023-12-18 03:25:32', '2023-12-24 05:31:57', NULL),
(510, 124, 1, 'كوب الرياضة المحمول', 'كوب الرياضة المحمول', 100, 170, NULL, NULL, 1, 'available', 'أكواب حبال بلاستيكية رياضية محمولة بسعة كبيرة من Nisiven هي رفيقك المثالي للشرب في الهواء الطلق. تتميز هذه الزجاجة بتصميم نمط Minmalist ومصنوعة من مادة ترايتان المستدامة. تحتوي الزجاجة على علامة زمنية تحفيزية تساعدك على تتبع استهلاك الماء بشكل منتظم وتشجيعك على البقاء مترطبًا طوال اليوم. بسعة كبيرة تبلغ 1300 مل، توفر هذه الزجاجة كمية كافية من الماء لتلبية احتياجاتك اليومية. مثالية للنشاطات الرياضية والرحلات والتخييم والسفر، وتأتي مع غطاء قابل للإغلاق لمنع التسرب والحفاظ على النضارة. استمتع بتجربة شرب مريحة وصحية مع هذه الزجاجة الرياضية المحمولة.', '044', NULL, NULL, '2023-12-18 03:28:21', '2023-12-24 05:31:21', NULL),
(511, 116, 1, 'زجاجة المياه الرياضية البلاستيكية المخصصة', 'زجاجة المياه الرياضية البلاستيكية المخصصة', 100, 180, NULL, NULL, 1, 'available', 'زجاجة مياه بلاستيكية للطلاب، صديقة للبيئة ومثالية للأنشطة الرياضيةتأتي الزجاجة بتصميم كبير ومخصص، مزودة بمصفاة قابلة للإزالة وتدفق سريع. تحتوي على مقياس لحجم الماء بالملليلتر. تصميمها الأنيق والعملي يسهل حملها واستخدامها في جميع الأوقات. تعد هذه الزجاجة البلاستيكية الشفافة خيارًا مثاليًا للطلاب الذين يحتاجون إلى الترطيب أثناء الدراسة أو ممارسة الرياضة. كما تعتبر صديقة للبيئة، حيث تساهم في تقليل استخدام الزجاجات البلاستيكية ذات الاستخدام الواحد. تمتع بمياه نقية ومنعشة في أي وقت وفي أي مكان مع هذه الزجاجة العملية والعصرية.', '045', NULL, NULL, '2023-12-18 03:32:04', '2023-12-18 03:32:04', NULL),
(512, 125, 1, 'زجاجة الصمام الحرارية الكبيرة', 'زجاجة الصمام الحرارية الكبيرة', 220, 320, NULL, NULL, 1, 'available', 'زجاجة حرارية للأعمال التجارية والمياه والرياضات المائية الخارجية معزولة بسعة كبيرة من الفولاذ المقاوم للصدأ. تعد هذه الزجاجة الحرارية المثالية للاستخدام في الأعمال التجارية والرحلات والأنشطة الرياضية المائية في الهواء الطلق. تم تصميمها بعناية باستخدام مواد عالية الجودة، بما في ذلك الفولاذ المقاوم للصدأ، مما يجعلها متينة ومقاومة للصدأ. بفضل التصميم العصري والأنيق، تتميز بمظهر جذاب. تتميز بقدرتها على الاحتفاظ بالمشروبات الساخنة والباردة لفترة طويلة، مما يوفر لك تجربة شرب مريحة في أي وقت وفي أي مكان. احصل على هذه الزجاجة الحرارية ذات السعة الكبيرة اليوم واستمتع بالراحة والأداء العالي', 'LH', NULL, NULL, '2023-12-18 16:51:15', '2023-12-24 04:46:23', NULL),
(513, 112, 1, 'قارورة الصمام الحرارية', 'قارورة الصمام الحرارية', 220, 320, NULL, NULL, 1, 'available', 'قارورة المياه الفولاذية المعزولة هدية رائعة تناسب الأعمال الرياضية الراقية وأنشطة السفر. تصميمها المحمول يجعلها مثالية للاستخدام في أي مكان. مصنوعة من الفولاذ المقاوم للصدأ عالي الجودة (304)، وتتميز بقدرة كبيرة لحفظ درجة الحرارة لساعات طويلة. تحتفظ بالمشروبات الساخنة أو الباردة لمدة تصل إلى 12-24 ساعة. تتميز بتصميم مزدوج الجدران الذي يساعد على منع التسرب والحفاظ على درجة الحرارة المثلى. تحتوي على غطاء بلاستيكي خالي من مادة البيسفينول أ المضرة بالصحة. هذه القارورة العملية والأنيقة هي هدية مثالية للأشخاص الذين يهتمون بالنشاط البدني ويرغبون في الاستمتاع بمشروباتهم المفضلة في أي وقت وفي أي مكان', 'ZNY', NULL, NULL, '2023-12-18 17:00:30', '2023-12-24 05:27:07', NULL),
(514, 125, 1, 'قارورة الصمام الحرارية الفولاذية', 'قارورة الصمام الحرارية الفولاذية', 350, 550, NULL, NULL, 1, 'available', 'قارورة الترمس الفولاذية المقاومة للصدأ بسعة كبيرة 316 مل، هي هدية مثالية لمحبي الرياضة والنشاطات الخارجية. تتميز بتصميم أنيق وعصري، وهي مصنوعة من الفولاذ المقاوم للصدأ عالي الجودة، مما يمنحها المتانة والمقاومة للصدأ. تتمتع بقدرة كبيرة تصل إلى 316 مل، مما يسمح لك بحمل كمية كافية من الماءأو المشروبات الساخنة أو الباردة طوال اليوم. تتميز بأداء عزل حراري ممتاز يحافظ على درجة الحرارة لفترة تصل إلى 12-24 ساعة، مما يسمح لك بالاستمتاع بالمشروبات الساخنة أو الباردة في أي وقت وفي أي مكان. تعد قارورة الترمس الفولاذية الكبيرة هذه خيارًا رائعًا للنشاطات الرياضية، التخييم، السفر، وغيرها من الأنشطة في الهواء الطلق', 'ZN39', NULL, NULL, '2023-12-18 17:07:35', '2023-12-24 05:23:58', NULL),
(515, 122, 1, 'زجاجة الأطفال', 'زجاجة الأطفال', 180, 270, NULL, NULL, 1, 'available', 'زجاجة المياه للأطفال في المدارس مثالية للأطفال. تتميز بتصميم أنيق وألوان متنوعة تجذب اهتمام الأطفال. تعتبر هذه الزجاجة خالية من مادة BPA الضارة، مما يجعلها آمنة للأطفال وصحية للاستخدام اليومي. تحتفظ بمشروبات الأطفال باردة أو ساخنة لفترة طويلة، حيث تحافظ على العزل الحراري لمدة تصل إلى 12-24 ساعة. تأتي بسعة 400 ملليتر، مما يكفي لتلبية احتياجات الأطفال في المدرسة أو أثناء التنقل. إن زجاجة المياه هذه هي الخيار الأمثل للأمهات الباحثات عن جودة وأمان لأطفالهم في النشاطات اليومية.', 'ZN24', NULL, NULL, '2023-12-18 17:13:32', '2023-12-18 17:41:56', NULL),
(516, 94, 1, 'قفازات السبا الجلية الفاخرة', 'قفازات السبا الجلية الفاخرة', 70, 160, NULL, NULL, 1, 'available', 'قفازات جل السبا لليدين هي منتجات فريدة ومبتكرة تهدف إلى ترطيب وتنعيم البشرة الجافة. تم تصميم هذه القفازات باستخدام تقنية تغليف الجل التي تتيح امتصاص العناصر الغذائية والترطيب العميق في البشرة. تحتوي القفازات على زيوت أساسية مغمورة بالجل، مثل زيت اللوز وزيت اللافندر، التي تساعد في تنعيم البشرة وتفتيحها. بفضل قفازات الجل الناعمة والمريحة، يمكنك الاستمتاع بتجربة سبا فاخرة في راحة منزلك. فهي ترطب وتنعم البشرة الجافة، وتساهم في تحقيق توازن الترطيب وإعادة الحيوية لليدين. احصل على قفازات جل السبا لليدين الآن واستمتع ببشرة ناعمة ومغذاة.', 'tv10', NULL, NULL, '2023-12-18 17:34:58', '2023-12-18 17:34:58', NULL),
(517, 94, 1, 'جوارب سبا العناية بالقدم', 'جوارب سبا العناية بالقدم', 70, 160, NULL, NULL, 1, 'available', 'جوارب مرطبة من جل العناية بالقدم هي منتج رائع للعناية بالقدمين. تم تصميم هذه الجوارب بتقنية متقدمة تجمع بين الجل المرطب والعناصر الغذائية الفعالة مثل زيت بذور العنب لتوفير ترطيب عميق وتغذية لبشرة القدم. تساعد في ترطيب الجلد الجاف والمتشقق وتعزيز تفتيح البشرة. تضمن الجوارب المريحة والقابلة للارتداء لفترات طويلة توزيع المكونات بشكل متساوٍ على القدمين، مما يمنحك تجربة سبا مريحة ومنعشة. سواء كنت تعاني من جفاف القدمين أو تبحث عن ترطيب إضافي وتفتيح للبشرة، فإن جوارب الجل المرطبة هي الخيار المثالي لتحقيق قدمين ناعمتين وصحية.', '0000', NULL, NULL, '2023-12-18 17:37:56', '2023-12-18 17:37:56', NULL),
(518, 115, 1, 'فرشاة الأسنان السيليكونية U-Shape للأطفال', 'فرشاة الأسنان السيليكونية U-Shape للأطفال', 25, 60, NULL, NULL, 1, 'available', 'فرشاة الأسنان بشكل U للأطفال بزاوية 360 درجة هي منتج مثالي للعناية بأسنان الأطفال. مصنوعة من السيليكون عالي الجودة الصديق للبيئة والآمن للاستخدام الفموي. تصميمها بشكل U يتيح الوصول الكامل إلى جميع الأسطح والزوايا في الفم، بما في ذلك الأسنان الأمامية والخلفية واللثة. تعمل الفرشاة على تنظيف الأسنان بفعالية، وإزالة البلاك والرواسب الغذائية، والحفاظ على صحة اللثة. بفضل تصميمها المريح والملائم لأيدي الأطفال الصغيرة، فإنها تعزز حب الأطفال للعناية بالصحة الفموية. تعتبر فرشاة الأسنان بشكل U للأطفال خيارًا مثاليًا للحفاظ على أسنان الأطفال نظيفة وصحية.', 'tv45', NULL, NULL, '2023-12-18 17:40:11', '2023-12-18 17:40:11', NULL),
(519, 63, 1, 'قفازات مقاومة للحرارة حماية اليدين', 'قفازات مقاومة للحرارة حماية اليدين', 120, 220, NULL, NULL, 1, 'available', 'قفازات مزدوجة مقاومة للحرارة من مادة القطن من Yulan CR20A هي منتجات عالية الجودة تستخدم لحماية اليدين من الحرارة العالية. تم تصنيعها بإتقان باستخدام مادة القطن المقاومة للحرارة والمتينة. تتميز هذه القفازات بتصميم مزدوج يوفر حماية إضافية وزيادة في الأداء. تستخدم في العديد من التطبيقات مثل الفرن، المدقة، وأعمال القطع المقاومة. تأتي بحجم حر ويمكن تخصيص اللون وفقًا للتفضيلات الشخصية. تعد قفازات Yulan CR20A خيارًا مثاليًا للحياة اليومية وللاستخدامات الصناعية، حيث توفر حماية قوية وراحة لليدين.', 'tv07', NULL, NULL, '2023-12-18 17:42:24', '2023-12-18 17:54:44', NULL),
(520, 94, 1, 'حاقن الأكسجين للوجه', 'حاقن الأكسجين للوجه', 500, 840, NULL, NULL, 1, 'available', 'احصل على بشرة صحية ومرطبة مع حاقن الأكسجين النانو للوجه عالي الضغط والقابل للشحن. يعمل هذا الجهاز المنزلي على رش الرذاذ النانوي من الأكسجين المرطب والمغذي على بشرتك، مما يعزز ترطيب البشرة ويوفر تأثيرًا مهدئًا ومنعشًا. يساعد في تجديد البشرة وتحسين مرونتها ومظهرها العام. يعمل الضباب النانوي على ترطيب البشرة الجافة والتقليل من الخطوط الدقيقة والتجاعيد. كما يمكن استخدامه لتطبيق المكياج بشكل مثالي وإضفاء تأثير نهائي مثالي على البشرة. يعد هذا الجهاز أداة مثالية للعناية بالبشرة في المنزل ويمكن استخدامه في أي وقت.', '0000', NULL, NULL, '2023-12-18 17:45:06', '2023-12-18 17:54:24', NULL),
(521, 125, 1, 'ترمس الفولاذي المقاوم للصدأ', 'ترمس الفولاذي المقاوم للصدأ', 120, 190, NULL, NULL, 1, 'available', 'تقدم شركة Okadi ترمسًا ثنائي الجدران مصنوعًا من الفولاذ المقاوم للصدأ بسعة 750 مللي. يتميز هذا الترمس بتصميمه الحديث وشكله الرياضي بشكل رصاصة. يتميز بأداء عزل حراري ممتاز يحافظ على درجة الحرارة لمدة تتراوح بين يتمتع بمتانة عالية ومتانة ليتحمل الاستخدام اليومي ويدوم طويلاً. يأتي بغطاء محكم الإغلاق لمنع التسرب والحفاظ على النكهة والطعم الأصلي للمشروبات. يمكن استخدامه لحمل المشروبات الساخنة والباردة على حد سواء، مما يجعله مثاليًا للسفر والتخييم والنزهات. احصل على هذا الترمس المذهل الفعّال والعصري الذي يوفر تجربة شرب مريحة وممتعة في أي وقت وفي أي مكان', '483', NULL, NULL, '2023-12-18 17:49:16', '2023-12-24 05:23:22', NULL),
(522, 112, 1, 'ترمس كوب القهوة', 'ترمس كوب القهوة', 200, 330, NULL, NULL, 1, 'available', 'الشمال الفولاذ المقاوم للصدأ القهوة القدح المحلية المحمولة هو كوب ماء حك سيليكون ترمس خوائي القهوة المميز. يتميز هذا الكوب بتصميمه الكلاسيكي ومصنوع من الفولاذ المقاوم للصدأ عالي الجودة. يحتفظ بحرارة المشروبات لفترة طويلة، مما يمنحك تجربة قهوة ساخنة أو ماء بارد طوال اليوم. يأتي الكوب بحجم 380 مل أو 510 مل ويحتوي على غطاء للإغلاق الآمن. يمكن تخصيص اللون والشعار حسب الاحتياجات الشخصية. مناسب للاستخدام في المدرسة أو العمل أو السفر. يعد هذا الكوب المحمول العملي رفيقًا مثاليًا للاستمتاع بمشروبك المفضل في أي مكان وزمان', 'ZN68', NULL, NULL, '2023-12-18 17:52:47', '2023-12-24 04:47:52', NULL),
(523, 125, 1, 'زجاجة المشروبات الساخنة', 'زجاجة المشروبات الساخنة', 250, 370, NULL, NULL, 1, 'available', 'زجاجة مياه معزولة من الفولاذ بالكامل هي منتج عالي الجودة وعملي للاستخدام اليومي. تم تصميمها بعناية لتوفير تجربة شرب مريحة وصحية. تأتي الزجاجة بتصميم كلاسيكي يمزج الأناقة والوظائف المتعددة في جهاز واحد. تتميز بجدران مزدوجة معزولة توفر عزلاً حراريًا ممتازًا، حيث تحافظ على المشروبات ساخنة لمدة تتراوح بين 12 و 24 ساعة وباردة لفترة مماثلة. تأتي الزجاجة بسعة كبيرة مما يسمح بتخزين كمية كافية من الماء أو المشروب المفضل لديك. بالإضافة إلى ذلك، فهي محمولة ومثالية للتخييم والرياضة. استمتع بالمشروبات الباردة أو الساخنة أثناء التنقل مع هذه الزجاجة المعزولة من الفولاذ بالكامل', 'ZN28', NULL, NULL, '2023-12-18 17:56:22', '2023-12-24 05:26:36', NULL),
(524, 112, 1, 'أكواب سفر مخصصة', 'أكواب سفر مخصصة', 180, 270, NULL, NULL, 1, 'available', 'مصنوعة من الفولاذ المقاوم للصدأ عالي الجودة، تتميز هذه الأكواب بتصميم عصري ومتين يضمن الاحتفاظ بحرارة السوائل لفترة طويلة. تأتي الأكواب مع قش وغطاء، مما يتيح لك الاستمتاع بمشروبك المفضل بطريقة مريحة ومنع الانسكابات. بإمكانك طلب هذه الأكواب بشعار مخصص لتعزيز هويتك العلامة التجارية وزيادة الوعي بها. احصل على هذه الأكواب المعدنية بالجملة الآن واستمتع بتجربة استخدامأكواب معدنية بسعة 30 أونصة بشعار مخصص، متوفرة للبيع بالجملة من الصين. تعتبر هذه الأكواب السفرية المعدنية خيارًا مثاليًا للاستخدام اليومي والتسويق التجاري. مصنوعة من الفولاذ المقاوم للصدأ عالي الجودة، فهي متينة وتضمن الحفاظ على درجة حرارة المشروبات لفترة طويلة. تأتي مع قشة وغطاء لسهولة الاستخدام والحفاظ على نظافتها. يمكن تخصيص الأكواب بشعار الشركة للترويج للعلامة التجارية وزيادة الوعي بها. احصل على هذه الأكواب المعدنية ذات الجودة العالية بالجملة وتمتع بتجربة سفر مريحة ومميزة', 'ZN', NULL, NULL, '2023-12-18 18:01:53', '2023-12-18 18:01:53', NULL),
(525, 115, 1, 'كوب الشرب الآمن للأطفال', 'كوب الشرب الآمن للأطفال', 120, 180, NULL, NULL, 1, 'available', 'كوب الشرب للأطفال ذو القشة المضادة للتسرب والاختناق ومقاوم للسقوط هو منتج ساخن ومبتكر يناسب الأطفال. يتميز هذا الكوب بسعة 250 ملليلتر ويأتي مع قشة مرفقة لسهولة شرب الأطفال. يتميز بتصميم مكافحة التسرب ومكافحة الاختناق ومكافحة السقوط لضمان سلامة الطفل أثناء الاستخدام. يتم تصنيعه من مواد آمنة خالية من مادة BPA والفثالات واللاتكس، مما يجعله آمنًا لصحة الطفل. يساعد هذا الكوب الأطفال على تعلم الشرب بشكل مستقل وتطوير مهاراتهم الحركية. إنه منتج عالي الجودة يناسب الأطفال في جميع المراحل العمرية ويعد خيارًا مثاليًا للأهل الذين يبحثون عن كوب آمن وموثوق لأطفالهم.', 'ZN-60', NULL, NULL, '2023-12-18 18:05:05', '2023-12-18 18:05:05', NULL),
(526, 115, 1, 'زجاجة الانتقال الصحية للأطفال', 'زجاجة الانتقال الصحية للأطفال', 70, 120, NULL, NULL, 1, 'available', 'زجاجة انتقال من القش للأطفال الصغار بعمر سنة كوب مقاوم للتسرب - احصل على زجاجة ماء مثالية لطفلك البالغ من العمر 12 شهرًا مع هذا الكوب المصمم خصيصًا. يحتوي الكوب على نوعين من الفوهات لتلبية احتياجات طفلك المتغيرة أثناء تعلمه الشرب بشكل مستقل. تتميز هذه الزجاجة بتصميم مقاوم للتسرب، مما يوفر راحة لك وللطفل أثناء الاستخدام. يتميز الكوب أيضًا بمقبض مريح يسهل حمله للأطفال الصغار. صُنعت الزجاجة من مواد عالية الجودة مثل البولي بروبيلين والسيليكون الصحي والآمن للأطفال. احصل على هذه الزجاجة المثالية لتسهيل تجربة الشرب المستقلة لطفلك وتوفير الراحة والأمان للطفل والوالدين.', 'ZN91', NULL, NULL, '2023-12-18 18:08:06', '2023-12-18 18:08:06', NULL),
(527, 86, 1, 'صندوق الغداء', 'صندوق الغداء', 130, 190, NULL, NULL, 1, 'available', 'مخصص تحلل القمح القش علب الأغذية رخيصة الثمن للترويج\r\n\r\nاستمتع بتجربة تناول الطعام الصحية والمستدامة مع علب الأغذية المصنوعة من قش القمح المتحلل. تتميز هذه العلب بجودتها العالية وتصميمها العملي، فهي مثالية لتخزين الوجبات الخفيفة والمأكولات في المدرسة أو في العمل. تتسم بقابليتها للتسخين في الميكروويف وتحافظ على الطعام طازجًا وآمنًا. تتوفر بألوان متنوعة وتصميم مربع سهل الاستخدام. كما أنها صديقة للبيئة وقابلة للتحلل بشكل طبيعي، مما يجعلها خيارًا مثاليًا لأولئك الذين يهتمون بالحفاظ على البيئة والاستدامة. احصل على علب الأغذية من قش القمح الآن واستمتع بأسلوب حياة صحي وصديق للبيئة', 'CL49', NULL, NULL, '2023-12-18 18:11:02', '2023-12-18 18:13:58', NULL),
(528, 119, 1, 'مثبت اوراق', 'مثبت اوراق', 50, 100, NULL, NULL, 1, 'available', 'مكتب البلاستيك دبابيس مكتب القرطاسية المدرسية القياسية الدليل هو منتج ممتاز يتميز بالجودة والمتانة. يتم تصنيعه بإتقان من مواد بلاستيكية عالية الجودة، مما يجعله مثاليًا للاستخدام في المكاتب والمدارس. يأتي بحجم 26/6 ويتميز بقدرته على وضع 100 دبوس في آن واحد، ويستوعب حتى 20 ورقة. تصميمه الحديث يجعله سهل الاستخدام ومريحًا لليد. يأتي بأبعاد مدروسة تجعله مثاليًا للحمل والتخزين. يمكنك الاعتماد على هذا المنتج لتثبيت وتنظيم أوراقك بشكل موثوق. احصل على مكتب البلاستيك دبابيس لتجربة مريحة وفعالة في تثبيت الأوراق والوثائق', '892', NULL, NULL, '2023-12-18 18:59:04', '2023-12-18 21:37:08', NULL),
(529, 79, 1, 'مكبرة شاشة للهاتف المحمول', 'مكبرة شاشة للهاتف المحمول', 80, 150, NULL, NULL, 1, 'available', 'شاشة مكبرة محمولة للهاتف المحمول RK-C46 بحجم 10 بوصة و 7 بوصة، تعمل بتقنية 3D وتوفر تجربة مشاهدة ممتعة وواقعية. تتميز بجودة عالية ووضوح فائق، حيث توفر صورًا واضحة وحادة للفيديو والمحتوى المفضل لديك. تتميز بتصميم قابل للطي وخفيف الوزن، مما يسهل حملها وتخزينها بشكل مريح في حقيبتك أو جيبك. تحمي العينين من التعب وتقلل من الإجهاد الناجم عن الشاشة الصغيرة للهاتف المحمول. تعتبر هذه الشاشة المكبرة مثالية لمشاهدة الأفلام والفيديوهات والقراءة وتصفح الإنترنت براحة وجودة عالية. احصل على تجربة مشاهدة أكبر وأكثر إثارة للهاتف المحمول مع شاشة المكبر المحمولة RK-C46.', 'tv16', NULL, NULL, '2023-12-18 21:25:10', '2023-12-18 21:25:10', NULL),
(530, 79, 1, 'تكبير شاشة الهاتف والصوت', 'تكبير شاشة الهاتف والصوت', 70, 175, NULL, NULL, 1, 'available', 'مكبر صوت ثلاثيمكبر صوت ثلاثي الأبعاد لشاشة الهاتف المحمول لحماية العين عدسة مكبرة للفيديو F2 هو منتج رائع يهدف إلى تعزيز تجربة مشاهدة الفيديو والمحتوى على شاشة الهاتف المحمول. يتميز هذا المكبر بتقنية ثلاثية الأبعاد التي توفر صورًا واقعية ومدهشة. بفضل العدسة المكبرة، يمكنك تكبير الشاشة بدون أي جهد والاستمتاع بصورة واضحة وواقعية. بالإضافة إلى ذلك، يعمل المكبر على حماية العين من الإجهاد والتعب الناتج عن النظر المتواصل إلى شاشة الهاتف المحمول. يتميز المنتج بتصميم محمول ومرن، مما يسهل حمله واستخدامه في أي مكان. يعد مكبر صوت ثلاثي الأبعاد لشاشة الهاتف المحمول لحماية العين عدسة مكبرة للفيديو F2 خيارًا مثاليًا لأولئك الذين يرغبون في تحسين تجربة مشاهدة الفيديو على هواتفهم المحمولة.', '0000', NULL, NULL, '2023-12-18 21:28:07', '2023-12-18 21:28:07', NULL),
(531, 79, 1, 'مكبر الشاشة 12 بوصة', 'مكبر الشاشة 12 بوصة', 80, 220, NULL, NULL, 1, 'available', 'هاتف المحمول الموسع لشاشة الهاتف المحمول بتقنية 3D HD ذو قياس 12 بوصة هو منتج مبتكر يوفر تجربة مشاهدة مذهلة ومريحة. يعمل هذا المكبر على تكبير شاشة الهاتف المحمول ثلاث مرات وتحسين جودة الصورة والتفاصيل، مما يتيح لك استمتاعًا أكثر بمحتوى هاتفك الذكي. يتميز بشاشة منحنية ومصنوعة من زجاج عالي الجودة لتوفير رؤية ممتازة وواضحة. يعمل المكبر على حماية عينيك من التعب والإجهاد الناتج عن النظر المستمر إلى الشاشة الصغيرة. بالإضافة إلى ذلك، يأتي بتصميم محمول وخفيف الوزن يسهل حمله واستخدامه في أي مكان. احصل على تجربة مشاهدة ممتعة ومريحة مع هذا المكبر المبتكر.', 'tv17', NULL, NULL, '2023-12-18 21:31:31', '2023-12-18 21:37:49', NULL),
(532, 103, 1, 'كأس التسخين العصري', 'كأس التسخين العصري', 200, 380, NULL, NULL, 1, 'available', 'كوستر تسخين بدرجة حرارة ثابتة كوب دافئ 55 درجة من الحليب الساخن هو منتج فريد وعملي يهدف إلى الحفاظ على درجة حرارة المشروبات الساخنة بشكل مستمر وثابت. يتميز هذا الكوستر بتقنية العزل الذكي التي تسمح بتسخين الكوب بدرجة حرارة الحليب الساخن إلى 55 درجة مئوية، مما يحافظ على الحليب دافئًا وجاهزًا للاستخدام في أي وقت. يأتي الكوستر مع قاعدة كوب ماء وصندوق هدايا، مما يجعله مثاليًا كهدية لأحبائك. بفضل وظيفته الذكية وتصميمه العصري، ستستمتع بمشروباتك الساخنة المفضلة بدرجة حرارة مثالية لفترة طويلة.', 'xjd88', NULL, NULL, '2023-12-18 21:36:03', '2023-12-18 21:37:29', NULL),
(533, 103, 1, 'كوب القهوة الذكي', 'كوب القهوة الذكي', 400, 650, NULL, NULL, 1, 'available', 'كوب القهوة بتحكم في درجة الحرارة الذكي والمزود بلوحة تدفئة عبر منفذ USB. يتميز بقدرته على الحفاظ على درجة حرارة القهوة عند 55 درجة مئوية بشكل ثابت. هذا الكوب المصنوع من السيراميك هو هدية رائعة لمناسبات مثل يوم المعلم. يتميز بتصميمه البسيط والأنيق، ويأتي مع ملعقة مرفقة. يمكن استخدامه لشرب القهوة والشاي والماء، ويأتي بألوان مختلفة يمكن تخصيصها حسب الطلب. يمكن استخدامه في المنزل، في المكتب، أو أثناء السفر. يعتبر هذا الكوب خيارًا مثاليًا لمحبي القهوة الذين يرغبون في الاستمتاع بقهوتهم بدرجة حرارة مثالية في أي وقت.', '0000', NULL, NULL, '2023-12-18 21:41:45', '2023-12-24 04:43:54', NULL),
(534, 119, 1, 'ماكينة تجليد الكتب الاحترافية', 'ماكينة تجليد الكتب الاحترافية', 80, 170, NULL, NULL, 1, 'available', 'ماكينة تجليد الكتب ذات الجودة العالية هي منتج ممتاز للمكاتب والمؤسسات التجارية. تتميز بتصميمها المتين والمتين، مما يجعلها قادرة على التعامل مع مهام التجليد اليومية بكفاءة عالية. تستخدم هذه الماكينة دبابيس قياسية لتجليد الكتب والمستندات بأمان وسرعة. بفضل قدرتها على تجليد حتى 30 صفحة في وقت واحد، فإنها توفر وقتًا وجهدًا قيميًا للمستخدمين. تتميز الماكينة بالمواد عالية الجودة المستخدمة في تصنيعها، مما يجعلها متينة وموثوقة للاستخدام الطويل الأمد. إنها اختيار مثالي لتلبية احتياجاتك في تجليد الكتب والمستندات بسهولة ودقة', '893', NULL, NULL, '2023-12-18 21:42:16', '2023-12-18 21:42:16', NULL),
(535, 119, 1, 'دبابيس إكسبرو', 'دبابيس إكسبرو', 50, 100, NULL, NULL, 1, 'available', 'دبابيس المكتب ذات الجودة العالية هي منتجات رائعة للاستخدام في المدارس والمكاتب. تتميز هذه الدبابيس بموادها المعدنية المتينة التي تضمن قوة وثبات عند التثبيت. تتميز بتصميمها العادي وحجمها القياسي 24/6، مما يجعلها مناسبة لمعظم مكائن التجليد والدبابيس القياسية. تأتي الدبابيس في لون فضي رائع يضفي لمسة من الأناقة على المستندات الملزمة. كما تتميز بطبقة مطلية بالزنك للحماية من الصدأ والتآكل. تستخدم هذه الدبابيس بكثرة في المنازل والمكاتب والمدارس، وهي مثالية لتأمين الأوراق والمستندات بشكل مرتب ومنظم. استمتع بجودة عالية وأداء موثوق به مع دبابيس المكتب ذات الجودة العالية.', '895', NULL, NULL, '2023-12-18 21:45:08', '2023-12-18 21:45:08', NULL),
(536, 74, 1, 'جهاز عرض النجوم في الغرفة', 'جهاز عرض النجوم في الغرفة', 500, 840, NULL, NULL, 1, 'available', 'جهاز عرض ليزري جديد ذكي لضوء النجوم والقمر والكون المضيئ، مصباح سيارة مزود بمنفذ USB، وجهاز عرض ضوئي لضوء السماء المضيئة وضوء الغيتار. يُعتبر هذا الجهاز المبتكر مثاليًا لتجربة فريدة في الإضاءة والتأثيرات المرئية. يوفر لك الجهاز عرضًا رائعًا للنجوم والقمر والكون، مما يخلق جوًا ساحرًا في غرفتك أو سيارتك. يتميز بتصميم ذكي ومريح، ويمكن استخدامه في المنزل، أو في السيارة، أو أثناء العروض الموسيقية. بفضل منفذ USB المدمج، يمكنك تشغيله بسهولة من خلال توصيله بأجهزة USB المختلفة. استمتع بالأجواء الفريدة والساحرة التي يخلقها هذا الجهاز الرائع.', '0000', NULL, NULL, '2023-12-18 21:46:08', '2023-12-18 21:46:08', NULL),
(537, 118, 1, 'قلم الرسم المائي الملون', 'قلم الرسم المائي الملون', 30, 60, NULL, NULL, 1, 'available', 'قلم ألوان الرسم المائي بيكول هو تصميم جديد وملون يتميز بأنه يحتوي على 12 لونًا مخصصًا، وهو مجموعة من أقلام الألوان الملونة ذات البطانة الدقيقة، مع إمكانية إضافة الشعار الخاص بك للرسم. يعتبر هذا القلم مناسبًا للرسم والتلوين بدقة وإتقان، حيث يتميز بقلم فرشاة بعرض 0.4 مم. يوفر لك هذا القلم تجربة رائعة وممتعة في الرسم والتلوين، سواء كنت فنانًا محترفًا أو هاويًا. احصل على هذه المجموعة المميزة وأضف لمسة فنية رائعة إلى أعمالك الفنية والرسومات.', 'W342', NULL, NULL, '2023-12-18 21:48:18', '2023-12-19 00:33:11', NULL),
(538, 69, 1, 'مكواة البخار الصغيرة', 'مكواة البخار الصغيرة', 250, 430, NULL, NULL, 1, 'available', 'مكواة البخار الجديدة OEM هي مكواة صغيرة قابلة للطي ومحمولة بشكل مريح. تعد هذه المكواة الكهربائية البخارية منتجًا مثاليًا للعناية بالملابس. تأتي بمواصفات صناعية متقدمة وضمان للجودة. تستخدم تقنية البخار لإزالة التجاعيد والتجعد من الملابس بسهولة وسرعة، مما يوفر لك وقتًا وجهدًا في عملية كي الملابس. تتميز بتصميم مدمج وخفيف الوزن، مما يسهل حملها أثناء السفر أو استخدامها في المنزل. احصل على مكواة البخار الكهربائية هذه اليوم واستمتع بملابس مكوَّنة بشكل مثالي وخالية من التجاعيد.', 'yn05', NULL, NULL, '2023-12-19 02:05:26', '2023-12-19 02:05:26', NULL),
(539, 69, 1, 'مكواة معدنية سوبر لايت', 'مكواة معدنية سوبر لايت', 320, 540, NULL, NULL, 1, 'available', 'مكواة البخار السحرية هي جهاز منزلي محمول كهربائي متعدد الوظائف، يجمع بين مميزات مكواة التجفيف والضغط الحديد المحمولة. تتميز هذه المكواة بأداء فائق وتقنية متقدمة لتجفيف وكوي الملابس بسهولة وفعالية. تتميز بتصميمها العصري والمريح، مما يجعلها سهلة الاستخدام ومحمولة بسهولة أثناء السفر. تحتوي على درجة حرارة قابلة للتعديل لتناسب أنواع مختلفة من الأقمشة والملابس. بفضل البخار المتولد منها، يمكنك إزالة التجاعيد والتجفيف السريع للملابس بكل سهولة وسرعة. إن مكواة البخار السحرية هي رفيقك المثالي للحصول على ملابس مكوَّة ومظهرٍ أنيق في أي وقت وأي مكان.', 'xjd-27', NULL, NULL, '2023-12-19 02:08:59', '2023-12-19 02:08:59', NULL),
(540, 69, 1, 'مكواة broms', 'مكواة broms', 250, 450, NULL, NULL, 1, 'available', 'مكواة الحديد الكهربائية الصغيرة هي منتج عملي وموثوق به لتسهيل عملية كي الملابس. تتميز بحجمها الصغير وتصميمها المريح، مما يجعلها مثالية للاستخدام المنزلي وأثناء السفر. تعمل المكواة بكفاءة عالية وتحتوي على ملحقات متعددة تسهل عملية الكي، مثل الألواح الحرارية المصنوعة من الألومنيوم عالي الجودة. كما تتميز بقوة تسخين عالية وتحكم سهل في درجة حرارة الكي. تعتبر مكواة الحديد الكهربائية الصغيرة حلاً مثاليًا للحفاظ على ملابسك بحالة ممتازة ومكوّنة بشكل رائع، سواء في المنزل أو أثناء السفر.', '00000', NULL, NULL, '2023-12-19 02:11:30', '2023-12-19 02:11:30', NULL),
(541, 69, 1, 'مكواة البخار philips المحمولة القوية', 'مكواة البخار philips المحمولة القوية', 500, 850, NULL, NULL, 1, 'available', '\"مكواة البخار الكهربائية المحمولة\" هي منتج مصغر ومحمول يتميز بقوته وكفاءته. تأتي بقوة تتراوح بين 2200 وات و 2600 وات، مما يسمح لها بتوليد بخار قوي وفعال لكي تكون قادرة على كوي الملابس بسرعة وسهولة. تصميمها المدمج يجعلها مثالية للاستخدام أثناء السفر، حيث يمكن حملها بسهولة في حقيبة السفر أو حقيبة اليد. تحتوي على ميزات مثل وظيفة إيقاف تلقائي ومادة تسخين السيراميك لتوفير حماية إضافية وأداء متفوق. إنها تساعدك على الحصول على ملابس مكوَّاة بشكل مثالي ومنتعش بدون مجهود كبير. تعتبر مكواة البخار المحمولة خيارًا مثاليًا للعناية بالملابس أثناء التنقل.', 'xjd-24', NULL, NULL, '2023-12-19 02:14:03', '2023-12-19 02:14:03', NULL),
(542, 69, 1, 'مكوات philips الكلاسيكيه', 'مكوات philips الكلاسيكيه', 320, 490, NULL, NULL, 1, 'available', 'مكواة تجفيف مؤشر ضوء مرنة سلك كهربائي غير عصا Soleplate جديدة. هذه المكواة تتميز بتصميمها العصري والعملي، وتعد خيارًا مثاليًا لتجفيف وكوي الملابس بسهولة وفعالية. تتميز بمؤشر ضوء مرن يسهل قراءته ويوفر معلومات حول درجة الحرارة المناسبة لكل نوع من الأقمشة. يأتي هذا الجهاز بسلك كهربائي طويل لسهولة الحركة والوصول إلى المناطق الصعبة. كما تتميز بلوحة سولبليت غير عصا توفر كفاءة عالية في الكوي وتجنب الالتصاق. احصل على هذه المكواة الجديدة العملية والعصرية اليوم واستمتع بنتائج مثالية في كوي الملابس.', 'xjd27', NULL, NULL, '2023-12-19 02:16:38', '2023-12-19 02:19:16', NULL),
(543, 69, 1, 'مكواة البخار اليدوية عالية الطاقة', 'مكواة البخار اليدوية عالية الطاقة', 500, 830, NULL, NULL, 1, 'available', 'مكواة ضغط الملابس صغيرة عالية الطاقة، مكواة بخار صغيرة كهربائية محمولة باليد للملابس. هذه المكواة المبتكرة والمتعددة الاستخدامات توفر لك تجربة كي متميزة. تتميز بقوة ضغط عالية لضمان كي مثالي وسريع للملابس. يمكنك استخدامها في محلات الغسيل أو في رحلات السفر بفضل تصميمها المحمول والمريح. تعمل بالبخار لإزالة التجاعيد والبقع العنيدة عن الملابس، مما يوفر لك نتائج ممتازة. تتميز أيضًا بوظيفة التنظيف الذاتي، مما يجعلها سهلة الاستخدام والصيانة. احصل على هذه المكواة العملية والفعالة لتحصل على ملابس مكوَّنة بشكل مثالي وجاهزة للارتداء في أي وقت وفي أي مكان.', 'xjd101', NULL, NULL, '2023-12-19 02:19:03', '2023-12-19 02:19:03', NULL),
(544, 119, 1, 'دفتر التخطيط', 'دفتر التخطيط', 100, 180, NULL, NULL, 1, 'available', 'يتميز بغلاف جلدي فاخر يعطيه مظهرًا أنيقًا وجذابًا. يعد هذا المخطط المنظم مثاليًا للاستخدام الشخصي أو كهدية فريدة وعملية للأصدقاء والعائلة. يحتوي على صفحات داخلية متعددة تسمح لك بتنظيم مهامك اليومية والأهداف والمواعيد الهامة. يأتي بحجمي A5 و A6 لتلبية احتياجاتك المحددة. يعتبر هذا المنتج مثاليًا للمكتب، والمدرسة، والعمل، والسفر وأي مناسبة تحتاج إلى تنظيم ممتاز وأناقة. احصل على Agendum Planer الخاص بك اليوم واستمتع بترتيب حياتك بكفاءة وأناقة.', '046', NULL, NULL, '2023-12-19 02:21:35', '2023-12-19 02:21:35', NULL),
(545, 70, 1, 'مكيف تبريد هواء صغير للأطفال', 'مكيف تبريد هواء صغير للأطفال', 300, 580, NULL, NULL, 1, 'available', 'مكيف كاسيت محمول كهربائي صيني معدات استهلاك منخفض للطاقة أنظمة تكييف هواء صغيرة\"\r\n\r\nاحصل على الراحة الفورية في أي مكان مع مكيف الهواء الكاسيت المحمول الكهربائي الصيني. يتميز هذا المكيف بالقدرة على توفير تجربة تبريد فعالة ومنخفضة للطاقة. يمكنك استخدامه في الفنادق والمنازل وأي مكان آخر تحتاج فيه إلى تكييف هواء محمول. يتميز بتصميمه المحمول والمدمج، مما يسهل حمله وتركيبه في أي مكان. يعمل بتقنية التبريد بالماء، ويتميز بواجهة USB الصغيرة وسعة خزان المياه الكبيرة. استمتع بالهواء النقي والمنعش في الأيام الحارة مع مكيف الهواء الكاسيت المحمول الكهربائي الصيني.', 'yn57', NULL, NULL, '2023-12-19 02:22:21', '2023-12-19 02:22:21', NULL),
(546, 119, 1, 'مفكرة الجلد الفاخرة', 'مفكرة الجلد الفاخرة', 80, 150, NULL, NULL, 1, 'available', 'مفكرة جلدية خدمة مخصصة لوازم مكتبية من الكرتون معبأة في دفاتر للضباط قابلة للتخصيص\r\n\r\nاحصل على مفكرة جلدية فاخرة ومخصصة لوازم المكتب التي تلبي احتياجاتك الشخصية. تأتي هذه المفكرة بتصميم أنيق يتميز بالجلد الفاخر وتفاصيل عالية الجودة. تتوفر في خيارات مختلفة للأحجام والألوان، مما يتيح لك الاختيار المثالي وفقًا لذوقك الشخصي. تعتبر مفكرة الجلد المخصصة هذه اختيارًا مثاليًا للمكاتب والضباط والطلاب. كما أنها تأتي في عبوة صديقة للبيئة مصنوعة من الكرتون، مما يعكس اهتمامك بالحفاظ على البيئة. احصل على هذه المفكرة المتعددة الاستخدامات التي تجمع بين الأناقة والوظائف المتعددة، واستمتع بتجربة كتابة مريحة ومميزة.', 'WJ51', NULL, NULL, '2023-12-19 02:24:38', '2023-12-19 02:24:38', NULL),
(547, 70, 1, 'مروحة الرقبة الباردة', 'مروحة الرقبة الباردة', 200, 380, NULL, NULL, 1, 'available', 'مروحة الرقبة بدون شفرات قابلة للشحن هي منتج رائع يوفر تجربة تبريد مريحة ومنعشة في الأيام الحارة. تتميز هذه المروحة بتصميمها الفريد بدون شفرات، مما يجعلها آمنة ومناسبة للاستخدام حول الرقبة. تتميز بقدرتها على التبريد بزاوية 360 درجة، مما يوفر توزيعًا مثاليًا للهواء البارد في جميع الاتجاهات. تعمل بشكل هادئ جدًا، مما يسمح لك بالاستمتاع بالهواء النقي والمنعش دون التسبب في إزعاج الآخرين. يمكن تعديل زاوية المروحة لتناسب راحتك الشخصية، وتتميز بميزة الشحن القابل للإعادة، مما يسمح لك باستخدامها لفترات طويلة دون الحاجة إلى استبدال البطاريات. مروحة الرقبة بدون شفرات هي رفيق مثالي للنشاطات الرياضية والسفر والاسترخاء في الهواء الطلق.', 'jf-100', NULL, NULL, '2023-12-19 02:25:39', '2023-12-19 02:25:39', NULL),
(548, 70, 1, 'مروحة قابلة ل الطي', 'مروحة قابلة ل الطي', 600, 860, NULL, NULL, 1, 'available', 'مروحة الباردة الصامتة 3 في 1 سطح المكتب مصغرة للطي محمولة USB قابلة للشحن توفر تجربة تبريد مريحة ومرنة. تتميز بتصميم قابل للطي، مما يجعلها مثالية للاستخدام في المنزل، المكتب، أو أثناء التنقل في الهواء الطلق. تعمل بواسطة بطارية قابلة للشحن أو منفذ USB، مما يجعلها ملائمة للاستخدام في أي مكان. توفر سرعات متعددة للرياح تمكنك من ضبط التهوية حسب احتياجاتك. تتميز بتصميم صامت، مما يوفر بيئة عمل هادئة ومريحة. بفضل مظهرها الأنيق والعملي، فهي تضفي لمسة عصرية على مكتبك أو طاولتك. استمتع بالراحة والانتعاش في الأيام الحارة مع مروحة الرقبة الباردة الصامتة هذه.', 'yn-89', NULL, NULL, '2023-12-19 02:28:25', '2023-12-19 02:28:25', NULL),
(549, 119, 1, 'دفتر الجلد المتعدد الاستخدامات', 'دفتر الجلد المتعدد الاستخدامات', 80, 140, NULL, NULL, 1, 'available', 'دفتر متعدد الأغراض بجودة ممتازة وتصميم جذاب يعدُّ خيارًا مثاليًا للاستخدام في المكتب وفي الحياة اليومية. يتميز هذا الدفتر بتصميمه العصري وغلافه المصنوع من الجلد الفاخر، مما يمنحه مظهرًا أنيقًا وأنثويًا. يمتاز الدفتر بأوراق عالية الجودة وعدد كبير من الصفحات الداخلية، مما يتيح لك الكتابة والرسم بحرية. بفضل حجمه المناسب (A5 أو B5)، يمكن حمله بسهولة في حقيبتك أو حقيبة الظهر. كما يتميز الدفتر بإمكانية التخصيص ووضع شعارك الخاص على الغلاف، مما يجعله هدية مثالية أو أداة ترويجية. احصل على هذا الدفتر المتعدد الاستخدامات بجودة عالية الآن واستمتع بتجربة كتابة استثنائية.', 'WJ50', NULL, NULL, '2023-12-19 02:29:36', '2023-12-19 02:29:36', NULL),
(550, 115, 1, 'مقص العناية بأظافر الأطفال الكهربائي', 'مقص العناية بأظافر الأطفال الكهربائي', 120, 240, NULL, NULL, 1, 'available', 'مجموعة كليبرز كهربائية للعناية بأظافر القدم مجموعة مانيكير 6 في 1 للأطفال\r\n\r\nاحرص على راحة وسلامة أطفالك مع مجموعة كليبرز كهربائية للعناية بأظافر القدم. تتميز هذه المجموعة بتصميم متعدد الوظائف الذي يلبي احتياجات الأطفال بشكل كامل. تتضمن المجموعة 6 أدوات في 1، بما في ذلك كليبر للأظافر، ومبراة للأظافر، وقطعة إزالة للبشرة الميتة، ومشذب للكعب، وفرشاة لتنظيف الأظافر وملف لتنعيم الأظافر.\r\n\r\nتعمل المجموعة بتقنية كهربائية آمنة وفعالة، مما يوفر سهولة الاستخدام والنتائج المثالية. كما يتميز المنتج بمواد عالية الجودة ومقاومة للبلى، مما يضمن متانة واستدامة المجموعة. بفضل حجمها المدمج والمحمول، يمكنك استخدام المجموعة في المنزل أو أثناء السفر.\r\n\r\nاحصل على مجموعة كليبرز كهربائية للعناية بأظافر القدم مجموعة مانيكير 6 في 1 للأطفال واستمتع بأظافر نظيفة ومرتبة لأطفالك بكل سهولة وأمان.', 'tv-34', NULL, NULL, '2023-12-19 02:31:28', '2023-12-19 02:31:28', NULL),
(551, 119, 1, 'دفتر الجلد المتعدد الاستخدامات الفاخر', 'دفتر الجلد المتعدد الاستخدامات الفاخر', 100, 170, NULL, NULL, 1, 'available', 'دفتر الملاحظات بالغلاف الصلب والتصميم الجديد هو منتج رائع يتميز بالجودة والأناقة. يأتي بغلاف PVC مطبوع بشعار مخصص، ويحتوي على غلاف مغناطيسي للإغلاق بشكل آمن. يتمتع هذا الدفتر بورق سميك عالي الجودة يحتوي على خطوط وشبكة ونقاط وأوراق بيضاء فارغة، مما يتيح لك استخدامه بمرونة وفقاً لاحتياجاتك. إنه مناسب للاستخدام في المكتب وأثناء السفر وفي المدرسة، ويمكن استخدامه كمفكرة أو مجلة. بفضل تصميمه البسيط والمتناسق وجودته المتفوقة، يعد هذا الدفتر هدية ممتازة للأصدقاء والزملاء والأحباء. استمتع بالكتابة والتخطيط بأناقة مع هذا الدفتر المميز', 'WJ49', NULL, NULL, '2023-12-19 02:32:56', '2023-12-19 02:37:13', NULL),
(552, 70, 1, 'المروحة الكهربائية المحمولة', 'المروحة الكهربائية المحمولة', 100, 190, NULL, NULL, 1, 'available', 'مروحة ببطارية قابلة لإعادة الشحن بتصميم الأفوكادو هي مروحة صغيرة ومحمولة تعمل بالكهرباء. تأتي مع منفذ USB للشحن وتتميز بتصميم جذاب يشبه الأفوكادو، مما يجعلها مثالية للاستخدام من قبل الفتيات. تعمل هذه المروحة على بطارية قابلة لإعادة الشحن، مما يوفر مروحة قوية ومنعشة في أي مكان تحتاج إليه. بفضل حجمها الصغير والمحمول، يمكنك حملها بسهولة في حقيبتك أو حقيبة الظهر أو حتى في جيبك. إنها مثالية للاستخدام في الرحلات، النزهات، المكاتب، أو أي مكان آخر تحتاج فيه إلى تدفق هواء منعش ومريح. استمتع بالبرودة والراحة مع هذه المروحة الصغيرة والعصرية بتصميم الأفوكادو.', 'jf-25', NULL, NULL, '2023-12-19 02:34:41', '2023-12-19 02:34:41', NULL),
(553, 119, 1, 'دفتر الجمال', 'دفتر الجمال المتعدد الاستخدامات', 50, 100, NULL, NULL, 1, 'available', 'دفتر ملاحظات متعدد الألوان من البولي فينيل كلوريد هو منتج فاخر ومتعدد الاستخدامات. يأتي هذا الدفتر بحجم A5/A6 ومصنوع من البولي فينيل كلوريد عالي الجودة، مما يجعله متينًا ومقاومًا للتلف. يحتوي الدفتر على منظم ليزر ملون ومفكرة يومية أسبوعية، مما يساعدك على تنظيم مهامك اليومية بفعالية. يمكن استخدامه كدفتر مسافر شخصي أو دفتر ملاحظات للمدرسة أو العمل. يتميز بتصميم متعدد الألوان الجميل والأنيق، مما يجعله مثاليًا للاستخدام الشخصي أو كهدية لشخص مميز. احصل على هذا الدفتر الملفت للنظر والعملي لتسجيل أفكارك وملاحظاتك بأناقة وتنظيم.', 'WJ48', NULL, NULL, '2023-12-19 02:36:43', '2023-12-19 02:40:01', NULL),
(554, 70, 1, 'مروحة ديلوكس بخاخ الترطيب', 'مروحة ديلوكس بخاخ الترطيب', 600, 830, NULL, NULL, 1, 'available', 'بخاخ ترطيب بمروحة كهربائية صغيرة مع ضوء ليلي محيطي (أبيض) هو منتج محمول وعملي يجمع بين وظائف التبريد والترطيب والإضاءة. تتميز هذه المروحة الكهربائية الصغيرة بتصميم محمول يسهل حملها واستخدامها في أي مكان ترغب فيه. توفر وظيفة الترطيب البخاخ العملية ترطيبًا منعشًا للهواء المحيط، مما يساعد في تخفيف الجفاف وزيادة الراحة. وبفضل الضوء الليلي المحيطي، يمكنك الاستمتاع بإضاءة هادئة ومريحة أثناء استخدام المروحة في الليل. إنها مثالية للاستخدام في الفنادق والأماكن الخارجية والمنازل. بفضل حجمها الصغير وخفة وزنها، يمكنك حملها بسهولة والاستمتاع بالتبريد والترطيب في أي وقت وفي أي مكان.', 'yn-85', NULL, NULL, '2023-12-19 02:39:22', '2023-12-19 02:39:22', NULL),
(555, 118, 1, 'دفتر ملاحظات12 قطعة', 'دفتر ملاحظات12 قطعة', 60, 120, NULL, NULL, 1, 'available', 'دوامة دفتر كلية حكمت غلاف دفتر دوامة صغيرة دفتر للمدرسة العمل الكتابة تدوين الملاحظات - احصل على دفتر الجمال المتعدد الاستخدامات الذي يلبي جميع احتياجاتك الكتابية. يتميز هذا الدفتر بحجمه العملي A5 وتصميمه الجذاب مع غلاف دوامة فريد وملفت للنظر. يحتوي الدفتر على 70 ورقة داخلية متعددة الاستخدامات، مثالية للكتابة وتدوين الملاحظات في المدرسة، الكلية أو مكان العمل. يمكن استخدامه أيضًا كدفتر يوميات أو مذكرة شخصية. يوفر الدفتر مساحة كافية للتعبير الإبداعي والتنظيم الفعال. كما أنه مصنوع من مواد عالية الجودة وصديقة للبيئة. احصل على دفتر الجمال المتعدد الاستخدامات اليوم واستمتع بتجربة كتابة استثنائية', 'WJ61', NULL, NULL, '2023-12-19 02:40:51', '2023-12-19 02:40:51', NULL),
(556, 100, 1, 'مجلس الدورية للتخسيس وتنحيف الخصر', 'مجلس الدورية للتخسيس وتنحيف الخصر', 250, 470, NULL, NULL, 1, 'available', 'جديد تصميم الجسم التخسيس الخصر التواء القرص القرص الرصيد مجلس الدورية\r\n\r\nاحصل على جسم مشدود وخصر رشيق مع مجلس الدورية للتخسيس وتنحيف الخصر. يتميز هذا المنتج بتصميمه الجديد والمبتكر الذي يساعد على تقوية عضلات البطن والخصر. يعمل المجلس عن طريق التواء الجسم والتوازن عليه، مما يعزز حرق الدهون في منطقة الخصر ويعزز اللياقة البدنية.\r\n\r\nصُنع المجلس من مادة عالية الجودة، وهو متين وآمن للاستخدام. يأتي بألوان جذابة مثل الأزرق والأخضر والبنفسجي. يتميز بحجم مريح يناسب الجميع ويسهل حمله وتخزينه. يمكن استخدامه في التدريبات المنزلية لتحقيق نتائج مثالية في تنحيف الخصر وتقوية العضلات.\r\n\r\nاحصل على مجلس الدورية للتخسيس واحصل على جسم رشيق ومتناسق بكل سهولة وراحة.', 'tv-05', NULL, NULL, '2023-12-19 02:43:22', '2023-12-19 02:48:28', NULL),
(557, 119, 1, 'قلم كتابة مستدامة', 'قلم كتابة مستدامة', 50, 100, NULL, NULL, 1, 'available', 'علامة دائمة سريعة الجفاف غير سامة للمدرسة والمنزل\r\n\r\nاحصل على علامة دائمة سريعة الجفاف وغير سامة تناسب احتياجاتك في المدرسة والمنزل. تتميز هذه العلامة بالكتابة السلسة والجفاف السريع، مما يضمن تجربة رائعة للكتابة والتميز بألوان زاهية. تعمل بشكل ممتاز على الخشب والمعدن والسيراميك والزجاج والبلاستيك ومعظم الأسطح الأخرى. تحتوي العلامة على حبر دائم عالي الجودة يدوم لفترة طويلة، مما يجعلها مثالية للعلامات والتسميات الدائمة. بفضل قلمها المزدوج الجانبي، يمكنك الاستمتاع بكتابة دقيقة وتظليل سهل. احصل على هذه العلامة الرائعة اليوم واستمتع بكتابة مذهلة ومستدامة في جميع أنحاء المدرسة والمنزل', 'WJ', NULL, NULL, '2023-12-19 02:44:08', '2023-12-19 02:44:08', NULL),
(558, 118, 1, 'قلم التصحيح 12 قطعة', 'قلم التصحيح قطعة', 120, 220, NULL, NULL, 1, 'available', 'سائل تصحيح السائل الأبيض، مستلزمات مكتبية، قلم سائل تصحيحي إبداعي مصغر\r\n\r\nاحصل على قلم سائل تصحيحي إبداعي مصغر يوفر لك الدقة والسهولة في تصحيح الأخطاء في المستندات والورق. يتميز هذا القلم بسائل تصحيح أبيض عالي الجودة يقوم بإخفاء الأخطاء بشكل فعال ويجف بسرعة ليتيح لك الكتابة على الفور. بفضل حجمه المصغر، يمكنك حمله بسهولة في حقيبتك أو جيبك، مما يجعله مثاليًا للاستخدام في المكتب وأثناء التنقل. استمتع بتجربة تصحيح سلسة ونتائج دقيقة مع هذا القلم السائل التصحيحي المبتكر. قم بشراء هذا المنتج والتمتع بأداة عملية وعصرية لتصحيح الأخطاء في مستنداتك', '899', NULL, NULL, '2023-12-19 02:48:06', '2023-12-19 02:48:06', NULL),
(559, 118, 1, 'قلم التصحيح 24 قطعة', 'قلم التصحيح 24 قطعة', 360, 560, NULL, NULL, 1, 'available', 'قلم تصحيح السوائل هو منتج مكتبي عالي الجودة ومثالي للطلاب والمكاتب. يتميز بتصميمه الصغير الذي يجعله سهل الحمل ومريح في الاستخدام. يستخدم هذا القلم لتصحيح الأخطاء والطلاء فوق النصوص المكتوبة. يعمل بسلاسة وسرعة، ويتميز بالجفاف السريع، مما يتيح استخدامه في أي وقت دون الحاجة للانتظار. يأتي القلم بسائل تصحيح أبيض عالي الجودة يمكنه تغطية الأخطاء بشكل فعال. قم بشراء قلم تصحيح السوائل لتجربة تصحيح سهلة ودقيقة للأخطاء في النصوص المكتوبة في المدارس والمكاتب', 'WJ45', NULL, NULL, '2023-12-19 02:52:16', '2023-12-19 14:46:35', NULL),
(560, 118, 1, 'مقصات مدرسية ملونة 24 قطعة', 'مقصات مدرسية ملونة 24 قطعة', 360, 560, NULL, NULL, 1, 'available', 'احصل على منتج \"مقصات مدرسية ملونة\" عالية الجودة لتلاميذك. تتميز هذه المقصات بتصميم ملون جذاب يجعلها مثالية للاستخدام في الفصول الدراسية والمشاريع الإبداعية. تم تصنيع هذه المقصات يدويًا باستخدام مواد عالية الجودة، بما في ذلك شفرات فولاذية مقاومة للصدأ ومقابض بلاستيكية. تتميز بحجم مريح يناسب أيدي الأطفال، مما يسهل عليهم استخدامها بسهولة ودقة. إنها مثالية للقص والحرف اليدوية والمشاريع المدرسية. ستساعد هذه المقصات الأطفال على تنمية مهاراتهم الحركية الدقيقة وتعزيز إبداعهم. اجعل تجربة التعلم ممتعة وملونة مع هذه المقصات المدرسية عالية الجودة', 'WJ-28', NULL, NULL, '2023-12-19 14:52:43', '2023-12-19 14:52:43', NULL),
(561, 118, 1, 'مبرات القلم العملاقة', 'مبرات القلم العملاقة', 45, 80, NULL, NULL, 1, 'available', 'البراية الكبيرة القابلة للتعديل، منتج قرطاسي جديد وعصري يتميز بتصميمه الجذاب ووظائفه المتعددة. مصنوعة من مواد عالية الجودة مثل ABS، تتميز هذه البراية بالمتانة والقوة. تأتي بحجم كبير يسمح بصقل وشحذ الأقلام بكفاءة وسهولة. تحتوي على آلية ميكانيكية تتيح ضبط درجة حدة الصقل المطلوبة وفقًا لاحتياجاتك. تتوفر بمجموعة من الألوان المتنوعة لتناسب ذوقك الشخصي. سواء كنت طالبًا أو موظفًا في المكتب، ستكون هذه البراية الكبيرة هدية رائعة وأداة مثالية لتحقيق صقل وتنعيم أقلامك بسهولة وسرعة. احصل على هذه البراية الكبيرة القابلة للتعديل الآن واستمتع بتجربة صقل الأقلام السلسة والفعالة', 'ZW-916', NULL, NULL, '2023-12-19 15:00:22', '2023-12-19 15:04:03', NULL),
(562, 118, 1, 'مبراة ترفيهية', 'مبراة ترفيهية', 45, 80, NULL, NULL, 1, 'available', 'خيارًا مثاليًا للأطفال. يأتي الطقم مع طقم مبراة قلم رصاص سطح المكتب بتصميم فريد على شكل حيوان، مصنوع من البلاستيك عالي الجودة. يتميز بفتحة واحدة لتسهيل عملية شحذ الأقلام الرصاص. يعد هذا الطقم الواحد واحدة من أدوات المكتب الأساسية التي يحتاجها الأطفال في المدرسة أو في المنزل. بفضل تصميمه المرح والجذاب، يعتبر هذا الطقم أيضًا هدية ترويجية رائعة. يتوفر بألوان متعددة ويمكن طلبه بكميات صغيرة. سواء كنت تبحث عن هدية للأطفال أو ترغب في إثراء مجموعتك من مستلزمات المكتب، فإن طقم أدوات المكتب هذا هو الخيار المثالي', 'ZW-917', NULL, NULL, '2023-12-19 15:03:32', '2023-12-19 15:03:32', NULL),
(563, 118, 1, 'مبراية الشحذ المبتكرة', 'مبراية الشحذ المبتكرة', 80, 130, NULL, NULL, 1, 'available', 'براية للأطفال برسوم كرتونية لطيفة تتميز بتصميم إبداعي يجمع بين المرح والتعلم. تعتبر هذه البراية أداة مكتبية مثالية للأطفال في سن المدرسة. تأتي بتصميم برسوم كرتونية جذابة وملونة تجذب انتباه الأطفال وتحفزهم على استخدامها. تعمل البراية عن طريق حركة اليد، وهي مصنوعة من مواد عالية الجودة مثل البلاستيك والمعدن. يمكن استخدامها في المدرسة أو في المنزل، وتساعد الأطفال على شحذ أقلامهم الرصاص بسهولة ودقة. إنها منتج مثالي لتشجيع الأطفال على حب الكتابة والتعلم بطريقة ممتعة وعملية', 'ZW-918', NULL, NULL, '2023-12-19 15:07:10', '2023-12-19 15:07:10', NULL),
(564, 118, 1, 'قلم تلوين', 'قلم تلوين', 100, 160, NULL, NULL, 1, 'available', 'أقلام الطلاء الدائمة بثنائي الخط لها 8 ألوان مذهلة تجمع بين اللمعان والجمال. تمتاز هذه الأقلام بتصميمها المميز الذي يتيح لك رسم خطين متوازيين معاً، مما يضفي لمسة فنية ممتعة على أعمالك الفنية وبطاقات المعايدة. تعتبر مثالية للرسم والتلوين وتزيين البطاقات والكتب الملونة. تأتي هذه الأقلام بجودة عالية وألوان زاهية تدوم طويلاً. كما أنها تعمل على جميع الأسطح وتتميز بحبر دائم وتلميح فرشاة للكتابة بأسلوب سلس ودقيق. تجعل هذه الأقلام تجربة الرسم والتلوين أكثر إثارة وإبداعًا.', 'WJ33', NULL, NULL, '2023-12-19 15:09:47', '2023-12-19 15:09:47', NULL);
INSERT INTO `products` (`id`, `subcategory_id`, `supplier_id`, `unit_name`, `pack_name`, `purchasing_price`, `unit_price`, `pack_price`, `pack_units`, `unit_type`, `status`, `description`, `code_supplier`, `code_bar`, `file`, `created_at`, `updated_at`, `deleted_at`) VALUES
(565, 118, 1, 'مجموعة ادوات هندسية', 'مجموعة ادوات هندسية', 60, 100, NULL, NULL, 1, 'available', 'طقم هندسة ببوصلات من بونفان هو منتج رائع يهدف إلى تلبية احتياجات طلاب الهندسة ومحبي الرسم التقني. يأتي الطقم مع مجموعة من البوصلات المميزة والعالية الجودة، والتي تساعد على رسم الدوائر والأشكال الهندسية بدقة وسهولة. تصميمها الأنيق والمريح يجعلها مثالية للاستخدام اليومي في المدارس والكليات والمكاتب. تتميز بوصلات الطقم بالمتانة والاستقرار، مما يضمن استخدامها لفترة طويلة دون تدهور الجودة. بالإضافة إلى ذلك، يأتي الطقم بتغليف ملائم يضمن الحفاظ على جميع المكونات منظمة وآمنة. احصل على طقم هندسة ببوصلات من بونفان واستمتع بتجربة رسم وهندسة ممتعة ومثمرة', '908', NULL, NULL, '2023-12-19 15:12:26', '2023-12-19 15:12:26', NULL),
(566, 118, 1, 'مجموعة أدوات الرياضيات الشاملة', 'مجموعة أدوات الرياضيات الشاملة', 50, 90, NULL, NULL, 1, 'available', 'مصنع الجملة 8 قطعة البوصلة حاكم عدة الرياضية مجموعة أدوات لطلاب المدارس القرطاسية والرياضيات تعلم أداة هي مجموعة أدوات رائعة تهدف إلى مساعدة طلاب المدارس في دروس الرياضيات والقرطاسية. تحتوي المجموعة على 8 قطع، بما في ذلك بوصلة وحاكم وأدوات أخرى ذات جودة عالية. تم تصميم هذه الأدوات بعناية لتلبية احتياجات طلاب المدارس، مما يساعدهم في رسم الدوائر والمساعدة في إجراء القياسات والحسابات الرياضية. بفضل هذه المجموعة المتكاملة، يمكن للطلاب استكشاف عالم الرياضيات بسهولة وتطوير مهاراتهم في هذا المجال. إنها أداة مثالية للمدارس وتعزز الإبداع والتعلم الفعال.', 'WJ44', NULL, NULL, '2023-12-19 15:15:56', '2023-12-19 15:15:56', NULL),
(567, 118, 1, 'قلم تحديد الإبداعي المصغر', 'قلم تحديد الإبداعي المصغر', 40, 80, NULL, NULL, 1, 'available', 'قلم تحديد البسيطة الترويجي الإبداعي هو منتج مثالي للاستخدام في المدارس والمكاتب وحتى للأطفال. يتميز بتصميمه الصغير والعملي، مما يجعله سهل الاستخدام والحمل في الجيب أو الحقيبة. يتوفر بستة ألوان مختلفة، مما يسمح لك بتمييز وتحديد المعلومات المهمة بشكل سهل وفعال. بفضل نقاط الكتابة المزدوجة، يمكنك استخدامه للكتابة بطرف الفرشاة أو الطرف المائل، مما يوفر لك خيارات متعددة للتعبير الإبداعي. يتميز بكتابة سلسة وثابتة، مما يجعله مثاليًا للتسليط الضوء على النصوص والملاحظات المهمة. استمتع بالتحديد الدقيق والألوان الزاهية مع قلم تحديد البسيطة الترويجي الإبداعي.', 'WJ68', NULL, NULL, '2023-12-19 15:19:21', '2023-12-19 15:19:21', NULL),
(568, 118, 1, 'ممحاة  الكرتون', 'ممحاة  الكرتون', 120, 250, NULL, NULL, 1, 'available', 'ممحاة على شكل شطيرة كرتونية بحجم 2B هي هدية ممتعة ومفيدة للأطفال. تأتي هذه الممحاة بتصميم كرتوني جذاب يشبه شطيرة، وهي مثالية للاستخدام في رسم الأطفال. تعتبر هذه الممحاة فنية وتوفر أداءً ممتازًا في محو الرسومات والألوان بسهولة وفعالية. بفضل حجمها المناسب، يمكن للأطفال حملها بسهولة في حقائبهم المدرسية أو الفنية. تعد هذه الممحاة أيضًا هدية مثالية للأطفال، حيث تجمع بين العناصر المرحة والمنتج العملي. ستضفي ممحاة شطيرة الكرتون لمسة من الإبداع والمرح على رسومات الأطفال وستكون إضافة رائعة إلى مجموعة مستلزمات المدرسة أو الفن', 'ZW;891A', NULL, NULL, '2023-12-19 15:23:30', '2023-12-19 15:23:30', NULL),
(569, 118, 1, 'ممحاة بريق 24 قطعة', 'ممحاة بريق 24 قطعة', 240, 440, NULL, NULL, 1, 'available', 'طالب ، سائل خاص ناعم ، رأس معدني ناعم هو منتج عالي الجودة وسهل الاستخدام. يأتي هذا السائل بزجاجة تحتوي على 12 مل من السائل المصحح بألوان مشرقة مثل الأصفر، الأزرق، والوردي. يتميز بتصميمه الناعم ورأسه المعدني الدقيق الذي يوفر دقة عند استخدامه. إنه سهل الجفاف ويجف بسرعة، مما يتيح لك التعديل والتصحيح بسرعة وسلاسة. يعد هذا المنتج صديقًا للبيئة ومريحًا للاستخدام اليومي في المدرسة، الجامعة، أو في مكتب العمل. استمتع بتجربة تصحيح سهلة وفعالة مع طالب ، سائل خاص ناعم ، رأس معدني ناعم', 'ZW-899', NULL, 'uploads/supplier/supplier-569-2023-12-19.pdf', '2023-12-19 15:28:09', '2023-12-21 01:33:31', NULL),
(570, 118, 1, 'قلم فواكهة براقة 36 قطعة', 'قلم فواكهة براقة 36 قطعة', 900, 1100, NULL, NULL, 1, 'available', 'قلم تزيين فاكهة لطيف ومميز، مستورد من تشيلي، بتخفيضات كبيرة! يتميز هذا القلم بحبر جاف ملون يوفر ألوانًا زاهية ومشرقة. يمكن استخدامه للإعلانات التجارية، ويعتبر هدية مثالية لعشاق القرطاسية والمكاتب. مصنوع من مواد عالية الجودة، يتميز بتصميم مريح للكتابة، مما يوفر تجربة استخدام مريحة وسلسة. يمكن استخدامه للكتابة، التسوق، وتزيين الفواكه والهدايا. يأتي بألوان متنوعة لتناسب جميع الأذواق والاحتياجات. احصل على هذا القلم الفريد اليوم وأضف لمسة لطيفة ومرحة إلى حياتك اليومية', 'wj14', NULL, 'uploads/supplier/supplier-570-2023-12-22.pdf', '2023-12-21 01:39:22', '2023-12-24 03:36:00', NULL),
(571, 119, 1, 'قلم الحبر 12 قطعة', 'قلم الحبر 12 قطعة', 120, 220, NULL, NULL, 1, 'available', 'قلم الحبر الجل المخصص هو منتج فريد وعملي يجمع بين جودة الكتابة والتصميم المتميز. يأتي القلم بقطر 0.5 ملم مع حبر هلام عالي الجودة ينساب بسلاسة على الورق، مما يجعل الكتابة سهلة ومريحة. يتوفر في ثلاثة ألوان رائعة: الأسود، الأزرق، والأحمر، مما يتيح لك الاختيار المفضل لك. يتميز القلم بجسمه المصنوع من البلاستيك الشفاف الذي يسمح لك بمراقبة مستوى الحبر المتبقي. بفضل شعار العلامة التجارية المخصص الموجود على القلم، يمكنك استخدامه كهدية ترويجية أو في البيئة المكتبية والمدرسية. استمتع بتجربة الكتابة الممتعة والأنيقة مع قلم الحبر الجل المخصص', 'ZW-910', NULL, NULL, '2023-12-22 21:02:59', '2023-12-22 21:02:59', NULL),
(572, 118, 1, 'اقلام كرتونية 36 قطعة', 'اقلام كرتونية 36 قطعة', 750, 950, NULL, NULL, 1, 'available', 'صندوق من السيليكون لخلط الحيوانات - احصل على صندوق من السيليكون الأنيق والعملي لخلط الحيوانات. يعد هذا الصندوق مثاليًا لمحبي القرطاسية الجميلة والمبتكرة. تصميمه الفريد والأنيق يجعله مثاليًا للاستخدام في المكتب أو المدرسة أو في المنزل. يتميز بمواد عالية الجودة من السيليكون هلام، ويوفر تجربة استخدام مريحة وسهلة. يمكن استخدامه لخلط الحبر أو الألوان أو الدهانات بكل سهولة ودقة. اجعل مكتبك أو مكان عملك أكثر تنظيمًا وأناقة مع هذا الصندوق العملي والمعاصر. احصل عليه الآن واستمتع براحة البال والإبداع في العمل والدراسة', 'WJ-34', NULL, NULL, '2023-12-22 21:09:16', '2023-12-22 21:09:16', NULL),
(573, 118, 1, 'أقلام متنوعة 36 قطعة', 'أقلام متنوعة 36 قطعة', 300, 550, NULL, NULL, 1, 'available', 'قلم حبر جاف كرتوني صغير وجديد متعدد الألوان، قلم حبر جاف إبداعي متعدد الوظائف ذو 4 ألوان 514. يعتبر هذا القلم حلاً ممتازًا للكتابة والرسم الملون. يتميز بتصميمه الكرتوني الصغير والعصري، مما يجعله مثاليًا للاستخدام اليومي في المدرسة، المكتب، أو المنزل. يحتوي على أربعة ألوان مختلفة في قلم واحد، بحيث يمكنك التبديل بسهولة بين الألوان بمجرد تحريك القلم. إنه مثالي للتسلية والإبداع، سواء كنت تكتب الملاحظات أو تقوم بالتلوين. يأتي في حجم صغير وخفيف الوزن، مما يجعله محمولًا وسهل الاستخدام في أي مكان. استمتع بتجربة فريدة وممتعة مع هذا القلم المتعدد الألوان', '922', NULL, NULL, '2023-12-22 21:13:51', '2023-12-22 21:13:51', NULL),
(574, 118, 1, 'قلم الكتابة المتقن 50 قطعة', 'قلم الكتابة المتقن 50 قطعة', 400, 600, NULL, NULL, 1, 'available', 'هوك خط اللوحة تصميم للماء Fineliner القلم إبرة أنبوب رسم رسمت باليد هوك خط قلم توقيع هو قلم فائق الدقة وعالي الجودة. يتميز بطرف إبرة رفيع بقياس 0.5 ملم وهو مثالي للرسم والتخطيط والرسومات التفصيلية. يستخدم في الفنون البصرية والرسم اليدوي والمزيد. يعمل بتقنية الماء المقاوم للتلطخ، مما يسمح بتطبيق الألوان بدقة وثبات. يمكن استخدامه على مجموعة متنوعة من الأسطح بما في ذلك الورق والكرتون والمخططات والمذكرات. بفضل تصميمه المريح وخفة وزنه، يوفر راحة أثناء الاستخدام الطويل. يعتبر هذا القلم الفريد خيارًا مثاليًا للفنانين والهواة الذين يبحثون عن أداة دقيقة وموثوقة للتعبير الإبداعي', 'WJ16', NULL, NULL, '2023-12-22 21:24:40', '2023-12-22 21:24:40', NULL),
(575, 118, 1, 'اقلام متميزة 24 قطعة', 'اقلام متميزة 24 قطعة', 600, 850, NULL, NULL, 1, 'available', 'قلم أنيمي سانريو مرحبا هريرة بلدي ميلودي كورومي الرمال المتحركة القلم الترتر مع ضوء الكرتون سيليكون القلم رئيس هلام طالب المياه\" هو منتج رائع لمحبي الأنيمي وعشاق شخصيات سانريو. يتميز هذا القلم بتصميم مميز يضم صورة هريرة مرحبا وميلودي كورومي، والتي تعزز الجاذبية البصرية للمنتج. يتميز القلم بحبيبات الرمل المتحركة والترتر التي تتحرك عند تحريك القلم، مما يضفي لمسة ساحرة عليه. بالإضافة إلى ذلك، يحتوي القلم على ضوء كرتوني يضيء عند الاستخدام، مما يجعله مثاليًا للاستخدام في الظروف المظلمة. يتميز القلم أيضًا برأس قلم هلام مريح ومناسب للطلاب ومحبي الكتابة. هذا القلم هو اختيار مثالي لمحبي سانريو وعشاق الأنيمي الذين يرغبون في إضافة لمسة ساحرة إلى مستلزماتهم المدرسية أو المكتبية.', 'WJ17', NULL, NULL, '2023-12-22 21:28:54', '2023-12-22 21:28:54', NULL),
(576, 118, 1, 'ممحاة سحرية 20 قطعة', 'ممحاة سحرية 20 قطعة', 60, 110, NULL, NULL, 1, 'available', 'ممحاة للطلاب بالمدرسة، ممحاة للطلاب بالمدرسة، ممحاة مكتبية مصنوعة من مادة البولي إيثيلين عالية الجودة والمقاومة للخدش. تتميز هذه الممحاة بمادة البولي إيثيلين قابلة للإزالة، مما يجعلها سهلة الاستخدام وفعالة في مسح الرصاص عن الأوراق. تم تصميمها بعناية لتوفير أداء ممتاز ونتائج ممحاة سلسة ونظيفة. تأتي هذه الممحاة بألوان متنوعة وتوفر قطع غيار إضافية، مما يجعلها مثالية للاستخدام في المدارس والمكاتب. بفضل جودتها العالية ومتانتها، فإن هذه الممحاة تدوم لفترة طويلة وتوفر تجربة ممتازة في مسح الأخطاء. احصل على ممحاة عالية الجودة وعملية لتلاميذ المدارس والمكاتب اليوم', 'WJ-43', NULL, NULL, '2023-12-22 21:32:01', '2023-12-22 21:32:01', NULL),
(577, 118, 1, 'قلم بزر النقر 36 قطعة', 'قلم بزر النقر 36 قطعة', 300, 550, NULL, NULL, 1, 'available', 'قلم كروي بلاستيكي قابل للنقر مصنوع بدقة عالية وتصميم فاخر، مثالي لعودة الطلاب إلى المدارس في الولايات المتحدة الأمريكية. يتميز بزر لطيف يمكن النقر عليه بسهولة لإظهار القلم بأكمله. تصميمه المريح يوفر راحة فائقة أثناء الكتابة والرسم. يتميز بحبر بلاستيكي عالي الجودة يسمح بكتابة نقية وسلسة بدقة 0.5 ملمتر. يأتي بعدة ألوان جذابة تلبي تفضيلات الأذواق المختلفة. مصنوع من مواد عالية الجودة وخفيف الوزن، مما يجعله مثاليًا للاستخدام اليومي في المكتب والمدرسة. احصل على هذا القلم الكروي البلاستيكي الفاخر واستمتع بتجربة كتابة استثنائية وأنيقة', '0000', NULL, NULL, '2023-12-22 21:36:40', '2023-12-22 21:36:40', NULL),
(578, 119, 1, 'قلم التوقيع الفاخر 12 قطعة', 'قلم التوقيع الفاخر 12 قطعة', 240, 480, NULL, NULL, 1, 'available', 'قلم محايد كبير الحجم بسعة 0.7 ملم، قلم توقيع رائع يناسب الاستخدام في المكتب والمدرسة. صُنع هذا القلم من مواد عالية الجودة مثل البلاستيك، مما يجعله متينًا ومتينًا للاستخدام اليومي. يتميز بحبر الجل الذي يكتب بسلاسة ودقة، مما يجعل كتابة النصوص والتوقيعات أمرًا سهلاً ومريحًا. بفضل قدرته على التخصيص، يمكن وضع شعار مخصص على القلم، مما يجعله هدية مثالية للعملاء أو الزملاء. يأتي القلم بثلاثة ألوان مختلفة للاختيار من بينها، وهي الأحمر والأزرق والأسود.', 'WJ-17', NULL, NULL, '2023-12-22 21:40:50', '2023-12-22 21:40:50', NULL),
(579, 100, 1, 'جهاز تمرين المعصم المتعدد الاستخدامات', 'جهاز تمرين المعصم المتعدد الاستخدامات', 100, 190, NULL, NULL, 1, 'available', 'جهاز معصم على شكل حرف U هو جهاز تمرين لياقة بدنية يستخدم لتقوية عضلات المعصم والساعد. يتميز بتصميمه الفريد على شكل حرف U، مما يوفر استقرارًا وراحة أثناء التمرين. يساعد هذا الجهاز على تحسين قوة المعصم والساعد وزيادة المرونة والثبات. مصنوع من مواد عالية الجودة بمقابض ABS البلاستيكية وربيع صلب وإيفا رغوة للراحة. يأتي مع عبوة OPP وصندوق لوني للتغليف. مناسب للاستخدام في التمارين الرياضية، سواء في الصالات الرياضية أو في المنزل. تعزز هذه الأداة البسيطة قوة ومرونة المعصم وتعزز الأداء العام في التمارين الرياضية والأنشطة اليومية.', 'tv61', NULL, NULL, '2023-12-22 21:41:01', '2023-12-22 21:41:01', NULL),
(580, 116, 1, 'قوس الدفع', 'قوس الدفع', 150, 280, NULL, NULL, 1, 'available', 'أنبوب فولاذي بشعار مخصص قوس دفع على شكل I تمرين قوة ذراع عضلات الصدر مانع للانزلاق قابل للإزالة على شكل H للياقة البدنية المنزلية - اشترِ قوس دفع لتمارين الصدر وتقوية عضلات الذراعين مصنوعًا من الفولاذ عالي الجودة. يتميز بشعار مخصص وتصميم قوس يساعد على تحسين الاستقامة وتثبيت الحركة. يوفر سطحًا غير قابل للانزلاق للثبات والأمان أثناء التمرين. يمكن إزالة الأذرع على شكل H لتعديل الارتفاع وتلبية احتياجات التمرين المختلفة. منتج مثالي لممارسة التمارين الرياضية في المنزل أو في النوادي الرياضية. احصل على هذا المنتج عالي الجودة الآن وتحسَّن من قوتك ولياقتك البدنية.', 'tv-06', NULL, NULL, '2023-12-22 21:44:15', '2023-12-22 21:44:15', NULL),
(581, 100, 1, 'عجلة التمرين البطنية', 'عجلة التمرين البطنية', 180, 280, NULL, NULL, 1, 'available', 'عجلة التمرين البطنية هي منتج مثالي لتقوية عضلات البطن وتحسين لياقتك البدنية. تم تصميمها خصيصًا لتوفير تجربة تمرين فعالة ومريحة في منزلك. تتكون العجلة من قاعدة مصنوعة من مادة ABS عالية الجودة وأنبوب فولاذي قوي ومقابض رغوية ناعمة للتثبيت المريح. توفر العجلة استقرارًا أثناء التمرين وتعزز التوازن والتحكم. يمكن استخدامها لتمارين البطن المتعددة مثل الإنحناءات الجانبية والتمديدات والانزلاقات. بفضل حجمها المدمج، يمكنك تخزينها بسهولة واستخدامها في أي مكان ترغب فيه. اجعل تمارين البطن جزءًا من روتينك اليومي واحصل على عضلات بطن قوية ومشدودة مع عجلة التمرين البطنية.', 'tv-02', NULL, NULL, '2023-12-22 21:47:05', '2023-12-22 21:47:05', NULL),
(582, 119, 1, 'قلم مكتبي 12 قطعة', 'قلم مكتبي 12 قطعة', 240, 420, NULL, NULL, 1, 'available', 'قلم الهلام اللطيف الملون القابل للسحب، المصنوع من البلاستيك عالي الجودة، يعتبر اختيارًا مثاليًا للمدارس والمكاتب. يأتي هذا القلم بحجم 0.5 ملليمتر، مما يوفر خطًا دقيقًا ومتسقًا أثناء الكتابة. يتميز بحبر الهلام العادي الذي يسهل الكتابة به ويجف بسرعة لتجنب التلطخ. يتوفر بألوان الأسود والأزرق والأحمر، مما يتيح لك الاختيار المناسب لاحتياجاتك وتفضيلاتك. يأتي هذا القلم في عبوة جميلة وسهلة الاستخدام، ويعد خيارًا رائعًا للمدرسة والعمل والهدايا الترويجية. احصل على مجموعة قلم الهلام اللطيف هذه الآن واستمتع بتجربة كتابة ممتعة وملونة.', 'WJ-40', NULL, NULL, '2023-12-22 21:47:31', '2023-12-22 21:51:52', NULL),
(583, 100, 1, 'حبال سحب اللياقة', 'حبال سحب اللياقة', 50, 110, NULL, NULL, 1, 'available', 'حبل سحب التدريب لرياضة بيلاتيس واللياقة البدنية هو منتج ممتاز لتعزيز التمارين وتحسين اللياقة البدنية. يأتي هذا الحبل بمجموعة مخصصة من العصابات المقاومة الوردية المصنوعة من اللاتكس الطبيعي عالي الجودة، والتي تضمن المتانة والمرونة. يمكن استخدامه في التدريبات المنزلية أو في الصالة الرياضية، حيث يساعد على تقوية العضلات، وتحسين المرونة، وزيادة القوة العضلية. يتميز بتصميمه المصغر وحلقة الشريط المطاطية، مما يجعله سهل الاستخدام والتخزين. بالإضافة إلى ذلك، فإنه محمول ويسهل حمله أثناء التنقل. احصل على حبل سحب التدريب هذا الآن واستمتع بتمارين فعالة ومتنوعة لتحقيق أهدافك في اللياقة البدنية.', 'tv67', NULL, NULL, '2023-12-22 21:49:54', '2023-12-22 21:49:54', NULL),
(584, 118, 1, 'قلم فائق الأداء 12 قطعة', 'قلم فائق الأداء 12 قطعة', 180, 300, NULL, NULL, 1, 'available', 'قلم الجل بطرف بلاستيكي، قلم جل قابل للسحب، قلم حبر جل 0.5 مم. احصل على أقلام الجل عالية الجودة والأداء الممتاز للاختبارات والمكاتب من خلال هذا العرض الرائع. يتميز هذا القلم بتصميمه العصري ومواده عالية الجودة، ما يجعله اختيارًا مثاليًا للاستخدام اليومي. يأتي بحبر جل سلس ينساب بسلاسة على الورق ويجف بسرعة، مما يمنحك كتابة نظيفة ومنتظمة. يتميز بطرف بلاستيكي دقيق بحجم 0.5 مم يتيح لك الكتابة بدقة ووضوح. هذا القلم المميز هو رفيقك المثالي للاختبارات والمذكرات والمهام اليومية في المكتب والمدرسة، وهو متوفر بألوان متعددة تلبي تفضيلاتك الشخصية', 'wj-41', NULL, NULL, '2023-12-22 21:51:16', '2023-12-22 21:52:33', NULL),
(585, 100, 1, 'ربطة اللياقة البدنية المقاومة', 'ربطة اللياقة البدنية المقاومة', 150, 280, NULL, NULL, 1, 'available', 'طقم أربطة مقاومة من القماش لتمارين اللياقة البدنية والجنازير، المقدم من شركة Jointop، هو منتج مثالي لتحسين لياقتك البدنية وتقوية عضلاتك. يتكون الطقم من أربعة أشرطة مقاومة مصنوعة من القماش عالي الجودة، مما يوفر متانة ومرونة فائقة أثناء التمارين. تصميمها المرن يتيح لك استخدامها في مجموعة متنوعة من التمارين الرياضية، بما في ذلك تدريبات الأرداف والأفخاذ والساقين. بفضل المقاومة المتغيرة، يمكنك زيادة تحدي التمارين وتعزيز تأثيرها. كما يتميز الطقم بشعار مخصص يمكن تصميمه حسب رغبتك. احصل على هذا الطقم العملي والمتعدد الاستخدامات للتمارين الرياضية وانطلق نحو لياقة أفضل!', 'jf-71', NULL, NULL, '2023-12-22 21:52:58', '2023-12-22 21:52:58', NULL),
(586, 91, 1, 'فرشاة وجه سيليكون', 'فرشاة وجه سيليكون', 120, 200, NULL, NULL, 1, 'available', 'فرشاة تنظيف الوجه بتقنية السيليكون قابلة للشحن ومقاومة للماء. تتميز هذه الفرشاة بتصميم محمول وسهل الاستخدام، مما يجعلها مثالية للعناية الشخصية في المنزل وأثناء السفر. تعمل بتقنية الاهتزاز السونيك، مما يساعد في التنظيف العميق للبشرة وإزالة الأوساخ والزيوت الزائدة. تساعد في تنشيط الدورة الدموية وتحسين مظهر البشرة، كما توفر تدليكًا لطيفًا ومريحًا. تعمل ببطارية قابلة للشحن وتأتي مع كابل USB لسهولة الشحن. تصميمها المدمج والمتين يجعلها مثالية للاستخدام اليومي ومناسبة لجميع أنواع البشرة. استمتعي ببشرة نظيفة ومشرقة مع فرشاة تنظيف الوجه بتقنية السيليكون.', 'jf-32', NULL, NULL, '2023-12-22 21:56:25', '2023-12-22 21:56:25', NULL),
(587, 118, 1, 'اقلام ملونة', 'اقلام ملونة', 40, 80, NULL, NULL, 1, 'available', 'احصل على قلم جل بلاستيكي فائق الأداء الذي يلبي احتياجاتك المكتبية والتعليمية. يتميز هذا القلم بجسمه الخشبي ذو الألوان الزاهية المشابهة لألوان الماكارون، مما يجعله مرحاً وجميلاً. يحتوي القلم على ممحاة مدمجة لتسهيل عملية المحو وتصحيح الأخطاء بسهولة. يتميز أيضًا برصاصة قوية من الصلب الناعم تعطي خطوطًا واضحة ومتسقة أثناء الكتابة. يعد هذا القلم مثاليًا للاستخدام في المدارس والمكاتب، ويمكن شراؤه بالجملة لاحتياجات البيع بالتجزئة. احصل على قلم جل بلاستيكي فائق الأداء اليوم واستمتع بتجربة كتابة مميزة ومريحة.', 'WJ55', NULL, NULL, '2023-12-22 21:57:01', '2023-12-22 21:57:01', NULL),
(588, 85, 1, 'جهاز فرد الذقن الكهربائي المحمول للرجال', 'جهاز فرد الذقن الكهربائي المحمول للرجال', 150, 280, NULL, NULL, 1, 'available', 'جهاز فرد الذقن الكهربائي المحمول للرجال هو أداة فريدة وعملية لتصفيف اللحية. يتميز هذا الجهاز بتقنية PTC السيراميك لتسخين سريع وقابلية للتعديل لدرجة حرارة تصل إلى 360 درجة. يأتي الجهاز مع سلك طاقة مضاد للتلف، مما يوفر استخدامًا آمنًا وموثوقًا. بفضل تصميمه المحمول، يمكنك حمله بسهولة أثناء السفر. يتميز هذا الجهاز بوظيفة جافة ورطبة مزدوجة، مما يتيح لك استخدامه على اللحية الجافة أو المبللة. يأتي الجهاز أيضًا مع مؤشر LED عالي الجودة للحرارة وتصميم مضاد للحروق، مما يجعله هدية مثالية للرجال في أي مناسبة. استمتع بتجربة تصفيف اللحية السلسة والمتميزة مع هذا الجهاز المتعدد الوظائف.', '00000', NULL, NULL, '2023-12-22 21:59:15', '2023-12-22 21:59:15', NULL),
(589, 118, 1, 'مجموعة الإبداع المدرسية', 'مجموعة الإبداع المدرسية', 140, 250, NULL, NULL, 1, 'available', 'قدمنا لكم مجموعة مستلزمات مدرسية من الصين بالجملة، تتضمن مجموعة أدوات مكتبية للطلاب المدرسية والمراهقين. هذه المجموعة تحتوي على مجموعة متنوعة من المستلزمات المدرسية الأساسية التي يحتاجها الطلاب في مدارسهم وحياتهم اليومية. تتضمن المجموعة أقلام الرصاص، وأقلام الحبر الجل، وممحاة، ومبراة، وقلم تحديد النص، وأقلام الألوان المائية، وغيرها من الأدوات المدرسية الضرورية. جميع المنتجات مصنوعة من مواد عالية الجودة وآمنة للاستخدام، وتأتي في صندوق ألوان جذاب. هذه المجموعة المتنوعة والعملية هي الخيار المثالي للطلاب والمراهقين لتلبية احتياجاتهم المدرسية في المدرسة وخارجها', 'yd-10', NULL, NULL, '2023-12-22 22:01:46', '2023-12-22 22:01:46', NULL),
(590, 74, 1, 'صندوق مجوهرات \"جوهرة الأناقة\"', 'صندوق مجوهرات \"جوهرة الأناقة\"', 250, 420, NULL, NULL, 1, 'available', 'صندوق عرض مجوهرات تصميم أزياء هو منتج عالي الجودة يهدف إلى عرض وتنظيم المجوهرات بشكل أنيق وجميل. يتميز بتصميم فريد وعصري يناسب أي ديكور منزلي أو متجر مجوهرات. يتضمن الصندوق أقسامًا وأدراجًا متعددة لتخزين الأقراط والقلادات والأساور والخواتم والمجوهرات الأخرى. يتميز بمواد عالية الجودة وتشطيب متقن لضمان الحفاظ على المجوهرات آمنة ومحمية. بفضل تصميمه المدمج والقابل للطي، يمكن حمله بسهولة أثناء السفر. إن صندوق عرض مجوهرات تصميم أزياء هو الخيار المثالي لأولئك الذين يرغبون في الاحتفاظ بمجوهراتهم بشكل آمن وعرضها بأناقة.', 'jf-74', NULL, NULL, '2023-12-22 22:02:41', '2023-12-22 22:02:41', NULL),
(591, 118, 1, 'مجموعة أدوات سبايدرمان المدرسية', 'مجموعة أدوات سبايدرمان المدرسية', 140, 260, NULL, NULL, 1, 'available', 'مجموعة أدوات مكتبية سبايدرمان للأطفال مع صندوق أقلام رصاص للأولاد هي مجموعة رائعة تناسب احتياجات الأطفال في المدرسة والمنزل. تتضمن هذه المجموعة مستلزمات مكتبية ومدرسية مميزة تحمل صور شخصية سبايدرمان، ما يجعلها جذابة للأطفال ويزيد من حماسهم في الدراسة. تشمل المجموعة أقلام رصاص، وممحاة لطيفة، ومستلزمات مكتبية أخرى. يأتي الصندوق بتصميم ملون ومبهج، مما يجعله مناسبًا لتخزين وحمل الأدوات بسهولة. هذه المجموعة تعتبر هدية رائعة للأطفال الذين يعشقون شخصية سبايدرمان وتعزز حبهم للتعلم والإبداع', 'YD-15', NULL, NULL, '2023-12-22 22:06:05', '2023-12-22 22:06:05', NULL),
(592, 118, 1, 'مجموعة تلوين الفن المبتدئين المدهشة', 'مجموعة تلوين الفن المبتدئين المدهشة', 1, 270, NULL, NULL, 1, 'available', 'مجموعة تلوين الفن ديلوكس للأطفال عبر الإبداع الفني هي مجموعة مثالية للأطفال المبتدئين في الرسم والتلوين. تحتوي المجموعة على 48 قطعة، وتشمل أدوات تلوين متنوعة تساعد الأطفال على التعبير عن إبداعهم الفني. تتميز المجموعة بألوان زاهية ومشرقة، وتصميم سداسي يجعلها سهلة الاستخدام ومريحة للأطفال. كما أنها مصنوعة من مواد صديقة للبيئة. تأتي المجموعة في حافظة كرتونية تحافظ على تنظيم الأدوات وتسهل حملها وتخزينها. إن مجموعة تلوين الفن ديلوكس للأطفال هي هدية مثالية لتطوير مهارات الرسم والإبداع الفني للأطفال', '0000', NULL, NULL, '2023-12-22 22:08:33', '2023-12-22 22:08:33', NULL),
(593, 94, 1, 'قلم الأناقة الكهربائي المصغر لتزيين الأظافر', 'قلم الأناقة الكهربائي المصغر لتزيين الأظافر', 100, 200, NULL, NULL, 1, 'available', 'قلم تزيين الأظافر الكهربائي المصغر القابل لإعادة الشحن USB هو أداة احترافية للعناية بالأظافر. يتميز هذا القلم بحجمه المصغر وسهولة حمله، مما يجعله مثاليًا للاستخدام المحمول. يأتي مع مجموعة تلميع الأظافر الاحترافية التي توفر لك الأدوات اللازمة لتحقيق تألق أظافرك. يتضمن القلم ميزات مثل تشغيل USB قابل لإعادة الشحن، وخمسة وظائف مختلفة في جهاز واحد، بما في ذلك الحفر والتلميع والنقش. تصميمه المحكم وشفراته المصنوعة من الفولاذ المقاوم للصدأ يضمنان الدقة والمتانة. استمتعي بتجربة تجميل الأظافر المحترفة في المنزل مع هذا القلم المصغر العملي والعصري.', 'yn86', NULL, NULL, '2023-12-22 22:09:46', '2023-12-22 22:09:46', NULL),
(594, 118, 1, 'مجموعة الفن دوامة المبتدئين المدهشة', 'مجموعة الفن دوامة المبتدئين المدهشة', 80, 130, NULL, NULL, 1, 'available', 'تقدم لك مجموعة الفن دوامة المدهشة قاعدة رسم Spirograph اللعبة المصنوعة من البلاستيك، والتي ستأخذ خيالك إلى مستوى جديد من الإبداع. تتضمن هذه المجموعة قاعدة رسم متينة وملحقات متنوعة تسمح لك بإنشاء أشكال رائعة ومعقدة بسهولة. بفضل التصميم الدقيق والدوائر المختلفة المتاحة، يمكنك إنشاء أعمال فنية مدهشة وتصاميم فريدة من نوعها. ستستمتع بتجربة الرسم الإبداعية وستطور مهاراتك الفنية من خلال هذه اللعبة الممتعة. اجعل وقتك الحر مليئًا بالإبداع واكتشف موهبتك في الرسم مع مجموعة الفن دوامة المدهشة', '8861', NULL, NULL, '2023-12-22 22:17:50', '2023-12-22 22:17:50', NULL),
(595, 118, 1, 'مجموعة الكرتون الساحرة', 'مجموعة الكرتون الساحرة', 400, 650, NULL, NULL, 1, 'available', 'قم بشراء مجموعة قلم رصاص القرطاسية بتصميم غلاية الكرتون الرائعة لتلاميذ المدارس الابتدائية والمستلزمات المدرسية للأطفال والطلاب. تتكون هذه المجموعة من صندوق قلم رصاص متعدد الألوان ومصنوع من مواد عالية الجودة. توفر هذه المجموعة مجموعة متنوعة من الأقلام الرصاص والأقلام الملونة وأقلام الرصاص الجاف وممحاة القلم. تعد هذه المجموعة اختيارًا مثاليًا كهدية ترويجية للأعمال التجارية أو كمجموعة مدرسية للطلاب. بفضل جودتها العالية وتصميمها الجذاب، فإن هذه المجموعة تلبي احتياجاتك في القرطاسية وتضيف لمسة مرحة وعملية إلى مستلزماتك المدرسية.', 'YD14', NULL, NULL, '2023-12-22 22:21:31', '2023-12-22 22:21:31', NULL),
(596, 119, 1, 'حامل القلم المتعدد الاستخدامات لسطح المكتب', 'حامل القلم المتعدد الاستخدامات لسطح المكتب', 25, 50, NULL, NULL, 1, 'available', 'الطاولة المخصصة متعددة الأغراض وحامل القلم لسطح المكتب هي منتج عملي وعصري يساعدك في تنظيم مكتبك بشكل فعال. تتميز بتصميمها العصري والأنيق، وتوفر مساحة وفيرة لتخزين أدواتك المكتبية المختلفة. يمكنك استخدامها لتخزين الأقلام وأدوات الكتابة، وكذلك الكوب القهوة لتبقى منتعشًا طوال اليوم. تتميز الطاولة بشبكة معدنية سوداء توفر استقرارًا ومتانة عالية. بفضل حجمها المناسب، يمكنك وضعها على سطح المكتب أو الطاولة الجانبية بسهولة. إنها مثالية للاستخدام في المنزل أو المكتب، وتعزز منظمتك وتجعلها تبدو أنيقة ومرتبة. احصل على هذا المنتج العملي اليوم واستمتع بمكتب منظم ومرتب', 'zw-444', NULL, NULL, '2023-12-22 23:10:05', '2023-12-22 23:10:05', NULL),
(597, 119, 1, 'حامل القلم الرصاص', 'حامل القلم الرصاص', 25, 55, NULL, NULL, 1, 'available', 'حامل القلم الرصاص المعدني بتصميم شبكة جولة العرف الأسود هو منتج عملي وأنيق يضيف لمسة جمالية إلى سطح المكتب الخاص بك. يتميز هذا الحامل ببنية معدنية قوية وشبكة جولة متينة تسمح بتنظيم الأقلام والأدوات الكتابية بشكل مناسب. يمكن استخدامه لتخزين الأقلام الرصاص والأقلام الجافة وأقلام الحبر والممحاة وغيرها من الأدوات الكتابية. يعتبر هذا الحامل الأسود المعدني مثاليًا للمكاتب المنزلية ومكاتب العمل والمدارس والجامعات. بفضل تصميمه الأنيق والعملي، يعد حامل القلم الرصاص المعدني بتصميم شبكة جولة العرف الأسود اختيارًا مثاليًا لتنظيم وتزيين مساحة العمل الخاصة بك.', 'AA7A', NULL, NULL, '2023-12-22 23:12:57', '2023-12-22 23:12:57', NULL),
(598, 118, 1, 'مجموعة الفن الخلاقة للأطفال بألوان مائية', 'مجموعة الفن الخلاقة للأطفال بألوان مائية', 450, 700, NULL, NULL, 1, 'available', 'طقم أدوات مكتبية هدية تعلم رسم الأطفال بألوان مائية هو منتج مميز يهدف إلى تنمية مهارات الرسم والإبداع لدى الأطفال. يتضمن الطقم مجموعة متنوعة من القلم المائي وفرشاة الرسم والطباشير الملون، مما يمنح الأطفال فرصة لاستكشاف الفن والتعبير عن أفكارهم بطريقة مبدعة.\r\n\r\nتتميز هذه الأدوات بجودتها العالية وسهولة الاستخدام، مما يجعلها مناسبة للأطفال في جميع المستويات الفنية. كما يأتي الطقم في حجم ملائم ومريح للاستخدام، مع إمكانية تخصيص الشعار حسب الطلب.\r\n\r\nسواء كانت كهدية لأطفالك، أو للاستخدام في المدارس والمراكز التعليمية، فإن طقم أدوات مكتبية هدية تعلم رسم الأطفال بألوان مائية سيكون اختيارًا مثاليًا لتعزيز الإبداع والتعلم الفني للأطفال', 'WJ24', NULL, NULL, '2023-12-22 23:15:44', '2023-12-22 23:15:44', NULL),
(599, 118, 1, 'مجموعة الفنان الصغير للألوان الزيتية', 'مجموعة الفنان الصغير للألوان الزيتية', 220, 400, NULL, NULL, 1, 'available', 'مجموعة ألوان زيتية للأطفال هي منتج رائع يهدف إلى تنمية مهارات الرسم والإبداع لدى الأطفال. تحتوي هذه المجموعة على 150 قلم للرسم بألوان زيتية، مما يوفر للأطفال تجربة فنية ممتعة وملهمة. تتميز هذه الألوان بجودتها العالية وتركيبتها الخاصة التي تجعلها سهلة الاستخدام وتوفر الألوان الزاهية والحية. تعد هذه المجموعة مناسبة للأطفال الذين يهوون الرسم والتعبير الفني، سواء في المنزل أو في المدرسة. اجعلي طفلك يستكشف عالم الفن ويطور مهاراته الإبداعية باستخدام مجموعة ألوان زيتية للأطفال المميزة هذه', 'WJ23', NULL, NULL, '2023-12-22 23:18:52', '2023-12-22 23:18:52', NULL),
(600, 118, 1, 'مجموعة إبداعية الأطفال للمدرسة', 'مجموعة إبداعية الأطفال للمدرسة', 200, 350, NULL, NULL, 1, 'available', 'مجموعة أدوات مكتبية مدرسية إبداعية للأطفال تتضمن براية أقلام رصاص. تعد هذه المجموعة مثالية للأطفال الذين يبدأون رحلتهم التعليمية. تحتوي المجموعة على أدوات مكتبية متنوعة ومفيدة، مثل أقلام رصاص وقلم رصاص وبراية لتحافظ على حدة الأقلام. تصميمها المبتكر والألوان الزاهية يجذبان انتباه الأطفال ويشجعان على الاستمتاع بالكتابة والرسم. بفضل جودة المواد المستخدمة في صناعة هذه المجموعة، فإنها تدوم طويلاً وتقدم أداءً ممتازًا. اجعل تجربة التعلم ممتعة ومثيرة للأطفال مع هذه المجموعة المدرسية الإبداعية الرائعة.', 'YD09', NULL, NULL, '2023-12-22 23:21:29', '2023-12-22 23:21:29', NULL),
(601, 118, 1, 'مجموعة قرطاسية Kawaii الفنية للطلاب', 'مجموعة قرطاسية Kawaii الفنية للطلاب', 150, 250, NULL, NULL, 1, 'available', 'تعتبر مجموعة القرطاسية للطلاب Kawaii الفنية من الجملة منتجًا رائعًا ولطيفًا للغاية للأطفال في المدارس. تحتوي المجموعة على مقلمة وأطقم أدوات كتابة وقرطاسية متنوعة. تتميز هذه المجموعة بتصميمها المبتكر وجودتها العالية، حيث تعتبر موادها صديقة للبيئة. تتنوع الألوان والنقوش المتاحة في المجموعة، مما يتيح للأطفال تجربة ممتعة وإبداعية أثناء الكتابة والرسم. تعد هذه المجموعة هدية مثالية للأطفال، سواء كانوا في المدرسة أو في المنزل. استمتع بالجودة والأناقة مع مجموعة القرطاسية للطلاب Kawaii الفنية الجميلة.', '873', NULL, NULL, '2023-12-22 23:24:33', '2023-12-22 23:24:33', NULL),
(602, 118, 1, 'شريط تصحيح القرطاسية البلاستيكي اللطيف للأطفال', 'شريط تصحيح القرطاسية البلاستيكي اللطيف للأطفال', 50, 90, NULL, NULL, 1, 'available', 'استمتع بشريط التصحيح البلاستيكي اللطيف والعملي للأطفال! يأتي هذا الشريط التصحيح بتصميم جذاب وألوان مشرقة تجعله مثاليًا للاستخدام في المدارس والمكاتب. يتميز بقوام رقيق يسهل استخدامه وتصحيح الأخطاء بدقة وسرعة.\r\n\r\nمصنوع من مادة البولي إيثيلين تيريفثاليت عالية الجودة، مما يجعله متينًا وموثوقًا. يجف بسرعة لذا لن تضطر للانتظار طويلاً لمواصلة الكتابة بعد التصحيح. يأتي بتصميم مريح يسمح للأطفال بالتعامل معه بسهولة.\r\n\r\nاحرص على تجربة هذا الشريط التصحيح البلاستيكي اللطيف والعملي، واجعل عملية التصحيح ممتعة وسهلة للأطفال', '868', NULL, NULL, '2023-12-22 23:26:35', '2023-12-22 23:26:35', NULL),
(603, 118, 1, 'قلم البخاخ الفني الملون للأطفال', 'قلم البخاخ الفني الملون للأطفال', 150, 270, NULL, NULL, 1, 'available', 'هدية ترويجية الأكثر مبيعًا للأطفال - اللوحة الملونة البخاخة الإستنسل فن ضربة القلم للأطفال. هذا المنتج هو هدية ترويجية رائعة للأطفال، يمكنهم من خلالها الاستمتاع بتجربة فنية ممتعة. تحتوي البخاخة الإستنسل على أقلام ملونة يمكن استخدامها لرسم الصور والتصاميم المبتكرة. يمكن للأطفال استخدامها لإنشاء لوحات فنية رائعة وتطوير مهاراتهم الإبداعية. تتضمن الحزمة 36 قطعة من البخاخة الإستنسل بألوان متنوعة. هذه الهدية المبتكرة ستساعد الأطفال على التعبير عن أنفسهم والاستمتاع بوقتهم بطريقة إبداعية وممتعة. احصل على هذه الهدية الرائعة للأطفال وشجع قدراتهم الفنية', 'BB62', NULL, NULL, '2023-12-22 23:30:00', '2023-12-22 23:30:00', NULL),
(604, 123, 1, 'مجموعة الغداء المبتكرة للأطفال', 'مجموعة الغداء المبتكرة للأطفال', 180, 270, NULL, NULL, 1, 'available', 'تتميز هذه المجموعة المثالية للأطفال بثلاثة أقسام بلاستيكية من الكرتون النمر. تتضمن المجموعة أيضًا بدلة مع زجاجة ماء وصندوق بينتو مع كوب ماء. تعد هذه الحاوية المثالية لوجبات الغداء للأطفال، حيث توفر ثلاثة أقسام لفصل الأطعمة المختلفة والحفاظ على نكهاتها ونضارتها. كما تأتي مع زجاجة ماء وكوب ماء لتلبية احتياجات السوائل للأطفال أثناء التنقل. يمكن استخدام صندوق بينتو والزجاجة والكوب في المدرسة أو الرحلات أو النزهات. تتميز المجموعة بجودة عالية ومواد بلاستيكية آمنة للاستخدام اليومي للأطفال.', 'CL48', NULL, NULL, '2023-12-22 23:36:44', '2023-12-24 04:42:52', NULL),
(605, 123, 1, 'صندوق الغداء المحمول', 'صندوق الغداء المحمول', 350, 550, NULL, NULL, 1, 'available', 'صندوق الغداء المحمول عالي الجودة من Homio Tedemei هو الحل المثالي للطلاب والأطفال. مصنوع من الفولاذ المقاوم للصدأ عيار 304 عالي الجودة، مما يضمن متانة وصحة الطعام. يتميز بتصميم مانع للتسرب وخالٍ من مادة BPA، ما يحافظ على جودة الطعام ويمنع التسرب. يتمتع بقدرة تخزين تصل إلى 1000 مل، مما يتيح حمل مجموعة متنوعة من الوجبات. كما يحتوي على غطاء للإغلاق الآمن والمحكم، مما يحفظ حرارة الطعام لفترة طويلة ويحافظ على نضارته. يتوفر بعدة ألوان جذابة، مما يجعله مثاليًا للاستخدام اليومي وأثناء التنقل. صندوق الغداء المحمول مناسب للاستخدام في المدرسة أو الرحلات أو العمل', 'CL-50', NULL, NULL, '2023-12-22 23:42:32', '2023-12-22 23:42:32', NULL),
(606, 123, 1, 'صندوق الغداء', 'صندوق الغداء', 150, 250, NULL, NULL, 1, 'available', 'صندوق الغداء هو رفيق ممتاز لكل من يحبون تناول وجباتهم في الخارج. يتميز بتصميمه المدمج والعملي، مما يسهل حمله في حقيبتك أو حقيبة الظهر. يوفر صندوق الغداء مساحة وفيرة لتخزين الأطعمة المتنوعة، سواء كانت وجبة غداء أو وجبات خفيفة. يتميز بالمواد عالية الجودة والآمنة للاستخدام الغذائي، ويحافظ على طعامك طازجًا ومحميًا من التسرب والتلوث. بفضل صندوق الغداء، يمكنك الاستمتاع بوجبة لذيذة وصحية في أي مكان تذهب إليه. احصل على صندوق الغداء اليوم وتمتع بتجربة تناول الطعام السهلة والمريحة.', 'JH-168', NULL, NULL, '2023-12-22 23:45:25', '2023-12-22 23:45:25', NULL),
(607, 123, 1, 'صندوق لحفظ الطعام', 'صندوق لحفظ الطعام', 250, 450, NULL, NULL, 1, 'available', 'صندوق الغداء هو رفيق ممتاز لكل من يحبون تناول وجباتهم في الخارج. يتميز بتصميمه المدمج والعملي، مما يسهل حمله في حقيبتك أو حقيبة الظهر. يوفر صندوق الغداء مساحة وفيرة لتخزين الأطعمة المتنوعة، سواء كانت وجبة غداء أو وجبات خفيفة. يتميز بالمواد عالية الجودة والآمنة للاستخدام الغذائي، ويحافظ على طعامك طازجًا ومحميًا من التسرب والتلوث. بفضل صندوق الغداء، يمكنك الاستمتاع بوجبة لذيذة وصحية في أي مكان تذهب إليه. احصل على صندوق الغداء اليوم وتمتع بتجربة تناول الطعام السهلة والمريحة', 'JH767', NULL, NULL, '2023-12-22 23:48:47', '2023-12-22 23:48:47', NULL),
(608, 73, 1, 'بخاخ صغير معطر الجو', 'بخاخ صغير معطر الجو', 120, 230, NULL, NULL, 1, 'available', 'بخاخ نانو محمول محمول باليد، مزود بمرآة علوية، بخاخ وجه قابل لإعادة الشحن عبر منفذ USB. يعد بخاخ نانو المحمول هذا حلاً مبتكرًا للحفاظ على بشرة الوجه منتعشة ومرطبة في أي وقت وفي أي مكان. يتميز بتصميمه المحمول الصغير الذي يمكن حمله بسهولة في حقيبة اليد أو الجيب. كما يأتي مع مرآة علوية مدمجة لتسهيل عملية الرش. يعمل البخاخ بتقنية النانو لتحويل الماء إلى رذاذ ناعم يتغلغل بعمق في المسام ويوفر ترطيبًا فوريًا ومنعشًا للبشرة. بفضل قابلية الشحن عبر منفذ USB، يمكنك إعادة شحنه بسهولة واستخدامه لفترات طويلة. احصل على بشرة مشعة ومرطبة مع بخاخ نانو المحمول هذا.', 'jf-67', NULL, NULL, '2023-12-22 23:50:07', '2023-12-22 23:50:07', NULL),
(609, 123, 1, 'مجموعة بنتو البلاستيكية', 'مجموعة بنتو البلاستيكية', 120, 190, NULL, NULL, 1, 'available', 'أطقم البلاستيكية مع زجاجة مختومة للمياه هي حلاً مثالياً لتخزين ونقل الطعام والمشروبات بشكل آمن ومريح. تتكون هذه الأطقم من علب بنتو مع علبة زجاجية للماء، مما يوفر سعة تخزين كافية لتناول وجبة كاملة. تتميز بتصميم مربع الشكل ومصنوعة من مادة البولي بروبلين عالية الجودة، مما يجعلها قابلة للاستخدام في الميكروويف وآمنة للغذاء. كما تحتوي على قفل سهل الاستخدام للحفاظ على الطعام طازجًا ومحمولًا بشكل آمن. تعد هذه الأطقم مثالية للاستخدام في المدارس أو الرحلات أو النشاطات في الهواء الطلق. تأتي بألوان مشرقة ومتنوعة لإضفاء لمسة مرحة على وجباتك اليومية.', 'OL47', NULL, NULL, '2023-12-22 23:51:10', '2023-12-22 23:51:10', NULL),
(610, 94, 1, '9قطع للعناية ب الأظافر', '9قطع للعناية ب الأظافر', 45, 90, NULL, NULL, 1, 'available', 'مقصات جمالية متعددة الاستخدامات\r\n\r\nاحصل على هذه المقصات الجمالية متعددة الاستخدامات والتي تعد أداة أساسية لروتين العناية بالجمال الخاص بك. تتميز بتصميمها العصري وجودتها العالية، فهي مصنوعة من الفولاذ المقاوم للصدأ لتوفير دقة القطع والمتانة الطويلة الأمد.\r\n\r\nتتضمن المقصات المتعددة الاستخدامات مقص أظافر للحصول على أظافر نظيفة ومرتبة، وكليبرز والقواطع لتقليم الأظافر بسهولة وأمان، والملفات لتنعيم وتشكيل الأظافر، ودافعات لدفع الجلد الزائد، ومكانس ومنظفات لإزالة الأتربة والأوساخ. تمنحك هذه المقصات تجربة مانيكير وباديكير محترفة في منزلك.\r\n\r\nاستمتعي براحة البال والأداء الممتاز مع هذه المقصات الجمالية متعددة الاستخدامات واحصل على أظافر جميلة ومظهر مميز.', 'zh-12', NULL, NULL, '2023-12-22 23:52:16', '2023-12-22 23:52:16', NULL),
(611, 123, 1, 'مجموعة وجبة مثالية', 'مجموعة وجبة مثالية', 150, 250, NULL, NULL, 1, 'available', 'حاوية بلاستيكية للطعام وزجاجة مياه من Wishome العلامة التجارية، تعتبر حلاً آمنًا وعمليًا لتخزين ونقل وجبات الطعام والمشروبات. تأتي هذه المجموعة مع علبة طعام مستطيلة وزجاجة مياه، حيث يمكن استخدامها لتخزين مجموعة متنوعة من الأطعمة والوجبات. تصميمها الوظيفي يسمح بحملها بسهولة وراحة، وتعتبر مثالية للاستخدام في المدرسة أو العمل أو الرحلات. تتميز بمواد بلاستيكية عالية الجودة ومستدامة، مما يضمن متانتها وقوتها في الاستخدام اليومي. بفضل تصميمها المضغوط والألوان الزاهية، فإنها تضفي لمسة من الأناقة على وجباتك وتجعلها أكثر إشراقًا. استمتع بوجبات لذيذة في أي مكان مع حاوية الطعام وزجاجة المياه من Wishome.', 'LC46', NULL, NULL, '2023-12-22 23:54:12', '2023-12-22 23:54:12', NULL),
(612, 85, 1, 'ماكينة \"روتاتشيك\" لفرد الشعر الكهربائية الدوّارة', 'ماكينة \"روتاتشيك\" لفرد الشعر الكهربائية الدوّارة', 400, 650, NULL, NULL, 1, 'available', 'ماكينة كهربية دوّارة لفرد الشعر هي منتج مبتكر يمنحك تجربة فرد الشعر المثالية في راحة منزلك. تتميز بتقنية الدوران الأوتوماتيكي بزاوية 360 درجة، مما يسمح لك بإنشاء تموجات وتجعيدات رائعة بسهولة وسرعة. تحتوي على سخان PTC عالي الجودة وعرض درجة حرارة LCD لضبط درجة الحرارة المناسبة لشعرك. تصميمها الأنيق والمريح يسهل الاستخدام، ويتيح لك الحصول على تسريحات شعر متنوعة ومثالية بدون عناء. تعتبر هذه الماكينة الكهربية الدوّارة مثالية للاستخدام المنزلي، وتأتي بضمان لمدة عام، مما يضمن جودة وأداء متميزين. احصل على شعر رائع وأنيق مع هذا المنتج المذهل.', 'yn64', NULL, NULL, '2023-12-22 23:54:42', '2023-12-22 23:54:42', NULL),
(613, 91, 1, 'بخاخ الوجه المحمول', 'بخاخ الوجه المحمول', 80, 150, NULL, NULL, 1, 'available', 'جهاز تجديد المياه متر شحن نانو البخاخ المحمولة الباردة رذاذ جهاز بخار الوجه هو جهاز مذهل يهدف إلى ترطيب البشرة وتجديدها. يعمل الجهاز بتقنية الرش النانوية الحديثة، حيث ينشر رذاذًا باردًا يحتوي على جزيئات صغيرة جدًا للمياه، مما يساعد على امتصاصها بشكل أفضل من قبل البشرة. يمكن استخدامه للعناية بالبشرة في المنزل أو أثناء التنقل، حيث يعمل بالبطارية ويدعم الشحن عبر منفذ USB. بالإضافة إلى ذلك، يتميز الجهاز بحجمه المحمول وخفة وزنه، مما يجعله سهل الحمل والاستخدام في أي وقت وفي أي مكان. استمتع ببشرة متجددة ومشرقة مع جهاز تجديد المياه متر شحن نانو البخاخ المحمولة الباردة.', 'jf17', NULL, NULL, '2023-12-22 23:57:04', '2023-12-22 23:57:04', NULL),
(614, 123, 1, 'صندوق الغداء الرائع', 'صندوق الغداء الرائع', 160, 240, NULL, NULL, 1, 'available', 'صندوق الغداء المتعدد الوظائف للأطفال هو منتج رائع وعملي يتميز بتصميمه الجذاب ووظائفه المتعددة. مصنوع من مواد قابلة لإعادة التدوير، ما يجعله خيارًا مثاليًا للأهل الذين يهتمون بالبيئة. يتميز بعدة أقسام وطبقات لتنظيم الوجبات المختلفة، ويمكن استخدامه للأطفال في المدرسة أو في الرحلات. يمكن تسخينه في الميكروويف بأمان، مما يوفر راحة أكبر في تناول الطعام. بفضل حجمه المناسب، يوفر سعة تخزين كبيرة للوجبات والمشروبات. كما يأتي بتصميم ملون وجذاب يجعل وجبات الأطفال ممتعة ولذيذة. هذا الصندوق المتعدد الوظائف هو رفيق مثالي للأطفال في جميع المناسبات', 'CL96', NULL, NULL, '2023-12-23 00:02:25', '2023-12-23 00:02:25', NULL),
(615, 85, 1, 'عصا تجعيد الشعر المحمولة برو', 'عصا تجعيد الشعر المحمولة برو', 400, 650, NULL, NULL, 1, 'available', 'عصا تجعيد الشعر المحمولة برو تجعيد الشعر التلقائي اللاسلكي بكرة الشعر الغزل هي أداة فعالة لتسريح وتجعيد الشعر بسهولة وسرعة. تتميز هذه العصا بتصميم محمول ولاسلكي، مما يسمح لك باستخدامها في أي مكان وفي أي وقت بدون تشابك الأسلاك. تأتي بكرة الشعر بتصميم تلقائي يجعل عملية التجعيد أسرع وأكثر سهولة، مع إمكانية التحكم في درجة الحرارة المناسبة لنوع شعرك. تعمل بتقنية PTC لتوزيع الحرارة بشكل متساوٍ وسريع، مع شاشة LCD تعرض درجة الحرارة. تعتبر عصا تجعيد الشعر هذه خيارًا مثاليًا للحصول على تسريحة شعر مثالية وجميلة في أي وقت وفي أي مكان.', '00000', NULL, NULL, '2023-12-23 00:02:55', '2023-12-23 00:02:55', NULL),
(616, 123, 1, 'صندوق الغداء المتعدد الوظائف الرائع', 'صندوق الغداء المتعدد الوظائف الرائع', 220, 320, NULL, NULL, 1, 'available', 'صندوق الغداء المتعدد الوظائف الرائع هو منتج مبتكر يلبي احتياجات أطفالك بشكل مثالي. يتميز بتصميمه العملي والجذاب، ويأتي مع ملعقة وشوكة وكوب كرتون، مما يوفر حلاً شاملاً لتناول وتخزين وشرب الطعام. يتميز بسعة تصل إلى 1.1 لتر للصندوق و0.5 لتر للزجاجة، مما يسمح بوضع مجموعة متنوعة من الوجبات الصحية والمشروبات. صندوق الغداء مصنوع من مواد عالية الجودة وآمنة للاستخدام في الميكروويف، مما يجعله مثاليًا للاستخدام اليومي. يتوفر بألوان مشرقة مثل الأحمر والأخضر والأزرق لإضفاء لمسة مرحة على وجبات طفلك. يعد صندوق الغداء المتعدد الوظائف الرائع خيارًا مثاليًا لتلبية احتياجات الطعام لأطفالك بطريقة سهلة وممتعة', 'CL97', NULL, NULL, '2023-12-23 00:05:58', '2023-12-23 00:05:58', NULL),
(617, 85, 1, 'جهاز إزالة الشعر', 'جهاز إزالة الشعر', 320, 480, NULL, NULL, 1, 'available', 'جهاز إزالة شعر نسائي محمول بدون ألم من المورد Hemei هو ماكينة حلاقة للسيدات بيضاء صغيرة ومقاومة للماء. يعتبر هذا الجهاز مثاليًا لإزالة الشعر بسهولة وفعالية في المنزل أو أثناء التنقل. يتميز بتصميم محمول ومريح يسمح بالاستخدام السهل والدقيق. بفضل التقنية المتقدمة، يعمل الجهاز على إزالة الشعر بدقة وبشكل دائم. كما أنه يتميز بوجود وظيفة إزالة الشعر بدون ألم، مما يجعل تجربة الاستخدام أكثر راحة وسلامة. بفضل مقاومته للماء، يمكن استخدامه أثناء الاستحمام أو تنظيفه بسهولة. إن جهاز إزالة شعر نسائي محمول بدون ألم هو الخيار المثالي لتحقيق نتائج فعالة ومريحة في إزالة الشعر.', 'yn-67', NULL, NULL, '2023-12-23 00:07:09', '2023-12-23 00:07:09', NULL),
(618, 124, 1, 'زجاجة مياه', 'زجاجة مياه', 150, 260, NULL, NULL, 1, 'available', 'زجاجات المياه البلاستيكية للرياضة بتصميم صيفي مخصص بسعة 700 مللي و 1000 مللي. تتميز هذه الزجاجات بشعار جذاب وأنيق، مما يجعلها مناسبة للاستخدام في الأنشطة الرياضية واللياقة البدنية في الهواء الطلق. تصميمها البسيط والعملي يجعلها سهلة الحمل والاستخدام. مصنوعة من مادة البلاستيك عالية الجودة (PP)، مما يجعلها متينة وخفيفة الوزن في الوقت نفسه. تتميز بأداء عزل حراري ممتاز وتناسب الاستخدام في الرحلات التخييم والأنشطة الرياضية في الهواء الطلق. تتوفر بألوان متعددة مثل الأسود والأخضر والوردي. احصل على هذه الزجاجات المائية المميزة والعملية للاستمتاع بالرياضة والنشاطات الخارجية بأناقة وراحة', 'ZN51', NULL, NULL, '2023-12-23 00:09:11', '2023-12-24 05:28:17', NULL),
(619, 124, 1, 'زجاجة مياه مزدوجة', 'زجاجة مياه مزدوجة', 35, 530, NULL, NULL, 1, 'available', 'زجاجة ماء شرب مزدوجة خالية من التريتان هي منتج عالي الجودة ومتعدد الاستخدامات. تتميز بتصميم واضح ومربع من مادة BPA بلاستيكية مع قشة قابلة للطي. تأتي الزجاجة مع كوب مشروب مزدوج الميزات، مما يوفر سعة كبيرة للشرب. تصميمها المزدوج يساعد في الحفاظ على درجة حرارة المشروبات، سواء كانت ساخنة أو باردة، لفترة أطول. تعد هذه الزجاجة مثالية للأطفال، والشباب، والبالغين، وتستخدم بسهولة في النشاطات الرياضية، والرحلات، والمكتب. كما أنها آمنة للاستخدام، حيث تكون خالية من مادة التريتان ومادة BPA الضارة. قم بشراء هذه الزجاجة المحمولة عالية الجودة واستمتع بالراحة والترطيب في أي وقت وفي أي مكان', 'ZN-69', NULL, NULL, '2023-12-23 00:14:16', '2023-12-23 00:14:16', NULL),
(620, 91, 1, '6علب تنظيف الأذن', '6علب تنظيف الأذن', 90, 190, NULL, NULL, 1, 'available', 'براعم قطنية قابلة للتحلل البيئي هي منتجات فريدة وصديقة للبيئة تستخدم في الاستخدام المنزلي. صُنعت هذه البراعم من قطن طبيعي 100% وأعواد خيزران قابلة للتحلل البيولوجي. تعتبر بديلًا مستدامًا للبراعم التقليدية التي تحتوي على مواد بلاستيكية غير قابلة للتحلل. إنها خيار مثالي للأشخاص الذين يهتمون بالحفاظ على البيئة وتقليل التأثير البيئي. تتميز هذه البراعم بجودتها العالية وأدائها الممتاز في تنظيف الأذن والعناية بالبشرة. كما أنها محمولة وقابلة للاستخدام المرة واحدة. استمتع بتجربة استخدام صحية ومستدامة مع براعم القطن القابلة للتحلل البيئي.', 'zw-360', NULL, NULL, '2023-12-23 00:17:24', '2023-12-23 00:17:24', NULL),
(621, 85, 1, 'ماكينة حلاقة كهربائية مصغرة 2 في 1', 'ماكينة حلاقة كهربائية مصغرة 2 في 1', 200, 350, NULL, NULL, 1, 'available', 'مصغرة 2 في 1 ماكينة حلاقة كهربائية للرجال هي أداة رائعة للعناية الشخصية. تتميز بتصميم مدمج يجمع بين ماكينة حلاقة كهربائية وماكينة حلاقة للشعر الوجهية في جهاز واحد. تأتي بشفرات حادة مصنوعة من الفولاذ لتوفير حلاقة سلسة وفعالة دون تهيج البشرة. تعمل بالبطارية وتشحن عبر USB، مما يجعلها مثالية للاستخدام المنزلي والسفر. تتميز بتصميم محمول وخفيف الوزن، مما يجعلها سهلة الاستخدام والتنقل. بفضل ميزة الاستخدام القابل لإعادة الشحن، فإنها توفر لك الراحة والتحكم في الحلاقة بدون الحاجة إلى البطاريات التقليدية. احصل على هذه الماكينة العملية والفعالة لتحقيق نتائج حلاقة مثالية ومريحة.', 'jf-69', NULL, NULL, '2023-12-23 00:20:13', '2023-12-23 00:20:13', NULL),
(622, 83, 1, 'كوب المشروبات الساخنة', 'كوب المشروبات الساخنة', 160, 260, NULL, NULL, 1, 'available', 'يعد الكوب الصلب من الفولاذ المقاوم للصدأ بسعة 16 أوقية / 500 مللي منتجًا رائعًا وعمليًا. يتميز بتصميم فريد باللون الفضي ولمسات بالألوان الزرقاء والبيضاء والسوداء. مصنوع من مواد عالية الجودة، فهو متين ومقاوم للصدأ، مما يضمن أنه سيدوم لفترة طويلة. يتميز بتصميم فراغي يحافظ على درجة حرارة المشروبات الساخنة أو الباردة لفترة طويلة، مما يجعله مثاليًا للاستخدام في السفر أو في المكتب. يأتي مع غطاء فراغي يحافظ على تسرب السوائل ويحفظ الحرارة. هذا الكوب العصري هو اختيار مثالي للاستمتاع بالمشروبات اللذيذة في أي وقت وفي أي مكان', 'ZN12', NULL, NULL, '2023-12-23 00:21:07', '2023-12-23 00:25:47', NULL),
(623, 125, 1, 'زجاجة المشروبات الساخنة الذكيه', 'زجاجة المشروبات الساخنة الذكيه', 130, 200, NULL, NULL, 1, 'available', 'تُعد زجاجة الماء تيرموس ذات الفولاذ المقاوم للصدأ عالية الجودة والفعالية. تم تصميمها بعناية لتلبية احتياجاتك اليومية في الحفاظ على درجة حرارة المشروبات الساخنة أو الباردة لفترة طويلة. تأتي بسعة 500 مل ومزودة بقفل محكم لمنع التسرب والحفاظ على جفاف حقيبتك. تتميز بتصميم عصري ومحمول، مما يجعلها مثالية للسفر والتخييم والرحلات والاستخدام اليومي. يمكنك الاعتماد على أداء العزل الحراري للحفاظ على المشروبات ساخنة لمدة تتراوح بين 6 إلى 12 ساعة. احصل على هذه الزجاجة الذكية ذات التصميم المتفوق والجودة العالية للاستمتاع بالمشروبات الطازجة في أي وقت وفي أي مكان.', 'ZN55', NULL, NULL, '2023-12-23 00:28:40', '2023-12-23 00:28:40', NULL),
(624, 122, 1, 'زجاجة الماء المحمولة', 'زجاجة الماء المحمولة', 200, 320, NULL, NULL, 1, 'available', 'زجاجة الماء المحمولة S1009 بسعة 300 مللي تعتبر اختيارًا مثاليًا للأطفال. مصنوعة من الفولاذ المقاوم للصدأ 316 عالي الجودة، وتأتي مع غلاف كرتوني جذاب وملصق فراغ للحفاظ على درجة حرارة المشروبات. تتميز بتصميم عصري ومعاصر، وتأتي مع سلسلة قش لسهولة حملها. تحافظ على العزل الحراري لمدة تصل إلى 12-24 ساعة، مما يجعلها مثالية للمشروبات الساخنة والباردة. زجاجة الماء متعددة الاستخدامات ومحمولة بسهولة، مما يجعلها رفيقًا مثاليًا للنشاطات اليومية والرحلات. بفضل تصميمها المستدام والمواد عالية الجودة، توفر لطفلك تجربة شرب آمنة وصحية', 'ZN-53', NULL, NULL, '2023-12-23 00:32:31', '2023-12-23 00:32:31', NULL),
(625, 91, 1, 'مدلك العيون الكهربائي المحمول', 'مدلك العيون الكهربائي المحمول', 75, 190, NULL, NULL, 1, 'available', 'مدلك العيون الكهربائي المحمول هو جهاز فريد يهدف إلى الاهتمام بصحة وجمال العيون. يعمل هذا المدلك على تقديم تدليك لطيف واهتزازات لمنطقة العين، وذلك لتحسين الدورة الدموية وتخفيف التوتر والتعب والانتفاخات في العينين. يساعد في إزالة التجاعيد والهالات السوداء، ويعمل على مكافحة علامات الشيخوخة وتحسين مظهر العين بشكل عام. يمتاز بتصميمه المحمول والصغير الحجم، مما يسهل حمله واستخدامه في أي مكان وزمان. يعد مدلك العيون الكهربائي المحمول خيارًا مثاليًا للأشخاص الذين يبحثون عن العناية الفعالة والمريحة بمنطقة العين.', 'yn-19', NULL, NULL, '2023-12-23 00:36:44', '2023-12-23 00:36:44', NULL),
(626, 91, 1, 'سماعة الأذن الصغيرة', 'سماعة الأذن الصغيرة', 100, 170, NULL, NULL, 1, 'available', 'جهاز السمع المصغر ذو التكنولوجيا المتقدمة والخفيف الوزن هو منتج مثالي لكبار السن. يأتي هذا الجهاز بملحقات متنوعة تلبي احتياجات الأشخاص ذوي صعوبات السمع. يعمل الجهاز على تحسين السمع وتعزيز تجربة الاستماع اليومية للمستخدم. تصميمه المصغر يجعله سهل الاستخدام ومريح للارتداء طوال اليوم. يتميز بنظام قنوات مزدوج يوفر صوتًا واضحًا وجودة صوت فائقة. وبفضل بطاريته القابلة للتبديل، يمكن للمستخدم الاستمتاع بساعات طويلة من الاستخدام المستمر. احصل على جهاز السمع المصغر هذا بسعر مناسب واستعد لتحسين تجربتك السمعية بشكل كبير', 'TV38', NULL, 'uploads/supplier/supplier-626-2023-12-23.pdf', '2023-12-23 00:36:49', '2023-12-23 00:45:07', '2023-12-23 00:45:07'),
(627, 91, 1, 'مزيل البثور بتقنية الشفط الجمالية', 'مزيل البثور بتقنية الشفط الجمالية', 120, 220, NULL, NULL, 1, 'available', 'فراغ الجمال لإزالة البثور هو منتج مبتكر يهدف إلى تحسين جودة ومظهر البشرة. يعمل هذا الجهاز على إزالة البثور والشوائب المتراكمة في الأنف والمناطق الأخرى من الوجه بفضل تقنية الشفط المتقدمة. يتميز بأربعة رؤوس مختلفة تتيح لك التحكم في شدة الشفط وتناسب احتياجاتك الشخصية. يعمل الجهاز بواسطة بطارية قابلة للشحن، مما يجعله محمولًا وسهل الاستخدام في أي وقت وفي أي مكان. بفضل هذا المنتج، يمكنك الحصول على بشرة نقية وصحية، حيث يعمل على تنظيف المسام وتحسين مظهر البشرة بشكل عام. احصل على بشرة مشرقة وخالية من البثور مع فراغ الجمال لإزالة البثور.', 'jf-66', NULL, NULL, '2023-12-23 00:39:57', '2023-12-23 00:40:36', NULL),
(628, 99, 1, 'لعبة فقاعات الدفع السريع الساطعة', 'لعبة فقاعات الدفع السريع الساطعة', 120, 200, NULL, NULL, 1, 'available', 'تعتبر لعبة فقاعات الدفع السريع منتجًا رائعًا يسعد الأطفال والكبار على حد سواء. تتميز هذه اللعبة بتصميمها الإلكتروني المبتكر الذي يساعد في تخفيف التوتر وزيادة التركيز. تعمل اللعبة عن طريق الضغط على الفقاعات الملونة والتي تضيء، مما يوفر تجربة مريحة ومسلية. تعتبر هذه اللعبة مثالية للأطفال من سن 3 سنوات وما فوق، وتأتي بألوان متعددة جذابة. بالإضافة إلى ذلك، فإنها مصنوعة من مواد عالية الجودة وآمنة للاستخدام. اجعل وقتك الممتع أكثر مع لعبة فقاعات الدفع السريع آلة اللعب المثالية لتسلية العائلة وتخفيف التوتر.', 'TB05', NULL, NULL, '2023-12-23 00:47:06', '2023-12-23 00:47:06', NULL),
(629, 98, 1, 'لعبة كرة السلة المصغرة', 'لعبة كرة السلة المصغرة', 180, 290, NULL, NULL, 1, 'available', 'لعبة كرة السلة لعبة اطلاق النار لعبة الطاولة هي لعبة ممتعة ومثيرة للاهتمام تصمم لمحبي كرة السلة. تتميز هذه اللعبة بتصميمها المصغر الذي يجعلها مثالية للعب في المنزل أو في أي مكان آخر. يمكن للأطفال والبالغين على حد سواء الاستمتاع بتجربة رياضية مشوقة وتحسين مهاراتهم في رمي الكرة. تأتي اللعبة مع ملحقاتها المتنوعة مثل مجموعة من الكرات والمنصة التي تستخدم لرمي الكرة وتسجيل النقاط. بفضل جودتها العالية وتصميمها المتين، فإن لعبة كرة السلة لعبة اطلاق النار لعبة الطاولة ستضمن ساعات طويلة من المرح والتسلية للجميع', 'BB326', NULL, NULL, '2023-12-23 00:49:53', '2023-12-23 01:02:36', NULL),
(630, 98, 1, 'مجموعة كرة القدم المثيرة', 'مجموعة كرة القدم المثيرة', 180, 300, NULL, NULL, 1, 'available', 'منتجنا هو لعبة كرة القدم على طاولة ممتعة وتعليمية تهدف إلى توفير ساعات لا متناهية من المرح والتسلية للعائلة. تتميز هذه اللعبة بتصميم مبتكر وجودة عالية، حيث تأتي بحجم صغير يمكن وضعه في أي مكان في المنزل. تتضمن المجموعة طاولة كرة قدم وأجهزة تحكم ولاعبين صغار يمكن تحريكهم بسهولة. يمكن للأطفال والكبار مشاركة اللعبة معًا والاستمتاع بتجارب المنافسة والتعاون. بفضل هذه اللعبة، ستتمكن الأسرة من قضاء وقت ممتع وتعلم مهارات جديدة مثل التنسيق والتركيز والتفكير الاستراتيجي. احصل على هذه اللعبة الرائعة الآن واستمتع بأوقات مليئة بالمرح والترفيه للعائلة', 'BB325', NULL, NULL, '2023-12-23 00:52:30', '2023-12-23 01:02:26', NULL),
(631, 99, 1, 'بيانو الموسيقى الكرتوني', 'بيانو الموسيقى الكرتوني', 130, 220, NULL, NULL, 1, 'available', 'لعبة كارتون آلة موسيقية بيانو إكسيليفون للأولاد والبنات\r\n\r\nاجعل طفلك يستمتع بالموسيقى ويكتشف مهاراته الموسيقية المبكرة مع لعبة كارتون آلة موسيقية بيانو إكسيليفون. تتميز هذه اللعبة بتصميم كرتوني جذاب ومشرق يجذب انتباه الأطفال. تساعد الألوان المبهجة والأشكال اللعبة على تنمية خيال الطفل وإثارة فضوله.\r\n\r\nتتضمن اللعبة ثمانية مفاتيح تصدر أصواتًا موسيقية عند الضغط عليها، مما يساعد الطفل على تعلم الأصوات والنغمات. تصنع اللعبة من مواد آمنة وعالية الجودة مثل البلاستيك، مما يجعلها مناسبة للاستخدام من قبل الأولاد والبنات.\r\n\r\nتعمل هذه اللعبة على تنمية قدرات الطفل الموسيقية وتعزز التعلم المبكر والتنسيق الحركي. إنها لعبة مسلية وتعليمية في آن واحد تساعد الطفل على استكشاف عالم الموسيقى بطريقة ممتعة ومحفزة.', 'BB-212', NULL, NULL, '2023-12-23 00:56:52', '2023-12-23 00:56:52', NULL),
(632, 99, 1, 'بيانو الموسيقى الكرتوني السعيد', 'بيانو الموسيقى الكرتوني السعيد', 110, 210, NULL, NULL, 1, 'available', 'البلاستيك بطارية تعمل المحمولة لعبة من الكارتون الإلكترون البيانو مصغرة\r\n\r\nاستمتع بمرح الموسيقى واللعب مع البيانو المصغر الإلكتروني البيانو المحمول من البلاستيك. يعد هذا المنتج مثاليًا للأطفال الذين يحبون الموسيقى ويرغبون في استكشاف موهبتهم الموسيقية الصغيرة. يأتي البيانو بتصميم جذاب للكارتون وألوان زاهية تجذب انتباه الأطفال. يعمل بالبطارية، مما يجعله محمولًا ويمكن استخدامه في أي مكان. يحتوي على مفاتيح صغيرة سهلة الضغط تساعد الأطفال على تعلم النغمات والألحان البسيطة. بالإضافة إلى ذلك، يعزز البيانو المصغر الإلكتروني مهارات التنسيق بين اليد والعين والإبداع الموسيقي لدى الأطفال. هذا المنتج المسلي سيوفر ساعات من المرح الموسيقي للأطفال.', 'BB-143', NULL, NULL, '2023-12-23 01:02:03', '2023-12-23 01:02:46', NULL);
INSERT INTO `products` (`id`, `subcategory_id`, `supplier_id`, `unit_name`, `pack_name`, `purchasing_price`, `unit_price`, `pack_price`, `pack_units`, `unit_type`, `status`, `description`, `code_supplier`, `code_bar`, `file`, `created_at`, `updated_at`, `deleted_at`) VALUES
(633, 91, 1, 'مزيل البثور بتقنية الشفط', 'مزيل البثور بتقنية الشفط', 200, 340, NULL, NULL, 1, 'available', 'تعتبر أداة الوجه تدليك نظافة شفط كهربائي المسام مزيل البثور السوداء بالشفط منتجًا مبتكرًا وفعالًا للعناية بالبشرة. تستخدم هذه الأداة التكنولوجيا الحديثة لإزالة البثور السوداء وتنظيف المسام بلطف وفعالية. تعمل الشفط الكهربائي القوي على إزالة الشوائب والدهون الزائدة من الوجه، مما يقلل من ظهور حب الشباب وعيوب البشرة. تصميمها المحمول يجعلها سهلة الاستخدام وملائمة للاستخدام المنزلي. تعمل الأداة بشكل آمن وفعال دون التسبب في أي آثار جانبية. استخدمي هذه الأداة للحصول على بشرة نظيفة وصحية، وتمتعي بمظهر متألق وجميل.', 'yn26', NULL, NULL, '2023-12-23 01:03:37', '2023-12-23 01:03:37', NULL),
(634, 99, 1, 'صندوق الموسيقى السعيد', 'صندوق الموسيقى السعيد', 160, 290, NULL, NULL, 1, 'available', 'صندوق مكبر الصوت لعبة الموسيقى هو منتج مثالي للأطفال الذين يحبون اللعب بالموسيقى. يتضمن هذا الصندوق مكبر الصوت البلاستيكي متفرقات ممتعة ومبهجة. يعمل بالبطارية ويحتوي على وظائف تشغيل الموسيقى والإضاءة وتكبير الصوت. يمكن للأطفال استخدام الميكروفون المرفق للغناء والتفاعل مع الموسيقى بطريقة ممتعة. يوفر هذا المنتج تجربة موسيقية مفيدة وتعليمية للأطفال، فهو يساعدهم على تنمية المهارات الإبداعية والموسيقية وتعزيز الاندماج الاجتماعي والتعبير عن الذات. بفضل تصميمه الآمن والمتين والملون، فإن صندوق مكبر الصوت لعبة الموسيقى يعد هدية رائعة لأي طفل', 'BB-210', NULL, NULL, '2023-12-23 01:05:51', '2023-12-23 01:05:51', NULL),
(635, 85, 1, 'آلة إزالة الشعر المناطق الحساسة', 'آلة إزالة الشعر المناطق الحساسة', 320, 550, NULL, NULL, 1, 'available', '2 في 1 آلة إزالة الشعر تحت الإبط قابلة لإعادة الشحن آلة حلاقة نسائية Kemei ماكينة حلاقة نسائية لاسلكية لإزالة الشعر.\r\n\r\nاحصلي على الجاهزية لإزالة الشعر بسهولة وفعالية مع هذه الآلة المبتكرة. تتميز بتصميم 2 في 1 الذي يتيح لك إزالة الشعر تحت الإبط وعلى الجسم بكل سهولة. تعمل الآلة بتقنية الشحن اللاسلكي، مما يوفر لك الحرية في الحركة وسهولة الاستخدام. تتميز برأس حلاقة دوار لإزالة الشعر بسلاسة ودقة. كما تتضمن العديد من الميزات الإضافية مثل الضوء المدمج لإضاءة المنطقة المراد حلاقتها ووظيفة الشفط للحفاظ على نظافة المنطقة. احصلي على بشرة ناعمة وخالية من الشعر بكل سهولة وراحة مع هذه الآلة العملية والفعالة.', 'yn21', NULL, NULL, '2023-12-23 01:06:52', '2023-12-23 03:31:04', NULL),
(636, 98, 1, 'المصفحة العسكرية المشوقة', 'المصفحة العسكرية المشوقة', 70, 150, NULL, NULL, 1, 'available', 'هذا المنتج هو \"COGO جديد العسكرية المصفحة مجموعات الألعاب اللبنات مجموعة الطوب التعليمية متوافق بناء كتلة الأطفال لعبة\". إنها لعبة بناء تعليمية تهدف إلى تطوير مهارات الأطفال في البناء والابتكار. تحتوي المجموعة على 185 قطعة من اللبنات البلاستيكية عالية الجودة، وتأتي في مجموعة مصممة بموضوع العسكرية المصفحة. يمكن للأطفال من الأعمار 5 إلى 14 سنة الاستمتاع بتجميع وبناء الدبابات العسكرية والمركبات الأخرى باستخدام هذه اللبنات. إنها تعزز الإبداع والتفكير المنطقي لدى الأطفال وتساعدهم على تطوير مهارات البناء والتصميم. هذه اللعبة الممتعة ستوفر ساعات من اللعب المليء بالمرح والتعلم للأطفال', 'ZW-758', NULL, NULL, '2023-12-23 01:08:49', '2023-12-23 03:30:29', NULL),
(637, 82, 1, 'مساج 3 في 1 للوجه', 'ماسجر ثلاثي الأبعاد للوجه', 150, 290, NULL, NULL, 1, 'available', 'أسطوانة تدليك ثلاثية الأبعاد للعناية بالبشرة، الأفضل مبيعًا في عام 2022، تعمل على شد الوجه ومكافحة التجاعيد والاهتمام بالبشرة الدقيقة. تعتبر هذه الأسطوانة منتجًا فريدًا ومبتكرًا لتحسين مظهر البشرة ومرونتها. تم تصميمها لتوفير تجربة تدليك مريحة ومهدئة للوجه. تعمل تقنية الاهتزاز ثلاثية الأبعاد على تنشيط الدورة الدموية وتحفيز العضلات، مما يؤدي إلى تحسين مظهر البشرة وشد الوجه. بفضل تصميمها المحمول والمريح، يمكن استخدامها في المنزل أو أثناء السفر. تعد هذه الأسطوانة خيارًا مثاليًا لمن يرغبون في الاستمتاع بعناية متميزة للبشرة وتجربة تدليك مريحة وفعالة.', 'yn20', NULL, NULL, '2023-12-23 01:11:10', '2023-12-23 01:11:10', NULL),
(638, 91, 1, 'مزيل الرؤوس السوداء الثلاثي الأبعاد للوجه', 'مزيل الرؤوس السوداء الثلاثي الأبعاد للوجه', 180, 290, NULL, NULL, 1, 'available', 'أداة تفريغ متعددة الوظائف لإزالة البثور وحب الشباب والرؤوس السوداء هي منتج رائع للعناية بالبشرة. تعمل هذه الأداة على تنظيف المسام وإزالة الشوائب والرؤوس السوداء بفعالية. تأتي بتصميم مزود بتقنية الشفط الثنائية وتحتوي على مجموعة متنوعة من الرؤوس لتناسب احتياجات جميع أنواع البشرة. يمكن استخدامها لعلاج حب الشباب وتقليل ظهور البثور، مما يساعد على تحسين مظهر البشرة وتنقيتها. تعمل الأداة بشكل لطيف وآمن على البشرة، وهي سهلة الاستخدام ومحمولة، مما يجعلها مثالية للاستخدام المنزلي وأثناء السفر. استمتع ببشرة نقية ومشرقة مع هذه الأداة المتعددة الوظائف للعناية بالبشرة.', 'YN61', NULL, NULL, '2023-12-23 01:14:24', '2023-12-23 01:14:24', NULL),
(639, 97, 1, 'مجموعة تجميل الأميرة الصغيرة', 'مجموعة تجميل الأميرة الصغيرة', 150, 290, NULL, NULL, 1, 'available', 'تعتبر هذه اللعبة الأطفال التعليمية رخيصة وممتعة مثالية للبنات. تتيح لهم فرصة اللعب والتخيل في عالم المكياج والتجميل. تأتي اللعبة بتصميم جميل وملون، وتحتوي على مجموعة متنوعة من المكونات المصغرة مثل مرآة، فرشاة، أحمر شفاه وألوان مختلفة. تساعد هذه اللعبة في تنمية مهارات الخيال والإبداع لدى الأطفال، كما تعزز التفاعل الاجتماعي واللعب الدوري. بفضل جودتها العالية وموادها الآمنة، يمكن للأطفال الاستمتاع باللعب لساعات طويلة دون أي مخاوف. اجعلي طفلتك تستمتع بتجربة اللعب الإبداعية والتعليمية مع هذه اللعبة الممتعة والمثيرة!', '000', NULL, NULL, '2023-12-23 01:14:28', '2023-12-23 01:14:28', NULL),
(640, 98, 1, 'كرات فواكه بلاستيكية', 'كرات فواكه بلاستيكية', 240, 490, NULL, NULL, 1, 'available', 'ضغط الأطفال اللعب قبضة اليد لينة الكرة رئيس اليقطين مع الضوء هو منتج ممتع ومفيد للأطفال. يتكون المنتج من كرة رئيس اليقطين اللينة والناعمة التي يمكن للأطفال الضغط عليها بقبضتهم. تتميز الكرة بإضاءة داخلية تضيء عند الضغط عليها، مما يضفي على التجربة جوًا ساحرًا ومرحًا. يساعد هذا المنتج على تخفيف التوتر والقلق لدى الأطفال، حيث يمكنهم اللعب به والضغط عليه لتحقيق الاسترخاء والراحة. كما أنه يعتبر هدية مثالية للأطفال في مناسبات الأعياد وأعياد الميلاد. صُمم هذا المنتج بعناية لضمان السلامة والجودة، وهو مناسب للأطفال الذين تتراوح أعمارهم بين 2 و 13 سنة', '552', NULL, NULL, '2023-12-23 01:17:55', '2023-12-23 01:17:55', NULL),
(641, 93, 1, 'جهاز إزالة الشعر بالخيط', 'جهاز إزالة الشعر بالخيط', 300, 490, NULL, NULL, 1, 'available', 'جهاز إزالة الشعر بالخيط القابل للشحن والمصمم بأسلوب عصري للوجه النسائي. يعد هذا الجهاز الخيار المثالي لإزالة الشعر الغير المرغوب فيه بسهولة وفعالية. يتميز بتصميم ربيعي فعال يسمح بإزالة الشعر من الشفاه والذقن والركبتين والخدين والإبط بشكل مريح. يعمل بقوة 5 واط ويعتمد على مصدر طاقة كهربائي قابل لإعادة الشحن. يتميز بالسلامة والجودة العالية، ويتميز بأداء فائق ونتائج دقيقة. يأتي بلون أبيض أنيق وحجم مخصص. مع هذا الجهاز، يمكنك الاستمتاع ببشرة ناعمة وخالية من الشعر لفترة طويلة.', 'yn-24', NULL, NULL, '2023-12-23 01:18:38', '2023-12-23 01:18:38', NULL),
(642, 98, 1, 'لعبة العجلة الدوارة', 'لعبة العجلة الدوارة', 90, 200, NULL, NULL, 1, 'available', 'أفضل العاب الأطفال، ومن بينها أعلى الغزل البلاستيكية. تعتبر هذه الألعاب ممتعة ومثالية للأطفال من جميع الأعمار. تأتي الأعلى بتصميم متعدد الألوان ومزودة بوظيفة الوميض، مما يجلب مزيدًا من المتعة والإثارة. تتوافر الأعلى بأحجام مختلفة لتناسب احتياجات الأطفال المختلفة. تتميز هذه اللعبة بجودة عالية وموثوقية، وهي آمنة للاستخدام. يمكن استخدامها في ألعاب الدوران والتنافس بين الأطفال. احصل على أعلى الغزل البلاستيكية الآن وامنح طفلك تجربة لعب ممتعة ومثيرة', 'BB270', NULL, NULL, '2023-12-23 01:22:23', '2023-12-23 01:25:20', NULL),
(643, 98, 1, 'قاذفة المعادن الساحرة', 'قاذفة المعادن الساحرة', 75, 180, NULL, NULL, 1, 'available', 'شريط المعادن المذهل المبهر Hlc549 هو لعبة جديدة وممتعة تتضمن قاذفة معدنية تستخدم ضد عموم الحلزون. يتميز هذا الشريط المعدني بتصميمه الجذاب والمبتكر، ويتضمن أيضًا تقنية الإضاءة بواسطة الصمامات الثنائية الموجودة في الشريط. يوفر الغزل العمودي والتصميم الديناميكي تجربة لعب مثيرة وممتعة. كما يتضمن هذا المنتج مجموعة جديدة من ألعاب الجيروسكوب، حيث يمكن للأطفال استكشاف الدوران والتوازن من خلال اللعب بهذه الألعاب. يعتبر هذا المنتج مثاليًا للأطفال من سن 2 إلى 14 سنة، وهو مصنوع من مواد عالية الجودة. سيكون هذا الشريط المعدني المذهل إضافة رائعة إلى مجموعة ألعاب الأطفال', 'BB277', NULL, NULL, '2023-12-23 01:24:59', '2023-12-23 01:24:59', NULL),
(644, 99, 1, 'بيانو المرح الإلكتروني', 'بيانو المرح الإلكتروني', 280, 450, NULL, NULL, 1, 'available', 'جهاز البيانو الإلكتروني الموسيقي المصغر للأطفال الممتع من Chengji هو لعبة بيانو صغيرة مصنوعة من البلاستيك. يتميز هذا البيانو بوجود ميكروفون لإضفاء مزيد من المرح والتفاعلية على تجربة اللعب. يعد هذا البيانو المصغر الإلكتروني بمثابة أداة تعليمية وترفيهية في آن واحد، حيث يمكن للأطفال استكشاف النغمات المختلفة والتعابير الموسيقية المبتكرة. بفضل التصميم المدمج والمحمول، يمكن للأطفال الاستمتاع بالعزف على البيانو في أي وقت وأي مكان. يعتبر هذا البيانو المصغر الإلكتروني منتجًا مثاليًا للأطفال الذين تتراوح أعمارهم بين 5 و13 عامًا، حيث يساعد في تطوير مهاراتهم الموسيقية والإبداعية بطريقة ممتعة ومحفزة.', 'YJH12', NULL, NULL, '2023-12-23 01:28:02', '2023-12-23 01:28:02', NULL),
(645, 97, 1, 'صينية الموسيقى الدوارة الساحرة', 'صينية الموسيقى الدوارة الساحرة', 100, 200, NULL, NULL, 1, 'available', 'صينية موسيقية دوارة مزيفة أخرى للعب داخل المنزل مجموعة ألعاب الآيس كريم للفتيات\r\n\r\nاستمتعي بساعات من المرح والتسلية مع صينية الموسيقى الدوارة المزيفة للعب داخل المنزل. تتميز هذه المجموعة بتصميمها الجميل والملون الذي يستهوي الفتيات. تحتوي المجموعة على مجموعة كاملة من ألعاب الآيس كريم التي تساعدك على تجسيد أحلامك وخيالك في صنع وتقديم الآيس كريم اللذيذ. كما تتميز بالمواد غير المفعمة بالحيوية وشهادة الجودة لتوفير بيئة آمنة للعب. استمتعي باللعب الإبداعي والتفاعلي داخل منزلك مع هذه المجموعة الرائعة، التي تعزز مهارات الخيال والإبداع لدى الأطفال', 'P-24', NULL, NULL, '2023-12-23 01:32:30', '2023-12-23 01:32:30', NULL),
(646, 99, 1, 'لعبة الجذعية المتوازنة', 'لعبة الجذعية المتوازنة', 160, 260, NULL, NULL, 1, 'available', 'تقدم لك شركة Shantou Dwi Model Toys Co., Ltd. لعبة الجذعية اللغز، وهي لعبة ممتعة وتعليمية تهدف إلى تنمية مهارات الأطفال وتعزيز تركيزهم وتنسيق حركتهم. تحتوي اللعبة على العديد من الألغاز والحواجز الصعبة التي يجب على الأطفال التغلب عليها باستخدام مهارات التوازن والتفكير المنطقي. تأتي اللعبة مع كرات صغيرة يجب على الأطفال وضعها في المواقع المناسبة وتوازنها بشكل صحيح لإكمال الألغاز. تعتبر هذه اللعبة مناسبة للأطفال من عمر 6 سنوات فما فوق، وتأتي بحجم ملائم للاستخدام اليومي. استمتع بتعليم المتعة والتسلية مع الجذعية اللعب لغز موازنة العاب الكرة بانوراما الألغاز.', 'BB-207', NULL, NULL, '2023-12-23 01:35:25', '2023-12-23 01:35:25', NULL),
(647, 87, 1, 'فرشاة الأسنان الذكية', 'فرشاة الأسنان الذكية', 180, 280, NULL, NULL, 1, 'available', 'فرشاة الأسنان الكهربائية بالموجات فوق الصوتية وموتور ماجليف مناسبة للسفر وتتميز بتقنية LED الذكية. تعد هذه الفرشاة الكهربائية فعالة في إزالة البلاك وتنظيف الأسنان بشكل شامل ولطيف. تعمل بتردد فوق الصوتيات لتوفير تجربة تنظيف متقدمة وفعالة. تأتي مع رؤوس فرشاة قابلة للتبديل لتلائم احتياجات العناية بالأسنان المختلفة. كما تتميز بموتور ماجليف قوي يوفر تدليكًا لطيفًا وتحفيزًا للثة. تصميمها المحمول يجعلها مثالية للسفر والاستخدام اليومي. هذه الفرشاة الكهربائية توفر تنظيفًا شاملاً وفعالًا للأسنان وتعزز الصحة العامة للفم.', '0000', NULL, NULL, '2023-12-23 01:49:35', '2023-12-23 01:49:35', NULL),
(648, 94, 1, 'مصباح الأشعة فوق البنفسجية \"السرعة الفائقة\"', 'مصباح الأشعة فوق البنفسجية \"السرعة الفائقة\"', 150, 280, NULL, NULL, 1, 'available', 'مصباح الأشعة فوق البنفسجية Osbang هو منتج محبب بقوة 36 واط، مصمم خصيصًا للاستخدام في تصنيع المجوهرات اليدوية والحرف اليدوية. يتميز بقدرته على تجفيف راتنج الأشعة فوق البنفسجية وتثبيت طلاء الأظافر بسرعة وكفاءة عالية. يعمل المصباح بأطوال موجية محددة للأشعة فوق البنفسجية بفترات زمنية مختلفة، حيث يمكنك ضبطه لمدة 60 ثانية، 90 ثانية أو 120 ثانية حسب الحاجة. يتمتع المصباح بتصميم محمول وسهل الاستخدام، كما يأتي بمصدر ضوء LED عالي الجودة. مع مصباح الأشعة فوق البنفسجية Osbang، يمكنك الاستمتاع بتجفيف سريع واحترافي للراتنج والأظافر، مما يجعله رفيقًا مثاليًا لعملك اليدوي والحرفي.', 'jf-51', NULL, NULL, '2023-12-23 02:09:11', '2023-12-23 02:09:11', NULL),
(649, 81, 1, 'ميكروفون فائق السرعة \"Ws858\"', 'ميكروفون فائق السرعة \"Ws858\"', 180, 280, NULL, NULL, 1, 'available', 'ميكروفون لاسلكي محمول باليد رائع بسعر خاص طراز Ws858\r\n\r\nاحصل على تجربة صوت استثنائية مع ميكروفون السماعة اللاسلكية طراز Ws858. يتميز هذا الميكروفون بتصميم محمول باليد يتيح لك الحرية في التنقل والغناء في أي مكان. بفضل تقنية الاتصال اللاسلكي، يمكنك الاستمتاع بالتحدث أو الغناء دون الحاجة إلى أسلاك مزعجة.\r\n\r\nيتميز طراز Ws858 بجودة صوت استثنائية ووظيفة مكثفة الميكروفون التي تساعد في تعزيز صوتك وجعله أكثر وضوحًا ونقاءً. يأتي الميكروفون مع مكونات عالية الجودة مثل البلاستيك وسبائك الألومنيوم وABS، مما يجعله متينًا وموثوقًا.\r\n\r\nاستمتع بتجربة الكاريوكي الممتعة أو استخدمه كمكبر صوت لهاتفك المحمول. احصل على ميكروفون السماعة اللاسلكية طراز Ws858 اليوم واستعد لتجربة صوت استثنائية وحرية التنقل.', 'jf-42', NULL, NULL, '2023-12-23 02:12:12', '2023-12-23 02:12:12', NULL),
(650, 85, 1, 'فرشاة الهواء الساخنة \"4 في 1\"', 'فرشاة الهواء الساخنة \"4 في 1\"', 420, 650, NULL, NULL, 1, 'available', 'فرشاة الهواء الساخنة \"4 في 1\" من Suttik\r\n\r\nاحصل على شعر رائع ومصفف بسهولة مع فرشاة الهواء الساخنة \"4 في 1\" من Suttik. تجمع هذه الفرشاة العملية بين أربع وظائف في جهاز واحد، حيث تجمع بين فرشاة الهواء الساخنة وفرشاة الكماشة وفرشاة تجعيد الشعر ومصفف الشعر. تساعدك هذه الفرشاة على تجفيف وتصفيف شعرك بسرعة وسهولة، مما يوفر الوقت والجهد.\r\n\r\nتأتي الفرشاة بتصميم مريح وخفيف الوزن، مما يسهل عملية التحكم والتصفيف. تتميز بتقنية الهواء الساخن لتجفيف الشعر بسرعة بدون تلفه، وتحتوي على خيارات تحكم في درجة الحرارة وسرعة الهواء لتلائم احتياجاتك الشخصية.\r\n\r\nاكتشف روعة تصفيف الشعر مع فرشاة الهواء الساخنة \"4 في 1\" من Suttik واحصل على شعر أنيق ومثالي في أي وقت.', 'YN09', NULL, NULL, '2023-12-23 02:15:03', '2023-12-23 02:15:03', NULL),
(651, 98, 1, 'مجموعة البناء الهندسية المبتكرة', 'مجموعة البناء الهندسية المبتكرة', 200, 350, NULL, NULL, 1, 'available', 'لعبة الأطفال مجموعة نماذج تجميع DIY قابلة للفصل هي لعبة ممتعة وتعليمية تهدف إلى تنمية مهارات الهندسة والإبداع لدى الأطفال. تأتي هذه المجموعة بمجموعة متنوعة من النماذج الهندسية المصنوعة من البلاستيك، حيث يمكن للأطفال تجميعها وتفكيكها بسهولة. تتضمن المجموعة قطعًا متعددة تمكن الأطفال من بناء مختلف المركبات الهندسية مثل الشاحنات والسيارات والجرارات والحافلات. تعزز هذه اللعبة الخيال والتفكير المنطقي وتطوير مهارات الحل المشترك والتركيز. بفضل تصميمها القابل للفصل، يمكن للأطفال تجربة تجميع أشكال مختلفة وتحويلها حسب رغبتهم، مما يعزز قدراتهم الإبداعية والهندسية. هذه اللعبة هي خيار مثالي لتنمية المهارات الفنية والهندسية لدى الأطفال بطريقة ممتعة وتفاعلية.', 'YJH41', NULL, NULL, '2023-12-23 03:29:03', '2023-12-23 03:29:03', NULL),
(652, 98, 1, 'قارب السباق اللاسلكي المثير', 'قارب السباق اللاسلكي المثير', 170, 300, NULL, NULL, 1, 'available', 'قارب سباق لاسلكي بالتحكم عن بعد صغير الحجم هو لعبة ممتعة ومثيرة للاهتمام للأطفال. يتميز هذا القارب بتصميمه المبتكر والعصري، ويمكن التحكم فيه بسهولة عن بُعد باستخدام وحدة التحكم اللاسلكية المرفقة. يمكن للأطفال استخدامه في الماء، سواء في الحمام أو المسبح. يوفر القارب تجربة سباق حقيقية حيث يمكن للأطفال التحكم في اتجاهاته وسرعته والمنافسة مع أصدقائهم. صُنع القارب من مواد آمنة وعالية الجودة، وهو مصمم لتحمل الاستخدام الشديد وضمان متعة طويلة الأمد. إنه هدية مثالية لأي طفل يحب اللعب بالماء ويستمتع بالمغامرة والتحدي', 'BB-261', NULL, NULL, '2023-12-23 03:33:33', '2023-12-23 03:33:33', NULL),
(653, 98, 1, 'طائرة الأبطال المتحكمة عن بعد', 'طائرة الأبطال المتحكمة عن بعد', 200, 390, NULL, NULL, 1, 'available', 'تعرّف على طائرة شهيرة تعمل بالتحكم عن بُعد وتُعد منتجًا مثاليًا للأطفال. تتميز هذه الطائرة بقناتين للألعاب، مما يسمح بالتحكم البعيد والتحكم المباشر فيها. تأتي الطائرة بتصميم جذاب من المعدن والبلاستيك، مما يمنحها متانة ومقاومة للصدمات. يمكن التحكم فيها عن بعد بمسافة تصل إلى 15 مترًا، وتحتوي على جهاز تحكم عن بُعد لسهولة الاستخدام. تتمتع الطائرة بدقة التقاط الفيديو وتتمتع بمستوى مهارة مناسب للمبتدئين. يمكن استخدامها في الأماكن الداخلية والخارجية. هذه الطائرة هي لعبة استثنائية توفر تجربة طيران ممتعة ومثيرة للأطفال من سن 2 إلى 13 سنة', 'BB285', NULL, NULL, '2023-12-23 03:36:27', '2023-12-23 20:33:14', NULL),
(654, 98, 1, 'قطار المسار الكهربائي الخفيف', 'قطار المسار الكهربائي الخفيف', 60, 260, NULL, NULL, 1, 'available', 'نقدم لكم عرضًا خاصًا على \"نموذج تعليمي بلاستيك كهربائي خفيف الوزن سهل الاستخدام لعبة مسار سكة حديدية مجموعة قطار لغز تجميع قطار المسار\". هذه المجموعة الممتعة تتضمن قطارًا صغيرًا يعمل بالكهرباء وقطع مسار سكة حديدية مجمعة بشكل لغز. تتيح للأطفال تجربة اللعب والتعلم في آن واحد. يتميز القطار بمواده البلاستيكية الصديقة للبيئة ويعمل ببطاريات قلوية AA. مناسب للأطفال من 2 إلى 14 سنة، ويعزز الابتكار والتفكير الإبداعي لديهم. هذه اللعبة المسلية توفر تجربة لعب ممتعة وتعليمية في نفس الوقت. احصل على هذه المجموعة الرائعة ودع طفلك يستمتع بالمغامرات على سكة حديدية خاصة به', 'BB242', NULL, 'uploads/supplier/supplier-654-2023-12-23.pdf', '2023-12-23 20:44:02', '2023-12-23 20:44:50', NULL),
(655, 98, 1, 'سيارة شرطية ترفيهية', 'سيارة شرطية ترفيهية', 80, 280, NULL, NULL, 1, 'available', 'وصف المنتج: سيارة الاحتكاك لعبة سيارة شرطة بقوة احتكاك عالية ومزودة بالضوء والصوت. هذه السيارة المصنوعة من البلاستيك عالية الجودة تأتي بنسبة مقياس 1:20 وتعد لعبة ممتعة ومثيرة للأطفال. تتميز بتصميم شرطة جذاب وملفت للانتباه، وتضيء بأضواء ملونة وتصدر أصواتًا واقعية لتحاكي السيارة الحقيقية. بفضل نظام الاحتكاك القوي، يمكن للأطفال أن يقوموا بدفع السيارة ومشاهدتها تتحرك بسرعة على الأسطح الملساء. إنها لعبة مثالية لتنمية مهارات التنسيق الحركي والتخيل لدى الأطفال. تعتبر سيارة الاحتكاك لعبة السيارة الشرطة خيارًا ممتازًا لهدية ممتعة وتسلية للأطفال', 'BB345', NULL, NULL, '2023-12-23 20:52:13', '2023-12-23 20:52:13', NULL),
(656, 97, 1, 'ميكروفون الأطفال المتنقل بالضوء', 'ميكروفون الأطفال المتنقل بالضوء', 70, 170, NULL, NULL, 1, 'available', 'مجموعة ميكروفون لاسلكية محمولة للأطفال مع ضوء للغناء هي منتج مثالي للأطفال الصغار الذين يحبون الغناء والتمثيل. يتميز الميكروفون بتصميمه اللاسلكي المحمول، مما يمنح الأطفال حرية الحركة والتنقل أثناء الأداء. بفضل الضوء الملون المدمج في الميكروفون، يمكن للأطفال أن يتمتعوا بأداء ساحر وممتع ويعزفوا الأغاني المفضلة لديهم مع تأثيرات الإضاءة المبهجة. يعمل الميكروفون بالبطارية ومصنوع من مواد عالية الجودة مثل البلاستيك، مما يجعله آمنًا للاستخدام من قبل الأطفال. هذه المجموعة المذهلة ستساعد الأطفال على تطوير مهاراتهم الموسيقية والتعبير عن أنفسهم بطريقة ممتعة ومبدعة', 'BB324', NULL, NULL, '2023-12-23 20:57:10', '2023-12-23 20:57:10', NULL),
(657, 98, 1, 'لعبة الطائرة الدوارة', 'لعبة الطائرة الدوارة', 120, 220, NULL, NULL, 1, 'available', 'صممت لعبة الطائرة الدوارة الكهربائية للأطفال لتوفير ساعات من المرح والتسلية للصغار. تتميز هذه اللعبة بوظيفة الاصطدام والانطلاق، حيث تصدم الطائرة بالعوائق وتتحرك بشكل تلقائي بفضل التقنية الكهربائية المدمجة. كما تتميز اللعبة بالأضواء الملونة والموسيقى الامضة التي تجذب انتباه الأطفال وتزيد من متعة اللعب. تعد هذه اللعبة مثالية للأطفال في سن 2 إلى 13 سنة، ويمكن استخدامها أثناء التسلق والزحف لتعزيز مهارات الحركة لدى الطفل الصغير. صُممت اللعبة لتتوافق مع المعايير الأمانية، وتأتي بحجم مناسب يسهل حمله وتخزينه. ستضفي لعبة الطائرة الدوارة الكهربائية تجربة ممتعة وتعليمية على الأطفال', 'BB101', NULL, NULL, '2023-12-23 21:00:36', '2023-12-23 21:00:36', NULL),
(658, 97, 1, 'مجموعة الأطفال الطبية المبتكرة', 'مجموعة الأطفال الطبية المبتكرة', 100, 200, NULL, NULL, 1, 'available', '15 قطعة لعبة أطفال لعب دور الطبيب الممرضات ألعاب تعلم الطبية مجموعة كيت هدية حقيبة حمل صلبة\r\n\r\nهل تبحث عن لعبة تعليمية تساعد طفلك في استكشاف عالم الطب وتعزز مهاراته الإبداعية؟ إليك مجموعة الأطباء للأطفال المكونة من 15 قطعة. تمنح هذه اللعبة الشيقة الأطفال فرصة اللعب والتعلم بنفس الوقت. تحتوي المجموعة على أدوات طبية ومعدات مثل مشرط، ومقياس ضغط الدم، وسماعة طبية، ومزيد من الأدوات المثيرة. تعزز هذه الألعاب الدورية تخيل الأطفال وتشجعهم على اللعب الإبداعي وتطوير مهارات التواصل والتعاون. صُممت بعناية فائقة ومصنوعة من مواد آمنة وعالية الجودة. اجعل تجربة تعلم الطب ممتعة وشيقة لطفلك مع هذه اللعبة الممتعة والتعليمية للأطباء الصغار', 'BB241', NULL, NULL, '2023-12-23 21:03:32', '2023-12-23 21:03:32', NULL),
(659, 97, 1, 'مجموعة طبيب الأطفال المبتكرة', 'مجموعة طبيب الأطفال المبتكرة', 90, 190, NULL, NULL, 1, 'available', 'مجموعة الطبيب الطبية للعب هي لعبة تعليمية تحاكي الطبيب وتساعد الأطفال على تطوير مهاراتهم وخيالهم. تحتوي المجموعة على مجموعة متنوعة من الأدوات الطبية الصغيرة مثل المزيدة ومقياس الضغط ومصباح العين وغيرها، بالإضافة إلى عربة طبية لتخزين الأدوات ونقلها بسهولة. تم تصميمها بجودة عالية ومواد آمنة للاستخدام الطويل الأمد. تعزز هذه المجموعة الابتكارية اللعب الدوري والتعاون بين الأطفال، وتساعدهم في تطوير المهارات الاجتماعية واللغوية والمعرفية. إنها لعبة مثالية للأطفال في مرحلة ما قبل المدرسة وتوفر لهم فرصة للاستمتاع بتجربة اللعب الطبيب والتعلم في نفس الوقت', 'BB109', NULL, NULL, '2023-12-23 21:09:34', '2023-12-23 21:09:34', NULL),
(660, 118, 1, 'لوح الرسم للأطفال', 'لوح الرسم للأطفال', 60, 140, NULL, NULL, 1, 'available', 'أدوات مكتبية جاهزة للأطفال لوح رسمملون هي منتج مثالي لتشجيع الإبداع والتعبير الفني لدى الأطفال. يتميز هذا اللوح بتصميم ملون وجذاب يجذب انتباه الأطفال. يتضمن الطقم أيضًا لوحة رسم قابلة للطي ومجموعة من الأدوات المرفقة مثل القلم المغناطيسي والأشكال يمكن للأطفال استخدام هذا اللوح للرسم والكتابة والتعبير الإبداعي بحرية وسهولة. يعمل القلم على جذب الأشكال لإنشاء أعمال فنية ملونة ومبتكرة. إن هذا المنتج مثالي لتنمية مهارات الرسم والتفكير الإبداعي لدى الأطفال بطريقة ممتعة وتعليمية.', 'HB08', NULL, NULL, '2023-12-23 21:14:02', '2023-12-23 23:43:04', NULL),
(661, 118, 1, 'لوحة الإبداعية للأطفال', 'لوحة الإبداعية للأطفال', 30, 90, NULL, NULL, 1, 'available', 'لوحة الرسم المغناطيسية الملونة للأطفال هي لعبة تعليمية ممتعة تهدف إلى تنمية مهارات الرسم والكتابة لدى الأطفال. تتميز هذه اللوحة بتقنية المغناطيسية، حيث يمكن للأطفال وضع الأشكال المغناطيسية الملونة على اللوحة وترتيبها وإعادة ترتيبها بسهولة حسب خيالهم وإبداعهم. يمكن استخدامها للرسم والكتابة على الجدران الجانبية للوحة بواسطة القلم المرفق. تعد هذه اللوحة منتجًا آمنًا وصديقًا للبيئة، حيث تتكون من مواد بلاستيكية عالية الجودة ومغناطيسات قوية. إنها تعزز الابتكار والتفكير الإبداعي للأطفال وتساعدهم على تطوير مهاراتهم الفنية واللغوية بطريقة مسلية وتفاعلية', 'HB06', NULL, NULL, '2023-12-23 21:17:08', '2023-12-23 23:42:54', NULL),
(662, 98, 1, 'صلصال الإبداع الناعم', 'صلصال الإبداع الناعم', 80, 180, NULL, NULL, 1, 'available', 'صلصال الهواء الناعم الجاف للأطفال هو منتج فني إبداعي يهدف إلى تنمية مهارات الأطفال وتحفيز خيالهم. يتميز هذا الصلصال بقوامه الناعم والجاف، مما يسهل على الأطفال تشكيله وتشكيل الأشكال المختلفة. يحتوي على أكثر من 24 لونًا مشرقًا، مما يسمح للأطفال بالتعبير عن إبداعهم وتجسيد أفكارهم بألوان مختلفة. يعد هذا الصلصال مثاليًا للأطفال من سن 3 سنوات فما فوق، ويمكن استخدامه في المنزل أو في المدرسة. كما أنه آمن للاستخدام ومصنوع من مواد عالية الجودة. يعتبر صلصال الهواء الناعم الجاف هدية مثالية للأطفال الذين يهوون الفن والحرف اليدوية', 'CN07', NULL, NULL, '2023-12-23 23:48:23', '2023-12-23 23:48:23', NULL),
(663, 97, 1, 'صلصال الإبداع', 'صلصال الإبداع', 50, 150, NULL, NULL, 1, 'available', 'صلصال الإبداع الناعم للأطفال هو طقم عيد ميلاد ذكي مصمم خصيصًا لإشباع خيال الأطفال وتعزيز قدراتهم الإبداعية. يتكون الطقم من صلصال صديق للبيئة مصنوع من البلاستيسين، حيث يتميز بسهولة الاستخدام والتشكيل. يتميز الصلصال بألوان زاهية وحيوية تحفز الحواس وتعزز التجربة التشكيلية. كما أنه غير سام وآمن للاستخدام من قبل الأطفال. يعد هذا الطقم مناسبًا للأطفال من سن 3 سنوات فما فوق، ويمكن أن يوفر ساعات من المرح والإبداع. اجعل عيد ميلاد طفلك فرحة مليئة بالإبداع مع طقم صلصال الإبداع الناعم', 'CN06', NULL, NULL, '2023-12-23 23:51:42', '2023-12-23 23:51:42', NULL),
(664, 97, 1, 'علبة العاب لأطفال', 'علبة العاب لأطفال', 100, 200, NULL, NULL, 1, 'available', 'الفاكهة الحيوان النمذجة الاطفال الحرف اليدوى DIY ضوء الطين هو منتج ممتع وإبداعي يهدف إلى تنمية مهارات الأطفال وتحفيز خيالهم. يتميز هذا الطين بخصائصه الخاصة، حيث يمكن استخدامه في تشكيل أشكال الفواكه والحيوانات بسهولة. يتميز بخاصية عدم الجفاف، مما يسمح للأطفال بالاستمتاع بلعبه لفترة طويلة. يأتي بتصميمات متنوعة وألوان جميلة تجعل عملية النمذجة مسلية وممتعة. يعد هذا المنتج خيارًا مثاليًا لتطوير قدرات الإبداع والتركيز والمهارات الحركية لدى الأطفال. اجعل وقت اللعب مليئًا بالمرح والتشويق مع ضوء الطين لتشكيل الفواكه والحيوانات', 'CN05', NULL, NULL, '2023-12-23 23:59:34', '2023-12-23 23:59:34', NULL),
(665, 118, 1, 'قلم النفخ المبتكر', 'قلم النفخ المبتكر', 80, 150, NULL, NULL, 1, 'available', 'قلم فني للأطفال يُنفخ بالهواء هو قلم فني رائع ورائج يستخدم للصبغ والتلوين بشكل مبتكر. يأتي هذا القلم بتصميم جذاب يشبه قلمًا عاديًا، ولكنه يعمل بالنفخ بواسطة الهواء. يعتبر هذا القلم خيارًا ممتازًا كهدية ترويجية للأطفال، ويمكن استخدامه في المدارس والمناسبات الخاصة. يتميز بألوان زاهية ومبهجة تلهم الإبداع وتشجع الأطفال على التعبير الفني. يتميز بسعر مغرٍ ومناسب للميزانية، مما يجعله خيارًا مثاليًا للأهل والمعلمين الذين يرغبون في تطوير مهارات التلوين والإبداع لدى الأطفال. اجعل تجربة الرسم والتلوين للأطفال ممتعة ومثيرة مع قلم النفخ المبتكر هذا', 'BB60', NULL, NULL, '2023-12-24 00:04:52', '2023-12-24 00:04:52', NULL),
(666, 118, 1, 'السبورة اللوح', 'السبورة اللوح', 1, 150, NULL, NULL, 1, 'available', 'السبورة اللوح الأفريقية شعبية ومصممة خصيصًا للمدارس وروضة الأطفال. تتميز بجودة عالية وسطح أسود نوير يتيح كتابة ومسح الكتابات بسهولة وسلاسة. يتميز هذا المنتج بإطار ABC المتين الذي يوفر الدعم والاستقرار للسبورة. تتميز السبورة بحجمها المناسب الذي يجعلها مثالية لالسبورة اللوح الأفريقية شعبية ومصممة خصيصًا للمدارس وروضة الأطفال. تتميز بجودة عالية وسطح أسود نوير يتيح كتابة ومسح الكتابات بسهولة وسلاسة. يتميز هذا المنتج بإطار ABC المتين الذي يوفر الدعم والاستقرار للسبورة. تتميز السبورة بحجمها المناسب الذي يجعلها مثالية للاستخدام في الفصول الدراسية والأماكن التعليمية الأخرى. كما أنها قابلة للطي لسهولة التخزين والنقل. تعد هذه السبورة اللوح الأفريقية خيارًا مثاليًا لتعزيز عملية التعلم وتفاعل الطلاب في البيئة التعليمية', '00', NULL, NULL, '2023-12-24 00:13:17', '2023-12-24 03:36:31', NULL),
(667, 85, 1, '1 فرشاة شعر متعددة الوظائف 5  في', '1 فرشاة شعر متعددة الوظائف 5  في', 550, 860, NULL, NULL, 1, 'available', 'مصفف شعر الكهربائية مجفف الشعر فرشاة المهنية 5 في 1 الهواء الساخن فرشاة هو منتج رائع يجمع بين سبعة وظائف في جهاز واحد. يتميز بتصميم كامل الطراز ووظائف متعددة لتلبية احتياجات تصفيف الشعر المتنوعة. يمكن استخدامه لتجفيف الشعر وتصفيفه وتمليسه وتجعيد الشعر وإضافة حجم ولمعان للشعر، مما يمنحك تجربة تصفيف شعر متكاملة وفعالة. يحتوي على سلك كهربائي قابل للدوران 360 درجة لسهولة الاستخدام. يعد هذا المصفف شعر الكهربائية مجفف الشعر فرشاة المهنية 7 في 1 الهواء الساخن فرشاة خيارًا مثاليًا لتحقيق تسريحات شعر رائعة وأنيقة بسهولة وفعالية.', 'yn10', NULL, NULL, '2023-12-24 02:01:58', '2023-12-26 03:48:30', NULL),
(668, 85, 1, 'مكواة تجعيد الشعر المحمولة الأوتوماتيكية', 'مكواة تجعيد الشعر المحمولة الأوتوماتيكية', 140, 290, NULL, NULL, 1, 'available', 'مكواة تجعيد الشعر المحمولة الأوتوماتيكية هي أداة مثالية للحصول على تسريحة شعر جميلة ومنسقة في أي وقت وفي أي مكان. تتميز هذه المكواة بتقنية السخان PTC التي توفر سرعة التسخين السريعة والتوزيع المتساوي للحرارة. تعمل بقوة 55 واط وتصل درجة الحرارة إلى 210 درجة مئوية، مما يمنحك نتائج مثالية ومتسقة. تحتوي على لوحة من الألومنيوم بطلاء سيراميك لحماية الشعر وتقليل التلف. تتميز أيضًا بحبل دوار بزاوية 360 درجة لسهولة الاستخدام. هذه المكواة مثالية للاستخدام المنزلي وتتميز بتصميم محمول وعملي يسهل حملها أثناء السفر. استمتعي بتجعيد شعرك بسهولة وسرعة باستخدام هذه المكواة المحمولة والأوتوماتيكية.', 'xjd07', NULL, NULL, '2023-12-24 02:05:08', '2023-12-24 02:05:08', NULL),
(669, 85, 1, 'مكواة تجعيد الشعر cronier', 'مكواة تجعيد الشعر cronier', 400, 640, NULL, NULL, 1, 'available', 'جهاز فرد الشعر وتجعيد الشعر هو منتج رائع يوفر لك تجربة تصفيف الشعر المثالية. يتميز بتصميمه القابل للتعديل واللاسلكي، مما يتيح لك حرية الحركة والاستخدام في أي مكان. يعمل على تقوية الشعر وتنعيمه بفضل تقنية الأيونات السالبة المدمجة، مما يؤدي إلى تحقيق نتائج مذهلة لشعر صحي ولامع. يتميز أيضًا بشاشة LED لعرض درجة الحرارة وتحكم سهل ودقيق. يعمل الجهاز بتقنية PTC المتقدمة للتسخين السريع والتوزيع المتساوي للحرارة. بفضل مواده عالية الجودة وتصميمه المريح، يوفر هذا الجهاز تجربة فرد الشعر وتجعيده فائقة الجودة والأداء.', 'yn100', NULL, NULL, '2023-12-24 02:07:25', '2023-12-24 02:07:25', NULL),
(670, 85, 1, 'مكواة فرد الشعر الاحترافية', 'مكواة فرد الشعر الاحترافية', 220, 390, NULL, NULL, 1, 'available', 'مكواة فرد الشعر Kemei Km-532 الجملة صالون المهنية الأيونية الشعر باخرة نمط عناصر تعد أداة مثالية لتحقيق تسريحات شعر مستقيمة وأنيقة. تتميز هذه المكواة بتقنية الأيونات التي تساعد في تقليل تجعيد الشعر وتجعيده بفعالية، مما يتيح لك الحصول على شعر ناعم ولامع. تتميز بلوحات ألومنيوم عرض LCD لضبط درجة الحرارة وتحكم سهل. يمكن تعديل درجة الحرارة من 160 إلى 220 درجة مئوية وتسخينها في غضون 1-3 دقائق فقط. تأتي هذه المكواة بتصميم نحيف وخفيف الوزن، مما يجعلها محمولة ومناسبة للاستخدام اليومي في صالونات التجميل أو في المنزل.', 'YN-70', NULL, NULL, '2023-12-24 02:10:02', '2023-12-24 02:10:02', NULL),
(671, 116, 1, 'تمرين الصدر المعدني القوي', 'تمرين الصدر المعدني القوي', 200, 370, NULL, NULL, 1, 'available', 'شريط جديد موسع للصدر من الفولاذ يعد منتجًا احترافيًا لبناء عضلات الصدر وتقوية الجسم. يتميز هذا الشريط بتصميمه المتين والعالي الجودة، حيث يتم تصنيعه من الفولاذ والمواد البلاستيكية. يعمل على زيادة نطاق تمدد الحركة في الصدر وتقليل التوتر العضلي، مما يساعد على تحسين اللياقة البدنية والأداء الرياضي. يعتبر هذا الشريط مثاليًا لممارسي كمال الأجسام ورياضيي اللياقة البدنية الذين يهتمون بتطوير عضلات الصدر والجسم بشكل عام. كما أنه سهل الاستخدام والتخزين، حيث يمكن طيه بسهولة وحمله في حقيبة الرياضة. استثمر في هذا الشريط الموسع للصدر واستمتع بتحقيق نتائج مذهلة في تمارينك الرياضية.', 'TV65', NULL, NULL, '2023-12-24 02:13:01', '2023-12-24 02:13:01', NULL),
(672, 116, 1, 'قابض الصدر المرن', 'قابض الصدر المرن', 180, 300, NULL, NULL, 1, 'available', 'المحمولة البلاستيك مقبض خمسة الينابيع الصدر المتوسع سحب التمارين مع قابض يدوي المعصم المطور للتدريب الأسلحة الصدر هو منتج لياقة بدنية مبتكر يهدف إلى تقوية وتطوير عضلات الصدر والذراعين. يوفر هذا المنتج التمارين المناسبة لتمديد الصدر وتعزيز القوة والمرونة. يأتي بخمسة ينابيع قابلة للتعديل لتناسب مستوى اللياقة البدنية المختلفة. يتميز بمقبض بلاستيكي محمول وقابض يدوي للمعصم يسهل حمله واستخدامه في أي مكان. يعد هذا المنتج مناسبًا لكل من الرياضيين المحترفين والمبتدئين، ويوفر تجربة تدريبية فعالة لتحقيق الأهداف اللياقة البدنية الصدر والذراعين المرغوبة.', 'tv-59', NULL, NULL, '2023-12-24 02:15:32', '2023-12-24 02:15:32', NULL),
(673, 74, 1, 'كرة الأرض البلورية الفاخرة', 'كرة الأرض البلورية الفاخرة', 180, 280, NULL, NULL, 1, 'available', 'يتميز هذا المنتج بكرة الأرض المجسمة على حامل معدني وزجاجي، وهو منتج فريد وجميل يجمع بين القيمة الديكورية والعنصر التذكاري. تعرض الكرة الزجاجية المجسمة بشكل دقيق جمال الكرة الأرضية وتفاصيلها الطبيعية بطريقة مذهلة. يمكن استخدام هذا المنتج كزخرفة رائعة للمنزل أو المكتب، كما يعتبر هدية مميزة تعبر عن الإبداع والتميز. بفضل تقنية الحفر بالليزر ثلاثية الأبعاد، يمكن تخصيص هذه الكرة البلورية بشعار أو نص يعكس الهوية الفردية أو العلامة التجارية. يأتي المنتج في علبة هدايا فاخرة، مما يجعله اختيارًا مثاليًا لمناسبات الهدايا الخاصة.', 'jf-72', NULL, NULL, '2023-12-24 02:32:47', '2023-12-24 02:32:47', NULL),
(674, 74, 1, 'القاعدة  الضوئية الثلاثية الأبعاد', 'القاعدة  الضوئية الثلاثية الأبعاد', 120, 250, NULL, NULL, 1, 'available', 'منتجنا هو قاعدة خشبية مضيئة ثلاثية الأبعاد مصممة لتوفير إضاءة جميلة ومبهجة. تتميز هذه القاعدة بتصميمها الخشبي الأنيق والعصري، وتأتي بثلاثة ألوان مضيئة مختلفة لتناسب أذواقك المتنوعة. يمكن استخدامها لإضاءة اللوحات الاكريليكية ثلاثية الأبعاد، والمذكرات، ولوحات الرسائل، وحتى للكتابة المباشرة على الجدران. تعمل بالطاقة USB 5V، وتتمتع بوضع التبديل اليدوي لتشغيل وإيقاف التشغيل بسهولة. بفضل جودة التصنيع العالية والمواد الخشبية المتينة، فإنها توفر إضاءة مشرقة ومتواصلة لتعزيز أي مساحة داخلية. احصل على هذه القاعدة الخشبية المضيئة الفريدة وأضف لمسة ساحرة ومبهجة إلى منزلك أو مكتبك.', 'jf-73', NULL, NULL, '2023-12-24 02:37:08', '2023-12-24 02:37:08', NULL),
(675, 85, 1, 'مشط التدليك الخشن', 'مشط التدليك الخشن', 80, 180, NULL, NULL, 1, 'available', 'مشط خشن بمقبض خشبي للتدليك، مشط خشن بمقبض خشن، كيس هواء مقاوم للكهرباء الساكنة\r\n\r\nاحصل على تجربة تدليك مريحة ومميزة مع مشط الشعر الخشن بمقبض خشبي. يتميز هذا المشط بفرشاة خشنة تساعد في تنشيط فروة الرأس وتحسين تدفق الدم، مما يساهم في تحفيز نمو الشعر وتقويته. يأتي بمقبض خشبي عالي الجودة يوفر قبضة مريحة وثابتة أثناء الاستخدام. بالإضافة إلى ذلك، يتميز بكيس هواء مقاوم للكهرباء الساكنة، مما يساعد على تقليل التجعد وتجميد الشعر. اجعل روتين العناية بشعرك أكثر فعالية واستمتع بشعر صحي وجميل مع مشط الشعر الخشن بمقبض خشبي هذا.', 'jf-68', NULL, NULL, '2023-12-24 02:40:31', '2023-12-24 02:40:31', NULL),
(676, 85, 1, 'جهاز فرد الشعر الساخن', 'جهاز فرد الشعر الساخن', 80, 180, NULL, NULL, 1, 'available', 'جهاز فرد الشعر الساخن المحمول والمهني هو خيار مثالي لتحقيق تسريحة شعر مثالية في أي وقت وفي أي مكان. يتميز بتصميمه الأنيق والمحمول، مما يجعله سهل الاستخدام والحمل. يعمل هذا الجهاز بتقنية الاستقامة بالحرارة لتحقيق شعر مستقيم وناعم دون تلف الشعر. يمكن استخدامه أيضًا لتجعيد الشعر وإضفاء لمسة جمالية مميزة عليه. يتميز بوظيفة التدليك، مما يساعد في تحسين تدفق الدم في فروة الرأس وتحقيق تجربة مريحة ومريحة. يعمل هذا الجهاز بالبطارية القابلة للشحن، مما يوفر لك سهولة الاستخدام والتنقل. احصل على شعر رائع وجميل مع جهاز فرد الشعر الساخن المحمول والمهني.', 'yn44', NULL, NULL, '2023-12-24 02:43:27', '2023-12-24 02:43:27', NULL),
(677, 87, 1, 'مسحوق الأسنان الفحمي المبيض \"بياض ساطع\"', 'مسحوق الأسنان الفحمي المبيض \"بياض ساطع\"', 50, 130, NULL, NULL, 1, 'available', 'مسحوق Peimei لتبييض الأسنان هو منتج فعال يزيل بقع الأسنان ويحافظ على نظافة الفم العميقة من خلال الفحم. يعمل هذا المسحوق على تبييض الأسنان بلطف وفعالية، مما يساعد على تحسين مظهر الأسنان واستعادة الابتسامة الساحرة. بفضل تركيبته المتقدمة، يقوم Peimei بتنظيف الأسنان بعمق، ويزيل البقع السطحية والتصبغات الناجمة عن التدخين وتناول المشروبات الملونة. يمكن استخدامه في المنزل بسهولة، ويوفر نتائج ملحوظة خلال فترة زمنية قصيرة. يعتبر مسحوق Peimei لتبييض الأسنان خيارًا ممتازًا لمن يرغبون في الحصول على ابتسامة بيضاء ومشرقة وفم صحي.', 'tv-06', NULL, NULL, '2023-12-24 02:46:18', '2023-12-24 02:46:18', NULL),
(678, 85, 1, 'مشط الشعر السريع الكهربائي', 'مشط الشعر السريع الكهربائي', 200, 350, NULL, NULL, 1, 'available', 'مشط شعر كهربائي سريع - مشط شعر جديد\r\n\r\nاحصل على شعر مستقيم ولامع بسهولة وسرعة مع مشط شعر كهربائي سريع. يعد هذا المشط المبتكر حلاً فعالًا لتصفيف وتسوية الشعر بطريقة سهلة ومريحة. يتميز بتقنية PTC ولوحة ساخنة لتسخين سريع وتوزيع حرارة متساوٍ، مما يساعد على تنعيم الشعر وتجنب تلفه. يحتوي المشط على وظيفة المزدوج الرطب والجاف، مما يسمح لك باستخدامه على شعر جاف أو رطب. كما يتميز بتقنية الأيونات السالبة للمساعدة في تقليل التجعد وإضفاء لمعان صحي على الشعر. بالإضافة إلى ذلك، يتميز بتصميم مريح ومواد عالية الجودة للاستخدام الطويل الأمد. احصل على شعر ناعم ومفعم بالحيوية مع مشط شعر كهربائي سريع.', 'jf25', NULL, NULL, '2023-12-24 02:50:13', '2023-12-24 02:50:13', NULL),
(679, 85, 1, 'فرشاة الشعر الساخنة', 'فرشاة الشعر الساخنة', 180, 300, NULL, NULL, 1, 'available', 'أزياء تصفيفة الشعر الهواء الساخن آلة إلكترونية الشعر شد الذرة بيمد بكرة التخصيص الدعم.\r\n\r\nاحصل على تجربة تصفيف الشعر الاحترافية في منزلك مع آلة تصفيف الشعر الهواء الساخن هذه. تأتي هذه الآلة بتقنية إلكترونية متقدمة وشد الذرة بيمد بكرة التخصيص، مما يسمح لك بتجفيف وتصفيف شعرك بسهولة وفعالية. تتميز بوظيفة الدوران التلقائي للهواء الساخن، مما يوفر تجربة تصفيف مريحة وسريعة. كما تتمتع بجودة عالية وتصميم مريح للاستخدام. بفضل مجموعة الأدوات الأربعة في واحد، يمكنك تجفيف وتصفيف وتجعيد وتمليس شعرك بأسلوبك المفضل. يعد هذا المنتج خيارًا مثاليًا لأولئك الذين يبحثون عن تجربة تصفيف شعر احترافية ومريحة في المنزل.', 'yn06', NULL, NULL, '2023-12-24 02:53:43', '2023-12-24 02:53:43', NULL),
(680, 85, 1, 'مجعد الشعر الوردي المتدوّر', 'مجعد الشعر الوردي المتدوّر', 300, 500, NULL, NULL, 1, 'available', 'مجعد شعر وردي حديدي مجعد دوار هو منتج مثالي للحصول على تسريحة شعر مذهلة وجذابة. يتميز هذا المجعد بتصميمه الأنيق والعصري باللون الوردي، ما يجعله ليس فقط أداة فعالة ولكن أيضًا قطعة مميزة في مجموعة أدوات التجميل الخاصة بك. يتميز بوظيفة الدوران لتصفيف الشعر بسهولة وسرعة، ويحتوي على درجات حرارة متعددة لتناسب جميع أنواع الشعر. يعمل المجعد الحديدي بفعالية على تجعيد الشعر وإضفاء لمسة نهائية سلسة ولامعة. بفضل المواد عالية الجودة والتقنيات المتقدمة، يوفر هذا المجعد الشعر الوردي تجربة تصفيف ممتازة ونتائج مذهلة. استمتعي بتجربة تصفيف شعر مبهرة مع هذا المجعد الفريد والأنيق.', 'yn31', NULL, NULL, '2023-12-24 02:57:04', '2023-12-24 02:57:04', NULL),
(681, 85, 1, 'مكواة شعر إنزو', 'مكواة شعر إنزو', 450, 650, NULL, NULL, 1, 'available', 'يعتبر مكواة شعر محل حلاقة Enzo و PTC المزودة بمقبض مريح ومجموعة منتجات الحلاقة مفيدة ومريحة للاستخدام في أي مكان. تتميز هذه المكواة بتصميم متعدد الاستخدامات، حيث يمكن استخدامها لتجعيد الشعر وتسريحه بسهولة. تأتي بلوحة سيراميك مغطاة لتوفير توزيع حرارة متساوٍ وحماية الشعر من التلف. تتميز بشاشة LCD لعرض درجة الحرارة وتحكم دقيق في درجة الحرارة. تعتبر مكواة شعر Enzo مثالية للاستخدام في الفنادق والمحلات التجارية والمنازل. يمكنك الاعتماد على جودة هذا المنتج واستخدامه بثقة لتحقيق تسريحة شعر رائعة ومثالية في أي وقت وفي أي مكان.', 'yn32', NULL, NULL, '2023-12-24 02:59:29', '2023-12-24 02:59:29', NULL),
(682, 85, 1, 'Surker فرد الشعر المحمول', 'Surker فرد الشعر المحمول', 75, 180, NULL, NULL, 1, 'available', 'جهاز فرد الشعر المحمول Surker هو جهاز فعال ومريح لتحقيق تسريحة شعر مثالية في أي وقت ومكان. يأتي هذا الجهاز بتصميم صغير وخفيف الوزن، مما يجعله محمولًا بسهولة في حقيبتك أو حقيبة السفر. يعمل بقوة 45 واط ويتميز بلوحة سيراميك عالية الجودة لتوزيع حرارة متساوية وتحقيق نتائج سلسة ومثالية. يتميز بسلك دوار 360 درجة لحرية الحركة وسهولة الاستخدام. كما يوفر جهاز فرد الشعر Surker تجربة فرد فائقة السرعة والفعالية، ويعد خيارًا مثاليًا للنساء اللواتي يرغبن في الاستمتاع بشعر مستقيم ولامع في أي وقت تشاء.', '794', NULL, NULL, '2023-12-24 03:01:50', '2023-12-24 03:01:50', NULL),
(683, 85, 1, 'جهاز فرد الشعر nova', 'جهاز فرد الشعر nova', 160, 290, NULL, NULL, 1, 'available', 'فرد الشعر المحمول Surker هو منتج عالي الجودة مصمم خصيصًا للتصفيف المهني وتسريح الشعر في المنزل. يتميز هذا الجهاز بتصميمه المحمول والمريح، مما يجعله مثاليًا للاستخدام أثناء السفر أو في أي مكان آخر. يوفر لوحات الألومنيوم عالية الجودة توزيعًا متساويًا للحرارة، مما يساعد على تحقيق نتائج مثالية وتسريحة شعر سلسة ولامعة. يحتوي على وظيفة تحكم في درجة الحرارة لتناسب مختلف أنواع الشعر، مما يسمح لك بتحديد الحرارة المثالية لشعرك. بفضل ميزاته الرائعة والأداء الممتاز، ستحصل على تجربة تصفيف شعر احترافية في راحة منزلك.', 'yn64', NULL, NULL, '2023-12-24 03:04:09', '2023-12-24 03:04:09', NULL),
(684, 70, 1, 'مروحة الرفاهية المحمولة', 'مروحة الرفاهية المحمولة', 100, 250, NULL, NULL, 1, 'available', 'مراوح كهربائية بطباعة مخصصة مراوح محمولة صغيرة Usb مراوح تهوية بقاعدة مروحة صغيرة صناديق هدايا محمولة للرفاهية الحالية - تعتبر مراوح Surker فرصة مثالية للترويج لعلامتك التجارية أو إضفاء طابع شخصي على منزلك أو مكتبك. تتميز هذه المراوح الكهربائية بتصميم محمول صغير وقاعدة مروحة تهوية تعمل بتقنية USB، مما يجعلها مثالية للاستخدام في المكتب، أو الرحلات، أو الرحلات التنزه. بفضل إمكانية طباعة الشعار أو الرسومات المخصصة عليها، يمكنك تعزيز هوية علامتك التجارية أو تقديمها كهدية فريدة وأنيقة. تأتي في صناديق هدايا محمولة للرفاهية الحالية، تعتبر مراوح Surker خيارًا رائعًا للترويج وإضفاء الجمال في نفس الوقت.', 'jf107', NULL, NULL, '2023-12-24 03:07:29', '2023-12-24 03:07:29', NULL),
(685, 70, 1, 'مروحة الجمال المحمولة', 'مروحة الجمال المحمولة', 100, 240, NULL, NULL, 1, 'available', '\"مروحة الرفاهية المحمولة\" هي منتج مميز يتميز بالعديد من الميزات. تصميمها الصغير والظريف يجعلها مثالية للاستخدام في أماكن متعددة مثل المكاتب والمنازل والسيارات والرحلات. تعمل المروحة بتقنية الشحن اللاسلكي USB، مما يوفر راحة كبيرة للمستخدمين. بفضل تقنية Abs المصاصة، فإنها توفر تجربة تبريد فعالة وتساعد في تهدئة الهواء بدون إنتاج ضوضاء مزعجة. إضافة إلى ذلك، تتميز المروحة بوظيفة إعادة الشحن باليد، مما يجعلها قابلة للاستخدام في أي وقت وفي أي مكان. بالإضافة إلى ذلك، فإنها تأتي بتصميم جذاب ومخصص للعلامة التجارية، مما يجعلها منتجًا مثاليًا للاستخدام الشخصي أو كهدية.', 'jf108', NULL, NULL, '2023-12-24 03:10:45', '2023-12-24 03:10:45', NULL),
(686, 94, 1, 'بندقية ثقب الأذن', 'بندقية ثقب الأذن المتاحة', 400, 640, NULL, NULL, 1, 'available', 'ثقب المتاح سلامة الأذن مربط بيرس عدة القرط بندقية\r\nاحصل على مجموعة ثقب الأذن المثالية مع بندقية ثقب المتاح الآمنة والعملية. تتميز هذه البندقية بتصميم مريح يضمن سهولة الاستخدام والتحكم الدقيق. توفر لك البندقية إمكانية ثقب الأذن بسرعة وسهولة دون الحاجة إلى زيارة صالون التجميل. تأتي مع عدة قرط مثقبة متنوعة، مما يتيح لك اختيار الأنماط والأشكال المفضلة لديك. تتميز البندقية بالسلامة والنظافة، حيث تتم معالجة الإبر بشكل فردي وتعبئتها بشكل متاح. احصل على هذه البندقية العملية والموثوقة لتحقيق إطلالة مذهلة ومميزة بثقوب أذن جميلة وبأمان.', '00000', NULL, NULL, '2023-12-24 03:13:26', '2023-12-24 03:13:26', NULL),
(687, 68, 1, 'خلاط القوة المزدوجة', 'خلاط القوة المزدوجة', 550, 850, NULL, NULL, 1, 'available', 'خلاط خلاط كهربائي مع خلاط طاحونة - احصل على هذا الخلاط الكهربائي المتعدد الاستخدامات لتحقيق أقصى درجات الراحة في مطبخك. يأتي الخلاط بتصميم أنيق وقوة مذهلة بقوة 250 واط وجهازي تحكم في السرعة للسماح لك بضبط السرعة وفقًا لاحتياجاتك. بفضل الخلاط ذي السعة الكبيرة 1.5 لتر، يمكنك خلط وطحن مختلف المكونات بسهولة. يتضمن الخلاط أيضًا خلاط طاحونة يمكن استخدامه لطحن التوابل والقهوة والمكسرات، مما يجعله أداة متعددة الاستخدامات في مطبخك. احصل على هذا الخلاط الكهربائي العملي والقوي الآن لتحقيق نتائج رائعة في إعداد الطعام.', 'xjd05', NULL, NULL, '2023-12-24 03:15:37', '2023-12-24 03:15:37', NULL),
(688, 68, 1, 'خلاط القوة 3 في 1', 'خلاط القوة 3 في 1', 800, 1300, NULL, NULL, 1, 'available', '\"برطمانات كهربائية متعددة الأغراض 3 في 1 خلاط مع مطحنة\"\r\n\r\nهذا المنتج هو خلاط كهربائي متعدد الاستخدامات، حيث يتميز بوجود ثلاثة وظائف مختلفة في جهاز واحد. يأتي الخلاط مع ثلاثة برطمانات من الفولاذ المقاوم للصدأ، مما يتيح لك خيارات متعددة لخلط وتجهيز المكونات المختلفة.\r\n\r\nبالإضافة إلى وظيفة الخلاط، يحتوي هذا المنتج أيضًا على مطحنة، مما يتيح لك طحن المكونات الصلبة مثل التوابل والقهوة والمكسرات بسهولة.\r\n\r\nيتميز هذا الخلاط بتصميم متغير السرعة مع خمسة إعدادات لتناسب احتياجاتك المحددة. كما يتميز بقوة محرك 250 واط للحصول على أداء قوي وفعال.\r\n\r\nهذا الخلاط مثالي للاستخدام في المطابخ المنزلية ويوفر لك الراحة والمرونة في إعداد وجباتك المفضلة', 'xjd-107', NULL, NULL, '2023-12-24 03:18:29', '2023-12-24 03:21:31', NULL),
(689, 68, 1, 'خلاط 2في 1', 'خلاط 2في 1', 450, 650, NULL, NULL, 1, 'available', 'خلاط العصير والعصارة الكهربائي بقوة 350 واط هو جهاز مطبخ متعدد الوظائف يساعدك على تحضير العصائر الطازجة والسلطات الصحية بسهولة وفي وقت قصير. يتميز هذا الخلاط بتصميمه المدمج والعصري، ويتمتع بقدرة عالية على الطحن والخلط. إنه مصنوع من مواد عالية الجودة مثل الفولاذ المقاوم للصدأ والبلاستيك، مما يجعله متينًا وقويًا. يتمتع بوظائف متعددة مثل عصر الفواكه والخضروات وخلط المكونات. كما يحتوي على أربعة درجات سرعة لتناسب احتياجاتك المختلفة. بفضل ميزاته العملية والفعالة، ستتمتع بتجربة طهي ممتعة وسهلة مع هذا الخلاط الكهربائي.', 'JHP02', NULL, NULL, '2023-12-24 03:21:26', '2023-12-24 03:21:26', NULL),
(690, 68, 1, 'مفرمة العصائر المزدوجة', 'مفرمة العصائر المزدوجة', 650, 1100, NULL, NULL, 1, 'available', 'قمة ملكية من الفضة آلية بالكامل متعددة الوظائف عصارة فواكه منزلية للأطفال - احصل على خلاط القوة المزدوجة هذا الذي يجمع بين وظائف العصارة والخلاط في جهاز واحد مذهل. يأتي هذا الخلاط الكهربائي بوعاء من الفولاذ المقاوم للصدأ بسعة 1500 مل، وخمس سرعات مختلفة لتناسب تفضيلاتك. يمكنك استخدامه لعصر الفواكه أو خلط المكونات بسهولة وفعالية. يتميز بتصميمه الأنيق والمتعدد الوظائف، وهو مناسب للاستخدام في المنازل والفنادق والمطاعم التجارية. احصل على هذا الخلاط العملي والعصري لتجربة ممتعة وصحية في تحضير العصائر والمشروبات اللذيذة.', 'xjd106', NULL, NULL, '2023-12-24 03:24:12', '2023-12-24 03:24:12', NULL),
(691, 68, 1, 'خلاط sinboss', 'خلاط sinboss', 700, 1150, NULL, NULL, 1, 'available', 'خلاط كهربائي 600 وات-1200 وات 220 فولت بسعر منخفض مرتفع\r\n\r\nاحصل على خلاط كهربائي عالي الجودة وفعال بقوة تتراوح بين 600 وات و1200 وات، ويعمل بجهد 220 فولت. يعد هذا الخلاط خيارًا مثاليًا للمهام المنزلية والتجارية. يتميز بتصميمه القوي والمتين، ويوفر أداءً استثنائيًا في الخلط والعصر والتقطيع. يأتي الخلاط بست شفرات مصنوعة من الفولاذ المقاوم للصدأ، ويحتوي على وظائف متعددة مثل التلقائي لب اللب والتنظيف الذاتي والعكس. بفضل حجمه الكبير البالغ 2 لتر والقوة العالية، يمكنك الاعتماد على هذا الخلاط لإعداد مجموعة متنوعة من المشروبات والوجبات اللذيذة. استمتع بالأداء الرائع والجودة العالية مع هذا الخلاط الكهربائي.', 'xjd53', NULL, NULL, '2023-12-24 03:26:56', '2023-12-24 03:26:56', NULL),
(692, 107, 1, 'مصباح لمسة فاخرة', 'مصباح لمسة فاخرة', 320, 520, NULL, NULL, 1, 'available', 'مصباح طاولة LED القابل لإعادة الشحن والمحمول يعد حلاً مثاليًا لإضاءة غرفة النوم بأسلوب حديث وفاخر. يتميز هذا المصباح بجسم أكريليكي فاخر وجودة عالية، ويتميز بخاصية التعتيم لتنظيم الإضاءة حسب الحاجة. يعمل المصباح بواسطة منفذ USB، مما يجعله سهل الاستخدام ويوفر مرونة في توصيله بمصدر الطاقة المناسب. يمكن استخدامه كمصدر إضاءة للقراءة أو الدراسة في غرفة المكتب أو غرفة النوم، ويوفر إضاءة ناعمة ومريحة للعين. بفضل تصميمه القابل للطي والمغناطيسي، يمكن حمله بسهولة واستخدامه في أي مكان في المنزل أو أثناء السفر. هذا المصباح العملي والعصري هو اختيار رائع لإضافة لمسة من الإضاءة الفاخرة إلى غرفتك.', 'jf-78', NULL, NULL, '2023-12-24 03:29:26', '2023-12-24 03:29:26', NULL),
(693, 98, 1, 'ديناصور البخاخ الكهربائي', 'ديناصور البخاخ الكهربائي', 250, 400, NULL, NULL, 1, 'available', 'يتميز هذا اللعبة بتصميمه الواقعي لديناصور ، وهو ينتج أصواتًا وأضواءًا مشوقة أثناء المشي. يعد هذا البخاخ الكهربائي الخفيف والسهل الاستخدام هدية رائعة للأطفال في سن 3 وما فوق. إنه يوفر تجربة تعليمية ممتعة ومحفزة للأطفال لاستكشاف عالم الديناصورات وتعلم المزيد عنها. بفضل جودته العالية ومواده المتينة ، فإن هذا البخاخ الصوتي الآلي الكهربائي سيوفر ساعات طويلة من المرح والتسلية للأطفال. كما أنه يعزز خيالهم وقدراتهم الحركية ويشجعهم على الاستكشاف والتفاعل', 'JD85', NULL, NULL, '2023-12-24 03:41:34', '2023-12-24 03:41:34', NULL),
(694, 98, 1, 'مجموعة سيارات البناء الترفيهية 10 قطع', 'مجموعة سيارات البناء الترفيهية 10 قطع', 450, 800, NULL, NULL, 1, 'available', 'مجموعة لعب سيارة البناء بعجلات حرة - الحفارة، جرافة، شاحنة، نماذج بلاستيكية. استمتع باللعب والاستكشاف مع هذه المجموعة المدهشة التي تتضمن ثلاث سيارات بناء مصنوعة من البلاستيك عالي الجودة. تتميز هذه السيارات بعجلات حرة تسمح لها بالتحرك بسلاسة على الأرض، وتتضمن الحفارة والجرافة والشاحنة لتعزيز خيال الطفل وتشجيع الألعاب الإبداعية. مثالية للأطفال في سن 2 إلى 13 سنة، تعد هذه المجموعة مصدرًا للتسلية والتعلم. اجعل لعبة البناء أكثر متعة وإثارة مع هذه المجموعة المذهلة من سيارات البناء.', 'HA58', NULL, NULL, '2023-12-24 03:46:11', '2023-12-24 03:46:11', NULL),
(695, 98, 1, 'ضفدع الاسترخاء 12 قطعة', 'ضفدع الاسترخاء 12 قطعة', 300, 500, NULL, NULL, 1, 'available', 'تعتبر هذه المنتجات لعب الحيوانات الأليفة ذات الطابع المضحك خيارًا مثاليًا لتخفيف التوتر والإجهاد لدى الأطفال. تأتي هذه اللعبة بشكل ضفدع صغير مع تصميم يصدر أصواتًا عند الضغط عليه. مصنوعة من مادة TPR آمنة وصديقة للبيئة، وهي مناسبة للأطفال في الفئة العمرية من 8 إلى 13 سنة وما فوق. تعد هذه اللعبة التعليمية المرحة والملونة وسيلة ممتعة لتحسين التركيز والاسترخاء لدى الأطفال. بفضل جودتها العالية وتصميمها المبتكر، فإنها توفر تجربة لعب مسلية ومفيدة. احصل على هذه اللعبة الرائعة الآن واستمتع بأوقات ممتعة ومفعمة بالابتسامة مع الأطفال.', 'HL-67', NULL, NULL, '2023-12-24 03:49:17', '2023-12-24 03:49:17', NULL),
(696, 98, 1, 'كرة الاسترخاء الترفيهية 12 قطعة', 'كرة الاسترخاء الترفيهية 12 قطعة', 720, 1000, NULL, NULL, 1, 'available', 'كرة الضغط النابضة هي لعبة تعليمية جديدة ومثيرة تستهدف الأطفال من سن 5 إلى 7 سنوات. تتميز هذه الكرة بتصميم فريد وملون، حيث تحتوي على نتوءات مسننة تعمل على تدليك اليدين وتحفيز حواس اللمس. بالإضافة إلى ذلك، فإنها تضيء بشكل لامع عندما يتم تحريكها أو ضغطها، مما يزيد من متعة اللعب ويجذب انتباه الأطفال. تعمل هذه الكرة على تخفيف الضغط وتحسين التركيز، وتعتبر خيارًا ممتازًا للعب المنزلي والترفيه في الهواء الطلق. احصل على كرة الضغط النابضة اليوم ودع طفلك يستمتع بساعات من المرح والاسترخاء', 'HL-64', NULL, NULL, '2023-12-24 03:54:21', '2023-12-24 03:54:21', NULL),
(697, 99, 1, 'كتل المغامرة الإبداعية', 'كتل المغامرة الإبداعية', 150, 300, NULL, NULL, 1, 'available', 'تقدم لك لعبة كتل البناء 74-308 ساعاتٍ من المرح والترفيه. تتألف هذه اللعبة من مجموعة كبيرة من الكتل الملونة المصنوعة من مادة ABS الصديقة للبيئة. تتضمن اللعبة 77 قطعة، وتتوافق مع مدينة البناء الشهيرة، مما يتيح للأطفال إمكانية بناء مناظر مدهشة وهياكل مبتكرة. بفضل تصميمها المبتكر، تتيح اللعبة للأطفال تنمية مهارات البناء والتفكير المنطقي، بالإضافة إلى تعزيز الإبداع والتخيل. ستستمتع الأطفال بقضاء وقت ممتع ومفيد مع هذه اللعبة المسلية. احصل عليها الآن واجعل وقت لعب أطفالك مليئًا بالمرح والإبداع', 'HL58', NULL, NULL, '2023-12-24 03:57:49', '2023-12-24 03:57:49', NULL),
(698, 98, 1, 'لعبت المغامرة', 'لعبت المغامرة', 220, 420, NULL, NULL, 1, 'available', 'صنعت لعبة مصنع وصول جديد المنزل للأطفال لتوفير تجربة ممتعة وتعليمية للصغار. تتضمن هذه اللعبة متجر ألعاب التسوق في مول المنزل، وتعمل على تنمية مهارات الأطفال الذكائية والتفكير المنطقي. تتوفر فيها العديد من الألعاب التعليمية التي تساعد الأطفال في فهم المفاهيم الأساسية مثل الألوان والأشكال والأعداد. تحفز اللعبة الابتكار والإبداع من خلال محاكاة تجربة التسوق والتعلم في بيئة محاكاة آمنة. بفضل جودتها العالية وتصميمها المتين، تعد هذه اللعبة هدية مثالية للأطفال في مناسبات الأعياد والمناسبات الخاصة', 'BB129', NULL, NULL, '2023-12-24 04:01:19', '2023-12-24 04:01:19', NULL),
(699, 97, 1, 'مجموعة المطبخ المعرفية للأطفال', 'مجموعة المطبخ المعرفية للأطفال', 220, 490, NULL, NULL, 1, 'available', 'تقدم لك ألعاب تعليمية للأطفال مجموعة ألعاب المطبخ فتاة عائلة شوكة وسكينة دونات الشاي بعد الظهر المعرفية التفاعلية مغامرة تعليمية مثيرة لأطفالك. تساعد هذه المجموعة الأطفال على تنمية المهارات التعليمية والإبداعية بطريقة ممتعة وتفاعلية. تأتي مع مجموعة متنوعة من الأدوات المطبخية الواقعية، مثل الشوكة والسكين والدونات والشاي بعد الظهر، مما يمكّن الأطفال من التعلم عبر اللعب وتجربة الأدوات اليومية. تعزز هذه اللعبة الإبداعية التفكير والتنسيق الحركي والقدرات الاجتماعية. اجعلي تجربة التعلم ممتعة وشيقة لأطفالك مع ألعاب تعليمية للأطفال مجموعة ألعاب المطبخ فتاة عائلة شوكة وسكينة دونات الشاي بعد الظهر المعرفية التفاعلية.', '88199', NULL, NULL, '2023-12-24 04:04:29', '2023-12-24 04:04:29', NULL);
