(700, 97, 1, 'مجموعة تجميل الأطفال المبتكرة', 'مجموعة تجميل الأطفال المبتكرة', 60, 120, NULL, NULL, 1, 'available', 'لعبة الماكياج للأطفال من البلاستيك، ولعبة التظاهر الممتعة التي ستسعد الصغار وتمنحهم تجربة واقعية للعب دور الماكياج وتطبيق طلاء الأظافر. تأتي هذه اللعبة مع طلاء أظافر للأطفال، وتوفر لهم فرصة للتعبير عن إبداعهم وتجربة ألوان مختلفة بطريقة آمنة ومسلية. تعمل اللعبة على تنمية خيال الطفل ومهاراته الحركية الدقيقة، وتعزز قدرته على التعبير الإبداعي واللعب التمثيلي. بتصميمها البلاستيكي الجذاب وسهولة الاستخدام، تعد هذه اللعبة خيارًا مثاليًا لهدية للأطفال ولتنمية مهاراتهم بطريقة ممتعة ومبتكرة.', 'BB344', NULL, NULL, '2023-12-24 04:32:15', '2023-12-24 04:32:15', NULL),
(701, 98, 1, 'سيارة القيادة الروبوتية', 'سيارة القيادة الروبوتية', 140, 280, NULL, NULL, 1, 'available', 'سيارة بجهاز تحكم عن بعد رباعية الحركة هي منتج مبتكر يوفر تجربة ممتعة ومثيرة للأطفال. تأتي هذه السيارة بتصميم روبوتي مدهش وتتميز بقدرتها على التحرك في جميع الاتجاهات بفضل وظيفة الرباعية الحركة. يمكن للأطفال التحكم في السيارة باستخدام جهاز التحكم عن بعد المرفق، مما يسمح لهم بالقيادة والتوجيه بسهولة. تشمل الميزات الأخرى للسيارة خط شحن USB للبطارية، مما يسهل عملية إعادة الشحن والاستمتاع بوقت لعب طويل. بالإضافة إلى ذلك، فإن هذه السيارة مصنوعة من مواد عالية الجودة تضمن المتانة والصلابة. بفضل هذه الميزات المذهلة، ستكون سيارة بجهاز تحكم عن بعد رباعية الحركة خيارًا مثاليًا للاستمتاع', 'TJH62', NULL, NULL, '2023-12-24 04:39:40', '2023-12-24 04:39:40', NULL),
(702, 98, 1, 'سيارة الشرطة الرباعية بالتحكم عن بُعد', 'سيارة الشرطة الرباعية بالتحكم عن بُعد', 280, 500, NULL, NULL, 1, 'available', 'تقدم لك هذه السيارة الشرطة ذات الأضواء الرباعية والتحكم عن بُعد تجربة رائعة للأطفال. تتميز بتصميم مثير ومبهج يجذب انتباه الأطفال. يمكن التحكم في السيارة بسهولة عبر جهاز التحكم عن بُعد، حيث يمكن أن تتحرك في أربع اتجاهات مختلفة. بالإضافة إلى ذلك، تتميز بأضواء ملونة تعمل عند تشغيلها، مما يزيد من إثارة اللعبة. تعمل السيارة ببطارية ليثيوم قابلة للشحن، وتأتي مع كابل USB لسهولة الشحن. تعد هذه السيارة الشرطة الرباعية الاتجاه خيارًا ممتازًا لهدية الأطفال ومصدرًا للتسلية والمرح اللا حدود', 'TJH08', NULL, 'uploads/supplier/supplier-702-2023-12-24.pdf', '2023-12-24 04:42:28', '2023-12-24 15:21:34', NULL),
(703, 99, 1, 'بيانو الأطفال الموسيقي', 'بيانو الأطفال الموسيقي', 220, 450, NULL, NULL, 1, 'available', 'جهاز إلكتروني مع المدمج في مكبر الصوت ميكروفون أطفال لوحة المفاتيح البيانو 31 مفتاحًا هو منتج مثالي للأطفال الصغار الذين يهتمون بالموسيقى ويرغبون في استكشافها. يتميز هذا الجهاز بتصميمه المصغر الذي يناسب أيدي الأطفال بسهولة. يحتوي على لوحة مفاتيح بيانو تحتوي على 31 مفتاحًا يمكن استخدامها لإنشاء الألحان الموسيقية المبتكرة. كما يتضمن ثلاثة وضعيات مختلفة للإيقاع وثلاثة أصوات موسيقية مختلفة واثنين من الإيقاعات الإيقاعية. يمكن للأطفال تعلم الموسيقى والإبداع من خلال استخدام هذا الجهاز الممتع. بالإضافة إلى ذلك، يتضمن ميكروفونًا مدمجًا لممارسة الغناء واستكشاف مهارات الأداء الصوتي. إنه منتج مثالي لتعزيز الابتكار الموسيقي والترفيه لدى الأطفال.', 'TJH11', NULL, NULL, '2023-12-25 03:16:27', '2023-12-25 03:16:27', NULL),
(704, 98, 1, 'سيارة السباق الرياضية التحكم عن بعد بنسبة للأطفال', 'سيارة السباق الرياضية التحكم عن بعد بنسبة للأطفال', 180, 330, NULL, NULL, 1, 'available', '1:20 رباعية التحكم عن بعد سيارة لعب الأطفال سيارة رياضية التحكم عن بعد لألعاب الأطفال Rc الرياضة السيارات عن الرياضة Rc سيارات - اشترِ سيارة رياضية لعب الأطفال بنسبة 1:20 مع نظام التحكم عن بعد الرباعي. توفر هذه السيارة الرياضية الرائعة ساعات من المتعة والترفيه للأطفال. تتميز بتصميم رياضي وجودة عالية، وتأتي بوظائف مثيرة مثل الأضواء وفتح الأبواب وامتصاص الصدمات. يمكن للأطفال التحكم في السيارة عن بعد لمسافة تصل إلى 100 متر. إنها لعبة مثالية للترفيه وجمع السيارات للأطفال من سن 2 إلى 7 سنوات. اجعل أطفالك يستمتعون بتجربة القيادة والمغامرة مع هذه السيارة الرياضية الرائعة', 'BB-144', NULL, NULL, '2023-12-25 03:20:13', '2023-12-25 03:20:13', NULL),
(705, 98, 1, 'سيارة السرعة اللاسلكية 4WD RC', 'سيارة السرعة اللاسلكية 4WD RC', 120, 250, NULL, NULL, 1, 'available', 'سيارة كونيانغ 16 1 مركبة Usb لاسلكية 4wd Rc للأطفال سيارة أطفال ببطارية قابلة لإعادة الشحن ألعاب بجهاز تحكم عن بعد\r\n\r\nاستمتع بتجربة السرعة والمرح مع سيارة كونيانغ 16 1 مركبة USB لاسلكية 4wd Rc للأطفال. تصميمها العصري والجذاب يجعلها مثالية للأطفال الذين يحبون لعب السيارات الرياضية. تأتي السيارة ببطارية قابلة لإعادة الشحن، مما يوفر ساعات طويلة من المتعة دون الحاجة إلى استبدال البطاريات. يتم التحكم في السيارة عن بُعد باستخدام جهاز التحكم اللاسلكي، مما يسمح للأطفال بتوجيه السيارة في الاتجاه المطلوب واستكشاف العالم من حولهم. سواء كنت تلعب في الداخل أو في الهواء الطلق، فإن هذه السيارة المدهشة ستضمن ساعات لا نهائية من المرح والتسلية لأطفالك.', 'BB243', NULL, NULL, '2023-12-25 03:27:05', '2023-12-25 03:27:05', NULL),
(706, 98, 1, 'سيارةالطرق الوعرة', 'سيارةالطرق الوعرة', 170, 270, NULL, NULL, 1, 'available', 'تتميز سيارة جيب RC بمقياس 1:18 على الطرق الوعرة بفتح الباب وتحكم عن بعد بـ 5 قنوات وإضاءة مذهلة. تعد هذه السيارة اللاسلكية واحدة من أفضل الخيارات لعشاق السيارات الرياضية الصغيرة. تتميز بتصميم جذاب وواقعي يعكس الجيب الحقيقي، مما يجعلها تبدو وكأنها نسخة مصغرة من السيارة الأصلية. تتميز بوظيفة فتح الباب والتحكم عن بعد بـ 5 قنوات، مما يسمح لك بالتحرك في جميع الاتجاهات والتحكم الكامل في السيارة. بالإضافة إلى ذلك، تأتي السيارة مع إضاءة جذابة تضفي مظهرًا مذهلاً أثناء اللعب. احصل على هذه السيارة الجيب RC الرائعة الآن واستمتع بتجربة قيادة واقعية وممتعة على الطرق الوعرة.', 'BB256', NULL, NULL, '2023-12-25 03:29:41', '2023-12-25 03:29:41', NULL),
(707, 98, 1, 'سيارة ألعاب', 'سيارة ألعاب', 120, 220, NULL, NULL, 1, 'available', 'سيارة لعب للأطفال RW Jianfengyuan، سيارة Rc، نموذج R8، لعبة أودي مرخصة، مصممة خصيصًا لإشباع شغف الأطفال بالسيارات. تأتي هذه السيارة بنسخة مصغرة من السيارة الحقيقية Audi R8 ، وتوفر تجربة قيادة ممتعة ومثيرة. تحتوي على واجهة أنيقة ومصابيح أمامية وخلفية ساطعة لإعطاء انطباع واقعي. يتم التحكم فيها عن بُعد بتردد 27 ميجا هرتز، مما يمنح الأطفال مرونة وحرية في توجيه السيارة. مصنوعة من مواد عالية الجودة وآمنة للاستخدام الداخلي والخارجي. تعتبر سيارة ألعاب أودي R8 Rc هذه هدية مثالية للأطفال الذين يهوون السيارات ويرغبون في تجربة قيادة مشوقة وممتعة.', 'BB-260', NULL, NULL, '2023-12-25 03:33:03', '2023-12-25 03:33:03', NULL),
(708, 99, 1, 'تلسكوب الطفل الموسيقي', 'تلسكوب الطفل الموسيقي', 160, 260, NULL, NULL, 1, 'available', 'تلعب لعبة تلسكوب الطفل هذه دورًا هامًا في تعزيز تطور الطفل وتوسيع مهاراته الحسية. تم تصميمها خصيصًا للأطفال من عمر 2 إلى 14 سنة، وتوفر تجربة تعليمية ممتعة وتحفيزية. يتميز التلسكوب بتصميم بلاستيكي مونتيسوري عالي الجودة، ويتضمن ميزات مثل الضوء والموسيقى لإضفاء الحيوية على اللعبة. يمكن للأطفال استخدام هذا التلسكوب للاستمتاع بأنشطة استكشافية ومشاهدة الأشياء من بعيد. بفضل تصميمه الآمن والمتين، يمكن للأطفال الاستمتاع باللعبة بأمان وتعزيز قدراتهم الحسية والتنسيق بين اليد والعين. هذا التلسكوب هو لعبة تعليمية رائعة لتوسيع مفهوم الأطفال عن العالم من حولهم.', 'BB185', NULL, NULL, '2023-12-25 03:36:53', '2023-12-25 03:36:53', NULL),
(709, 98, 1, 'شاحنة الشرطة لعبة الأطفال التعليمية', 'شاحنة الشرطة لعبة الأطفال التعليمية', 100, 200, NULL, NULL, 1, 'available', 'شاحنة الشرطة لعبة الأطفال التعليمية DIY هي منتج ممتع وتعليمي يهدف إلى تطوير مهارات الأطفال وإشراكهم في نشاطات إبداعية. تتميز الشاحنة بتصميم جميل ومبهج يجذب انتباه الأطفال. يمكن للأطفال تجميع الشاحنة بأنفسهم باستخدام الأجزاء المرفقة والأدوات المرفقة وتعليمات التجميع. تعتبر هذه التجربة ممتعة وتساعد الأطفال على تنمية مهاراتهم الحركية الدقيقة والتركيز. بعد الانتهاء من التجميع، يمكن للأطفال استكشاف وتجربة مختلف وظائف الشاحنة وتخيل مشاهد الشرطة والمغامرات. إنها لعبة تجمع بين المرح والتعلم بطريقة مبدعة وتثقيفية', 'BB176', NULL, NULL, '2023-12-25 03:39:14', '2023-12-25 03:39:14', NULL),
(710, 97, 1, 'مجموعة تجميل الأميرة الوردية', 'مجموعة تجميل الأميرة الوردية', 50, 120, NULL, NULL, 1, 'available', 'إبت دولارتويز تعزيز ماكياج الوردي فتاة الجمال هو مجموعة لعب رائعة تهدف إلى تعزيز خيال الأطفال ومهاراتهم الإبداعية. تحتوي المجموعة على مجموعة واسعة من أدوات الماكياج الوردي الجميلة التي تتضمن أحمر الشفاه والمرايا والفرش والمساحيق والمزيد. تصميمها الجميل واللون الوردي الزاهي يضفي مزيدًا من السحر والأناقة على تجربة اللعب. تعزز هذه المجموعة الخيال والابتكار وتساعد الأطفال في تطوير مهاراتهم الاجتماعية واللغوية أثناء اللعب. إنها تعتبر هدية مثالية للفتيات الصغيرات اللواتي يحببن اللعب بالماكياج والتظاهر بالجمال والأناقة. استمتعوا بالوقت الممتع والإبداعي مع مجموعة إبت دولارتويز تعزيز ماكياج الوردي فتاة الجمال!', 'BB132', NULL, NULL, '2023-12-25 03:57:33', '2023-12-25 03:57:33', NULL),
(711, 98, 1, 'مجموعة الشرطة المثيرة', 'مجموعة الشرطة المثيرة', 140, 280, NULL, NULL, 1, 'available', 'مجموعة ألعاب الأطفال البيني البلاستيكية تضم مجموعة من الألعاب المستوحاة من رجال الإطفاء. تتضمن المجموعة ملحقات شرطة مثيرة مثل قبعة الشرطة والأدوات اللازمة لتجربة لعب ممتعة وتخيلية. كما تتضمن مجموعة الألعاب أيضًا أكسسوارات إضافية مثل جهاز اتصال لاسلكي ومجموعة من هواتف البلاستيك المترابطة، مما يسمح للأطفال بتجسيد دور رجال الإطفاء والتواصل والتنسيق معًا في مهمتهم الخيالية. تعتبر هذه المجموعة البلاستيكية مثالية لتنمية مهارات اللعب التخيلي وتعزيز التعاون والتواصل بين الأطفال. صُنعت المجموعة باستخدام مواد عالية الجودة لضمان المتانة والأمان أثناء اللعب.', 'BB131', NULL, NULL, '2023-12-25 04:05:34', '2023-12-25 04:05:34', NULL),
(712, 99, 1, 'مجموعة حيوانات الغابة المثيرة', 'مجموعة حيوانات الغابة المثيرة', 40, 80, NULL, NULL, 1, 'available', 'تعرض هذه المجموعة من لعب حيوانات الغابة المصنوعة من البلاستيك تجربة لعب ممتعة وتعليمية للأطفال. تحتوي المجموعة على ثمانية أنواع مختلفة من الحيوانات البرية، بما في ذلك الأسد، والزرافة، والفيل، والنمر، والقرد، والزائر، والفهد، والتمساح. صُممت الحيوانات بشكل واقعي ومفصل، مما يساعد في تعزيز خيال الطفل وتحفيز لعب الأدوار والقصص المبتكرة. تعتبر هذه اللعبة مثالية للعب الفردي أو اللعب الجماعي، وهي تساعد في تنمية مهارات التعرف على الحيوانات وتوسيع المفردات وتعزيز التنسيق الحركي للأطفال. بالإضافة إلى ذلك، فإن المواد البلاستيكية عالية الجودة تضمن المتانة والسلامة أثناء اللعب.', 'BB342', NULL, NULL, '2023-12-25 04:09:02', '2023-12-25 04:09:02', NULL),
(713, 98, 1, 'مسدس ترفيهي', 'مسدس ترفيهي', 100, 190, NULL, NULL, 1, 'available', 'مسدس لعبة الكهربائي الصبي بالأضواء المتلألئة والصوت هو منتج مثالي للأطفال. يتميز هذا المسدس بتصميمه الجذاب والمشرق، حيث يتميز بأضواء ملونة تومض وتلمع، مما يضفي على اللعبة طابعًا ممتعًا ومثيرًا. بالإضافة إلى ذلك، يأتي المسدس مع صوت واقعي يضيف المزيد من الإثارة والمتعة لتجربة اللعب. يتمتع هذا المنتج بجودة عالية ومصنوع من مواد بلاستيكية آمنة للاستخدام اليومي. كما يأتي بحجم ملائم لأيدي الأطفال، مما يسهل حمله واستخدامه. اجعل لحظات اللعب أكثر إشراقًا ومرحًا مع مسدس اللعب الكهربائي للأطفال هذا', '0000', NULL, NULL, '2023-12-25 04:12:26', '2023-12-25 04:12:26', NULL),
(714, 97, 1, 'عصا السحر الضوئية', 'عصا السحر الضوئية', 50, 90, NULL, NULL, 1, 'available', 'عصا سحرية مضيئة، عصا مضيئة تضيء عصا كرة سحرية مضيئة عصا كرة مضيئة LED لعبة مطاطية لعيد ميلاد الأميرة هالوين للحفلات KNL102. استمتع بالسحر والإثارة مع هذه العصا السحرية المضيئة. تتميز بتأثير الإضاءة اللامعة والجذابة التي تجعل العصا تبدو سحرية وممتعة. توفر تجربة لعب مدهشة للأطفال والكبار على حد سواء. مصنوعة من مواد عالية الجودة ومطاطية للغاية، مما يجعلها آمنة ومتينة للاستخدام الطويل. تعتبر هذه العصا المضيئة خيارًا مثاليًا لحفلات عيد الميلاد وحفلات الأميرات والهالوين والاحتفالات الأخرى. اجذب الأنظار وأضف لمسة سحرية إلى الحفل الخاص', 'YH04', NULL, NULL, '2023-12-25 04:16:37', '2023-12-25 04:16:37', NULL),
(715, 97, 1, 'مجموعة لعبة المطبخ الساحرة مع ماكينة تسجيل المدفوعات النقدية', 'مجموعة لعبة المطبخ الساحرة مع ماكينة تسجيل المدفوعات النقدية', 80, 160, NULL, NULL, 1, 'available', 'تعتبر مجموعة لعبة المطبخ المثيرة للاهتمام للأطفال مع ماكينة تسجيل المدفوعات النقدية منتجًا رائعًا وممتعًا للأطفال. تتضمن هذه المجموعة مجموعة متنوعة من الأدوات والأطباق البلاستيكية ذات الألوان الزاهية والجذابة. يمكن للأطفال استخدامها للتمثيل واللعب بأدوار المطبخ وإعداد الطعام الخيالي.\r\n\r\nوبالإضافة إلى ذلك، تتضمن المجموعة ماكينة تسجيل المدفوعات النقدية، حيث يمكن للأطفال تجربة دور البائع وتقديم الخدمات والمبيعات. يعزز هذا اللعب الإبداعي مهارات التخيل والتفاعل الاجتماعي لدى الأطفال ويساعدهم في تطوير مهارات العد والرياضيات البسيطة.\r\n\r\nتعتبر مجموعة لعبة المطبخ المثيرة للاهتمام مع ماكينة تسجيل المدفوعات النقدية هدية ممتازة للأطفال وتعزز التعلم والترفيه في وقت واحد.', 'HL01', NULL, NULL, '2023-12-25 04:20:34', '2023-12-25 04:20:34', NULL),
(716, 99, 1, 'لوحة رسم الإبداع المتحركة', 'لوحة رسم الإبداع المتحركة', 280, 500, NULL, NULL, 1, 'available', 'لوحة رسم بروجكتوري لوحة تتبع رسم انعكاس منظر للأطفال\r\n\r\nتعتبر لوحة الرسم البروجكتورية لوحة تتبع رسم انعكاس منظر للأطفال ألعابًا لوحية رائعة. تساعد هذه اللوحة الأطفال على تطوير مهاراتهم الإبداعية والرسم، حيث يمكنهم تتبع الصور المعروضة على اللوحة ونقلها إلى الورقة أو السطح الذي يرسمون عليه. تأتي اللوحة مع مجموعة متنوعة من الصور الملونة والجذابة التي يمكن للأطفال اختيارها وتتبعها. كما تتميز اللوحة بوظيفة الانعكاس لإضفاء مزيد من الإثارة والتشويق على عملية الرسم. تعد لوحة الرسم البروجكتورية هذه اختيارًا مثاليًا للأطفال الذين يستمتعون بالإبداع والتعبير الفني', 'BB112', NULL, NULL, '2023-12-25 04:23:43', '2023-12-26 03:48:45', NULL),
(717, 97, 1, 'مجموعة الطبخ الخيالية للأطفال', 'مجموعة الطبخ الخيالية للأطفال', 60, 100, NULL, NULL, 1, 'available', 'مجموعة أدوات الطبخ المخصصة للأطفال مع فنجان شاي ومجموعة دور اللعب هي لعبة ممتعة وتعليمية للأطفال. تتضمن المجموعة مجموعة متنوعة من الأدوات المصنوعة من البلاستيك عالي الجودة، مثل السكين والشوكة والملاعق والمقصات وغيرها، بالإضافة إلى فنجان شاي وأطباق صغيرة وأدوات أخرى.\r\n\r\nتعزز هذه المجموعة خيال الأطفال وتشجعهم على التفاعل واللعب الإبداعي. يمكن للأطفال استخدام هذه الأدوات لتقطيع الفواكه الوهمية وإعداد وجبات خيالية. بالإضافة إلى ذلك، تساعد هذه اللعبة على تنمية مهاراتهم الحركية الدقيقة وتعزز التعلم الذاتي والتفكير الإبداعي.\r\n\r\nبواسطة مجموعة أدوات الطبخ هذه، سيستمتع الأطفال بساعات من المرح واللعب الإبداعي، بينما يتعلمون مهارات جديدة ويطورون خيالهم وقدراتهم.', '900', NULL, NULL, '2023-12-25 04:25:58', '2023-12-25 23:06:34', NULL),
(718, 98, 1, 'لعبة الغزل المعدنية الدوّارة', 'لعبة الغزل المعدنية الدوّارة', 50, 100, NULL, NULL, 1, 'available', 'هذه اللعبة الدوّارة الكلاسيكية هي هدية مثالية للأطفال والبالغين على حد سواء. تأتي اللعبة بتصميم معدني متين وجهاز إطلاق مرفق، مما يجعلها مثالية للعب الممتع والمسلي. تعتبر هذه اللعبة من الألعاب الشهيرة والمحبوبة، حيث توفر تجربة غزل ممتعة ومثيرة. يمكن للأطفال والبالغين استخدامها لتحسين المهارات الحركية والتنسيق بين اليدين. بفضل تصميمها الكلاسيكي وجودتها الممتازة، تعد هذه اللعبة هدية فريدة ومميزة لأحبائك. ستضفي لمسة من المرح والتسلية على وقت اللعب وستكون إضافة رائعة لأي مجموعة ألعاب. احصل على هذه اللعبة الدوّارة الكلاسيكية اليوم واستمتع بساعات لا تُنسى من اللعب الممتعة.', '000-0', NULL, NULL, '2023-12-25 04:28:51', '2023-12-26 03:03:33', NULL),
(719, 107, 1, 'مصباح ورود اللمس الملون', 'مصباح ورود اللمس الملون', 250, 450, NULL, NULL, 1, 'available', 'مصباح طاولة من الورود بإضاءة ليد قابلة لإعادة الشحن مع إمكانية تخفيف الإضاءة باللمس ملونة بنظام لوني أحمر أخضر أزرق هو منتج راقٍ وعصري يضفي جمالًا فريدًا على أي مكان. يتميز بتصميمه الحديث ومواده عالية الجودة، حيث يتم تشكيل الورود الاصطناعية بشكل فني ويتم تنويرها بواسطة تقنية الإضاءة بالليد. يمكن تعديل سطوع الإضاءة بسهولة عن طريق اللمس، ويتوفر بمجموعة من الألوان الملونة لإضفاء أجواء مميزة ورومانسية. يعتبر هذا المصباح مثاليًا للاستخدام في غرف النوم والفنادق والبارات، حيث يوفر إضاءة مريحة وجذابة. كما أنه يتمتع بميزة الشحن اللاسلكي وقدرة البطارية على إعادة الشحن، مما يجعله محمولًا وعمليًا للاستخدام في أي مكان ترغب فيه.', 'jf97', NULL, NULL, '2023-12-26 01:46:32', '2023-12-26 01:46:32', NULL),
(720, 126, 1, 'فرن طهي كهربائي مزدوج', 'فرن طهي كهربائي مزدوج', 300, 450, NULL, NULL, 1, 'available', 'فرن طهي منزلي مزدوج صغير، فرن ترموستات، طباخ حليب ساخن للسفر، وصحن ساخن. هذا الفرن المزدوج الكهربائي بتقنية الأشعة تحت الحمراء مثالي لاستخدامه في المنزل. يتميز بتصميمه الصغير الحجم مما يجعله مثاليًا للمطابخ الصغيرة. يوفر الفرن تحكمًا دقيقًا في درجات الحرارة بفضل وجود ترموستات، مما يسمح لك بتحضير الطعام بشكل مثالي. يأتي الفرن مع طباخ حليب ساخن للسفر وصحن ساخن للتلذذ بالحليب الدافئ أو الأطباق الساخنة أثناء التنقل. يعد هذا الفرن الكهربائي المزدوج حلاً مثاليًا لتلبية احتياجات الطهي المنزلي بشكل سهل وفعال.', 'xjd110', NULL, NULL, '2023-12-26 01:51:51', '2023-12-26 01:51:51', NULL),
(721, 126, 1, 'موقد كهربائي محمول', 'موقد كهربائي محمول', 220, 380, NULL, NULL, 1, 'available', 'موقد كهربائي ممتاز محمول بطبق ساخن صلب من العلامة التجارية الممتازة 1 - احصل على موقد كهربائي محمول عالي الجودة والأداء من العلامة التجارية الممتازة. يتميز هذا الموقد بطبقين ساخنين صلبين، مما يتيح لك إعداد وجبات لذيذة بكل سهولة وسرعة. يعمل بالكهرباء، وبفضل تصميمه المحمول، يمكنك استخدامه في أي مكان ترغب فيه، سواء في المنزل أو في رحلات التخييم أو في الرحلات الطويلة. يتميز الموقد بمواد الإسكان الفولاذية المقاومة للصدأ، مما يجعله متينًا ومستدامًا. بفضل وظائفه المتعددة، يمكنك استخدامه لطهي الشوربات والمرق والأطباق الساخنة والمزيد. احصل على تجربة طهي مريحة وفعالة مع موقد كهربائي ممتاز محمول بطبق ساخن صلب.', 'xjd109', NULL, NULL, '2023-12-26 01:54:26', '2023-12-26 01:54:26', NULL),
(722, 126, 1, 'موقد الطهي الكهربائي المحمول بعين واحدة', 'موقد الطهي الكهربائي المحمول بعين واحدة', 150, 290, NULL, NULL, 1, 'available', 'موقد الطهي الكهربائي بعين واحدة بقوة 1000 واط هو جهاز محمول وعملي للطهي في المنزل. يتميز بتصميمه الأنيق والمدمج، مما يجعله مثاليًا للمطابخ ذات المساحات الصغيرة أو للاستخدام في الرحلات والتخييم. يوفر هذا الموقد الكهربائي السريع تجربة طهي فعالة ومريحة، حيث يتميز بوظائف متعددة مثل التحكم في درجة الحرارة والحماية من الحرارة الزائدة. يتميز الموقد بلوحة ساخنة متينة من المعدن الساخن، ويتم التحكم فيه بسهولة باستخدام واجهة بسيطة. احصل على هذا الموقد الكهربائي المحمول لتجربة الطهي السريعة والمريحة في منزلك أو أثناء تنقلك.', 'xjd108', NULL, NULL, '2023-12-26 01:57:43', '2023-12-26 02:54:30', NULL),
(723, 98, 1, 'لعبة الدوامة', 'لعبة الدوامة', 50, 100, NULL, NULL, 1, 'available', 'هذا المنتج هو لعبة البلبل (الدوّامة)، وهي واحدة من ألعاب الأطفال الشهيرة والمحبوبة. تأتي اللعبة مع قاذفة قوية تسمح للأطفال بإطلاق البلبل بسرعة وقوة. يتميز الملعب بتصميم إنصهار معدني متين وممتع للأطفال. يمكن للأطفال التنافس في قمة دوارة مثيرة للحصول على أداء أفضل وتحقيق الانتصارات. هذه اللعبة تعزز مهارات الدقة والتنسيق بين اليدين لدى الأطفال وتوفر ساعات من المرح والتسلية. إنها مناسبة للأطفال من سن 2 إلى 13 سنة. اشترِ هذه اللعبة الرائعة اليوم واجعل أطفالك يستمتعون بوقتهم ويتنافسون بشغف ومتعة.', 'BB-59', NULL, NULL, '2023-12-26 03:00:01', '2023-12-26 03:00:01', NULL),
(724, 98, 1, 'كرة القدم النفخة الآمنة', 'كرة القدم النفخة الآمنة', 60, 120, NULL, NULL, 1, 'available', '\"2021 8 بوصة كرة القدم تنس الضغط لعبة الكرة الكرتون صمام أمان ضغط متوسط الإجهاد المخلص ضد الإجهاد اللعب في الهواء الطلق ألعاب رياضية - لعبة كرة القدم الشاطئية القابلة للنفخ بطول 8 بوصات، مصنوعة من مواد صديقة للبيئة وآمنة للأطفال. تتميز بالمتانة ومقاومة الضغط، مما يجعلها مناسبة للعب في الهواء الطلق. تحتوي على صمام أمان للحفاظ على الضغط المثالي والاستمتاع بتجربة اللعب المستمرة. تعتبر هذه الكرة الكرتونية القابلة للنفخ خيارًا مثاليًا للأطفال الذين يحبون لعبة كرة القدم في الأماكن الخارجية. قم بشراء هذه الكرة العصرية البيئية الآمنة اليوم واستمتع بلحظات ممتعة مع أطفالك.', 'BB338', NULL, NULL, '2023-12-26 03:03:07', '2023-12-26 03:33:36', NULL),
(725, 98, 1, 'بندقية المغامرة الصوتية', 'بندقية المغامرة الصوتية', 110, 210, NULL, NULL, 1, 'available', 'بندقية اللعب بالضوء والموسيقى هي لعبة ممتعة ومثيرة للاهتمام للأطفال. تتميز بتصميم إلكتروني مبتكر يتضمن ضوءًا ملونًا وموسيقى ممتعة لزيادة المتعة أثناء اللعب. تعمل البندقية بالبطاريات وتتميز بزنبرك قوي لإطلاق النيران الوهمية. تأتي البندقية مع تنوع في الألوان وتحفز خيال الأطفال وتعزز قدراتهم التخيلية. إنها مناسبة للأطفال في جميع الفئات العمرية وتوفر ساعات لا نهاية من اللعب الممتع. كما أنها تعزز التنسيق بين العين واليد وتطوير المهارات الحركية لدى الأطفال. احصل على بندقية اللعب بالضوء والموسيقى الآن ودع طفلك يستمتع بتجربة لعب ممتعة ومليئة بالإثارة', '000-0', NULL, NULL, '2023-12-26 03:51:59', '2023-12-26 03:51:59', NULL),
(726, 98, 1, 'حقيبة القطيفة الناعمة', 'حقيبة القطيفة الناعمة', 200, 350, NULL, NULL, 1, 'available', 'حقيبة ظهر من بوبي ووجيز قطيفة هي هدية مثالية لعيد الفصح. تتميز بتصميمها الناعم والمرح، وتحمل شخصية الوحش النقانق السعيدة في لعبة بوبي بلايتايم. تأتي الحقيبة بلون أزرق مميز وتفاصيل واقعية للشخصية، مما يجعلها جذابة للأطفال. صُنعت الحقيبة من قماش القطيفة الناعم ومحشوة بالقطن PP لتوفير الراحة والمتانة. تتميز بحجم مناسب يناسب الأطفال في جميع الأعمار، وتوفر مساحة وفيرة لحمل الأشياء الضرورية مثل الألعاب أو المستلزمات المدرسية. تعتبر حقيبة بوبي ووجيز قطيفة هدية ممتعة وعملية للأطفال وستضفي لمسة من المرح والتجديد على أي مناسبة', '09999', NULL, NULL, '2023-12-26 03:54:55', '2023-12-26 03:54:55', NULL),
(727, 97, 1, 'مجموعة سلايم كريستالي رائعة', 'مجموعة سلايم كريستالي رائعة', 240, 490, NULL, NULL, 1, 'available', 'سلايم كريستالي غير لاصق بجودة عالية مصنوع في الصين. هذه المجموعة المدهشة تتضمن 12 لونًا مختلفًا من السلايم لتوفير ساعات لا نهاية من المرح والإبداع للأطفال. يتميز السلايم بقوامه الناعم والمرونة العالية، مما يجعله سهل اللعب به وتشكيله. كما أنه غير لاصق، مما يعني أنه لا يلتصق باليدين أو الأسطح. يمكن استخدامه لأغراض الترفيه والإبداع، ويعزز التنمية الحسية والمهارات الحركية الدقيقة لدى الأطفال. اجعل وقت اللعب أكثر متعة وإثارة مع سلايم كريستالي غير لاصق جودة عالية. منتج مثالي للأطفال الذين يتمتعون بالإبداع والاستكشاف.', 'SSN-03', NULL, NULL, '2023-12-26 03:58:15', '2023-12-26 03:58:15', NULL),
(728, 97, 1, 'مجموعة ألعاب الطبيب الخيالية للفتيات', 'مجموعة ألعاب الطبيب الخيالية للفتيات', 95, 220, NULL, NULL, 1, 'available', 'تعتبر مجموعة ألعاب الطبيب للفتيات بالجملة منتجًا رائعًا ومثاليًا لتنمية خيال الأطفال وتعزيز مهاراتهم الاجتماعية والإبداعية. تتميز هذه المجموعة بتصميمها الجذاب وجودتها العالية، حيث تم تصنيعها باستخدام مواد البلاستيك عالية الجودة. تشمل المجموعة مجموعة متنوعة من الأدوات الطبية الواقعية مثل مقياس الضغط، وسماعة الطبيب، والمصباح الطبي، وغيرها الكثير. بالإضافة إلى ذلك، فإنها تأتي في عبوة بطاقة نفطة جاهزة للتوزيع. تعتبر مجموعة ألعاب الطبيب للفتيات هدية مثالية للأطفال الذين يحبون اللعب بالأدوار ويتطلعون لاستكشاف عالم الطب والمساعدة الإنسانية', '766', NULL, NULL, '2023-12-26 04:01:06', '2023-12-26 04:01:06', NULL),
(729, 98, 1, 'روبوت تحوّل سيارة المغامرة', 'روبوت تحوّل سيارة المغامرة', 25, 60, NULL, NULL, 1, 'available', 'هذا المنتج هو لعبة روبوت تحوّل سيارة مصغرة بتصميم 2 في 1، مثالية كهدية للأطفال. تم تصميمها بشكل تعليمي لتعزيز الإبداع والمرح لدى الأطفال. يمكن للأطفال تجميع هذه اللعبة بأنفسهم باستخدام التعليمات الموجودة، مما يساعدهم على تنمية مهارات التجميع والتفكير المنطقي. يمكن للروبوت أن يتحول بسهولة من سيارة إلى روبوت، مما يوفر تجربة لعب متعددة الأوجه للأطفال. يأتي المنتج بتصميم جذاب وألوان مشرقة، مما يزيد من جاذبيته لدى الأطفال. هذه اللعبة هي خيار مثالي للأطفال الذين يهتمون بالروبوتات والسيارات ويسعون للاستمتاع بتجربة لعب ممتعة وتعليمية في آن واحد.', 'BB-237', NULL, NULL, '2023-12-26 04:05:32', '2023-12-26 04:05:32', NULL),
(730, 98, 1, 'سيارة المغامرة الشفافة', 'سيارة المغامرة الشفافة', 30, 70, NULL, NULL, 1, 'available', 'سيارة العتاد الشفافة الكهربائية للأطفال هي لعبة مثيرة وممتعة للأطفال. تتميز هذه السيارة بتصميمها الشفاف الرائع الذي يتيح للأطفال رؤية المكونات والعتاد الداخلي أثناء اللعب. تأتي مع موسيقى مبهجة وأضواء ملونة تضفي مزيدًا من الإثارة والمرح على تجربة اللعب. تعمل هذه السيارة بالبطارية، وهي مجهزة بثلاث بطاريات AA (غير مدرجة) لتوفير القوة اللازمة. تعد هذه السيارة منتجًا مثاليًا للأطفال في الفئة العمرية من 2 إلى 14 سنة. تعزز اللعب بالسيارة العتاد الشفافة الكهربائية للأطفال المهارات الحركية والتنسيق بين العين واليد، وتوفر تجربة مليئة بالمرح والتشويق للصغار', 'BB-238', NULL, NULL, '2023-12-26 04:07:54', '2023-12-26 04:07:54', NULL),
(731, 98, 1, 'بندقية المغامرة الناعمة', 'بندقية المغامرة الناعمة', 55, 130, NULL, NULL, 1, 'available', 'بندقية اللعب بالرصاص الناعمة هي لعبة رائعة للأطفال في الهواء الطلق. تتميز بسهام رغوية لينة وآمنة للاستخدام، مما يوفر متعة ومغامرة بلا حدود. تتميز بتصميمها الأنيق والملون، وتتضمن مجموعة من السهام اللينة التي يمكن إطلاقها بسهولة باستخدام البندقية. سيستمتع الأطفال باللعب والتسلية مع هذه البندقية الناسفة، حيث يمكنهم تنمية مهارات الرماية والتركيز والدقة. إنها لعبة مثالية للعب الجماعي أو لتنمية مهارات اللعب الفردية. بندقية اللعب بالرصاص الناعمة هي خيار ممتاز للترفيه الصحي والممتع للأطفال', '0000', NULL, NULL, '2023-12-26 04:11:36', '2023-12-26 04:11:36', NULL),
(732, 98, 1, 'بندقية المغامرة', 'بندقية المغامرة', 30, 70, NULL, NULL, 1, 'available', 'بندقية الرصاص البلاستيكية ، اللعبة الأصفرة بندقية الرصاص ، بندقية الرصاص المطاطية هي لعبة ممتعة وآمنة للأطفال. تتميز هذه البندقية بتصميم بلاستيكي عالي الجودة يوفر متعة لا تنتهي للعب والتسلية. تعمل بندقية الرصاص بالضغط على زناد ناعم ، مما يسمح للأطفال بالتمتع بتجربة اللعب الواقعية. كما تأتي مع رصاصات بلاستيكية ومطاطية آمنة للاستخدام ، مما يسمح باللعب الخالي من المخاطر. بفضل حجمها المناسب ووزنها الخفيف ، يمكن للأطفال حملها واستخدامها بسهولة. اجعل لعبة الخيال تأخذ طفلك إلى مغامرات مذهلة مع بندقية الرصاص البلاستيكية ، اللعبة الأصفرة بندقية الرصاص ، بندقية الرصاص المطاطية', '755', NULL, NULL, '2023-12-26 04:14:12', '2023-12-26 04:14:12', NULL),
(733, 98, 1, 'مجموعة الشرطة المغامرة السريعة', 'مجموعة الشرطة المغامرة السريعة', 100, 320, NULL, NULL, 1, 'available', 'تقدم لك شركة Yiwu Xingdong Toys Co., Ltd. مجموعة منتجات جديدة ومثيرة للاهتمام، بما في ذلك سيارة شرطة لعبة التراجع للأطفال. تتميز هذه السيارة بتصميم مصغّر وجميل، ويمكن سحبها للخلف لتحقيق حركة تراجعية سريعة ومثيرة. تعتبر هذه السيارة مثالية لتنمية مهارات الحركة والتنسيق بين العين واليد لدى الأطفال الصغار. تأتي السيارة بألوان جذابة ومشرقة، وتوفر ساعات من المرح والتسلية للأطفال. صُنعت السيارة باستخدام مواد عالية الجودة وآمنة للاستخدام، وهي مصممة لتحمل الاستخدام اليومي الشاق. اجعل أطفالك يستمتعون بلحظات لا تُنسى مع سيارة شرطة لعبة التراجع هذه.', '0999', NULL, NULL, '2023-12-26 04:16:22', '2023-12-26 04:16:22', NULL),
(734, 97, 1, 'طين الإبداع', 'طين الإبداع', 240, 490, NULL, NULL, 1, 'available', 'نقدم لكم مجموعة نمذجة الأطفال الطين بتقنية الهواء الجاف، تتألف من 36 قطعة من الطين الملون، مصممة لتعزيز الإبداع والمهارات الحرفية للأطفال. يتميز هذا الطين بقوامه اللين وسهولة تشكيله، حيث يمكن للأطفال تشكيل أشكال وأنماط متنوعة باستخدام أدوات النحت والتشكيل المرفقة مع المجموعة.\r\n\r\nيتميز هذا الطين بأنه يجف بسرعة عند التعرض للهواء، مما يسمح للأطفال بالاستمتاع بإبداعاتهم بشكل سريع وسهل. بالإضافة إلى ذلك، يأتي هذا المنتج مع صندوق تخزين للحفاظ على الطين منظمًا وآمنًا بعد الاستخدام.\r\n\r\nاحصل على مجموعة طين النمذجة الهواء الجاف هذه وساعد أطفالك في تطوير مهاراتهم الإبداعية والحرفية بطريقة ممتعة وتعليمية', 'SJN02', NULL, NULL, '2023-12-26 04:20:42', '2023-12-26 04:20:42', NULL),
(735, 98, 1, 'طقم شاي المرح السيراميكي للأطفال', 'طقم شاي المرح السيراميكي للأطفال', 1, 400, NULL, NULL, 1, 'available', 'قدم لأطفالك هذا اللعبة الرائعة والممتعة، طقم شاي من السيراميك بتصميم جميل وجودة عالية. يتضمن الطقم فنجاني شاي وصحنين وإبريقاً صغيراً وملعقتين، مما يسمح للأطفال بتجربة محاكاة ممتعة لتناول الشاي وتقديمه. يتميز الطقم بتفاصيل دقيقة وألوان جذابة تجعلها مثالية للعب الدور وتنمية خيال الأطفال. مصنوع من السيراميك عالي الجودة، مما يجعله آمنًا ومتينًا للاستخدام اليومي. هذه اللعبة الممتعة ستساعد أطفالك على تطوير مهاراتهم الاجتماعية واللغوية وتعزيز خيالهم وإبداعهم. اشترِ الآن واجعل لحظات اللعب مع الشاي أكثر متعة وتشويقًا.', '0000', NULL, NULL, '2023-12-26 04:23:17', '2023-12-26 04:23:17', NULL),
(736, 97, 1, 'عصا فقاعة سحرية للأطفال', 'عصا فقاعة سحرية للأطفال', 160, 320, NULL, NULL, 1, 'available', 'ألعاب حديقة ألعاب في الهواء الطلق التلقائي صنع عصا فقاعة كهربائية عدة طفل رذاذ فقاعة نفخ للأطفال\r\n\r\nاستمتع بوقت ممتع في الهواء الطلق مع هذه اللعبة الرائعة. تتميز بعصا فقاعة كهربائية تنتج فقاعات ساحرة وجميلة بكل سهولة. تصميمها المتطور يسمح للأطفال بإنشاء العديد من الفقاعات في وقت واحد، مما يزيد من المتعة والتسلية. الطفل سيستمتع بمشاهدة الفقاعات اللامعة والتي تطفو في الهواء وتنثر السعادة من حوله. تعد هذه اللعبة مثالية للاستخدام في الحدائق والفناء الخارجي وأي مناسبة خارجية أخرى. اجعل وقت اللعب أكثر مرحًا ومتعة لأطفالك مع هذه اللعبة الرائعة للفقاعات.', '0777', NULL, NULL, '2023-12-26 04:26:57', '2023-12-26 04:26:57', NULL),
(737, 98, 1, 'عصا سحرية مضيئة لعيد الميلاد', 'عصا سحرية مضيئة لعيد الميلاد', 65, 170, NULL, NULL, 1, 'available', 'تعتبر عصا هدايا عيد الميلاد Led حورية البحر المتوهجة وامضة وطاحونة الصولجانات المضيئة منتجًا سحريًا يجلب البهجة والمرح إلى حفلات الأطفال. تتميز بتصميم مبهج يجمع بين جمال حورية البحر وسحر الألياف السحرية. تضيء العصا بأضواء LED متعددة الألوان وتتميز بومضات ساحرة تلفت انتباه الأطفال وتحفز خيالهم. يمكن استخدامها كزينة لحفلات الأطفال أو هدية مميزة في مناسبات عيد الميلاد. تعمل ببطاريات AA ومتوفرة بألوان مختلفة. هذه العصا الساحرة ستضفي لمسة سحرية وإضاءة مميزة على حفلة الأطفال وستكون هدية مثالية لإسعادهم وإشراكهم في اللعب الإبداعي.', '161', NULL, NULL, '2023-12-26 04:31:52', '2023-12-26 04:31:52', NULL),
(738, 97, 1, 'مجموعة أدوات المائدة وأواني الطبخ للأطفال', 'مجموعة أدوات المائدة وأواني الطبخ للأطفال', 100, 220, NULL, NULL, 1, 'available', 'مجموعة أدوات المائدة وأواني الطبخ للأطفال هذه هي لعبة مثالية لتعليم الأطفال وتحفيز خيالهم ومهاراتهم الإبداعية في المطبخ. تحتوي المجموعة على أدوات المائدة الأساسية مثل أطباق وأكواب وشوك وملعقة وسكين، بالإضافة إلى أواني الطبخ مثل وعاء ومقلاة وملعقة خشبية. تم تصميمها بعناية باستخدام مواد آمنة وعالية الجودة، وتأتي بألوان جميلة وجذابة. تساعد هذه المجموعة الأطفال على تنمية مهاراتهم الحركية الدقيقة وتعزز اللعب التخيلي والتعاون. إنها مثالية للعب المستقل واللعب الجماعي وستوفر ساعات من المرح والتعلم للأطفال.', 'BB81', NULL, NULL, '2023-12-26 04:35:38', '2023-12-26 04:35:38', NULL),
(739, 99, 1, 'لوحة الرمي بالأقواس', 'لوحة الرمي بالأقواس', 150, 300, NULL, NULL, 1, 'available', 'لوحة دارتبورد للأطفال 2022 في الأماكن المغلقة مع مجموعة لوحة دارتو للأطفال مخصصة للمنزل هي منتج رائع لتنمية مهارات الرمي والتركيز لدى الأطفال. تأتي اللوحة بتصميم مغناطيسي آمن وممتع، مما يضمن سلامة الأطفال أثناء اللعب. تتضمن المجموعة لوحة دارتبورد وألواح رمي مغناطيسية تلتصق باللوحة بسهولة، مما يجعلها مناسبة للاستخدام في المنازل والأماكن المغلقة. بفضل هذه اللوحة، سيتمكن الأطفال من تطوير مهاراتهم الحركية والتركيز والدقة بطريقة ممتعة وتفاعلية. إنها منتج مثالي للأطفال الذين يرغبون في تجربة لعبة الدارت بأمان ومتعة في راحة منازلهم', '718', NULL, NULL, '2023-12-26 04:38:18', '2023-12-26 04:38:18', NULL),
(740, 98, 1, 'تلسكوب المغامر الصغير', 'تلسكوب المغامر الصغير', 40, 90, NULL, NULL, 1, 'available', 'تقدم أطفال لعبة للهواء الطلق تلسكوب HD 3.5x36 طويلة المدى مناظير تجربة مدهشة للأطفال في استكشاف العالم من حولهم. يتميز هذا التلسكوب بتصميمه المتين وخفيف الوزن، مما يجعله مثاليًا للاستخدام في الهواء الطلق. يوفر تكبيرًا قويًا بنسبة 3.5x وقطر تلميذ يبلغ 36 ملم، مما يسمح للأطفال بمشاهدة الأشياء بوضوح على مسافات طويلة. يعزز الجودة العالية للعدسات التصوير الواقعي والوضوح في التفاصيل. بفضل تصميمه المريح والسهل الاستخدام، يعتبر هذا التلسكوب خيارًا مثاليًا للأطفال الذين يهتمون بالمشاهدة والاستكشاف في الهواء الطلق', 'BB-18', NULL, NULL, '2023-12-26 04:43:05', '2023-12-26 04:43:05', NULL),
(741, 97, 1, 'دمية', 'دمية', 200, 350, NULL, NULL, 1, 'available', 'يتميز بمرونة وتفاصيله الدقيقة، إنها دمية ITTL بقياس 6 بوصات مع دراجة نارية ومجموعة ألعاب المطبخ البلاستيكية PVC. تعد هذه الدمية لعبة مثالية للأطفال، حيث تقدم تجربة لعب ممتعة وتشجع على الإبداع والتخيل. تصميمها البسيط والجميل يجعلها مناسبة للفتيات في مجموعات العمر من 2 إلى 13 سنة. تأتي الدمية مع دراجة نارية تضفي عليها لمسة من المغامرة والتشويق. كما تأتي مع مجموعة ألعاب المطبخ البلاستيكية PVC التي تمكن الأطفال من تجربة لعب ممتعة في المطبخ. استمتعوا بساعات لا تُنسى من اللعب والمرح مع هذه الدمية البسيطة والمثيرة للأطفال', 'BB-107', NULL, NULL, '2023-12-26 04:46:11', '2023-12-26 04:46:11', NULL),
(742, 98, 1, 'سيارة لعب', 'سيارة لعب', 80, 170, NULL, NULL, 1, 'available', 'الكرتون رقم الهاتف جرس سحب خط سيارات لعبة هي لعبة رائعة تمنح الأطفال ساعات من المرح والتسلية. تتميز بتصميم ملون وجذاب يجمع بين السيارات والأرقام والهواتف، مما يعزز الاستكشاف والتعلم بطريقة ممتعة. يمكن للأطفال سحب السيارات عن طريق الخط الذي يتصل بالجرس على شكل هاتف، وبذلك يتمكنون من استكشاف الحركة والسرعة. تعد هذه اللعبة مناسبة للأطفال في مجموعة الأعمار المبكرة، وتعزز تنمية المهارات الحركية والإبداعية لديهم. استمتع بلحظات ممتعة ومليئة بالتسلية مع الكرتون رقم الهاتف جرس سحب خط سيارات لعبة', '000', NULL, NULL, '2023-12-26 04:49:06', '2023-12-26 04:49:06', NULL),
(743, 97, 1, 'آلة فقاعة الدولفين الكهربائية', 'آلة فقاعة الدولفين الكهربائية', 200, 370, NULL, NULL, 1, 'available', 'آلة فقاعة الأطفال الكهربائية عشرة حفرة دولفين جاتلينج هي لعبة ممتعة ومسلية للأطفال في الهواء الطلق. تأتي هذه الآلة بتصميم دولفين جميل ومبتكر، وتتميز بثمانية فتحات لإطلاق الفقاعات. تعمل الآلة بواسطة الكهرباء وهي سهلة الاستخدام، حيث يكفي ملء الجهاز بمحلول الفقاعات وتشغيله ليبدأ في إنشاء فقاعات ساحرة في الهواء. تعد آلة فقاعة الدولفين الممتعة هذه خيارًا رائعًا للألعاب الخارجية والأنشطة الترفيهية، وتساعد على تعزيز خيال الأطفال وتنمية مهاراتهم الحركية. كما أنها توفر ساعات من المرح والتسلية للأطفال وتجعل الأوقات الخارجية أكثر إثارة ومتعة', 'BB155', NULL, NULL, '2023-12-26 04:51:35', '2023-12-26 04:51:35', NULL),
(744, 98, 1, 'مدفع الفقاعات المحمول', 'مدفع الفقاعات المحمول', 70, 180, NULL, NULL, 1, 'available', 'مدفع فقاعات لعبة جديد محمول نشاط صانع فقاعات 8 ثقوب Gatling هو لعبة مسلية ومبتكرة تمنح الأطفال فرصة للتمتع بوقتهم في صنع الفقاعات. يتميز هذا المدفع بتصميم Gatling الأوتوماتيكي الفريد، حيث يمكنه إطلاق الفقاعات بشكل مستمر من ثمانية ثقوب في نفس الوقت. يسهل حمله وتحريكه بفضل حجمه المحمول ووزنه الخفيف. يوفر هذا المسدس فرصة للأطفال للعب والاستمتاع بالفقاعات في الهواء الطلق أو في أي مكان يفضلونه. إنه لعبة مثالية لتعزيز المرح والإبداع وتنمية مهارات الحركة الدقيقة لدى الأطفال. سيكون هذا المدفع مصدرًا للسعادة والمرح للأطفال من جميع الأعمار.', 'HL-16', NULL, NULL, '2023-12-26 04:53:57', '2023-12-26 04:53:57', NULL),
(745, 98, 1, 'تلسكوب الاستكشاف', 'تلسكوب الاستكشاف', 85, 190, NULL, NULL, 1, 'available', 'تلسكوب التمويه عالي الوضوح للأطفال هو لعبة تظاهرية رائعة تساعد الأطفال على استكشاف العالم من حولهم بطريقة ممتعة وتشجع خيالهم وفضولهم. يتميز هذا التلسكوب بتصميمه المتموِّه الذي يتماشى مع البيئة الخارجية، مما يسمح للأطفال بالاندماج بشكل أكبر في الطبيعة والمحيط. تم تصنيعه من مواد عالية الجودة وآمنة للاستخدام الأطفال. هذه اللعبة مثالية للأطفال من سن 3 سنوات وما فوق، وتساعدهم على تطوير مهارات المراقبة والتركيز والاستكشاف. سواء كانوا يستخدمونها في الحديقة أو خلال رحلات التخييم أو في الألعاب التظاهرية، فإن تلسكوب التمويه العالي الوضوح سيوفر للأطفال ساعات من المرح والتشويق', 'BB184', NULL, NULL, '2023-12-26 04:57:14', '2023-12-26 04:57:14', NULL),
(746, 98, 1, 'سيارة القفز المدهشة', 'سيارة القفز المدهشة', 1, 450, NULL, NULL, 1, 'available', 'نقدّم لكم سيارة RC على الطرق الوعرة للأطفال، وهي سيارة ممتعة ومبتكرة تمكن الأطفال من الاستمتاع بتجربة قيادة مميزة. تتميز هذه السيارة بمستشعر حركة اليد، حيث يمكن التحكم بها بواسطة حركات اليد بدلاً من جهاز التحكم عن بعد التقليدي. تتميز أيضًا بالأضواء الملونة والموسيقى التي تضفي مزيدًا من الإثارة والمرح على تجربة القيادة. تتميز السيارة بتصميمها القوي والمتين، مما يسمح لها بالتحرك بسهولة على الطرق الوعرة والتغلب على التضاريس الصعبة. إنها لعبة مثالية لتعزيز مهارات التنسيق والتحكم لدى الأطفال وتوفير ساعات من المرح والتسلية', 'ZW-XR13', NULL, NULL, '2023-12-26 05:01:55', '2023-12-26 05:01:55', NULL),
(747, 98, 1, 'دمية الديناصور', 'دمية الديناصور', 260, 520, NULL, NULL, 1, 'available', 'استمتع بمغامرات لا حدود لها مع دمية الديناصور المذهلة! تأتي هذه الدمية بتصميم مدهش يجسد الديناصور بكل تفاصيله الجميلة. صُممت الدمية بعناية فائقة لتوفر تجربة لعب وتخيل واقعية للأطفال. تأتي مع ملمس ناعم وجودة عالية لتوفر لمسة مريحة وممتعة للأطفال. بفضل حجمها المناسب، يمكن للأطفال حملها ولعبها في أي مكان. كما أنها تعمل بالبطارية لإضفاء المزيد من الحيوية على اللعبة مع أضواء وأصوات مدهشة. اجعل لعبة الديناصور هذه رفيقًا مثاليًا للأطفال في لحظات المرح والتسلية.', 'ZW-572', NULL, NULL, '2023-12-26 05:04:50', '2023-12-26 05:04:50', NULL),
(748, 97, 1, 'تاج الأميرة', 'تاج الأميرة', 1, 600, NULL, NULL, 1, 'available', 'تاج الأميرة هو منتج رائع يضفي لمسة من السحر والجمال على إطلالة الأميرات الصغيرات. يأتي بتصميم أنيق بقطعة واحدة مصنوعة من مواد عالية الجودة. يتميز بإكسسوار فريد يوفر تجربة لعب ممتعة ومثيرة للاهتمام للأطفال. يمكن استخدامه في الألعاب الخيالية والأنشطة الترفيهية وحفلات الأميرات الصغيرات. يساعد التاج الأميرة على تنمية الخيال والإبداع لدى الأطفال، كما يساهم في تعزيز التواصل الاجتماعي وتطوير المهارات الحركية الدقيقة. هذا المنتج هو هدية مثالية للأطفال الذين يحبون الأميرات والقصص الساحرة.', '000', NULL, NULL, '2023-12-26 17:35:07', '2023-12-26 17:39:58', NULL),
(749, 97, 1, 'مجموعة الخيالية للأطفال', 'مجموعة الخيالية للأطفال', 420, 630, NULL, NULL, 1, 'available', 'محاكاة إلكترونية لعبة أدوات مطبخ للأطفال طباخ ماكينة الخبز الثلاجة لعبة للأطفال اللعب منزل 2020 أفضل بيع المنتجات.\r\n\r\nاجعلي طفلك يستمتع بتجربة الطهي والاستكشاف مع مجموعة اللعب هذه. تحتوي هذه اللعبة على طباخ، وماكينة خبز، وثلاجة، وأدوات مطبخ مصغرة، مما يسمح للأطفال بالقيام بأدوار الطهاة والاستمتاع بلا نهاية في العاب الخيال والتعلم.\r\n\r\nتتميز هذه اللعبة بتصميم إلكتروني ووظائف محاكاة واقعية، مثل الأضواء والأصوات التي تضيف المزيد من المرح والواقعية لتجربة اللعب. بالإضافة إلى ذلك، فإنها تعزز التعلم والتطوير الإبداعي للأطفال من خلال تعزيز مهارات التنسيق الحركي والخيال والتفكير الابتكاري.\r\n\r\nهذه اللعبة المثيرة والتعليمية هي هدية مثالية للأطفال في مناسبات مثل الأعياد وأعياد الميلاد. اشتريها الآن واجعلي طفلك يستمتع بتجربة طهي ممتعة ومثيرة.', 'ZN-BB111', NULL, NULL, '2023-12-26 17:39:27', '2023-12-26 17:39:27', NULL),
(750, 69, 1, 'ماكينة ختم الطعام المحمولة', 'ماكينة ختم الطعام المحمولة', 300, 600, NULL, NULL, 1, 'available', 'آلة ختم الطعام المنزلية المحمولة باليد هي أداة عملية لتعبئة وتخزين الطعام بطريقة محكمة ومحافظة على الجودة والطازجة. تتميز هذه الآلة بتقنية فراغية تساعد في إزالة الهواء من الأكياس والأغلفة البلاستيكية، مما يقلل من التأكسد ويطيل مدة الصلاحية للأطعمة. تتميز بتصميم محمول باليد، مما يجعلها سهلة الاستخدام وقابلة للحمل أثناء التنقل. توفر هذه الآلة الراحة والمرونة في تخزين الطعام في المنزل، وتعتبر خيارًا مثاليًا لأصحاب العائلات والمسافرين والمخيمين. بفضل وظيفتها المتعددة وسهولة التشغيل، فإن آلة ختم الطعام المحمولة باليد تعد شريكًا مثاليًا للحفاظ على طعامك طازجًا ومحميًا لفترة أطول.', 'tv-70', NULL, NULL, '2023-12-27 02:17:20', '2023-12-27 02:17:20', NULL),
(751, 68, 1, 'مطحنة لحم كهربائية قوية', 'مطحنة لحم كهربائية قوية', 600, 860, NULL, NULL, 1, 'available', 'مطحنة لحم كهربائية قوية من الفولاذ المقاوم للصدأ بسعة 2 لتر 3 لتر هي أداة مطبخ مثالية لتحويل لحمك المفضل إلى قطع مفرومة طازجة وعالية الجودة في منزلك. تتميز هذه المطحنة بتصميمها المتين والقوي، حيث تم تصنيعها من فولاذ مقاوم للصدأ الذي يوفر المتانة والمتانة الطويلة الأمد. تتميز بسعة 2 لتر أو 3 لتر، وتوفر القدرة على طحن كميات كبيرة من اللحم بسهولة. تعمل بمحرك نحاسي نقي عالي الكفاءة، مما يضمن أداءًا متميزًا وقوة قطع فائقة. إنها مناسبة للاستخدام المنزلي ويمكن استخدامها في المطاعم والفنادق وحفلات الشواء والمناسبات الخاصة. قم بتحضير وجبات شهية ولذيذة بكل سهولة باستخدام هذه المطحنة القوية والموثوقة.', '00000', NULL, NULL, '2023-12-27 02:21:23', '2023-12-27 02:21:23', NULL),
(752, 68, 1, 'مطحنة لحم كهربائية 3l', 'مطحنة لحم كهربائية 3l', 450, 650, NULL, NULL, 1, 'available', 'مطحنة لحم كهربائية من الفولاذ المقاوم للصدأ بسعة 2 لتر، 3 لتر، و 4 لتر. هذه المطحنة الصغيرة المنزلية مثالية لطحن اللحم بكفاءة وسهولة. تتميز بتصميم أوتوماتيكي يجعل عملية التشغيل آمنة ومريحة. تعمل هذه المطحنة الكهربائية على تحويل اللحم الطازج إلى حشوات لذيذة ومفضلة مثل الكفتة واللحمة المفرومة. مصنوعة من الفولاذ المقاوم للصدأ عالي الجودة، مما يجعلها متينة ومقاومة للصدأ. تتوفر بعدة أحجام لتلبية احتياجاتك المطبخية. سواء كنت ترغب في إعداد وجبات لذيذة في المنزل أو في استخدامها في الفنادق والمطاعم التجارية، فإن هذه المطحنة هي الخيار المثالي لك.', '3lxjd72', NULL, NULL, '2023-12-27 02:25:02', '2023-12-27 02:25:02', NULL),
(753, 63, 1, 'صانع الكبكيك والبسكويت والكوكيز', 'صانع الكبكيك والبسكويت والكوكيز', 3, 1500, NULL, NULL, 1, 'available', 'صانع كعكة وبوب لطعام الأطفال من Anbo هو جهاز رائع يمكنك من صنع حلوى لذيذة ومشوقة لأطفالك في المنزل. يتميز هذا الصانع بتصميمه العصري والعملي، ويقدم لك تجربة ممتعة ومبتكرة في إعداد الكعك والبوب. يأتي الصانع مع مجموعة متنوعة من الأشكال الممتعة مثل الكيك والدونات والكوكيز، ويمكنك تخصيصها حسب احتياجاتك وتفضيلاتك. بفضل سطح الطهي المانع للالتصاق، فإن الطهي سهل وسريع وتنظيف الجهاز بعد الاستخدام يكون مريحًا. اجعل وجبات طفلك الممتعة ولذيذة مع صانع كعكة وبوب لطعام الأطفال من Anbo.', '00000', NULL, NULL, '2023-12-27 02:29:20', '2023-12-27 02:29:20', NULL),
(754, 63, 1, 'ماكينة الشطائر', 'ماكينة الشطائر', 750, 1250, NULL, NULL, 1, 'available', 'ماكينة همبرغر عالية الجودة بشواية نار جيدة هي منتج ممتاز لعشاق الهمبرغر والوجبات السريعة. تتميز هذه الماكينة بتصميمها العصري والعملي، وتعد خيارًا مثاليًا للاستخدام المنزلي. توفر لك هذه الماكينة إمكانية صنع همبرغر لذيذ بطريقة سهلة وسريعة. تتميز بشواية نار جيدة التي تساعد على تحقيق نتائج ممتازة في طهي اللحم وإبراز نكهته اللذيذة. بفضل طبقة الطلاء غير اللاصقة، يمكنك تجنب الالتصاق وتنظيفها بسهولة. تتضمن هذه الماكينة وظيفة تحضير الهمبرغر والسندويشات المختلفة، مما يجعلها خيارًا متعدد الاستخدامات في المطبخ. احصل على هذه الماكينة العالية الجودة واستمتع بتجربة طهي مريحة ونتائج لذيذة.', 'xjd50', NULL, NULL, '2023-12-27 02:34:42', '2023-12-27 02:34:42', NULL),
(755, 113, 1, 'مجموعة سكاكين المطبخ الساخنة متعددة الوظائف', 'مجموعة سكاكين المطبخ الساخنة متعددة الوظائف', 1, 600, NULL, NULL, 1, 'available', 'سكاكين مطبخ ساخنة متعددة الوظائف تعد حلاً مثاليًا لمطبخك. تحتوي هذه المجموعة على 6 سكاكين غير لاصقة مصنوعة من الفولاذ المقاوم للصدأ عالي الجودة، مما يضمن حدة الشفرات ومتانتها. تصميمها العصري والمريح يوفر قبضة مريحة ومتينة أثناء الاستخدام. تتضمن المجموعة مجموعة متنوعة من السكاكين المفيدة لتلبية احتياجات المطبخ المختلفة، بما في ذلك سكين الطهاة، سكين التقطيع، وسكين المقشرة. تعد هذه السكاكين العملية والحادة أدوات مثالية لتحضير الفواكه والخضروات وتقطيع اللحوم والأسماك بكل سهولة. احصل على مجموعة سكاكين المطبخ هذه واستمتع بتجربة طهي ممتعة ومريحة', '0000', NULL, NULL, '2023-12-27 02:44:25', '2023-12-28 01:35:38', NULL),
(756, 63, 1, 'صانع الإفطار المتعدد الوظائف 3 في 1', 'صانع الإفطار المتعدد الوظائف 3 في 1', 850, 1350, NULL, NULL, 1, 'available', 'صانع الساندوتشات والوافل المتعدد الوظائف 3 في 1 الكهربائي هو جهاز مذهل يوفر لك تجربة إفطار متنوعة وشهية. يتميز هذا الصانع بوظائف متعددة، حيث يمكنك إعداد الساندوتشات اللذيذة والوافل الهش بسهولة وفي وقت قصير. يتميز بتصميم غير عصا وطلاء طلاء الهراء، مما يضمن سهولة التنظيف وعدم الالتصاق. يحتوي على مفتاح تحكم قابل للتعديل للتحكم في درجة الحرارة المثلى للطهي. يعد هذا الجهاز مثاليًا للاستخدام المنزلي، ويوفر وجبات إفطار لذيذة ومتنوعة لك ولعائلتك. استمتع بتجربة إعداد الوجبات الشهية مع هذا الصانع المتعدد الوظائف الكهربائي.', '0000', NULL, NULL, '2023-12-27 02:53:07', '2023-12-27 02:53:07', NULL),
(757, 63, 1, 'صانع الكعك المتعدد الوظائف 7 فتحات', 'صانع الكعك المتعدد الوظائف 7 فتحات', 680, 1050, NULL, NULL, 1, 'available', 'صانع الكعك الصغيرة الكهربائي بـ 7 فتحات من الماركة أريبا هو جهاز متعدد الاستخدامات يناسب احتياجاتك في المطبخ. يتميز بتصميمه العصري والمدمج، ويوفر سبع فتحات لصنع الكعك الصغيرة بسهولة وسرعة. يمكنك استخدامه أيضًا لتحضير الهراء أو الأريبا أو الكب كيك، مما يجعله مثاليًا لتناول وجبة شهية في أي وقت. يعمل بالكهرباء ويتمتع بخصائص مثل السطح المانع للالتصاق والتحكم في درجة الحرارة لضمان النتائج المثالية في كل مرة. بفضل جودته العالية وسهولة الاستخدام، يعد صانع الكعك الصغيرة الكهربائي هذا خيارًا مثاليًا لمحبي الحلويات في المنزل أو في المطاعم والفنادق.', 'xjd-95', NULL, NULL, '2023-12-27 02:58:00', '2023-12-27 02:58:00', NULL),
(758, 74, 1, 'رذاذ خافض للضباب الصوتي', 'رذاذ خافض للضباب الصوتي', 750, 1250, NULL, NULL, 1, 'available', 'رذاذ خافض للضباب بالموجات فوق الصوتية 3 لتر هو جهاز فعال وعملي لترطيب الهواء في المنزل والمكتب وغرفة النوم. يعمل هذا الرذاذ عن طريق تحويل الماء إلى ضباب ناعم باستخدام الموجات فوق الصوتية، مما يساعد في زيادة مستوى الرطوبة في البيئة المحيطة. يتميز بسعة 3 لتر، مما يعني أنه يمكنه توفير ترطيب لفترة طويلة دون الحاجة للتعبئة المتكررة. كما يتميز بإمكانية ضبط كمية الضباب المفرغ، مما يتيح لك تخصيص تجربة الترطيب حسب احتياجاتك. بفضل تصميمه المدمج والأنيق، يمكن وضعه بسهولة في أي غرفة ويضفي لمسة جمالية على الديكور.', 'xjd47', NULL, NULL, '2023-12-27 03:02:45', '2023-12-27 03:02:45', NULL),
(759, 128, 1, 'غلاية ستانلس ستيل 2.3 لتر', '\"غلاية ستانلس ستيل 2.3 لتر', 750, 1300, NULL, NULL, 1, 'available', 'غلاية المنزلية من Sokany هي غلاية كهربائية عالية الجودة وعملية للاستخدام في المنزل. تتميز بتصميمها المصنوع من الفولاذ المقاوم للصدأ غير القابل للصدأ، مما يجعلها متينة ومقاومة للتآكل. تأتي بسعة 2.3 لتر، مما يعني أنها تمكنك من غلي كمية كبيرة من الماء في وقت واحد. تعمل بمصدر الطاقة الكهربائية وتحتوي على ميزات مثل الإغلاق التلقائي وحماية الجفاف وتغلي الحماية. يتميز التصميم بسرعة التسخين والاحتفاظ بالحرارة لفترة طويلة. إنها منتجات عالية الجودة تضمن تجربة غلي الماء سهلة ومريحة في المنزل.', '00000', NULL, NULL, '2023-12-27 03:09:27', '2023-12-28 02:24:48', NULL),
(760, 107, 1, 'مصباح الجدول المطوّل', 'مصباح الجدول المطوّل', 1, 180, NULL, NULL, 1, 'available', 'مصباح الجدول للطي العين حماية مصباح الطاولة بطارية تعمل بالطاقة مصغرة مكتب الجدول مصابيح لغرفة النوم المنزل. يتميز هذا المصباح بتصميمه العصري والمتطور، وهو مثالي للاستخدام في غرفة النوم أو المكتب. يوفر حماية للعين من الإجهاد والتعب بفضل تقنية الحماية من الضوء الضار. يعمل بالبطارية، مما يسهل حمله وتحريكه بسهولة دون الحاجة إلى قابس كهرباء. يعمل بتقنية الإضاءة بالصمام الثنائي المصغر (LED)، مما يوفر إضاءة ساطعة ومناسبة للقراءة والعمل. بفضل تصميمه المدمج والمحمول، يمكن وضعه على الطاولة أو الرف أو حتى حمله أثناء التنقل. يعد هذا المصباح خيارًا مثاليًا لمن يبحثون عن إضاءة مريحة وعملية في المنزل أو في الأماكن المغلقة الأخرى', '00', NULL, NULL, '2023-12-28 01:46:30', '2023-12-28 01:46:30', NULL),
(761, 84, 1, 'بخور طارد للبعوض', 'بخور طارد للبعوض', 20, 60, NULL, NULL, 1, 'available', 'أعواد البخور طارد البعوض - اشترِ أعواد البخور اللفافية المستديرة برائحة خشب الصندل للعلاج بالروائح العطرية وتعطير المنزل. يتميز هذا البخور بتصميمه عالي الجودة وفعاليته في صد البعوض. يأتي مع حامل للبخور، ويحتوي على مكونات نباتية تعمل كطارد طبيعي للبعوض. يمكن استخدامه في المنازل والفنادق والمكاتب وغرف النوم والمطاعم. يأتي بلون طبيعي وشكل مخروطي. يتم تغليفه بشكل آمن وفق المعايير الدولية. يتوفر بكميات متنوعة ويتم التفاوض بشأن الوقت المقدر للتسليم. استمتع بتجربة طرد البعوض الفعالة والعطر الرائع مع أعواد البخور هذه', '00000', NULL, NULL, '2023-12-28 01:55:49', '2023-12-28 01:55:49', NULL),
(762, 127, 1, 'عصارة الليمون البلاستيكية المدورة', 'عصارة الليمون البلاستيكية المدورة', 60, 120, NULL, NULL, 1, 'available', 'عصارة الليمون الفواكه البلاستيكية اليدوية من Lixsun هي أداة ممتازة لاستخراج العصير من الليمون والفواكه الأخرى بسهولة. تصميمها البلاستيكي المتين يجعلها آمنة على الغذاء ومتينة للاستخدام اليومي. تعمل عصارة الليمون هذه بسهولة مع توفير قوة ضغط مريحة لاستخراج أكبر قدر ممكن من العصير بسرعة. بفضل حجمها المناسب وسهولة الاستخدام، يمكنك استخدامها في المنزل أو في المطبخ بكل سهولة. ستساعدك هذه العصارة اليدوية على الاستمتاع بعصير الليمون الطازج وإضافته إلى أطباقك المفضلة والمشروبات بكل سهولة', '00000', NULL, NULL, '2023-12-28 01:59:52', '2023-12-28 01:59:52', NULL),
(763, 128, 1, 'غلاية كهربائية سمارت ماكس', 'غلاية كهربائية سمارت ماكس', 550, 820, NULL, NULL, 1, 'available', 'الجهاز المطبخ الذكي الجديد، غلاية كهربائية سعة 2 لتر سعة كبيرة سعة 6663 لتر، يتميز بتصميم رائع يناسب المنازل والفنادق. هذه الغلاية الكهربائية مثالية لتسخين الماء بسرعة وسهولة. تتمتع بوظيفة التحكم في درجة الحرارة لضبط الحرارة المطلوبة للماء، مما يجعلها مثالية لإعداد الشاي والقهوة والحساء وأكثر من ذلك. تأتي الغلاية بسعة كبيرة تصل إلى 2 لتر، مما يسمح بغلي كمية كبيرة من الماء في وقت واحد. تتميز بجودة عالية ومتانة، وتعد خيارًا مثاليًا لتحسين تجربة المطبخ اليومية.', 'xjd86', NULL, NULL, '2023-12-28 02:42:51', '2023-12-28 02:42:51', NULL),
(764, 107, 1, 'إضاءة حبل المشهد الساحر', 'إضاءة حبل المشهد الساحر', 150, 300, NULL, NULL, 1, 'available', 'إضاءة ليد حبل بسعر مغرٍ وجذاب تعد خيارًا رائعًا لتزيين المنازل والكنائس وتحسين المشاهد الخارجية خلال فترة الأعياد. تتميز بتصميمها المرن والمتين، وتعمل على إضفاء جو ساحر ومدهش على المكان. تأتي بمجموعة متنوعة من الألوان والتأثيرات، بما في ذلك الأحمر والأبيض والأزرق والأخضر والوردي والأرجواني والمتعددة الألوان. تعمل بتقنية LED عالية الكفاءة وعمر افتراضي طويل يصل إلى 50000 ساعة. يمكن استخدامها في الأماكن الداخلية والخارجية، وتتميز بمقاومتها للماء والعوامل الجوية. هذه المنتجات مصممة لتوفير الإضاءة المثالية وتعزيز الديكور في أي مناسبة خاصة أو حدث', 'DD02', NULL, NULL, '2023-12-28 02:59:36', '2023-12-28 02:59:36', NULL),
(765, 128, 1, 'غلاية كهربائية marado', 'غلاية كهربائية marado', 850, 1250, NULL, NULL, 1, 'available', 'غلاية كهربائية منزلية معزولة من الفولاذ المقاوم للصدأ بنسبة 304 هي منتج عالي الجودة وعملي للاستخدام في المنزل. تتميز هذه الغلاية بقدرتها الكبيرة 2.5 لتر، مما يوفر سعة كافية لتسخين الماء بسرعة وبكمية كبيرة. تصميمها المعزول يحافظ على درجة حرارة الماء لفترة أطول، مما يسمح بالاستمتاع بالماء الساخن لفترة أطول. يمكن استخدامها في الفنادق والمكاتب والمنازل، وتتميز بموادها عالية الجودة من الفولاذ المقاوم للصدأ بنسبة 304. تتميز أيضًا بميزات إضافية مثل القاعدة الدوارة بزاوية 360 درجة ووظيفة الإغلاق التلقائي للحماية من الجفاف. إن غلاية كهربائية منزلية معزولة من الفولاذ المقاوم للصدأ بنسبة 304 هي اختيار مثالي لتلبية احتياجات التسخين في المنزل بكفاءة وسهولة.', 'xjd87', NULL, NULL, '2023-12-28 03:02:24', '2023-12-28 03:02:24', NULL),
(766, 128, 1, 'غلاية الماء الكهربائية', 'غلاية الماء الكهربائية', 450, 620, NULL, NULL, 1, 'available', 'غلاية كهربائية من الفولاذ المقاوم للصدأ بسعة 2.0 لتر من ماركة Marado هي غلاية عالية الجودة وذات تصميم غير ملحوم. تتميز بالمتانة والمتانة العالية بفضل استخدام الفولاذ المقاوم للصدأ في تصنيعها. تتمتع هذه الغلاية بأداء فائق وقدرة على غلي الماء بسرعة وكفاءة. تحتوي على وحدة تحكم كهربائية تسمح بضبط درجة الحرارة وإيقاف التشغيل التلقائي عند الوصول إلى نقطة الغليان. تعتبر هذه الغلاية خيارًا مثاليًا للاستخدام المنزلي والتجاري مثل الفنادق والمطاعم. إنها تجمع بين الأداء المتميز والمتانة لتلبية احتياجاتك في تحضير المشروبات الساخنة بكل سهولة وراحة.', 'x5d-97', NULL, NULL, '2023-12-28 03:05:21', '2023-12-28 03:05:21', NULL);
