(767, 107, 1, 'حبل المشهد الساحر 10 ميتر', 'حبل المشهد الساحر 10 ميتر', 200, 400, NULL, NULL, 1, 'available', 'جولة 2 سلك الديكور إضاءة ليد هي منتج مبهر يتميز بمقاومته للماء. يعتبر هذا الحبل المضيء خيارًا مثاليًا لإضفاء الإشراق والجمال على المساحات الداخلية والخارجية. يأتي بتصميم دائري يجعله سهل التركيب والتشكيل حسب الاحتياجات. يتوفر بمجموعة واسعة من الألوان بما في ذلك الأبيض الدافئ والأبيض البارد والأحمر والأزرق والأخضر والأصفر والألوان المتعددة. يعمل بتقنية الإضاءة LED عالية الجودة التي توفر إضاءة ساطعة وموفرة للطاقة. يمكن استخدامه في المتنزهات والمناسبات والديكورات المنزلية لإضفاء لمسة ساحرة ومبهجة على المحيط. هذا المنتج هو خيار مثالي لمحبي الديكور والإضاءة الفريدة والمبتكرة', 'DD03', NULL, NULL, '2023-12-28 03:07:27', '2023-12-28 03:07:27', NULL),
(768, 63, 1, 'ماكينة حلوى غزل بنات', 'ماكينة حلوى غزل بنات', 900, 1320, NULL, NULL, 1, 'available', 'ماكينة حلوى غزل بنات المهنية/ صغيرة الحجم/ مصغرة للبيع\r\n\r\nاحصل على تجربة فريدة من نوعها مع ماكينة حلوى غزل بنات المهنية. تتميز هذه الماكينة بحجمها الصغير والمصغر، مما يجعلها مثالية للاستخدام في المنازل والفنادق ومحلات الطعام والمتاجر التجزئية والمزارع والأماكن الأخرى. تعمل الماكينة بكفاءة عالية في صنع حلوى القطن اللذيذة والمميزة. تأتي بتصميم أنيق ومتين مصنوع من الفولاذ المقاوم للصدأ، وتتميز بقوة وأداء استثنائيين. بفضل ميزاتها الشبه التلقائية، يمكنك بسهولة إعداد حلوى القطن الخاصة بك وتقديمها للضيوف والعائلة. استمتع بتجربة حلوى الغزل بنات اللذيذة في أي وقت وفي أي مكان مع هذه الماكينة المذهلة.', 'xjd75', NULL, NULL, '2023-12-28 03:08:17', '2023-12-28 03:08:17', NULL),
(769, 84, 1, 'فخ الفأرة اللاصقة الجاهزة', 'فخ الفأرة اللاصقة الجاهزة', 20, 50, NULL, NULL, 1, 'available', 'فخ فأرة لاصقة جاهزة للاستخدام بأنبوب لاصق سعة 135 جرام - ماسك لاصق للفئران والفئران، منتج لاصق عالي الجودة وقوي، يستخدم للتقاط الفئران. يُستخدم هذا الفخ اللاصق للفئران في المنزل وملحقاته بشكل فعال. يتميز بلزوق قوي جدًا يجذب الفئران ويعتقلها بشكل آمن. يعد هذا المنتج مناسبًا للاستخدام في الحدائق والمزارع وأماكن أخرى توجد فيها مشكلة الفئران. صُمم بجودة عالية ولزوق فائق القوة، ويأتي في أنبوب سعة 135 جرام. احصل على هذا المنتج العملي والفعال الآن للتخلص من مشكلة الفئران بسهولة وفعالية', '00', NULL, NULL, '2023-12-28 03:10:39', '2023-12-28 03:10:39', NULL),
(770, 128, 1, 'غلاية سكارليت الكهربائية الكلاسيكية بسعة 2.0 لتر', 'غلاية سكارليت الكهربائية الكلاسيكية بسعة 2.0 لتر', 180, 280, NULL, NULL, 1, 'available', 'الغلاية الكهربائية سكارليت بسعة 2.0 لتر هي منتج عالي الجودة وبتصميم كلاسيكي. تتميز بسعة كبيرة تسمح لك بتسخين كمية كبيرة من الماء في وقت قصير. مصنوعة من الفولاذ المقاوم للصدأ عالي الجودة، مما يجعلها متينة ومقاومة للصدأ. تتوفر ميزة الإغلاق التلقائي وحماية الجفاف لضمان السلامة والحماية. تتميز بقاعدة تدور 360 درجة لتسهيل التحكم والاستخدام. تعتبر هذه الغلاية المحمولة مثالية للاستخدام في المنزل والفنادق والمطاعم والأماكن التجارية. بفضل سعرها المنخفض وأدائها الممتاز، فإنها خيار رائع لمحبي الشاي والقهوة.', '847', NULL, NULL, '2023-12-28 03:11:04', '2023-12-28 03:11:04', NULL),
(771, 84, 1, 'ورقة الذبابة القاتلة 100 قطعة', 'ورقة الذبابة القاتلة 100 قطعة', 400, 600, NULL, NULL, 1, 'available', 'منتج مكافحة الآفات البيئية - لزجة ورقة ذبابة القاتل الجيل الجديد\r\n\r\nاحصل على منتج مكافحة الآفات البيئية القوي والفعال، وهو لزجة ورقة ذبابة القاتل الجيل الجديد. يعد هذا المنتج حلاً فعالاً لمشكلة الذباب المزعجة في المنزل أو المكتب. تصميمه القوي والمخصص يضمن تجذب الذباب والحشرات الأخرى والتصاقها بالورقة اللزجة، مما يؤدي إلى قتلها بفعالية. يمكن استخدامه في العديد من الأماكن مثل المنازل والفنادق والمكاتب وغرف النوم والمطاعم. كما يتميز بسهولة الاستخدام والتركيب. استمتع بالتخلص من الذباب والحشرات بشكل فعال وصديق للبيئة مع هذا المنتج الممتاز لمكافحة الآفات البيئية.', '01111', NULL, NULL, '2023-12-28 03:14:04', '2023-12-28 03:14:04', NULL),
(772, 128, 1, 'غلاية الفولاذ المقاوم للصدأ الكهربائية بسعة 1.8 لتر', 'غلاية الفولاذ المقاوم للصدأ الكهربائية بسعة 1.8 لتر', 220, 350, NULL, NULL, 1, 'available', 'الغلاية الكهربائية من الفولاذ المقاوم للصدأ بسعة 1.8 لتر وجهاز منزلي مثالي لتسخين الماء بسرعة وسهولة. تتميز هذه الغلاية بجودة عالية وتصميم فريد يجمع بين الأداء الممتاز والمتانة. مصنوعة من الفولاذ المقاوم للصدأ عالي الجودة، مما يجعلها مقاومة للصدأ وسهلة التنظيف. تأتي الغلاية مع قاعدة دوارة بزاوية 360 درجة لسهولة الاستخدام، وتقنية الغلق التلقائي للحفاظ على سلامتك. كما تتميز بوظيفة التحكم في درجة الحرارة والحفاظ على الحرارة لفترة أطول. هذه الغلاية الكهربائية هي اختيار مثالي لمنزلك أو المطبخ وتوفر لك تجربة تسخين الماء المريحة والفعالة.', 'hy16', NULL, NULL, '2023-12-28 03:15:40', '2023-12-28 03:15:40', NULL),
(773, 68, 1, 'عصارة العصائر المتعددة الوظائف', 'عصارة العصائر المتعددة الوظائف', 1200, 1590, NULL, NULL, 1, 'available', 'متعددة الوظائف بطيئة عصارة لاستخراج العصائر صنع في الصين\r\n\r\nتعتبر هذه العصارة المتعددة الوظائف بطيئة الاستخراج منتجًا ممتازًا صنع في الصين. تتميز بتقنية فريدة تسمح بالاستمتاع بالعصائر الطازجة والصحية في المنزل أو في الأماكن التجارية. تستخدم هذه العصارة شفرة مصنوعة من الفولاذ المقاوم للصدأ وتتميز بأداء قوي وموثوقية عالية. تتضمن وظائف متعددة مثل عصر الفواكه التجاري وعصر قصب السكر، مما يوفر مرونة في استخدامها. تتميز بسهولة التنظيف والصيانة، وتوفر أداءً هادئًا ومريحًا أثناء الاستخدام. سواء كنت تدير مطعمًا أو ترغب في الاستمتاع بالعصائر الطازجة في المنزل، ستكون هذه العصارة البطيئة مثالية لتلبية احتياجاتك.', '00000', NULL, NULL, '2023-12-28 03:20:47', '2023-12-28 03:37:46', NULL),
(774, 110, 1, 'صانع الكريب المنزلي', 'صانع الكريب المنزلي', 400, 620, NULL, NULL, 1, 'available', 'صانع الكريب المنزلي من صانعي القطع الأصلية بقدرة 800 واط هو جهاز متعدد الاستخدامات يتيح لك إعداد الكريب والفطائر بسهولة في منزلك. يتميز هذا الصانع بتصميمه العصري والعملي، وهو مزود بطبقة غير قابلة للالتصاق تسهل عملية الطهي وتساعد على الحصول على كريب مثالي بدون إلتصاق. يأتي الصانع بقوة 800 واط، مما يوفر سخونة سريعة ومتساوية لضمان طهي سريع ومتجانس. يمكن استخدامه لتحضير الكريب والفطائر بأحجام وأشكال مختلفة. إنه أداة رائعة للمطبخ، تتيح لك الاستمتاع بتحضير وجبات شهية ولذيذة في راحة منزلك.', 'xjd32', NULL, NULL, '2023-12-28 03:24:05', '2023-12-28 03:24:05', NULL),
(775, 110, 1, 'صانع كريب حجم كبير', 'صانع كريب حجم كبير', 700, 1100, NULL, NULL, 1, 'available', 'صانع فطائر وكريب بأشكال مختلفة، ماكينة صنع فطائر وكريب بأشكال مختلفة تتميز بسهولة التنظيف والحمل، مما يجعلها مثالية للاستخدام في المطبخ. تعتبر كهربائية وتأتي بموديل 2022 الجديد. يمكن استخدامها لصنع الفطائر والكريب بأشكال وأحجام متنوعة. تأتي بلوحات مصنوعة من الألومنيوم السبك بالقوالب وطلاء مضاد للالتصاق، مما يسهل عملية إزالة الفطائر والكريب بسهولة ويجعلها صحية. تعمل بقوة 1200 واط وجهد 220 فولت. يمكن أيضًا تخصيص الجهاز بشعار مخصص. إن صانع فطائر وكريب هذا مثالي للفنادق والمطاعم التجارية واستخدام المنزلي. يعد هذا المنتج اختيارًا جيدًا لصنع الفطائر والكريب اللذيذة في المنزل بسهولة وسرعة.', 'zw-xjd60', NULL, NULL, '2023-12-28 03:28:24', '2023-12-28 03:28:24', NULL),
(776, 110, 1, 'صانع الكريب الكهربائي 4 فتحات', 'صانع الكريب الكهربائي 4 فتحات', 580, 850, NULL, NULL, 1, 'available', 'صانع الكريب الكهربائي ATC-CM100 1000 واط قابل للتغيير هو جهاز متعدد الاستخدامات يسهل استخدامه في صنع الكريب والفطائر. يتميز بقدرته العالية وقوة 1000 واط، مما يساعد في طهي الكريب بشكل سريع وفعال. يحتوي على مفتاح تحكم تلقائي للحرارة يسمح بضبط درجة الحرارة المثلى للحصول على نتائج مثالية ومتساوية في كل مرة. يتميز بطلاء مضاد للالتصاق على لوحة السخونة، مما يسهل تجنب الالتصاق ويسهل تنظيفه. يمكن استخدامه في المطابخ المنزلية وفي الفنادق والمطاعم. يعتبر صانع الكريب الكهربائي ATC-CM100 أداة مثالية لمحبي الكريب والفطائر.', 'xjd39', NULL, NULL, '2023-12-28 03:31:15', '2023-12-28 03:31:15', NULL),
(777, 76, 1, 'شواية اللهب الكهربائية الخالية من الدخان', 'شواية اللهب الكهربائية الخالية من الدخان', 550, 830, NULL, NULL, 1, 'available', 'شواية كهربائية متعددة الوظائف، شواية كهربائية بدون دخان، ولوح تسخين كهربائي بدون دخان هي منتج عالي الجودة ومتعدد الاستخدامات. تتميز هذه الشواية بتصميمها الأنيق والمصنوع من الفولاذ المقاوم للصدأ، مما يجعلها متينة وسهلة التنظيف. تعمل الشواية بالكهرباء وتتمتع بنظام خاص يسمح بطهي الطعام بدون دخان، مما يجعلها مثالية للاستخدام في الأماكن المغلقة. يمكن استخدامها لشواء اللحوم والخضروات والأسماك بسهولة وفعالية. بفضل حجمها المناسب، يمكن استخدامها لشخصين إلى ثلاثة أشخاص. إنها خيار رائع للاستمتاع بوجبات الشواء في المنزل بسهولة وأمان. قم بشراء هذه الشواية الكهربائية المتعددة الوظائف الآن واستمتع بتجربة طهي رائعة وخالية من الدخان.', 'xjd82', NULL, NULL, '2023-12-28 03:35:43', '2023-12-28 03:35:43', NULL),
(778, 73, 1, 'بندقية الغراء الساخنة', 'بندقية الغراء الساخنة', 50, 150, NULL, NULL, 1, 'available', 'بندقية الغراء الساخنة للحرف DIY بتصميم يسخن بالكهرباء هي أداة مثالية لمشاريع الحرف اليدوية. تأتي البندقية مع عصي صمغ يسيح بالحرارة، مما يسهل استخدامها في تثبيت الأجزاء وتجميع المواد. تعمل بقوة كهربائية يمكن أن تعمل على الجهد الكهربائي 110-240 فولت مع تردد 50/60 هرتز. يتميز التصميم بسهولة الاستخدام والتسخين السريع في غضون 1-3 دقائق. إنها آمنة وموثوقة ومناسبة للاستخدام في الحرف اليدوية والمشاريع الإبداعية الأخرى', 'JH-21', NULL, NULL, '2023-12-28 03:37:23', '2023-12-28 03:37:23', NULL),
(779, 63, 1, 'محمص التوست', 'محمص التوست', 500, 850, NULL, NULL, 1, 'available', 'صانعة الإفطار المنزلية، صانعة الإفطار المنزلية سريعة التسخين من الفولاذ المقاوم للصدأ، هي جهاز أساسي في مطبخك. تتميز بتصميمها الأنيق والعصري وقوتها في أداء المهام. تتسع لـ 2-4 شرائح من الخبز، مما يتيح لك تحضير وجبات الإفطار بسرعة وسهولة. تعمل بتقنية التسخين السريع لتوفير الوقت والطاقة، بينما توفر الفولاذ المقاوم للصدأ الجودة والمتانة. يمكنك ضبط مستوى التحميص حسب تفضيلاتك للحصول على نتائج مثالية. بفضل وظيفة النوافذ المنبثقة التلقائية، يمكنك مراقبة الخبز أثناء التحميص. هذه الصانعة المنزلية هي اختيار رائع لتحضير وجبات إفطار شهية ولذيذة في راحة منزلك.', 'xjd83', NULL, NULL, '2023-12-28 03:38:31', '2023-12-28 03:38:31', NULL),
(780, 77, 1, 'غسالة صغيرة قابلة للطي', 'غسالة صغيرة قابلة للطي', 1600, 2600, NULL, NULL, 1, 'available', 'غسالة صغيرة، غسالة صغيرة محمولة هي جهاز عملي ومريح لغسل الملابس. تتميز بحجمها الصغير وسهولة حملها، مما يجعلها مثالية للاستخدام في المنازل الصغيرة أو أثناء السفر. تتيح لك هذه الغسالة الصغيرة غسل الملابس بكفاءة وسهولة، حيث تتمتع بوظائف مختلفة مثل الغسيل والشطف. بفضل ميزة الطي، يمكنك طيها وتخزينها بسهولة عندما لا تكون قيد الاستخدام. تعد هذه الغسالة المحمولة حلاً مثاليًا للأفراد الذين يحتاجون إلى غسل كميات صغيرة من الملابس بشكل منتظم، مما يوفر الوقت والجهد في عملية الغسيل.', 'jf45', NULL, NULL, '2023-12-28 03:41:13', '2023-12-28 03:41:13', NULL),
(781, 73, 1, 'مسدس الغراء الساخن السريع', 'مسدس الغراء الساخن السريع', 120, 220, NULL, NULL, 1, 'available', 'مسدس صمغ ساخن صغير سريع هو أداة فعالة وموثوقة لإصلاح المنازل بسرعة وسهولة. يتميز هذا المسدس بقوة 20 واط وتسخين سريع، مما يعني أنه يمكنك البدء في الاستخدام بسرعة والحصول على نتائج مذهلة. يعد هذا المسدس مثاليًا للمشغولات الفنية ذاتية الصنع وزخارف المهرجانات، حيث يمكن استخدامه لتثبيت الديكورات والأشكال والتجميعات بسهولة ودقة. يتميز بتصميم صغير الحجم وخفيف الوزن، مما يجعله ملائمًا للاستخدام اليدوي والتحكم الدقيق. بفضل مواده المتينة وجودته العالية، يوفر هذا المسدس راحة واستدامة طويلة الأمد. سواء كنت تقوم بمشروعات صغيرة في المنزل أو ترغب في تنفيذ مشاريع فنية أكبر، فإن مسدس الصمغ الساخن هذا هو الخيار المثالي لك', 'JH-21', NULL, NULL, '2023-12-28 03:42:46', '2023-12-28 03:42:46', NULL),
(782, 76, 1, 'موقد كهربائي للطهي', 'موقد كهربائي للطهي', 850, 1350, NULL, NULL, 1, 'available', 'موقد كهربائي منزلي محمول منخفض السعر ومقاوم للماء هو جهاز مثالي لمطبخك. يتميز بتصميمه الحديث والمحمول، مما يسهل حمله واستخدامه في أي مكان داخل المنزل. يعمل بتقنية الحث الحراري الذكية التي توفر تسخينًا سريعًا وفعالًا للطهي. يحتوي على لوحة حثية بناءًا على التكنولوجيا الإشعاعية بأشعة تحت الحمراء لتوزيع الحرارة بالتساوي وتوفير أداء طهي استثنائي. يتميز أيضًا بوظائف متعددة مثل الغلي والقلي والطهي بالبخار والتحمير، مما يجعله مناسبًا لمجموعة متنوعة من الوصفات. بفضل توفيره للطاقة وسهولة استخدامه، ستحصل على تجربة طهي مريحة وممتعة مع هذا الموقد الكهربائي المحمول.', 'xjd85', NULL, NULL, '2023-12-28 03:43:49', '2023-12-28 03:46:03', NULL),
(783, 107, 1, 'مصباح الضوء الحديث', 'مصباح الضوء الحديث', 85, 180, NULL, NULL, 1, 'available', 'يعتبر مصباح الطاولة LED الحديث من البلاستيك المصنوع في مدينة ييوو خيارًا رائعًا لتعزيز الإضاءة والديكور في المنزل أو المكتب. يتميز هذا المصباح بتصميمه العصري والأنيق، ويوفر إضاءة LED ساطعة وعالية الجودة. يمكن التحكم بوضعية الإضاءة باستخدام التبديل الموجود، ويتميز بوظيفة الخافت للضوء لضبط السطوع حسب الاحتياجات الشخصية. مصنوع من مواد البلاستيك عالية الجودة، مما يجعله خفيف الوزن ومتينًا في الاستخدام اليومي. يعد هذا المصباح مثاليًا للاستخدام في المكاتب وغرف الدراسة وغرف المعيشة، وهو يوفر إضاءة مريحة ومشرقة لتحسين التركيز والإنتاجية', '0988', NULL, NULL, '2023-12-28 03:45:43', '2023-12-28 03:45:43', NULL),
(784, 102, 1, 'ديكور السيارة الداخلي بشكل الربيع Emojis', 'ديكور السيارة الداخلي بشكل الربيع Emojis', 1, 160, NULL, NULL, 1, 'available', 'يعتبر ديكور السيارات الداخلي بشكل الربيع Emojis الإبداعية يهز رأسه لطيفًا من الكرتون واحدًا من أهم لوازم تزيين السيارة. يتميز هذا الديكور بتصميمه الكرتوني الجذاب والمرح، حيث يمثل رموز Emojis الربيعية المبتسمة. يمكن استخدامه لتزيين لوحة القيادة أو مقعد السيارة أو أي جزء آخر من السيارة. تصنع من مواد الراتنج المسطح عالية الجودة، مما يجعلها قوية ومتينة. بفضل سهولة تثبيتها وتحريك رأس الديكور، يمكنك تغيير مظهر سيارتك بطريقة فريدة وممتعة. إنها لوازم مثالية لمحبي الديكور الكرتوني والمرح', '9999', NULL, NULL, '2023-12-28 03:50:47', '2023-12-28 03:50:47', NULL),
(785, 107, 1, 'مصباح يدوي', 'مصباح يدوي', 1, 130, NULL, NULL, 1, 'available', 'مصباح يدوي بإضاءة ليد بإصمين شحن المكونات مع شعلة مصباح يدوي بالطاقة هو منتج عالي الجودة يوفر إضاءة قوية وموثوقة في الأماكن المظلمة. يتميز هذا المصباح اليدوي بتقنية الإضاءة بواسطة الليد، مما يوفر إضاءة ساطعة وفعالة بفضل استخدام بطارية قابلة للشحن. يتميز المصباح أيضًا بتصميمه القوي والمتين، مما يجعله مثاليًا للاستخدام في حالات الطوارئ والتخييم والأنشطة الخارجية. بفضل وظيفة الشحن السريع، يمكن شحن المصباح بسرعة وسهولة لضمان توفر الإضاءة عند الحاجة إليها. احصل على هذا المصباح اليدوي المتين والموثوق به لتلبية احتياجاتك من الإضاءة المحمولة والعملية', '0777', NULL, NULL, '2023-12-28 03:53:29', '2023-12-28 03:53:29', NULL),
(786, 63, 1, 'طبق الميلامين الصلب', 'طبق الميلامين الصلب', 100, 250, NULL, NULL, 1, 'available', 'نقدم لكم طبق الميلامين غير القابل للكسر، وهو منتج مثالي للاستخدام في المطاعم وفي وجبات الطعام اليومية. صُمم هذا الطبق بجودة عالية من البلاستيك الميلامين، مما يجعله قويًا ومتينًا ومناسبًا للاستخدام المكثف. يتميز بتقنية الزخرفة المزججة الداخلية، مع تصميم كلاسيكي يضفي لمسة أناقة على المائدة. يمكن استخدامه في المنزل وفي المناسبات الخاصة، كما أنه مناسب للتخييم والحفلات. تتوفر مجموعة متنوعة من الألوان والأشكال لتلبية احتياجاتك المختلفة. احصل على طعام لذيذ واستمتع بتجربة تناول الطعام بأناقة وسهولة مع طبق الميلامين غير القابل للكسر', 'WH128', NULL, NULL, '2023-12-28 03:57:28', '2023-12-28 03:57:28', NULL),
(787, 117, 1, 'شريط لاصق مقاوم للماء بلون مصفر', 'شريط لاصق مقاوم للماء بلون مصفر', 1, 90, NULL, NULL, 1, 'available', 'شريط لاصق بلون مصفر للمكتب مقاوم للماء هو منتج عالي الجودة ومتعدد الاستخدامات. يأتي هذا الشريط اللاصق بتصميم مقاوم للماء، مما يجعله مثاليًا للاستخدام في الأماكن الرطبة أو حيثما يتعرض للماء. يمتاز بلونه المصفر الجميل، مما يضيف لمسة من الحيوية والجاذبية إلى مكتبك أو مشاريعك اليومية. يمكن استخدامه لتغليف الهدايا، إصلاح الأوراق، تنظيم الملفات، وغيرها الكثير. يتميز هذا الشريط اللاصق بقوة الالتصاق والتحمل، ويمكن استخدامه لفترات طويلة دون أن يفقد قوته. سواء كنت تحتاجه للاستخدام الشخصي أو في العمل، فإن هذا الشريط اللاصق سيكون رفيقًا مثاليًا لك', '0077', NULL, NULL, '2023-12-28 04:29:21', '2023-12-28 04:29:21', NULL),
(788, 63, 1, 'وعاء الشوربة', 'وعاء الشوربة', 1, 120, NULL, NULL, 1, 'available', 'هدية رمضان كريم مصنوعة يدويًا عالية الجودة منتصف القرن الحديث، وهي وعاء معدني قابل للتخصيص يناسب طقوس الطعام في شهر رمضان الكريم. يتميز هذا الوعاء بتصميمه الفريد والعصري، وهو مصنوع بعناية فائقة ودقة يدوية لضمان الجودة العالية. يمكن استخدامه في المنازل والفنادق والمطاعم، ويعتبر قطعة ديكور رائعة تضيف لمسة من الرقي والأناقة إلى أي مكان. يأتي الوعاء بأحجام مختلفة وإمكانية تخصيص الشعار، مما يجعله هدية مثالية وفريدة لأحبائك في رمضان. اجعل أوقات الإفطار والسحور أكثر جمالًا بهذا الوعاء الرائع والعصري.', '0888', NULL, NULL, '2023-12-28 04:32:09', '2023-12-28 04:32:09', NULL),
(789, 113, 1, 'مجموعة سكاكين المائدة', 'مجموعة سكاكين المائدة', 1, 190, NULL, NULL, 1, 'available', 'صممت مجموعة أدوات المائدة من الفولاذ المقاوم للصدأ لتكون مثالية للاستخدام اليومي في المنزل أو في المطاعم والفنادق. تتميز بتصميمها الحديث والأنيق، وتتضمن سكين. مصنوعة من الفولاذ المقاوم للصدأ عالي الجودة، مما يجعلها متينة ومقاومة للصدأ وسهلة التنظيف. تعد هذه المجموعة صديقة للبيئة بفضل استخدام المواد المستدامة والقابلة لإعادة التدوير. إنها مثالية للاستخدام في المناسبات المختلفة مثل الحفلات والمناسبات الخاصة. استمتع بتجربة تناول الطعام المريحة والأنيقة مع مجموعة أدوات المائدة هذه، واحصل على قيمة مضمونة وجودة لا تضاهى', '0444', NULL, NULL, '2023-12-28 04:36:40', '2023-12-28 04:36:40', NULL),
(790, 89, 1, 'دلو الماء الأحمر الأنيق', 'دلو الماء الأحمر الأنيق', 100, 200, NULL, NULL, 1, 'available', 'دلو حمام القدم من البلاستيك بسعة 26-30 لترًا، مصنوع من مواد عالية الجودة للتحمل والمتانة. يتميز بتصميم أنيق وعملي، فهو مزود بمقبض من الفولاذ المقاوم للصدأ الأحمر يوفر قبضة محكمة وسهولة في حمله ونقله. يستخدم للعناية بالقدمين وتنظيفهما، سواء في المنزل أو في صالونات العناية بالقدمين. يمكن استخدامه أيضًا في الفنادق والمنتجعات الصحية ومراكز التجميل. يعد هذا الدلو بلاستيكيًا مثاليًا للاسترخاء وتهدئة القدمين بعد يوم طويل، ويتوفر بلون أحمر جميل يضفي لمسة من الأناقة والجمال على تجربة الحمام', 'JH95', NULL, NULL, '2023-12-28 05:07:26', '2023-12-28 05:07:26', NULL),
(791, 66, 1, 'كوب الزجاج الفاخر 6 قطع', 'كوب الزجاج الفاخر 6 قطع', 160, 360, NULL, NULL, 1, 'available', 'كوب الماء الزجاجي هو منتج رائع وعصري يتميز بالكفاءة والجودة. يتميز هذا الكوب بتصميمه الجميل والأنيق ومقاومته للحرارة، مما يجعله مثاليًا للاستخدام اليومي. تم تصنيعه من زجاج البوروسيليكات عالي الجودة، مما يجعله قويًا ومتينًا ومقاومًا للصدمات. بفضل سعته الكبيرة، يمكنك الاستمتاع بمشروباتك المفضلة بكميات وفيرة. يمكن استخدامه لتناول الماء والعصائر والقهوة والشاي والكوكتيلات. كما يمكن استخدامه في مناسبات التخييم والرحلات. كوب الماء الزجاجي هو اختيار رائع لأولئك الذين يبحثون عن مزيج من الأناقة والوظائف العملية', 'IL33', NULL, NULL, '2023-12-28 05:12:46', '2023-12-28 05:12:46', NULL),
(792, 66, 1, 'كأس الأيسكريم 6 قطع', 'كأس الأيسكريم 6 قطع', 350, 700, NULL, NULL, 1, 'available', 'كوب الزجاج الفاخر هو منتج مثالي لتقديم الآيس كريم والجيلي والحلوى في المناسبات الخاصة مثل حفلات الزفاف والأعياد والمناسبات الاحتفالية. يتميز بتصميمه الأنيق والعصري ومصنوع من زجاج عالي الجودة. يتميز بشفافيته الرائعة التي تبرز جمال الحلوى المقدمة فيه. يعطي لمسة من الفخامة والأناقة للأحداث الخاصة. يتميز بسعة واسعة لاستيعاب كمية كبيرة من الحلوى المفضلة لديك. يعد هذا الكوب الزجاجي الفاخر خيارًا مثاليًا لتقديم الحلوى بأناقة وتمتع الضيوف بتجربة لا تنسى', '111', NULL, NULL, '2023-12-28 05:20:04', '2023-12-28 05:20:04', NULL),
(793, 66, 1, 'كأس زجاجي 4 قطع', 'كأس زجاجي قطع', 220, 450, NULL, NULL, 1, 'available', 'الكأس الزجاجية الفاخرة للحلوى\r\n\r\nاستمتع بتجربة استثنائية لتناول الحلوى مع الكأس الزجاجية الفاخرة. تم تصميم هذا الكأس بجودة مضمونة وإبداعية فريدة، كما يتميز بمقاومته للحرارة. إنها الخيار المثالي للاستخدام في المناسبات الخاصة والحفلات والحفلات المنزلية. يعكس تصميمه الكلاسيكي الأنيق سحر الزجاج ويضفي لمسة من الرقي على أي مناسبة. يتسع الكأس لحجم مناسب من الحلوى، مما يجعلها مثالية لتقديم الحلوى المفضلة لديك للضيوف أو للاستمتاع بها بمفردك. اجعل من تجربة تناول الحلوى لحظة لا تُنسى مع هذا الكأس الزجاجي الفاخر', 'YL32', NULL, NULL, '2023-12-28 05:24:04', '2023-12-28 05:24:04', NULL),
(794, 66, 1, 'مجموعة أكواب الجوهرة', 'مجموعة أكواب الجوهرة', 200, 460, NULL, NULL, 1, 'available', '\"كوب زجاجي فاخر مع مقبض  يتميز هذا الكوب بتصميمه الكلاسيكي والأنيق، وهو مصنوع من زجاج عالي الجودة. يأتي الكوب مع مقبض لسهولة الحمل وغطاء لمنع تسرب السوائل. إنه مثالي للاستخدام المنزلي في شرب القهوة والشاي والبيرة والماء. يتميز الكوب بشفافيته ويمكن تخصيص الشعار على السطح وفقًا للطلب. يتوفر بسعات مختلفة، ويتم تعبئته بشكل آمن في عبوة قياسية للشحن العالمي. احصل على هذا الكوب الزجاجي الفاخر واستمتع بتجربة شرب مميزة وأنيقة.', 'YL-29', NULL, NULL, '2023-12-28 05:29:51', '2023-12-28 05:29:51', NULL),
